INSERT INTO dbo.Strongs VALUES ('H177', 'n-pr-m', 'oo-ale''', 'ʼÛwʼêl', 'h', 'x-pn', N'אוּאֵל', '', N'from 176 and 410; wish of God;', 'Uel.', 'Uel, and Israelite');
