INSERT INTO dbo.Strongs VALUES ('H182', 'n-f', 'o-doth''', 'ʼôwdôwth', 'h', 'heb', N'אוֹדוֹת', '', N'or (shortened) אֹדוֹת (only thus in the plural); from the same as 181;', '(be-) cause, concerning, sake.', 'turnings (i.e. occasions); (adverb) on account of');
INSERT INTO dbo.Strongs VALUES ('H183', 'v', 'aw-vaw''', 'ʼâvâh', 'h', 'heb', N'אָוָה', '', N'a primitive root;', 'covet, (greatly) desire, be desirous, long, lust (after).', 'to wish for');
