INSERT INTO dbo.Strongs VALUES ('H187', 'n-pr-m', 'oo-zawl''', 'ʼÛwzâl', 'h', 'x-pn', N'אוּזָל', '', N'of uncertain derivation;', 'Uzal.', 'Uzal, a son of Joktan');
INSERT INTO dbo.Strongs VALUES ('H188', 'inj', 'o''-ee', 'ʼôwy', 'h', 'heb', N'אוֹי', '', N'probably from 183 (in the sense of crying out after);', 'alas, woe.', 'lamentation; also interjectionally Oh!');
INSERT INTO dbo.Strongs VALUES ('H189', 'n-pr-m', 'ev-ee''', 'ʼĔvîy', 'h', 'x-pn', N'אֱוִי', '', N'probably from 183; desirous;', 'Evi.', 'Evi, a Midianitish chief');
INSERT INTO dbo.Strongs VALUES ('H190', 'inj', 'o-yaw''', 'ʼôwyâh', 'h', 'heb', N'אוֹיָה', '', N'feminine of 188', 'woe.', '');
INSERT INTO dbo.Strongs VALUES ('H191', 'a-m', 'ev-eel''', 'ʼĕvîyl', 'h', 'heb', N'אֱוִיל', '', N'from an unused root (meaning to be perverse);', 'fool(-ish) (man).', '(figuratively) silly');
INSERT INTO dbo.Strongs VALUES ('H192', 'n-pr-m', 'ev-eel'' mer-o-dak''', 'ʼĔvîyl Mᵉrôdak', 'h', 'x-pn', N'אֱוִיל מְרֹדַךְ', '', N'of Aramaic derivation and probably meaning soldier of Merodak;', 'Evil-merodach.', 'Evil-Merodak, a Babylonian king');
INSERT INTO dbo.Strongs VALUES ('H193', 'n-m', 'ool', 'ʼûwl', 'h', 'heb', N'אוּל', '', N'from an unused root meaning to twist, i.e. (by implication) be strong;', 'mighty, strength.', 'the body (as being rolled together); also powerful');
INSERT INTO dbo.Strongs VALUES ('H194', 'adv', 'oo-lah''ee', 'ʼûwlay', 'h', 'heb', N'אוּלַי', '', N'or (shortened) אֻלַי; from 176;', 'if so be, may be, peradventure, unless.', 'if not; hence perhaps');
INSERT INTO dbo.Strongs VALUES ('H195', 'n', 'oo-lah''ee', 'ʼÛwlay', 'h', 'heb', N'אוּלַי', '', N'of Persian derivation;', 'Ulai.', 'the Ulai (or Eulaeus), a river of Persia');
