INSERT INTO dbo.Strongs VALUES ('H197', 'n-m', 'oo-lawm''', 'ʼûwlâm', 'h', 'heb', N'אוּלָם', '', N'or (shortened), אֻלָם ; from 481 (in the sense of tying);', 'porch.', 'a vestibule (as bound to the building)');
INSERT INTO dbo.Strongs VALUES ('H198', 'n-pr-m', 'oo-lawm''', 'ʼÛwlâm', 'h', 'x-pn', N'אוּלָם', '', N'appar, from 481 (in the sense of dumbness); solitary;', 'Ulam.', 'Ulam, the name of two Israelites');
