INSERT INTO dbo.Strongs VALUES ('H200', 'n-f', 'iv-veh''-leth', 'ʼivveleth', 'h', 'heb', N'אִוֶּלֶת', '', N'from the same as 191;', 'folly, foolishly(-ness).', 'silliness');
INSERT INTO dbo.Strongs VALUES ('H201', 'n-pr-m', 'o-mawr''', 'ʼÔwmâr', 'h', 'x-pn', N'אוֹמָר', '', N'from 559; talkative;', 'Omar.', 'Omar, a grandson of Esau');
