INSERT INTO dbo.Strongs VALUES ('H205', 'n-m', 'aw-ven''', 'ʼâven', 'h', 'heb', N'אָוֶן', '', N'from an unused root perhaps meaning properly, to pant (hence, to exert oneself, usually in vain; to come to naught);', 'affliction, evil, false, idol, iniquity, mischief, mourners(-ing), naught, sorrow, unjust, unrighteous, vain, vanity, wicked(-ness). Compare 369.', 'strictly nothingness; also trouble, vanity, wickedness; specifically an idol');
