INSERT INTO dbo.Strongs VALUES ('H207', 'n-pr-loc', 'o-no''', 'ʼÔwnôw', 'h', 'x-pn', N'אוֹנוֹ', '', N'or (shortened) אֹנוֹ; prolonged from 202; strong;', 'Ono.', 'Ono, a place in Palestine');
