INSERT INTO dbo.Strongs VALUES ('H209', 'n-pr-m', 'o-nawn''', 'ʼÔwnân', 'h', 'x-pn', N'אוֹנָן', '', N'a variation of 207; strong;', 'Onan.', 'Onan, a son of Judah');
INSERT INTO dbo.Strongs VALUES ('H210', 'n-pr-loc', 'oo-fawz''', 'ʼÛwphâz', 'h', 'x-pn', N'אוּפָז', '', N'perhaps a corruption of 211;', 'Uphaz.', 'Uphaz, a famous gold region');
