INSERT INTO dbo.Strongs VALUES ('H212', 'n-m', 'o-fawn''', 'ʼôwphân', 'h', 'heb', N'אוֹפָן', '', N'or (shortened) אֹפָן; from an unused root meaning to revolve;', 'wheel.', 'a wheel');
INSERT INTO dbo.Strongs VALUES ('H213', 'v', 'oots', 'ʼûwts', 'h', 'heb', N'אוּץ', '', N'a primitive root;', '(make) haste(-n, -y), labor, be narrow.', 'to press; (by implication) to be close, hurry, withdraw');
INSERT INTO dbo.Strongs VALUES ('H214', 'n-m', 'o-tsaw''', 'ʼôwtsâr', 'h', 'heb', N'אוֹצָר', '', N'from 686;', 'armory, cellar, garner, store(-house), treasure(-house) (-y).', 'a depository');
INSERT INTO dbo.Strongs VALUES ('H215', 'v', 'ore', 'ʼôwr', 'h', 'heb', N'אוֹר', '', N'a primitive root;', '× break of day, glorious, kindle, (be, en-, give, show) light (-en, -ened), set on fire, shine.', 'to be (causative, make) luminous (literally and metaphorically)');
INSERT INTO dbo.Strongs VALUES ('H216', 'n-f', 'ore', 'ʼôwr', 'h', 'heb', N'אוֹר', '', N'from 215;', 'bright, clear,   day, light (-ning), morning, sun.', 'illumination or (concrete) luminary (in every sense, including lightning, happiness, etc.)');
