INSERT INTO dbo.Strongs VALUES ('H220', 'n-f', 'av-ay-raw''', 'ʼăvêrâh', 'h', 'heb', N'אֲוֵרָה', '', N'by transposition for 723;', 'cote.', 'a stall');
