INSERT INTO dbo.Strongs VALUES ('H246', 'n-m', 'az-ik-keem''', 'ʼăziqqîym', 'h', 'heb', N'אֲזִקִּים', '', N'a variation for 2131;', 'chains.', 'manacles');
INSERT INTO dbo.Strongs VALUES ('H247', 'v', 'aw-zar''', 'ʼâzar', 'h', 'heb', N'אָזַר', '', N'a primitive root;', 'bind (compass) about, gird (up, with).', 'to belt');
INSERT INTO dbo.Strongs VALUES ('H248', 'n-f', 'ez-ro''-a', 'ʼezrôwaʻ', 'h', 'heb', N'אֶזְרוֹעַ', '', N'a variation for 2220;', 'arm.', 'the arm');
