INSERT INTO dbo.Strongs VALUES ('H257', 'n-pr-m', 'akh-bawn''', 'ʼAchbân', 'h', 'x-pn', N'אַחְבָן', '', N'from 251 and 995; brother (i.e. possessor) of understanding;', 'Ahban.', 'Achban, an Israelite');
