INSERT INTO dbo.Strongs VALUES ('H260', 'n-m', 'aw''-khoo', 'ʼâchûw', 'h', 'heb', N'אָחוּ', '', N'of uncertain (perhaps Egyptian) derivation;', 'flag, meadow.', 'a bulrush or any marshy grass (particularly that along the Nile)');
INSERT INTO dbo.Strongs VALUES ('H261', 'n-pr-m', 'ay-khood''', 'ʼÊchûwd', 'h', 'x-pn', N'אֵחוּד', '', N'from 258; united;', 'Ehud.', 'Echud, the name of three Israelites');
INSERT INTO dbo.Strongs VALUES ('H262', 'n-f', 'akh-vaw''', 'ʼachvâh', 'h', 'heb', N'אַחְוָה', '', N'from 2331 (in the sense of 2324);', 'declaration.', 'an utterance');
