INSERT INTO dbo.Strongs VALUES ('H348', 'n-pr-f', 'ee-zeh''-bel', 'ʼÎyzebel', 'h', 'x-pn', N'אִיזֶבֶל', '', N'from 336 and 2083;', 'Jezebel.', 'Izebel, the wife of king Ahab');
