INSERT INTO dbo.Strongs VALUES ('H350', 'n-pr-m', 'ee-kaw-bode''', 'ʼÎy-kâbôwd', 'h', 'x-pn', N'אִי־כָבוֹד', '', N'from 336 and 3519; (there is) no glory, i.e. inglorious;', 'I-chabod.', 'Ikabod, a son of Phineas');
INSERT INTO dbo.Strongs VALUES ('H351', 'adv', 'ay-ko', 'ʼêykôh', 'h', 'heb', N'אֵיכֹה', '', N'probably a variation for 349, but not as an interogative;', 'where.', 'where');
INSERT INTO dbo.Strongs VALUES ('H352', 'n-m', 'ah''-yil', 'ʼayil', 'h', 'heb', N'אַיִל', '', N'from the same as 193;', 'mighty (man), lintel, oak, post, ram, tree.', 'properly, strength; hence, anything strong; specifically a chief (politically); also a ram (from his strength); a pilaster (as a strong support); an oak or other strong tree');
INSERT INTO dbo.Strongs VALUES ('H353', 'n-m', 'eh-yawl''', 'ʼĕyâl', 'h', 'heb', N'אֱיָל', '', N'a variation of 352;', 'strength.', 'strength');
INSERT INTO dbo.Strongs VALUES ('H354', 'n-m', 'ah-yawl''', 'ʼayâl', 'h', 'heb', N'אַיָּל', '', N'an intensive form of 352 (in the sense of ram);', 'hart.', 'a stag or male deer');
INSERT INTO dbo.Strongs VALUES ('H355', 'n-f', 'ah-yaw-law''', 'ʼayâlâh', 'h', 'heb', N'אַיָּלָה', '', N'feminine of 354;', 'hind.', 'a doe or female deer');
INSERT INTO dbo.Strongs VALUES ('H356', 'n-pr', 'ay-lone''', 'ʼÊylôwn', 'h', 'x-pn', N'אֵילוֹן', '', N'or (shortened) אֵלוֹן ; or אֵילֹן ; from 352; oak-grove;', 'Elon.', 'Elon, the name of a place in Palestine, and also of one Hittite, two Israelites');
INSERT INTO dbo.Strongs VALUES ('H357', 'n-pr-loc', 'ah-yaw-lone''', 'ʼAyâlôwn', 'h', 'x-pn', N'אַיָּלוֹן', '', N'from 354; deer-field;', 'Aijalon, Ajalon.', 'Ajalon, the name of five places in Palestine');
INSERT INTO dbo.Strongs VALUES ('H358', 'n-pr-loc', 'ay-lone'' bayth-chawnawn''', 'ʼÊylôwn Bêyth Chânân', 'h', 'x-pn', N'אֵילוֹן בֵּית חָנָן', '', N'from 356, 1004, and 2603; oak-grove of (the) house of favor;', 'Elon-bethhanan.', 'Elon of Beth-chanan, a place in Palestine');
INSERT INTO dbo.Strongs VALUES ('H359', 'n-pr-loc', 'ay-loth''', 'ʼÊylôwth', 'h', 'x-pn', N'אֵילוֹת', '', N'or אֵילַת ; from 352; trees or a grove (i.e. palms);', 'Elath, Eloth.', 'Eloth or Elath, a place on the Red Sea');
INSERT INTO dbo.Strongs VALUES ('H360', 'n-f', 'eh-yaw-looth''', 'ʼĕyâlûwth', 'h', 'heb', N'אֱיָלוּת', '', N'feminine of 353;', 'strength.', 'power; by implication, protection');
INSERT INTO dbo.Strongs VALUES ('H361', 'n-m', 'ay-lawm''', 'ʼêylâm', 'h', 'heb', N'אֵילָם', '', N'or (shortened) אֵלָם ; or (feminine) אֵלַמָּה ; probably from 352;', 'arch.', 'a pillar-space (or colonnade), i.e. a pale (or portico)');
INSERT INTO dbo.Strongs VALUES ('H362', 'n-pr-loc', 'ay-leem''', 'ʼÊylim', 'h', 'x-pn', N'אֵילִם', '', N'plural of 352; palm-trees;', 'Elim.', 'Elim, a place in the Desert');
INSERT INTO dbo.Strongs VALUES ('H363', 'n-m', 'ee-lawn''', 'ʼîylân', 'h', 'arc', N'אִילָן', '', N'(Aramaic) corresponding to 356;', 'tree.', 'a tree');
INSERT INTO dbo.Strongs VALUES ('H364', 'n-pr-loc', 'ale paw-rawn''', 'ʼÊyl Pâʼrân', 'h', 'x-pn', N'אֵיל פָּארָן', '', N'from 352 and 6290; oak of Paran;', 'El-paran.', 'El-Paran, a portion of the district of Paran');
INSERT INTO dbo.Strongs VALUES ('H365', 'n-f', 'ah-yeh''-leth', 'ʼayeleth', 'h', 'heb', N'אַיֶּלֶת', '', N'the same as 355;', 'hind, Aijeleth.', 'a doe');
INSERT INTO dbo.Strongs VALUES ('H366', 'a', 'aw-yome''', 'ʼâyôm', 'h', 'heb', N'אָיֹם', '', N'from an unused root (meaning to frighten);', 'terrible.', 'frightful');
INSERT INTO dbo.Strongs VALUES ('H367', 'n-f', 'ay-maw''', 'ʼêymâh', 'h', 'heb', N'אֵימָה', '', N'or (shortened) אֵמָה; from the same as 366;', 'dread, fear, horror, idol, terrible, terror.', 'fright; concrete, an idol (as a bugbear)');
INSERT INTO dbo.Strongs VALUES ('H368', 'n-pr-m', 'ay-meem''', 'ʼÊymîym', 'h', 'x-pn', N'אֵימִים', '', N'plural of 367; terrors;', 'Emims.', 'Emim, an early Canaanitish (or Maobitish) tribe');
INSERT INTO dbo.Strongs VALUES ('H369', 'np', 'ah''-yin', 'ʼayin', 'h', 'heb', N'אַיִן', '', N'as if from a primitive root meaning to be nothing or not exist;', 'else, except, fail, (father-) less, be gone, in(-curable), neither, never, no (where), none, nor, (any, thing), not, nothing, to nought, past, un(-searchable), well-nigh, without. Compare 370.', 'a nonentity; generally used as a negative particle');
INSERT INTO dbo.Strongs VALUES ('H370', 'adv', 'ah-yin''', 'ʼayin', 'h', 'heb', N'אַיִן', '', N'probably identical with 369 in the sense of query (compare 336)', 'whence, where.', 'where? (only in connection with prepositional prefix, whence)');
INSERT INTO dbo.Strongs VALUES ('H371', 'adv', 'een', 'ʼîyn', 'h', 'heb', N'אִין', '', N'apparently a shortened form of 369; but (like 370) an interrogative;', 'not.', 'is it not?');
INSERT INTO dbo.Strongs VALUES ('H372', 'n-pr-m', 'ee-eh''-zer', 'ʼÎyʻezêr', 'h', 'x-pn', N'אִיעֶזֵר', '', N'from 336 and 5828; helpless;', 'Jeezer.', 'Iezer, an Israelite');
INSERT INTO dbo.Strongs VALUES ('H373', 'a', 'ee-ez-ree''', 'ʼÎyʻezrîy', 'h', 'x-pn', N'אִיעֶזְרִי', '', N'patronymic from 372;', 'Jezerite.', 'an Iezrite or descendant of Iezer');
INSERT INTO dbo.Strongs VALUES ('H374', 'n-f', 'ay-faw''', 'ʼêyphâh', 'h', 'heb', N'אֵיפָה', '', N'or (shortened) אֵפָה ; of Egyptian derivation;', 'ephah, (divers) measure(-s).', 'an ephah or measure for grain; hence, a measure in general');
INSERT INTO dbo.Strongs VALUES ('H375', 'adv', 'ay-fo''', 'ʼêyphôh', 'h', 'heb', N'אֵיפֹה', '', N'from 335 and 6311;', 'what manner, where.', 'what place?; also (of time) when?; or (of means) how?');
INSERT INTO dbo.Strongs VALUES ('H376', 'n-m', 'eesh', 'ʼîysh', 'h', 'heb', N'אִישׁ', '', N'contracted for 582 (or perhaps rather from an unused root meaning to be extant);', 'also, another, any (man), a certain,   champion, consent, each, every (one), fellow, (foot-, husband-) man, (good-, great, mighty) man, he, high (degree), him (that is), husband, man(-kind),   none, one, people, person,   steward, what (man) soever, whoso(-ever), worthy. Compare 802.', 'a man as an individual or a male person; often used as an adjunct to a more definite term (and in such cases frequently not expressed in translation)');
INSERT INTO dbo.Strongs VALUES ('H377', 'v', 'eesh', 'ʼîysh', 'h', 'heb', N'אִישׁ', '', N'denominative from 376;', 'show (one) self a man.', 'to be a man, i.e. act in a manly way');
INSERT INTO dbo.Strongs VALUES ('H378', 'n-pr-m', 'eesh-bo''-sheth', 'ʼÎysh-Bôsheth', 'h', 'x-pn', N'אִישׁ־בֹּשֶׁת', '', N'from 376 and 1322; man of shame;', 'Ish-bosheth.', 'Ish-Bosheth, a son of King Saul');
INSERT INTO dbo.Strongs VALUES ('H379', 'n-pr-m', 'eesh-hode''', 'ʼÎyshᵉhôwd', 'h', 'x-pn', N'אִישְׁהוֹד', '', N'from 376 and 1935; man of renown;', 'Ishod.', 'Ishod, an Israelite');
INSERT INTO dbo.Strongs VALUES ('H380', 'n-m', 'ee-shone''', 'ʼîyshôwn', 'h', 'heb', N'אִישׁוֹן', '', N'diminutive from 376;', 'apple (of the eye), black, obscure.', 'the little man of the eye; the pupil or ball; hence, the middle (of night)');
INSERT INTO dbo.Strongs VALUES ('H381', 'n-m', 'eesh-khah''-yil', 'ʼÎysh-Chayil', 'h', 'x-pn', N'אִישׁ־חַיִל', '', N'from 376 and 2428; man of might; by defective transcription (2 Samuel 23:20) אִישׁ־חַיxlit ʼÎsh-Chay corrected to ʼÎysh-Chay; as if from 376 and 2416; living man;', 'a valiant man.', 'Ishchail (or Ish-chai), an Israelite');
INSERT INTO dbo.Strongs VALUES ('H382', 'n-pr-loc', 'eesh-tobe''', 'ʼÎysh-Ṭôwb', 'h', 'x-pn', N'אִישׁ־טוֹב', '', N'from 376 and 2897; man of Tob;', 'Ish-tob.', 'Ish-Tob, a place in Palestine');
INSERT INTO dbo.Strongs VALUES ('H383', 'prt', 'ee-thah''ee', 'ʼîythay', 'h', 'arc', N'אִיתַי', '', N'(Aramaic) corresponding to 3426;', 'art thou, can, do ye, have, it be, there is (are), × we will not.', 'properly, entity; used only as a particle of affirmation, there is');
INSERT INTO dbo.Strongs VALUES ('H384', 'n-pr-m', 'eeth-ee-ale''', 'ʼÎythîyʼêl', 'h', 'x-pn', N'אִיתִיאֵל', '', N'perhaps from 837 and 410; God has arrived;', 'Ithiel.', 'Ithiel, the name of an Israelite, also of a symbolical person');
INSERT INTO dbo.Strongs VALUES ('H385', 'n-pr-m', 'eeth-aw-mawr''', 'ʼÎythâmâr', 'h', 'x-pn', N'אִיתָמָר', '', N'from 339 and 8558; coast of the palm-tree;', 'Ithamar.', 'Ithamar, a son of Aaron');
INSERT INTO dbo.Strongs VALUES ('H386', 'a', 'ay-thawn''', 'ʼêythân', 'h', 'heb', N'אֵיתָן', '', N'or (shortened) אֵתָן ; from an unused root (meaning to continue);', 'hard, mighty, rough, strength, strong.', 'permanence; hence (concrete) permanent; specifically a chieftain');
INSERT INTO dbo.Strongs VALUES ('H387', 'n-pr-m', 'ay-thawn''', 'ʼÊythân', 'h', 'x-pn', N'אֵיתָן', '', N'the same as 386; permanent;', 'Ethan.', 'Ethan, the name of four Israelites');
INSERT INTO dbo.Strongs VALUES ('H388', 'n-pr-m', 'ay-thaw-neem''', 'ʼÊythânîym', 'h', 'x-pn', N'אֵיתָנִים', '', N'plural of 386; always with the article; the permanent brooks;', 'Ethanim.', 'Ethanim, the name of a month');
INSERT INTO dbo.Strongs VALUES ('H389', 'adv', 'ak', 'ʼak', 'h', 'heb', N'אַךְ', '', N'akin to 403;', 'also, in any wise, at least, but, certainly, even, howbeit, nevertheless, notwithstanding, only, save, surely, of a surety, truly, verily,   wherefore, yet (but).', 'a particle of affirmation, surely; hence (by limitation) only');
INSERT INTO dbo.Strongs VALUES ('H390', 'n-pr-loc', 'ak-kad''', 'ʼAkkad', 'h', 'x-pn', N'אַכַּד', '', N'from an unused root probably meaning to strengthen; a fortress;', 'Accad.', 'Accad, a place in Babylon');
INSERT INTO dbo.Strongs VALUES ('H391', 'a', 'ak-zawb''', 'ʼakzâb', 'h', 'heb', N'אַכְזָב', '', N'from 3576;', 'liar, lie.', 'falsehood; by implication treachery');
INSERT INTO dbo.Strongs VALUES ('H392', 'n-pr-loc', 'ak-zeeb''', 'ʼAkzîyb', 'h', 'x-pn', N'אַכְזִיב', '', N'from 391; deceitful (in the sense of a winter-torrent which fails in summer);', 'Achzib.', 'Akzib, the name of two places in Palestine');
INSERT INTO dbo.Strongs VALUES ('H393', 'a', 'ak-zawr''', 'ʼakzâr', 'h', 'heb', N'אַכְזָר', '', N'from an unused root (apparently meaning to act harshly);', 'cruel, fierce.', 'violent; by implication deadly; also (in a good sense) brave');
INSERT INTO dbo.Strongs VALUES ('H394', 'a', 'ak-zawr-ree''', 'ʼakzârîy', 'h', 'heb', N'אַכְזָרִי', '', N'from 393;', 'cruel (one).', 'terrible');
INSERT INTO dbo.Strongs VALUES ('H395', 'n-f', 'ak-ze-ree-ooth''', 'ʼakzᵉrîyûwth', 'h', 'heb', N'אַכְזְרִיּוּת', '', N'from 394;', 'cruel.', 'fierceness');
INSERT INTO dbo.Strongs VALUES ('H396', 'n-f', 'ak-ee-law''', 'ʼăkîylâh', 'h', 'heb', N'אֲכִילָה', '', N'feminine from 398;', 'meat.', 'something eatable, i.e. food');
INSERT INTO dbo.Strongs VALUES ('H397', 'n-pr-m', 'aw-keesh''', 'ʼĂkîysh', 'h', 'x-pn', N'אֲכִישׁ', '', N'of uncertain derivation;', 'Achish.', 'Akish, a Philistine king');
INSERT INTO dbo.Strongs VALUES ('H398', 'v', 'aw-kal''', 'ʼâkal', 'h', 'heb', N'אָכַל', '', N'a primitive root;', '× at all, burn up, consume, devour(-er, up), dine, eat(-er, up), feed (with), food, × freely, × in...wise(-deed, plenty), (lay) meat, × quite.', 'to eat (literally or figuratively)');
INSERT INTO dbo.Strongs VALUES ('H399', 'v', 'ak-al''', 'ʼăkal', 'h', 'arc', N'אֲכַל', '', N'(Aramaic) corresponding to 398', '  accuse, devour, eat.', '');
INSERT INTO dbo.Strongs VALUES ('H400', 'n-m', 'o''-kel', 'ʼôkel', 'h', 'heb', N'אֹכֶל', '', N'from 398;', 'eating, food, meal(-time), meat, prey, victuals.', 'food');
INSERT INTO dbo.Strongs VALUES ('H401', 'n-pr-m', 'oo-kawl''', 'ʼUkâl', 'h', 'x-pn', N'אֻכָל', '', N'or אֻכָּל; apparently from 398; devoured;', 'Ucal.', 'Ucal, a fancy name');
INSERT INTO dbo.Strongs VALUES ('H402', 'n-f', 'ok-law''', 'ʼoklâh', 'h', 'heb', N'אׇכְלָה', '', N'feminine of 401;', 'consume, devour, eat, food, meat.', 'food');
INSERT INTO dbo.Strongs VALUES ('H403', 'adv', 'aw-kane''', 'ʼâkên', 'h', 'heb', N'אָכֵן', '', N'from 3559 (compare 3651);', 'but, certainly, nevertheless, surely, truly, verily.', 'firmly; figuratively, surely; also (adversative) but');
INSERT INTO dbo.Strongs VALUES ('H404', 'v', 'aw-kaf''', 'ʼâkaph', 'h', 'heb', N'אָכַף', '', N'a primitive root; apparently meaning to curve (as with a burden);', 'crave.', 'to urge');
INSERT INTO dbo.Strongs VALUES ('H405', 'n-m', 'eh''-kef', 'ʼekeph', 'h', 'heb', N'אֶכֶף', '', N'from 404;', 'hand.', 'a load; by implication, a stroke (others dignity)');
INSERT INTO dbo.Strongs VALUES ('H406', 'n-m', 'ik-kawr''', 'ʼikkâr', 'h', 'heb', N'אִכָּר', '', N'from an unused root meaning to dig;', 'husbandman, ploughman.', 'a farmer');
INSERT INTO dbo.Strongs VALUES ('H407', 'n-pr-loc', 'ak-shawf''', 'ʼAkshâph', 'h', 'x-pn', N'אַכְשָׁף', '', N'from 3784; fascination;', 'Achshaph.', 'Acshaph, a place in Palestine');
INSERT INTO dbo.Strongs VALUES ('H408', 'adv', 'al', 'ʼal', 'h', 'heb', N'אַל', '', N'a negative particle (akin to 3808);', 'nay, neither, + never, no, nor, not, nothing (worth), rather than.', 'not (the qualified negation, used as a deprecative); once (Job 24:25) as a noun, nothing');
INSERT INTO dbo.Strongs VALUES ('H409', 'adv', 'al', 'ʼal', 'h', 'arc', N'אַל', '', N'(Aramaic) corresponding to 408', 'not.', '');
INSERT INTO dbo.Strongs VALUES ('H410', 'n-m', 'ale', 'ʼêl', 'h', 'heb', N'אֵל', '', N'shortened from 352;', 'God (god), × goodly, × great, idol, might(-y one), power, strong. Compare names in ''-el.''', 'strength; as adjective, mighty; especially the Almighty (but used also of any deity)');
INSERT INTO dbo.Strongs VALUES ('H411', 'd', 'ale', 'ʼêl', 'h', 'heb', N'אֵל', '', N'a demonstrative particle (but only in a plural sense)', 'these, those. Compare 428.', 'these or those');
INSERT INTO dbo.Strongs VALUES ('H412', 'd', 'ale', 'ʼêl', 'h', 'arc', N'אֵל', '', N'(Aramaic) corresponding to 411', 'these.', '');
INSERT INTO dbo.Strongs VALUES ('H413', 'prep', 'ale', 'ʼêl', 'h', 'heb', N'אֵל', '', N'(but only used in the shortened constructive form אֶל ); a primitive particle; properly, denoting motion towards, but occasionally used of a quiescent position, i.e.', 'about, according to, after, against, among, as for, at, because(-fore, -side), both...and, by, concerning, for, from, × hath, in(-to), near, (out) of, over, through, to(-ward), under, unto, upon, whether, with(-in).', 'near, with or among; often in general, to');
INSERT INTO dbo.Strongs VALUES ('H414', 'n-pr-m', 'ay-law''', 'ʼÊlâʼ', 'h', 'x-pn', N'אֵלָא', '', N'a variation of 424; oak;', 'Elah.', 'Ela, an Israelite');
INSERT INTO dbo.Strongs VALUES ('H415', 'n-pr', 'ale el-o-hay'' yis-rawale''', 'ʼÊl ʼĕlôhêy Yisrâʼêl', 'h', 'x-pn', N'אֵל אֱלֹהֵי יִשְׂרָאֵל', '', N'from 410 and 430 and 3478; the mighty god if Jisrael;', 'Elelohe-israel.', 'El-Elohi-Jisrael, the title given to a consecrated spot by Jacob');
INSERT INTO dbo.Strongs VALUES ('H416', 'n-pr-loc', 'ale bayth-ale''', 'ʼÊl Bêyth-ʼÊl', 'h', 'x-pn', N'אֵל בֵּית־אֵל', '', N'from 410 and 1008; the God of Bethel;', 'El-beth-el.', 'El-Bethel, the title given to a consecrated spot by Jacob');
INSERT INTO dbo.Strongs VALUES ('H417', 'n-m', 'el-gaw-beesh''', 'ʼelgâbîysh', 'h', 'heb', N'אֶלְגָּבִישׁ', '', N'from 410 and 1378;', 'great hail(-stones).', 'hail (as if a great pearl)');
INSERT INTO dbo.Strongs VALUES ('H418', 'n-m', 'al-goom-meem''', 'ʼalgûwmmîym', 'h', 'heb', N'אַלְגּוּמִּים', '', N'by transposition for 484;', 'algum (trees).', 'sticks of algum wood');
INSERT INTO dbo.Strongs VALUES ('H419', 'n-pr-m', 'el-dad''', 'ʼEldâd', 'h', 'x-pn', N'אֶלְדָּד', '', N'from 410 and 1730; God has loved;', 'Eldad.', 'Eldad, an Israelite');
INSERT INTO dbo.Strongs VALUES ('H420', 'n-pr-m', 'el-daw-aw''', 'ʼEldâʻâh', 'h', 'x-pn', N'אֶלְדָּעָה', '', N'from 410 and 3045; God of knowledge;', 'Eldaah.', 'Eldaah, a son of Midian');
INSERT INTO dbo.Strongs VALUES ('H421', 'v', 'aw-law''', 'ʼâlâh', 'h', 'heb', N'אָלָה', '', N'a primitive root (rather identical with 422 through the idea of invocation);', 'lament.', 'to bewail');
INSERT INTO dbo.Strongs VALUES ('H422', 'v', 'aw-law''', 'ʼâlâh', 'h', 'heb', N'אָלָה', '', N'a primitive root;', 'adjure, curse, swear.', 'properly, to adjure, i.e. (usually in a bad sense) imprecate');
INSERT INTO dbo.Strongs VALUES ('H423', 'n-f', 'aw-law''', 'ʼâlâh', 'h', 'heb', N'אָלָה', '', N'from 422;', 'curse, cursing, execration, oath, swearing.', 'an imprecation');
INSERT INTO dbo.Strongs VALUES ('H424', 'n-f', 'ay-law''', 'ʼêlâh', 'h', 'heb', N'אֵלָה', 'lemma אִלָה first vowel, corrected to אֵלָה', N'feminine of 352;', 'elm, oak, teil-tree.', 'an oak or other strong tree');
INSERT INTO dbo.Strongs VALUES ('H425', 'n-pr', 'ay-law''', 'ʼÊlâh', 'h', 'x-pn', N'אֵלָה', '', N'the same as 424;', 'Elah.', 'Elah, the name of an Edomite, of four Israelites, and also of a place in Palestine');
INSERT INTO dbo.Strongs VALUES ('H426', 'n-m', 'el-aw''', 'ʼĕlâhh', 'h', 'x-pn', N'אֱלָהּ', '', N'(Aramaic) corresponding to 433;', 'God, god.', 'God');
INSERT INTO dbo.Strongs VALUES ('H427', 'n-m', 'al-law''', 'ʼallâh', 'h', 'heb', N'אַלָּה', '', N'A variation of 424', 'oak.', '');
INSERT INTO dbo.Strongs VALUES ('H428', 'd', 'ale''-leh', 'ʼêl-leh', 'h', 'heb', N'אֵלֶּה', '', N'prolonged from 411;', 'an-(the) other; one sort, so, some, such, them, these (same), they, this, those, thus, which, who(-m).', 'these or those');
INSERT INTO dbo.Strongs VALUES ('H429', 'd', 'ale''-leh', 'ʼêlleh', 'h', 'arc', N'אֵלֶּה', '', N'(Aramaic) corresponding to 428', 'these.', '');
INSERT INTO dbo.Strongs VALUES ('H430', 'n-m', 'el-o-heem''', 'ʼĕlôhîym', 'h', 'heb', N'אֱלֹהִים', '', N'plural of 433;', 'angels, × exceeding, God (gods) (-dess, -ly), × (very) great, judges, × mighty.', 'gods in the ordinary sense; but specifically used (in the plural thus, especially with the article) of the supreme God; occasionally applied by way of deference to magistrates; and sometimes as a superlative');
INSERT INTO dbo.Strongs VALUES ('H431', 'inj', 'al-oo''', 'ʼălûw', 'h', 'arc', N'אֲלוּ', '', N'(Aramaic) probably prolonged from 412;', 'behold.', 'lo!');
INSERT INTO dbo.Strongs VALUES ('H432', 'conj', 'il-loo''', 'ʼillûw', 'h', 'heb', N'אִלּוּ', '', N'probably from 408;', 'but if, yea though.', 'nay, i.e. (softened) if');
