INSERT INTO dbo.Strongs VALUES ('H834', 'r', 'ash-er''', 'ʼăsher', 'h', 'heb', N'אֲשֶׁר', '', N'a primitive relative pronoun (of every gender and number);', '× after, × alike, as (soon as), because, × every, for, + forasmuch, + from whence, + how(-soever), × if, (so) that ((thing) which, wherein), × though, + until, + whatsoever, when, where (+ -as, -in, -of, -on, -soever, -with), which, whilst, + whither(-soever), who(-m, -soever, -se). As it is indeclinable, it is often accompanied by the personal pronoun expletively, used to show the connection.', 'who, which, what, that; also (as an adverb and a conjunction) when, where, how, because, in order that, etc.');
