INSERT INTO dbo.Strongs VALUES ('H860', 'n-f', 'aw-thone''', 'ʼâthôwn', 'h', 'heb', N'אָתוֹן', '', N'probably from the same as 386 (in the sense of patience);', '(she) ass.', 'a female donkey (from its docility)');
