INSERT INTO dbo.Strongs VALUES ('H2652', 'n-pr-m', 'khof-nee''', 'Chophnîy', 'h', 'x-pn', N'חׇפְנִי', '', N'from 2651; perhaps pugilist;', 'Hophni.', 'Chophni, an Israelite');
INSERT INTO dbo.Strongs VALUES ('H2653', 'v', 'khaw-faf''', 'chophaph', 'h', 'heb', N'חׇפַף', '', N'a primitive root (compare 2645, 3182);', 'cover.', 'to cover (in protection)');
