INSERT INTO dbo.Strongs VALUES ('H2689', 'n-f', 'khats-o-tser-aw''', 'chătsôtsᵉrâh', 'h', 'heb', N'חֲצֹצְרָה', '', N'by reduplication from 2690;', 'trumpet(-er).', 'a trumpet (from its sundered or quavering note)');
INSERT INTO dbo.Strongs VALUES ('H2690', 'v', 'khaw-tsar''', 'châtsar', 'h', 'heb', N'חָצַר', '', N'a primitive root; properly, to surround with a stockade, and thus separate from the open country; but used only in the reduplicated form חֲצֹצֵר; or (2 Chronicles 5:12) חֲצֹרֵר; as dem. from 2689;', 'blow, sound, trumpeter.', 'to trumpet, i.e. blow on that instrument');
INSERT INTO dbo.Strongs VALUES ('H2691', 'n-m', 'khaw-tsare''', 'châtsêr', 'h', 'heb', N'חָצֵר', '', N'(masculine and feminine); from 2690 in its original sense;', 'court, tower, village.', 'a yard (as inclosed by a fence); also a hamlet (as similarly surrounded with walls)');
INSERT INTO dbo.Strongs VALUES ('H2692', 'n-pr-loc', 'khats-ar'' addawr''', 'Chătsar ʼAddâr', 'h', 'x-pn', N'חֲצַר אַדָּר', 'xlit Addâr corrected to ʼAddâr', N'from 2691 and 146; (the) village of Addar;', 'Hazar-addar.', 'Chatsar-Addar, a place in Palestine');
INSERT INTO dbo.Strongs VALUES ('H2693', 'n-pr-loc', 'khats-ar'' gad-daw''', 'Chătsar Gaddâh', 'h', 'x-pn', N'חֲצַר גַּדָּה', '', N'from 2691 and a feminine of 1408; (the) village of (female) Fortune;', 'Hazar-gaddah.', 'Chatsar-Gaddah, a place in Palestine');
INSERT INTO dbo.Strongs VALUES ('H2694', 'n-pr-loc', 'khats-ar'' hat-tee-kone''', 'Chătsar hat-Tîykôwn', 'h', 'x-pn', N'חֲצַר הַתִּיכוֹן', '', N'from 2691 and 8484 with the article interposed; village of the middle;', 'Hazar-hatticon.', 'Chatsar-hat-Tikon, a place in Palestine');
INSERT INTO dbo.Strongs VALUES ('H2695', 'n-pr-m', 'khets-ro''', 'Chetsrôw', 'h', 'x-pn', N'חֶצְרוֹ', '', N'by an orthographical variation for 2696; enclosure;', 'Hezro, Hezrai.', 'Chetsro, an Israelite');
INSERT INTO dbo.Strongs VALUES ('H2696', 'n-pr-m n-pr-loc', 'khets-rone''', 'Chetsrôwn', 'h', 'x-pn', N'חֶצְרוֹן', '', N'from 2691; court-yard;', 'Hezron.', 'Chetsron, the name of a place in Palestine; also of two Israelites');
INSERT INTO dbo.Strongs VALUES ('H2697', 'n-m', 'khets-ro-nee''', 'Chetsrôwnîy', 'h', 'x-pn', N'חֶצְרוֹנִי', '', N'patronymically from 2696;', 'Hezronites.', 'a Chetsronite or (collectively) descendants of Chetsron');
INSERT INTO dbo.Strongs VALUES ('H2698', 'n-pr-loc', 'khats-ay-roth''', 'Chătsêrôwth', 'h', 'x-pn', N'חֲצֵרוֹת', '', N'feminine plural of 2691; yards;', 'Hazeroth.', 'Chatseroth, a place in Palestine');
INSERT INTO dbo.Strongs VALUES ('H2699', 'n-pr-loc', 'khats-ay-reem''', 'Chătsêrîym', 'h', 'x-pn', N'חֲצֵרִים', '', N'plural masculine of 2691; yards;', 'Hazerim', 'Chatserim, a place in Palestine');
INSERT INTO dbo.Strongs VALUES ('H2700', 'n-pr-m', 'khats-ar-maw''-veth', 'Chătsarmâveth', 'h', 'x-pn', N'חֲצַרְמָוֶת', '', N'from 2691 and 4194; village of death;', 'Hazarmaveth.', 'Chatsarmaveth, a place in Arabia');
INSERT INTO dbo.Strongs VALUES ('H2701', 'n-pr-loc', 'khats-ar''soo-saw''', 'Chătsar Çûwçâh', 'h', 'x-pn', N'חֲצַר סוּסָה', '', N'from 2691 and 5484; village of cavalry;', 'Hazar-susah.', 'Chatsar-Susah, a place in Palestine');
INSERT INTO dbo.Strongs VALUES ('H2702', 'n-pr-loc', 'khats-ar'' soo-seem''', 'Chătsar Çûwçîym', 'h', 'x-pn', N'חֲצַר סוּסִים', '', N'from 2691 and the plural of 5483; village of horses;', 'Hazar-susim.', 'Chatsar-Susim, a place in Palestine');
INSERT INTO dbo.Strongs VALUES ('H2703', 'n-pr-loc', 'khats-ar'' ay-none''', 'Chătsar ʻÊynôwn', 'h', 'x-pn', N'חֲצַר עֵינוֹן', '', N'from 2691 and a derivative of 5869; village of springs;', 'Hazar-enon.', 'Chatsar-Enon, a place in Palestine');
INSERT INTO dbo.Strongs VALUES ('H2704', 'n-pr-loc', 'khats-ar'' ay-nawn''', 'Chătsar ʻÊynân', 'h', 'x-pn', N'חֲצַר עֵינָן', '', N'from 2691 and the same as 5881; village of springs;', 'Hazar-enan.', 'Chatsar-Enan, a place in Palestine');
INSERT INTO dbo.Strongs VALUES ('H2705', 'n-pr-loc', 'khats-ar'' shoo-awl''', 'Chătsar Shûwʻâl', 'h', 'x-pn', N'חֲצַר שׁוּעָל', '', N'from 2691 and 7776; village of (the) fox;', 'Hazar-shual.', 'Chatsar-Shual, a place in Palestine');
INSERT INTO dbo.Strongs VALUES ('H2706', 'n-m', 'khoke', 'chôq', 'h', 'heb', N'חֹק', '', N'from 2710;', 'appointed, bound, commandment, convenient, custom, decree(-d), due, law, measure, × necessary, ordinance(-nary), portion, set time, statute, task.', 'an enactment; hence, an appointment (of time, space, quantity, labor or usage)');
INSERT INTO dbo.Strongs VALUES ('H2707', 'v', 'khaw-kaw''', 'châqâh', 'h', 'heb', N'חָקָה', '', N'a primitive root;', 'carved work, portrayed, set a print.', 'to carve; by implication, to delineate; also to entrench');
INSERT INTO dbo.Strongs VALUES ('H2708', 'n-f', 'khook-kaw''', 'chuqqâh', 'h', 'heb', N'חֻקָּה', '', N'feminine of 2706, and meaning substantially the same', 'appointed, custom, manner, ordinance, site, statute.', '');
INSERT INTO dbo.Strongs VALUES ('H2709', 'n-pr-m', 'khah-oo-faw''', 'Chăqûwphâʼ', 'h', 'x-pn', N'חֲקוּפָא', '', N'from an unused root probably meaning to bend; crooked;', 'Hakupha.', 'Chakupha, one of the Nethinim');
INSERT INTO dbo.Strongs VALUES ('H2710', 'v', 'khaw-kak''', 'châqaq', 'h', 'heb', N'חָקַק', '', N'a primitive root;', 'appoint, decree, governor, grave, lawgiver, note, pourtray, print, set.', 'properly, to hack, i.e. engrave (Judges 5:14, to be a scribe simply); by implication, to enact (laws being cut in stone or metal tablets in primitive times) or (gen.) prescribe');
INSERT INTO dbo.Strongs VALUES ('H2711', 'n-m', 'khay''-kek', 'chêqeq', 'h', 'heb', N'חֵקֶק', '', N'from 2710;', 'decree, thought.', 'an enactment, a resolution');
INSERT INTO dbo.Strongs VALUES ('H2712', 'n-pr-loc', 'Khook-koke''', 'Chuqqôq', 'h', 'x-pn', N'חֻקֹּק', '', N'or (fully) חוּקֹק; from 2710; appointed;', 'Hukkok, Hukok.', 'Chukkok or Chukok, a place in Palestine');
INSERT INTO dbo.Strongs VALUES ('H2713', 'v', 'khaw-kar''', 'châqar', 'h', 'heb', N'חָקַר', '', N'a primitive root;', 'find out, (make) search (out), seek (out), sound, try.', 'properly, to penetrate; hence, to examine intimately');
INSERT INTO dbo.Strongs VALUES ('H2714', 'n-m', 'khay''-ker', 'chêqer', 'h', 'heb', N'חֵקֶר', '', N'from 2713;', 'finding out, number, (un-) search(-able, -ed, out, -ing).', 'examination, enumeration, deliberation');
INSERT INTO dbo.Strongs VALUES ('H2715', 'n-m', 'khore', 'chôr', 'h', 'heb', N'חֹר', '', N'or (fully) חוֹר; from 2787; (compare 2751)', 'noble.', 'properly, white or pure (from the cleansing or shining power of fire); hence (figuratively) noble (in rank)');
INSERT INTO dbo.Strongs VALUES ('H2716', 'n-m', 'kheh''-reh', 'chereʼ', 'h', 'heb', N'חֶרֶא', '', N'from an unused (and vulgar) root probably meaning to evacuate the bowels;', 'dung. Also חֲרִי.', 'excrement');
INSERT INTO dbo.Strongs VALUES ('H2717', 'v', 'khaw-rab''', 'chârab', 'h', 'heb', N'חָרַב', '', N'or חֲרֵב; a primitive root;', 'decay, (be) desolate, destroy(-er), (be) dry (up), slay, × surely, (lay, lie, make) waste.', 'to parch (through drought) i.e. (by analogy,) to desolate, destroy, kill');
INSERT INTO dbo.Strongs VALUES ('H2718', 'v', 'khar-ab''', 'chărab', 'h', 'arc', N'חֲרַב', '', N'(Aramaic) a root corresponding to 2717;', 'destroy.', 'to demolish');
INSERT INTO dbo.Strongs VALUES ('H2719', 'n-f', 'kheh''-reb', 'chereb', 'h', 'heb', N'חֶרֶב', '', N'from 2717;', 'axe, dagger, knife, mattock, sword, tool.', 'drought; also a cutting instrument (from its destructive effect), as a knife, sword, or other sharp implement');
INSERT INTO dbo.Strongs VALUES ('H2720', 'a', 'khaw-rabe''', 'chârêb', 'h', 'heb', N'חָרֵב', '', N'from 2717;', 'desolate, dry, waste.', 'parched or ruined');
INSERT INTO dbo.Strongs VALUES ('H2721', 'n-m', 'kho''-reb', 'chôreb', 'h', 'heb', N'חֹרֶב', '', N'a collaterally form of 2719;', 'desolation, drought, dry, heat, × utterly, waste.', 'drought or desolation');
INSERT INTO dbo.Strongs VALUES ('H2722', 'n-pr-loc', 'kho-rabe''', 'Chôrêb', 'h', 'x-pn', N'חֹרֵב', '', N'from 2717; desolate;', 'Horeb.', 'Choreb, a (generic) name for the Sinaitic mountains');
INSERT INTO dbo.Strongs VALUES ('H2723', 'n-f', 'khor-baw''', 'chorbâh', 'h', 'heb', N'חׇרְבָּה', '', N'feminine of 2721;', 'decayed place, desolate (place, -tion), destruction, (laid) waste (place).', 'properly, drought, i.e. (by implication) a desolation');
INSERT INTO dbo.Strongs VALUES ('H2724', 'n-f', 'khaw-raw-baw''', 'chârâbâh', 'h', 'heb', N'חָרָבָה', '', N'feminine of 2720;', 'dry (ground, land).', 'a desert');
INSERT INTO dbo.Strongs VALUES ('H2725', 'n-m', 'khar-aw-bone''', 'chărâbôwn', 'h', 'heb', N'חֲרָבוֹן', '', N'from 2717;', 'drought.', 'parching heat');
INSERT INTO dbo.Strongs VALUES ('H2726', 'n-pr-m', 'khar-bo-naw''', 'Charbôwnâʼ', 'h', 'x-pn', N'חַרְבוֹנָא', '', N'or חַרְבוֹנָה; of Persian origin;', 'Harbona, Harbonah.', 'Charbona or Charbonah, a eunuch of Xerxes');
INSERT INTO dbo.Strongs VALUES ('H2727', 'v', 'khaw-rag''', 'chârag', 'h', 'heb', N'חָרַג', '', N'a primitive root;', 'be afraid.', 'properly, to leap suddenly, i.e. (by implication) to be dismayed');
INSERT INTO dbo.Strongs VALUES ('H2728', 'n-m', 'khar-gole''', 'chârᵉgôl', 'h', 'heb', N'חָרְגֹּל', '', N'from 2727;', 'beetle.', 'the leaping insect, i.e. a locust');
INSERT INTO dbo.Strongs VALUES ('H2729', 'v', 'khaw-rad''', 'chârad', 'h', 'heb', N'חָרַד', '', N'a primitive root;', 'be (make) afraid, be careful, discomfit, fray (away), quake, tremble.', 'to shudder with terror; hence, to fear; also to hasten (with anxiety)');
INSERT INTO dbo.Strongs VALUES ('H2730', 'a', 'khaw-rade''', 'chârêd', 'h', 'heb', N'חָרֵד', '', N'from 2729;', 'afraid, trembling.', 'fearful; also reverential');
INSERT INTO dbo.Strongs VALUES ('H2731', 'n-f', 'khar-aw-daw''', 'chărâdâh', 'h', 'heb', N'חֲרָדָה', '', N'feminine of 2730;', 'care, × exceedingly, fear, quaking, trembling.', 'fear, anxiety');
INSERT INTO dbo.Strongs VALUES ('H2732', 'n-pr-loc', 'khar-aw-daw''', 'Chărâdâh', 'h', 'x-pn', N'חֲרָדָה', '', N'the same as 2731;', 'Haradah.', 'Charadah, a place in the Desert');
INSERT INTO dbo.Strongs VALUES ('H2733', 'n-m', 'khar-o-dee''', 'Chărôdîy', 'h', 'x-pn', N'חֲרֹדִי', '', N'patrial from a derivative of 2729 (compare 5878);', 'Harodite.', 'a Charodite, or inhabitant of Charod');
INSERT INTO dbo.Strongs VALUES ('H2734', 'v', 'khaw-raw''', 'chârâh', 'h', 'heb', N'חָרָה', '', N'a primitive root (compare 2787);', 'be angry, burn, be displeased, × earnestly, fret self, grieve, be (wax) hot, be incensed, kindle, × very, be wroth. See 8474.', 'to glow or grow warm; figuratively (usually) to blaze up, of anger, zeal, jealousy');
INSERT INTO dbo.Strongs VALUES ('H2735', 'n-pr-loc', 'khore hag-ghid-gawd''', 'Chôr hag-Gidgâd', 'h', 'x-pn', N'חֹר הַגִּדְגָּד', '', N'from 2356 and a collateral (masculine) form of 1412, with the article interposed; hole of the cleft;', 'Hor-hagidgad.', 'Chor-hag-Gidgad, a place in the Desert');
INSERT INTO dbo.Strongs VALUES ('H2736', 'n-pr-m', 'khar-hah-yaw''', 'Charhăyâh', 'h', 'x-pn', N'חַרְהֲיָה', '', N'; from 2734 and 3050; fearing Jah;', 'Harhaiah.', 'Charhajah, an Israelite');
INSERT INTO dbo.Strongs VALUES ('H2737', 'n-m', 'khaw-rooz''', 'chârûwz', 'h', 'heb', N'חָרוּז', '', N'from an unused root meaning to perforate;', 'chain.', 'properly, pierced, i.e. a bead of pearl, gems or jewels (as strung)');
INSERT INTO dbo.Strongs VALUES ('H2738', 'n-m', 'khaw-rool''', 'chârûwl', 'h', 'heb', N'חָרוּל', '', N'or (shortened) חָרֻל; apparently, a passive participle of an unused root probably meaning to be prickly;', 'nettle.', 'properly, pointed, i.e. a bramble or other thorny weed');
INSERT INTO dbo.Strongs VALUES ('H2739', 'n-pr-m', 'khar-oo-maf''', 'chărûwmaph', 'h', 'x-pn', N'חֲרוּמַף', '', N'from passive participle of 2763 and 639; snub-nosed;', 'Harumaph.', 'Charumaph, an Israelite');
INSERT INTO dbo.Strongs VALUES ('H2740', 'n-m', 'khaw-rone''', 'chârôwn', 'h', 'heb', N'חָרוֹן', '', N'or (shortened) חָרֹן; from 2734;', 'sore displeasure, fierce(-ness), fury, (fierce) wrath(-ful).', 'a burning of anger');
INSERT INTO dbo.Strongs VALUES ('H2741', 'n-m', 'khar-oo-fee''', 'Chărûwphîy', 'h', 'x-pn', N'חֲרוּפִי', '', N'a patrial from (probably) a collateral form of 2756;', 'Haruphite.', 'a Charuphite or inhabitant of Charuph (or Chariph)');
INSERT INTO dbo.Strongs VALUES ('H2742', 'a', 'khaw-roots''', 'chărûwts', 'h', 'heb', N'חֲרוּץ', '', N'or חָרֻץ; passive participle of 2782;', 'decision, diligent, (fine) gold, pointed things, sharp, threshing instrument, wall.', 'properly, incised or (active) incisive; hence (as noun masculine or feminine) a trench (as dug), gold (as mined), a threshing-sledge (having sharp teeth); (figuratively) determination; also eager');
INSERT INTO dbo.Strongs VALUES ('H2743', 'n-pr-m', 'khaw-roots''', 'Chârûwts', 'h', 'x-pn', N'חָרוּץ', '', N'the same as 2742; earnest;', 'Haruz.', 'Charuts, an Israelite');
INSERT INTO dbo.Strongs VALUES ('H2744', 'n-pr-m', 'khar-khoor''', 'Charchûwr', 'h', 'x-pn', N'חַרְחוּר', '', N'a fuller form of 2746; inflammation;', 'Harhur.', 'Charchur, one of the Nethinim');
INSERT INTO dbo.Strongs VALUES ('H2745', 'n-pr-m', 'khar-khas''', 'Charchaç', 'h', 'x-pn', N'חַרְחַס', '', N'from the same as 2775; perhaps shining;', 'Harhas.', 'Charchas, an Israelite');
INSERT INTO dbo.Strongs VALUES ('H2746', 'n-m', 'khar-khoor''', 'charchur', 'h', 'heb', N'חַרְחֻר', '', N'from 2787;', 'extreme burning.', 'fever (as hot)');
INSERT INTO dbo.Strongs VALUES ('H2747', 'n-m', 'kheh''-ret', 'chereṭ', 'h', 'heb', N'חֶרֶט', '', N'from a primitive root meaning to engrave;', 'graving tool, pen.', 'a chisel or graver; also a style for writing');
INSERT INTO dbo.Strongs VALUES ('H2748', 'n-m', 'khar-tome''', 'charṭôm', 'h', 'heb', N'חַרְטֹם', '', N'from the same as 2747;', 'magician.', 'a horoscopist (as drawing magical lines or circles)');
INSERT INTO dbo.Strongs VALUES ('H2749', 'n-m', 'khar-tome''', 'charṭôm', 'h', 'arc', N'חַרְטֹם', '', N'(Aramaic) the same as 2748', 'magician.', '');
INSERT INTO dbo.Strongs VALUES ('H2750', 'n-m', 'khor-ee''', 'chŏrîy', 'h', 'heb', N'חֳרִי', '', N'from 2734;', 'fierce, × great, heat.', 'a burning (i.e. intense) anger');
INSERT INTO dbo.Strongs VALUES ('H2751', 'n-m', 'kho-ree''', 'chôrîy', 'h', 'heb', N'חֹרִי', '', N'from the same as 2353;', 'white.', 'white bread');
INSERT INTO dbo.Strongs VALUES ('H2752', 'n-m', 'kho-ree''', 'Chôrîy', 'h', 'x-pn', N'חֹרִי', '', N'from 2356; cave-dweller or troglodyte;', 'Horims, Horites.', 'a Chorite or aboriginal Idumaean');
INSERT INTO dbo.Strongs VALUES ('H2753', 'n-pr-m', 'kho-ree''', 'Chôrîy', 'h', 'x-pn', N'חֹרִי', '', N'or חוֹרִי; the same as 2752;', 'Hori.', 'Chori, the name of two men');
INSERT INTO dbo.Strongs VALUES ('H2754', 'n-m', 'khaw-reet''', 'chârîyṭ', 'h', 'heb', N'חָרִיט', '', N'or חָרִט; from the same as 2747;', 'bag, crisping pin.', 'properly, cut out (or hollow), i.e. (by implication) a pocket');
INSERT INTO dbo.Strongs VALUES ('H2755', 'n-m', 'khar-ay''-yo-neem''', 'chărêy-yôwnîym', 'h', 'heb', N'חֲרֵי־יוֹנִים', '', N'from the plural of 2716 and the plural of 3123; or perhaps rather the plural of a single word חֲרָאיוֹן, probably a kind of vegetable', 'doves'' dung.', 'excrements of doves');
INSERT INTO dbo.Strongs VALUES ('H2756', 'n-pr-m', 'khaw-reef''', 'Chârîyph', 'h', 'x-pn', N'חָרִיף', '', N'from 2778; autumnal;', 'Hariph.', 'Chariph, the name of two Israelites');
INSERT INTO dbo.Strongs VALUES ('H2757', 'n-m', 'khaw-reets''', 'chârîyts', 'h', 'heb', N'חָרִיץ', '', N'or חֲרִץ; from 2782; (compare 2742)', '  cheese, harrow.', 'properly, incisure or (passively) incised; hence, a threshing-sledge (with sharp teeth); also a slice (as cut)');
INSERT INTO dbo.Strongs VALUES ('H2758', 'n-m', 'khaw-reesh''', 'chârîysh', 'h', 'heb', N'חָרִישׁ', '', N'from 2790;', 'earing (time), ground.', 'ploughing or its season');
INSERT INTO dbo.Strongs VALUES ('H2759', 'a', 'khar-ee-shee''', 'chărîyshîy', 'h', 'heb', N'חֲרִישִׁי', '', N'from 2790 in the sense of silence;', 'vehement.', 'quiet, i.e. sultry (as feminine noun, the sirocco or hot east wind)');
INSERT INTO dbo.Strongs VALUES ('H2760', 'v', 'khaw-rak''', 'chârak', 'h', 'heb', N'חָרַךְ', '', N'a primitive root;', 'roast.', 'to braid (i.e. to entangle or snare) or catch (game) in a net');
INSERT INTO dbo.Strongs VALUES ('H2761', 'v', 'khar-ak''', 'chărak', 'h', 'arc', N'חֲרַךְ', '', N'(Aramaic) a root probably allied to the equivalent of 2787;', 'singe.', 'to scorch');
INSERT INTO dbo.Strongs VALUES ('H2762', 'n-m', 'kheh''-rek', 'cherek', 'h', 'heb', N'חֶרֶךְ', '', N'from 2760;', 'lattice.', 'properly, a net, i.e. (by analogy) lattice');
INSERT INTO dbo.Strongs VALUES ('H2763', 'v', 'khaw-ram''', 'châram', 'h', 'heb', N'חָרַם', '', N'a primitive root;', 'make accursed, consecrate, (utterly) destroy, devote, forfeit, have a flat nose, utterly (slay, make away).', 'to seclude; specifically (by a ban) to devote to religious uses (especially destruction); physical and reflexive, to be blunt as to the nose');
INSERT INTO dbo.Strongs VALUES ('H2764', 'n-m', 'khay''-rem', 'chêrem', 'h', 'heb', N'חֵרֶם', '', N'or (Zechariah 14:11) חֶרֶם; from 2763;', '(ac-) curse(-d, -d thing), dedicated thing, things which should have been utterly destroyed, (appointed to) utter destruction, devoted (thing), net.', 'physical (as shutting in) a net (either literally or figuratively); usually a doomed object; abstractly extermination');
INSERT INTO dbo.Strongs VALUES ('H2765', 'n-pr-loc', 'khor-ame''', 'Chŏrêm', 'h', 'x-pn', N'חֳרֵם', '', N'from 2763; devoted;', 'Horem.', 'Chorem, a place in Palestine');
INSERT INTO dbo.Strongs VALUES ('H2766', 'n-pr-m', 'khaw-reem''', 'Chârim', 'h', 'x-pn', N'חָרִם', '', N'from 2763; snub-nosed;', 'Harim.', 'Charim, an Israelite');
INSERT INTO dbo.Strongs VALUES ('H2767', 'n-pr-loc', 'khor-maw''', 'Chormâh', 'h', 'x-pn', N'חׇרְמָה', '', N'from 2763; devoted;', 'Hormah.', 'Chormah, a place in Palestine');
INSERT INTO dbo.Strongs VALUES ('H2768', 'n-pr-m', 'kher-mone''', 'Chermôwn', 'h', 'x-pn', N'חֶרְמוֹן', '', N'from 2763; abrupt;', 'Hermon.', 'Chermon, a mount of Palestine');
INSERT INTO dbo.Strongs VALUES ('H2769', 'n-pr-m', 'kher-mo-neem''', 'Chermôwnîym', 'h', 'x-pn', N'חֶרְמוֹנִים', '', N'plural of 2768;', 'the Hermonites.', 'Hermons, i.e. its peaks');
INSERT INTO dbo.Strongs VALUES ('H2770', 'n-m', 'kher-mashe''', 'chermêsh', 'h', 'heb', N'חֶרְמֵשׁ', '', N'from 2763;', 'sickle.', 'a sickle (as cutting)');
