INSERT INTO dbo.Strongs VALUES ('H2860', 'n-m', 'khaw-thawn''', 'châthân', 'h', 'heb', N'חָתָן', '', N'from 2859;', 'bridegroom, husband, son in law.', 'a relative by marriage (especially through the bride); figuratively, a circumcised child (as a species of religious espousal)');
INSERT INTO dbo.Strongs VALUES ('H2861', 'n-f', 'khath-oon-naw''', 'chăthunnâh', 'h', 'heb', N'חֲתֻנָּה', '', N'from 2859;', 'espousal.', 'a wedding');
INSERT INTO dbo.Strongs VALUES ('H2862', 'v', 'khaw-thaf''', 'châthaph', 'h', 'heb', N'חָתַף', '', N'a primitive root;', 'take away.', 'to clutch');
INSERT INTO dbo.Strongs VALUES ('H2863', 'n-m', 'kheh''-thef', 'chetheph', 'h', 'heb', N'חֶתֶף', '', N'from 2862;', 'prey.', 'properly, rapine; figuratively, robbery');
INSERT INTO dbo.Strongs VALUES ('H2864', 'v', 'khaw-thar''', 'châthar', 'h', 'heb', N'חָתַר', '', N'a primitive root;', 'dig (through), row.', 'to force a passage, as by burglary; figuratively, with oars');
INSERT INTO dbo.Strongs VALUES ('H2865', 'v', 'khaw-thath''', 'châthath', 'h', 'heb', N'חָתַת', '', N'a primitive root;', 'abolish, affright, be (make) afraid, amaze, beat down, discourage, (cause to) dismay, go down, scare, terrify.', 'properly, to prostrate; hence, to break down, either (literally) by violence, or (figuratively) by confusion and fear');
INSERT INTO dbo.Strongs VALUES ('H2866', 'n-m', 'khath-ath''', 'chăthath', 'h', 'heb', N'חֲתַת', '', N'from 2865;', 'casting down.', 'dismay');
INSERT INTO dbo.Strongs VALUES ('H2867', 'n-pr-m', 'khath-ath''', 'Chăthath', 'h', 'x-pn', N'חֲתַת', '', N'the same as 2866;', 'cathath. f', 'Chathath, an Israelite');
INSERT INTO dbo.Strongs VALUES ('H2868', 'v', 'teh-abe''', 'ṭᵉʼêb', 'h', 'arc', N'טְאֵב', '', N'(Aramaic) a primitive root;', 'be glad', 'to rejoice');
INSERT INTO dbo.Strongs VALUES ('H2869', 'n-m', 'teh-abe''', 'ṭâb', 'h', 'arc', N'טָב', '', N'the same as 2896;', 'fine, good.', 'good');
INSERT INTO dbo.Strongs VALUES ('H2870', 'n-pr-m', 'taw-beh-ale''', 'ṭâbᵉʼêl', 'h', 'x-pn', N'טָבְאֵל', '', N'from 2895 and 410; pleasing (to) God;', 'Tabeal, Tabeel.', 'Tabeel, the name of a Syrian and of a Persian');
INSERT INTO dbo.Strongs VALUES ('H2871', 'n-m', 'taw-bool''', 'ṭâbûwl', 'h', 'heb', N'טָבוּל', '', N'passive participle of 2881;', 'dyed attire.', 'properly, dyed, i.e. a turban (probably as of colored stuff)');
INSERT INTO dbo.Strongs VALUES ('H2872', 'n-m', 'tab-boor''', 'ṭabbûwr', 'h', 'heb', N'טַבּוּר', '', N'from an unused root meaning to pile up;', 'middle, midst.', 'properly, accumulated; i.e. (by implication) a summit');
INSERT INTO dbo.Strongs VALUES ('H2873', 'v', 'taw-bakh''', 'ṭâbach', 'h', 'heb', N'טָבַח', '', N'a primitive root;', 'kill, (make) slaughter, slay.', 'to slaughter (animals or men)');
INSERT INTO dbo.Strongs VALUES ('H2874', 'n-m', 'teh''-bakh', 'ṭebach', 'h', 'heb', N'טֶבַח', '', N'from 2873;', '× beast, slaughter, × slay, × sore.', 'properly, something slaughtered; hence, a beast (or meat, as butchered); abstractly butchery (or concretely, a place of slaughter)');
INSERT INTO dbo.Strongs VALUES ('H2875', 'n-pr-m', 'teh''-bakh', 'Ṭebach', 'h', 'x-pn', N'טֶבַח', '', N'the same as 2874; massacre;', 'Tebah.', 'Tebach, the name of a Mesopotamian and of an Israelite');
INSERT INTO dbo.Strongs VALUES ('H2876', 'n-m', 'tab-bawkh''', 'ṭabbâch', 'h', 'heb', N'טַבָּח', '', N'from 2873;', 'cook, guard.', 'properly, a butcher; hence, a lifeguardsman (because he was acting as an executioner); also a cook (usually slaughtering the animal for food)');
INSERT INTO dbo.Strongs VALUES ('H2877', 'n-m', 'tab-bawkh''', 'ṭabbâch', 'h', 'arc', N'טַבָּח', '', N'(Aramaic) the same as 2876;', 'guard.', 'a lifeguardsman');
INSERT INTO dbo.Strongs VALUES ('H2878', 'n-f', 'tib-khaw''', 'ṭibchâh', 'h', 'heb', N'טִבְחָה', '', N'feminine of 2874 and meaning the same', 'flesh, slaughter.', '');
INSERT INTO dbo.Strongs VALUES ('H2879', 'n-f', 'tab-baw-khaw''', 'ṭabbâchâh', 'h', 'heb', N'טַבָּחָה', '', N'feminine of 2876;', 'cook.', 'a female cook');
INSERT INTO dbo.Strongs VALUES ('H2880', 'n-pr-loc', 'tib-khath''', 'Ṭibchath', 'h', 'x-pn', N'טִבְחַת', 'lemma טבְחַת missing vowel, corrected to טִבְחַת', N'from 2878; slaughter;', 'Tibhath.', 'Tibchath, a place in Syria');
INSERT INTO dbo.Strongs VALUES ('H2881', 'v', 'taw-bal''', 'ṭâbal', 'h', 'heb', N'טָבַל', '', N'a primitive root;', 'dip, plunge.', 'to dip, to immerse');
INSERT INTO dbo.Strongs VALUES ('H2882', 'n-pr-m', 'teb-al-yaw''-hoo', 'Ṭᵉbalyâhûw', 'h', 'x-pn', N'טְבַלְיָהוּ', '', N'from 2881 and 3050; Jah has dipped;', 'Tebaliah.', 'Tebaljah, an Israelite');
INSERT INTO dbo.Strongs VALUES ('H2883', 'v', 'taw-bah''', 'ṭâbaʻ', 'h', 'heb', N'טָבַע', '', N'a primitive root;', 'drown, fasten, settle, sink.', 'to sink');
INSERT INTO dbo.Strongs VALUES ('H2884', 'n-pr-m', 'tab-baw-othe''', 'Ṭabbâʻôwth', 'h', 'x-pn', N'טַבָּעוֹת', '', N'plural of 2885; rings;', 'Tabaoth.', 'Tabbaoth, one of the Nethinim');
INSERT INTO dbo.Strongs VALUES ('H2885', 'n-m', 'tab-bah''-ath', 'ṭabbaʻath', 'h', 'heb', N'טַבַּעַת', '', N'from 2883;', 'ring.', 'properly, a seal (as sunk into the wax), i.e. signet (for sealing); hence (generally) a ring of any kind');
INSERT INTO dbo.Strongs VALUES ('H2886', 'n-pr-m', 'tab-rim-mone''', 'Ṭabrimmôwn', 'h', 'x-pn', N'טַבְרִמּוֹן', '', N'from 2895 and 7417; pleasing (to) Rimmon;', 'Tabrimmon.', 'Tabrimmon, a Syrian');
INSERT INTO dbo.Strongs VALUES ('H2887', 'n', 'tay''-beth', 'Ṭêbeth', 'h', 'x-pn', N'טֵבֶת', '', N'probably of foreign derivation;', 'Tebeth.', 'Tebeth, the tenth Hebrew month');
INSERT INTO dbo.Strongs VALUES ('H2888', 'n-pr-loc', 'tab-bath''', 'Ṭabbath', 'h', 'x-pn', N'טַבַּת', '', N'of uncertain derivation;', 'Tabbath.', 'Tabbath, a place East of the Jordan');
INSERT INTO dbo.Strongs VALUES ('H2889', 'a', 'taw-hore''', 'ṭâhôwr', 'h', 'heb', N'טָהוֹר', '', N'or טָהֹר; from 2891;', 'clean, fair, pure(-ness).', 'pure (in a physical, chemical, ceremonial or moral sense)');
INSERT INTO dbo.Strongs VALUES ('H2890', 'n-m', 'teh-hore''', 'ṭᵉhôwr', 'h', 'heb', N'טְהוֹר', '', N'from 2891;', 'pureness.', 'purity');
INSERT INTO dbo.Strongs VALUES ('H2891', 'v', 'taw-hare''', 'ṭâhêr', 'h', 'heb', N'טָהֵר', '', N'a primitive root; properly, to be bright; i.e. (by implication)', 'be (make, make self, pronounce) clean, cleanse (self), purge, purify(-ier, self).', 'to be pure (physical sound, clear, unadulterated; Levitically, uncontaminated; morally, innocent or holy)');
INSERT INTO dbo.Strongs VALUES ('H2892', 'n-m', 'to''-har', 'ṭôhar', 'h', 'heb', N'טֹהַר', '', N'from 2891;', 'clearness, glory, purifying.', 'literally brightness; ceremonially purification');
INSERT INTO dbo.Strongs VALUES ('H2893', 'n-f', 'toh-or-aw''', 'ṭohŏrâh', 'h', 'heb', N'טׇהֳרָה', '', N'feminine of 2892;', '× is cleansed, cleansing, purification(-fying).', 'ceremonial purification; moral purity');
INSERT INTO dbo.Strongs VALUES ('H2894', 'v', 'too', 'ṭûwʼ', 'h', 'heb', N'טוּא', '', N'a primitive root;', 'sweep.', 'to sweep away');
INSERT INTO dbo.Strongs VALUES ('H2895', 'v', 'tobe', 'ṭôwb', 'h', 'heb', N'טוֹב', '', N'a primitive root,', 'be (do) better, cheer, be (do, seem) good, (make) goodly, × please, (be, do, go, play) well.', 'to be (transitively, do or make) good (or well) in the widest sense');
INSERT INTO dbo.Strongs VALUES ('H2896', 'a n-m n-f', 'tobe', 'ṭôwb', 'h', 'heb', N'טוֹב', '', N'from 2895;', 'beautiful, best, better, bountiful, cheerful, at ease, × fair (word), (be in) favour, fine, glad, good (deed, -lier, -liest, -ly, -ness, -s), graciously, joyful, kindly, kindness, liketh (best), loving, merry, × most, pleasant,   pleaseth, pleasure, precious, prosperity, ready, sweet, wealth, welfare, (be) well(-favoured).', 'good (as an adjective) in the widest sense; used likewise as a noun, both in the masculine and the feminine, the singular and the plural (good, a good or good thing, a good man or woman; the good, goods or good things, good men or women), also as an adverb (well)');
INSERT INTO dbo.Strongs VALUES ('H2897', 'n-pr-loc', 'tobe', 'Ṭôwb', 'h', 'x-pn', N'טוֹב', '', N'the same as 2896; good;', 'Tob.', 'Tob, a region apparently East of the Jordan');
INSERT INTO dbo.Strongs VALUES ('H2898', 'n-m', 'toob', 'ṭûwb', 'h', 'heb', N'טוּב', '', N'from 2895;', 'fair, gladness, good(-ness, thing, -s), joy, go well with.', 'good (as a noun), in the widest sense, especially goodness (superlative concretely, the best), beauty, gladness, welfare');
INSERT INTO dbo.Strongs VALUES ('H2899', 'n-pr-m', 'tobe ado-nee-yah''-hoo', 'Ṭôwb ʼĂdônîyâhûw', 'h', 'x-pn', N'טוֹב אֲדֹנִיָּהוּ', 'xlit Ădônîyâhûw corrected to ʼĂdônîyâhûw', N'from 2896 and 138; pleasing (to) Adonijah;', 'Tob-adonijah.', 'Tob-Adonijah, an Israelite');
INSERT INTO dbo.Strongs VALUES ('H2900', 'n-pr-m', 'to-bee-yaw''', 'Ṭôwbîyâh', 'h', 'x-pn', N'טוֹבִיָּה', '', N'or טוֹבִיָּהוּ; from 2896 and 3050; goodness of Jehovah;', 'Tobiah, Tobijah.', 'Tobijah, the name of three Israelites and of one Samaritan');
INSERT INTO dbo.Strongs VALUES ('H2901', 'v', 'taw-vaw''', 'ṭâvâh', 'h', 'heb', N'טָוָה', '', N'a primitive root;', 'spin.', 'to spin');
INSERT INTO dbo.Strongs VALUES ('H2902', 'v', 'too''-akh', 'ṭûwach', 'h', 'heb', N'טוּחַ', '', N'a primitive root;', 'daub, overlay, plaister, smut.', 'to smear, especially with lime');
INSERT INTO dbo.Strongs VALUES ('H2903', 'n-f', 'to-faw-faw''', 'ṭôwphâphâh', 'h', 'heb', N'טוֹפָפָה', '', N'from an unused root meaning to go around or bind;', 'frontlet.', 'a fillet for the forehead');
INSERT INTO dbo.Strongs VALUES ('H2904', 'v', 'tool', 'ṭûwl', 'h', 'heb', N'טוּל', '', N'a primitive root;', 'carry away, (utterly) cast (down, forth, out), send out.', 'to pitch over or reel; hence (transitively) to cast down or out');
INSERT INTO dbo.Strongs VALUES ('H2905', 'n-m', 'toor', 'ṭûwr', 'h', 'heb', N'טוּר', '', N'from an unused root meaning to range in a regular manner;', 'row.', 'a row; hence, a wall');
INSERT INTO dbo.Strongs VALUES ('H2906', 'n-m', 'toor', 'ṭûwr', 'h', 'arc', N'טוּר', '', N'(Aramaic) corresponding to 6697;', 'mountain.', 'a rock or hill');
INSERT INTO dbo.Strongs VALUES ('H2907', 'v', 'toos', 'ṭûws', 'h', 'heb', N'טוּשׂ', '', N'a primitive root;', 'haste.', 'to pounce as a bird of prey');
INSERT INTO dbo.Strongs VALUES ('H2908', 'adv', 'tev-awth''', 'ṭᵉvâth', 'h', 'arc', N'טְוָת', '', N'(Aramaic) from a root corresponding to 2901;', 'fasting.', 'hunger (as twisting)');
INSERT INTO dbo.Strongs VALUES ('H2909', 'v', 'taw-khaw''', 'ṭâchâh', 'h', 'heb', N'טָחָה', '', N'a primitive root;', '(bow-) shot.', 'to stretch a bow, as an archer');
INSERT INTO dbo.Strongs VALUES ('H2910', 'n-f', 'too-khaw''', 'ṭuchâh', 'h', 'heb', N'טֻחָה', 'xlit ṭuwchâh corrected to ṭuchâh', N'from 2909 (or 2902) in the sense of overlaying;', 'inward parts.', '(in the plural only) the kidneys (as being covered); hence (figuratively) the inmost thought');
INSERT INTO dbo.Strongs VALUES ('H2911', 'n-m', 'tekh-one''', 'ṭᵉchôwn', 'h', 'heb', N'טְחוֹן', '', N'from 2912;', 'to grind.', 'a hand mill; hence, a millstone');
INSERT INTO dbo.Strongs VALUES ('H2912', 'v', 'taw-khan''', 'ṭâchan', 'h', 'heb', N'טָחַן', '', N'a primitive root;', 'grind(-er).', 'to grind meal; hence, to be a concubine (that being their employment)');
INSERT INTO dbo.Strongs VALUES ('H2913', 'n-f', 'takh-an-aw''', 'ṭachănâh', 'h', 'heb', N'טַחֲנָה', '', N'from 2912;', 'grinding.', 'a hand mill; hence (figuratively) chewing');
INSERT INTO dbo.Strongs VALUES ('H2914', 'n-m', 'tekh-ore''', 'ṭᵉchôr', 'h', 'heb', N'טְחֹר', '', N'from an unused root meaning to burn;', 'emerod.', 'a boil or ulcer (from the inflammation), especially a tumor in the anus or pudenda (the piles)');
INSERT INTO dbo.Strongs VALUES ('H2915', 'n-m', 'tee''akh', 'ṭîyach', 'h', 'heb', N'טִיחַ', '', N'from (the equiv. of) 2902;', 'daubing.', 'mortar or plaster');
INSERT INTO dbo.Strongs VALUES ('H2916', 'n-m', 'teet', 'ṭîyṭ', 'h', 'heb', N'טִיט', '', N'from an unused root meaning apparently to be sticky (rather perhaps a demonstrative); from 2894, through the idea of dirt to be swept away);', 'clay, dirt, mire.', 'mud or clay; figuratively, calamity');
INSERT INTO dbo.Strongs VALUES ('H2917', 'n-m', 'teen', 'ṭîyn', 'h', 'arc', N'טִין', '', N'(Aramaic) perhaps, by interchange, for a word corresponding to 2916;', 'miry.', 'clay');
INSERT INTO dbo.Strongs VALUES ('H2918', 'n-f', 'tee-raw''', 'ṭîyrâh', 'h', 'heb', N'טִירָה', '', N'feminine of (an equivalent to) 2905;', '(goodly) castle, habitation, palace, row.', 'a wall; hence, a fortress or a hamlet');
INSERT INTO dbo.Strongs VALUES ('H2919', 'n-m', 'tal', 'ṭal', 'h', 'heb', N'טַל', '', N'from 2926;', 'dew.', 'dew (as covering vegetation)');
INSERT INTO dbo.Strongs VALUES ('H2920', 'n-m', 'tal', 'ṭal', 'h', 'arc', N'טַל', '', N'(Aramaic) the same as 2919', 'dew.', '');
INSERT INTO dbo.Strongs VALUES ('H2921', 'v', 'taw-law''', 'ṭâlâʼ', 'h', 'heb', N'טָלָא', '', N'a primitive root;', 'clouted, with divers colours, spotted.', 'properly, to cover with pieces; i.e. (by implication) to spot or variegate (as tapestry)');
INSERT INTO dbo.Strongs VALUES ('H2922', 'n-m', 'tel-aw''', 'ṭᵉlâʼ', 'h', 'heb', N'טְלָא', '', N'apparently from 2921 in the (orig.) sense of covering (for protection); (compare 2924)', 'lamb.', 'a lamb');
INSERT INTO dbo.Strongs VALUES ('H2923', 'n-pr-loc', 'tel-aw-eem''', 'Ṭᵉlâʼîym', 'h', 'x-pn', N'טְלָאִים', '', N'from the plural of 2922; lambs;', 'Telaim.', 'Telaim, a place in Palestine');
INSERT INTO dbo.Strongs VALUES ('H2924', 'n-m', 'taw-leh''', 'ṭâleh', 'h', 'heb', N'טָלֶה', '', N'by variation for 2922;', 'lamb.', 'a lamb');
INSERT INTO dbo.Strongs VALUES ('H2925', 'n-f', 'tal-tay-law''', 'ṭalṭêlâh', 'h', 'heb', N'טַלְטֵלָה', '', N'from 2904;', 'captivity.', 'overthrow or rejection');
INSERT INTO dbo.Strongs VALUES ('H2926', 'v', 'taw-lal''', 'ṭâlal', 'h', 'heb', N'טָלַל', '', N'a primitive root;', 'cover.', 'properly, to strew over, i.e. (by implication) to cover in or plate (with beams)');
INSERT INTO dbo.Strongs VALUES ('H2927', 'v', 'tel-al''', 'ṭᵉlal', 'h', 'arc', N'טְלַל', '', N'(Aramaic) corresponding to 2926;', 'have a shadow.', 'to cover with shade');
INSERT INTO dbo.Strongs VALUES ('H2928', 'n-pr-m n-pr-loc', 'teh''-lem', 'Ṭelem', 'h', 'x-pn', N'טֶלֶם', '', N'from an unused root meaning to break up or treat violently; oppression;', 'Telem.', 'Telem, the name of a place in Idumaea, also of a temple doorkeeper');
INSERT INTO dbo.Strongs VALUES ('H2929', 'n-pr-m', 'tal-mone''', 'Ṭalmôwn', 'h', 'x-pn', N'טַלְמוֹן', '', N'from the same as 2728; oppressive;', 'Talmon.', 'Talmon, a temple doorkeeper');
INSERT INTO dbo.Strongs VALUES ('H2930', 'v', 'taw-may''', 'ṭâmêʼ', 'h', 'heb', N'טָמֵא', '', N'a primitive root;', 'defile (self), pollute (self), be (make, make self, pronounce) unclean, × utterly.', 'to be foul, especially in a ceremial or moral sense (contaminated)');
INSERT INTO dbo.Strongs VALUES ('H2931', 'a', 'taw-may''', 'ṭâmêʼ', 'h', 'heb', N'טָמֵא', '', N'from 2930;', 'defiled,   infamous, polluted(-tion), unclean.', 'foul in a religious sense');
INSERT INTO dbo.Strongs VALUES ('H2932', 'n-f', 'toom-aw''', 'ṭumʼâh', 'h', 'heb', N'טֻמְאָה', '', N'from 2930;', 'filthiness, unclean(-ness).', 'religious impurity');
INSERT INTO dbo.Strongs VALUES ('H2933', 'v', 'taw-maw''', 'ṭâmâh', 'h', 'heb', N'טָמָה', '', N'a collateral form of 2930;', 'be defiled, be reputed vile.', 'to be impure in a religious sense');
INSERT INTO dbo.Strongs VALUES ('H2934', 'v', 'taw-man''', 'ṭâman', 'h', 'heb', N'טָמַן', '', N'a primitive root;', 'hide, lay privily, in secret.', 'to hide (by covering over)');
INSERT INTO dbo.Strongs VALUES ('H2935', 'n-m', 'teh''-neh', 'ṭeneʼ', 'h', 'heb', N'טֶנֶא', '', N'from an unused root probably meaning to weave;', 'basket.', 'a basket (of interlaced osiers)');
INSERT INTO dbo.Strongs VALUES ('H2936', 'v', 'taw-naf''', 'ṭânaph', 'h', 'heb', N'טָנַף', '', N'a primitive root;', 'defile.', 'to soil');
INSERT INTO dbo.Strongs VALUES ('H2937', 'v', 'taw-aw''', 'ṭâʻâh', 'h', 'heb', N'טָעָה', '', N'a primitive root;', 'seduce.', 'to wander; causatively to lead astray');
INSERT INTO dbo.Strongs VALUES ('H2938', 'v', 'taw-am''', 'ṭâʻam', 'h', 'heb', N'טָעַם', '', N'a primitive root;', '× but, perceive, taste.', 'to taste; figuratively, to perceive');
INSERT INTO dbo.Strongs VALUES ('H2939', 'v', 'teh-am''', 'ṭᵉʻam', 'h', 'arc', N'טְעַם', '', N'(Aramaic) corresponding to 2938;', 'make to eat, feed.', 'to taste; causatively to feed');
INSERT INTO dbo.Strongs VALUES ('H2940', 'n-m', 'tah''-am', 'ṭaʻam', 'h', 'heb', N'טַעַם', '', N'from 2938;', 'advice, behaviour, decree, discretion, judgment, reason, taste, understanding.', 'properly, a taste, i.e. (figuratively) perception; by implication, intelligence; transitively, a mandate');
INSERT INTO dbo.Strongs VALUES ('H2941', 'n-m', 'tah''-am', 'ṭaʻam', 'h', 'arc', N'טַעַם', '', N'(Aramaic) from 2939; compare 2940)', 'account, × to be commanded, commandment, matter.', 'properly, a taste, i.e. a judicial sentence');
INSERT INTO dbo.Strongs VALUES ('H2942', 'n-m', 'teh-ame''', 'ṭᵉʻêm', 'h', 'arc', N'טְעֵם', '', N'(Aramaic) from 2939, and equivalent to 2941;', '  chancellor,   command, commandment, decree,   regard, taste, wisdom.', 'properly, flavor; figuratively, judgment (both subjective and objective); hence, account (both subjectively and objectively)');
INSERT INTO dbo.Strongs VALUES ('H2943', 'v', 'taw-an''', 'ṭâʻan', 'h', 'heb', N'טָעַן', '', N'a primitive root;', 'lade.', 'to load a beast');
INSERT INTO dbo.Strongs VALUES ('H2944', 'v', 'taw-an''', 'ṭâʻan', 'h', 'heb', N'טָעַן', '', N'a primitive root;', 'thrust through.', 'to stab');
INSERT INTO dbo.Strongs VALUES ('H2945', 'n-m', 'taf', 'ṭaph', 'h', 'heb', N'טַף', '', N'from 2952 (perhaps referring to the tripping gait of children);', '(little) children (ones), families.', 'a family (mostly used collectively in the singular)');
INSERT INTO dbo.Strongs VALUES ('H2946', 'v', 'taw-fakh''', 'ṭâphach', 'h', 'heb', N'טָפַח', '', N'a primitive root; or perhaps a denominative from 2947, from dandling on the palms', 'span, swaddle.', 'to flatten out or extend (as a tent); figuratively, to nurse a child (as promotive of growth);');
INSERT INTO dbo.Strongs VALUES ('H2947', 'n-m', 'tay''-fakh', 'ṭêphach', 'h', 'heb', N'טֵפַח', '', N'from 2946;', 'coping, hand-breadth.', 'a spread of the hand, i.e. a palm-breadth (not ''span'' of the fingers); architecturally, a corbel (as a supporting palm)');
INSERT INTO dbo.Strongs VALUES ('H2948', 'n-m', 'to''-fakh', 'ṭôphach', 'h', 'heb', N'טֹפַח', '', N'from 2946', 'hand-breadth (broad).', '(the same as 2947)');
