INSERT INTO dbo.Strongs VALUES ('H2950', 'v', 'taw-fal''', 'ṭâphal', 'h', 'heb', N'טָפַל', '', N'a primitive root;', 'forge(-r), sew up.', 'properly, to stick on as a patch; figuratively, to impute falsely');
INSERT INTO dbo.Strongs VALUES ('H2951', 'n-m', 'tif-sar''', 'ṭiphçar', 'h', 'heb', N'טִפְסַר', '', N'of foreign derivation;', 'captain.', 'a military governor');
INSERT INTO dbo.Strongs VALUES ('H2952', 'v', 'taw-faf''', 'ṭâphaph', 'h', 'heb', N'טָפַף', '', N'a primitive root; apparently', 'mince.', 'to trip (with short steps) coquettishly');
