INSERT INTO dbo.Strongs VALUES ('H3030', 'n-pr-loc', 'yid-al-aw''', 'Yidʼălâh', 'h', 'x-pn', N'יִדְאֲלָה', 'xlit Yidălâh corrected to Yidʼălâh', N'of uncertain derivation;', 'Idalah.', 'Jidalah, a place in Palestine');
INSERT INTO dbo.Strongs VALUES ('H3031', 'n-pr-m', 'yid-bawsh''', 'Yidbâsh', 'h', 'x-pn', N'יִדְבָּשׁ', '', N'from the same as 1706; perhaps honeyed;', 'Idbash.', 'Jidbash, an Israelite');
INSERT INTO dbo.Strongs VALUES ('H3032', 'v', 'yaw-dad''', 'yâdad', 'h', 'heb', N'יָדַד', '', N'a primitive root; (compare 3034)', 'cast.', 'properly, to handle, i.e. to throw, e.g. lots');
INSERT INTO dbo.Strongs VALUES ('H3033', 'n-f', 'yed-ee-dooth''', 'yᵉdidûwth', 'h', 'heb', N'יְדִדוּת', '', N'from 3039;', 'dearly beloved.', 'properly, affection; concretely, a darling object');
INSERT INTO dbo.Strongs VALUES ('H3034', 'v', 'yaw-daw''', 'yâdâh', 'h', 'heb', N'יָדָה', '', N'a primitive root; used only as denominative from 3027; literally, to use (i.e. hold out) the hand;', 'cast (out), (make) confess(-ion), praise, shoot, (give) thank(-ful, -s, -sgiving).', 'physically, to throw (a stone, an arrow) at or away; especially to revere or worship (with extended hands); intensively, to bemoan (by wringing the hands)');
