INSERT INTO dbo.Strongs VALUES ('H3036', 'n-pr-m', 'yaw-done''', 'Yâdôwn', 'h', 'x-pn', N'יָדוֹן', '', N'from 3034; thankful;', 'Jadon.', 'Jadon, an Israelite');
