INSERT INTO dbo.Strongs VALUES ('H3045', 'v', 'yaw-dah''', 'yâdaʻ', 'h', 'heb', N'יָדַע', '', N'a primitive root;', 'acknowledge, acquaintance(-ted with), advise, answer, appoint, assuredly, be aware, (un-) awares, can(-not), certainly, comprehend, consider, × could they, cunning, declare, be diligent, (can, cause to) discern, discover, endued with, familiar friend, famous, feel, can have, be (ig-) norant, instruct, kinsfolk, kinsman, (cause to let, make) know, (come to give, have, take) knowledge, have (knowledge), (be, make, make to be, make self) known,   be learned,   lie by man, mark, perceive, privy to, × prognosticator, regard, have respect, skilful, shew, can (man of) skill, be sure, of a surety, teach, (can) tell, understand, have (understanding), × will be, wist, wit, wot.', 'to know (properly, to ascertain by seeing); used in a great variety of senses, figuratively, literally, euphemistically and inferentially (including observation, care, recognition; and causatively, instruction, designation, punishment, etc.)');
INSERT INTO dbo.Strongs VALUES ('H3046', 'v', 'yed-ah''', 'yᵉdaʻ', 'h', 'arc', N'יְדַע', '', N'(Aramaic) corresponding to 3045', 'certify, know, make known, teach.', '');
INSERT INTO dbo.Strongs VALUES ('H3047', 'n-pr-m', 'yaw-daw''', 'Yâdâʻ', 'h', 'x-pn', N'יָדָע', '', N'from 3045; knowing;', 'Jada.', 'Jada, an Israelite');
