INSERT INTO dbo.Strongs VALUES ('H3049', 'n-m', 'yid-deh-o-nee''', 'yiddᵉʻônîy', 'h', 'heb', N'יִדְּעֹנִי', '', N'from 3045;', 'wizard.', 'properly, a knowing one; specifically, a conjurer; (by impl) a ghost');
