INSERT INTO dbo.Strongs VALUES ('H3051', 'v', 'yaw-hab''', 'yâhab', 'h', 'heb', N'יָהַב', '', N'a primitive root;', 'ascribe, bring, come on, give, go, set, take.', 'to give (whether literal or figurative); generally, to put; imperatively (reflexive) come');
