INSERT INTO dbo.Strongs VALUES ('H3056', 'n-pr-m', 'yeh-dah''-ee', 'Yehday', 'h', 'x-pn', N'יֶהְדַי', '', N'perhaps from a form corresponding to 3061; Judaistic;', 'Jehdai.', 'Jehdai, an Israelite');
