INSERT INTO dbo.Strongs VALUES ('H3360', 'n-pr-m', 'yek-am''-awm', 'Yᵉqamʻâm', 'h', 'x-pn', N'יְקַמְעָם', '', N'from 6965 and 5971; (the) people will rise;', 'Jekameam. Compare 3079, 3361.', 'Jekamam, an Israelite');
INSERT INTO dbo.Strongs VALUES ('H3361', 'n-pr-loc', 'yok-meh-awm''', 'Yoqmᵉʻâm', 'h', 'x-pn', N'יׇקְמְעָם', '', N'from 6965 and 5971; (the) people will be raised;', 'Jokmeam. Compare 3360, 3362.', 'Jokmeam, a place in Palestine');
INSERT INTO dbo.Strongs VALUES ('H3362', 'n-pr-loc', 'yok-neh-awm''', 'Yoqnᵉʻâm', 'h', 'x-pn', N'יׇקְנְעָם', '', N'from 6969 and 5971; (the) people will be lamented;', 'Jokneam.', 'Jokneam, a place in Palestine');
INSERT INTO dbo.Strongs VALUES ('H3363', 'v', 'yaw-kah''', 'yâqaʻ', 'h', 'heb', N'יָקַע', '', N'a primitive root;', 'be alienated, depart, hang (up), be out of joint.', 'properly, to sever oneself, i.e. (by implication) to be dislocated; figuratively, to abandon; causatively, to impale (and thus allow to drop to pieces by rotting)');
INSERT INTO dbo.Strongs VALUES ('H3364', 'v', 'yaw-kats''', 'yâqats', 'h', 'heb', N'יָקַץ', '', N'a primitive root;', '(be) awake(-d).', 'to awake (intransitive)');
INSERT INTO dbo.Strongs VALUES ('H3365', 'v', 'yaw-kar''', 'yâqar', 'h', 'heb', N'יָקַר', '', N'a primitive root;', 'be (make) precious, be prized, be set by, withdraw.', 'properly, apparently, to be heavy, i.e. (figuratively) valuable; causatively, to make rare (figuratively, to inhibit)');
INSERT INTO dbo.Strongs VALUES ('H3366', 'n-m', 'yek-awr''', 'yᵉqâr', 'h', 'heb', N'יְקָר', '', N'from 3365;', 'honour, precious (things), price.', 'value, i.e. (concretely) wealth; abstractly, costliness, dignity');
INSERT INTO dbo.Strongs VALUES ('H3367', 'n-m', 'yek-awr''', 'yᵉqâr', 'h', 'arc', N'יְקָר', '', N'(Aramaic) corresponding to 3366', 'glory, honour.', '');
INSERT INTO dbo.Strongs VALUES ('H3368', 'a', 'yaw-kawr''', 'yâqâr', 'h', 'heb', N'יָקָר', '', N'from 3365;', 'brightness, clear, costly, excellent, fat, honourable women, precious, reputation.', 'valuable (objectively or subjectively)');
INSERT INTO dbo.Strongs VALUES ('H3369', 'v', 'yaw-koshe''', 'yâqôsh', 'h', 'heb', N'יָקֹשׁ', '', N'a primitive root;', 'fowler (lay a) snare.', 'to ensnare (literally or figuratively)');
INSERT INTO dbo.Strongs VALUES ('H3370', 'n-pr-m', 'yok-shawn''', 'Yoqshân', 'h', 'x-pn', N'יׇקְשָׁן', '', N'from 3369; insidious;', 'Jokshan.', 'Jokshan, an Arabian patriarch');
INSERT INTO dbo.Strongs VALUES ('H3371', 'n-pr-loc', 'yok-theh-ale''', 'Yoqthᵉʼêl', 'h', 'x-pn', N'יׇקְתְאֵל', '', N'probably from the same as 3348 and 410; veneration of God (compare 3354);', 'Joktheel.', 'Joktheel, the name of a place in Palestine, and of one in Idumaea');
INSERT INTO dbo.Strongs VALUES ('H3372', 'v', 'yaw-ray''', 'yârêʼ', 'h', 'heb', N'יָרֵא', '', N'a primitive root;', 'affright, be (make) afraid, dread(-ful), (put in) fear(-ful, -fully, -ing), (be had in) reverence(-end), × see, terrible (act, -ness, thing).', 'to fear; morally to revere; causatively to frighten');
INSERT INTO dbo.Strongs VALUES ('H3373', 'a', 'yaw-ray''', 'yârêʼ', 'h', 'heb', N'יָרֵא', '', N'from 3372;', 'afraid, fear (-ful).', 'fearing; morally, reverent');
INSERT INTO dbo.Strongs VALUES ('H3374', 'n-f', 'yir-aw''', 'yirʼâh', 'h', 'heb', N'יִרְאָה', '', N'feminine of 3373;', '× dreadful, × exceedingly, fear(-fulness).', 'fear (also used as infinitive); morally, reverence');
INSERT INTO dbo.Strongs VALUES ('H3375', 'n-pr-loc', 'yir-ohn''', 'Yirʼôwn', 'h', 'x-pn', N'יִרְאוֹן', 'xlit Yirôwn corrected to Yirʼôwn', N'from 3372; fearfulness;', 'Iron.', 'Jiron, a place in Palestine');
INSERT INTO dbo.Strongs VALUES ('H3376', 'n-pr-m', 'yir-ee-yaw''', 'Yirʼîyâyh', 'h', 'x-pn', N'יִרְאִיָּיה', '', N'from 3373 and 3050; fearful of Jah;', 'Irijah.', 'Jirijah, an Israelite');
