INSERT INTO dbo.Strongs VALUES ('H3378', 'n-pr-m', 'yer-oob-bah''-al', 'Yᵉrubbaʻal', 'h', 'x-pn', N'יְרֻבַּעַל', '', N'from 7378 and 1168; Baal will contend;', 'Jerubbaal.', 'Jerubbaal, a symbolic name of Gideon');
INSERT INTO dbo.Strongs VALUES ('H3379', 'n-pr-m', 'yaw-rob-awm''', 'Yârobʻâm', 'h', 'x-pn', N'יָרׇבְעָם', '', N'from 7378 and 5971; (the) people will contend;', 'Jeroboam.', 'Jarobam, the name of two Israelite kings');
INSERT INTO dbo.Strongs VALUES ('H3380', 'n-pr-m', 'yer-oob-beh''-sheth', 'Yᵉrubbesheth', 'h', 'x-pn', N'יְרֻבֶּשֶׁת', '', N'from 7378 and 1322; shame (i.e. the idol) will contend;', 'Jerubbesheth.', 'Jerubbesheth, a symbolic name for Gideon');
INSERT INTO dbo.Strongs VALUES ('H3381', 'v', 'yaw-rad''', 'yârad', 'h', 'heb', N'יָרַד', '', N'a primitive root;', '× abundantly, bring down, carry down, cast down, (cause to) come(-ing) down, fall (down), get down, go(-ing) down(-ward), hang down, × indeed, let down, light (down), put down (off), (cause to, let) run down, sink, subdue, take down.', 'to descend (literally, to go downwards; or conventionally to a lower region, as the shore, a boundary, the enemy, etc.; or figuratively, to fall); causatively, to bring down (in all the above applications)');
INSERT INTO dbo.Strongs VALUES ('H3382', 'n-pr-m', 'yeh''-red', 'Yered', 'h', 'x-pn', N'יֶרֶד', '', N'from 3381; a descent;', 'Jared.', 'Jered, the name of an antediluvian, and of an Israelite');
INSERT INTO dbo.Strongs VALUES ('H3383', 'n-pr', 'yar-dane''', 'Yardên', 'h', 'x-pn', N'יַרְדֵּן', '', N'from 3381; a descender;', 'Jordan.', 'Jarden, the principal river of Palestine');
INSERT INTO dbo.Strongs VALUES ('H3384', 'v', 'yaw-raw''', 'yârâh', 'h', 'heb', N'יָרָה', '', N'or (2 Chronicles 26:15) יָרָא; a primitive root;', '( ) archer, cast, direct, inform, instruct, lay, shew, shoot, teach(-er,-ing), through.', 'properly, to flow as water (i.e. to rain); transitively, to lay or throw (especially an arrow, i.e. to shoot); figuratively, to point out (as if by aiming the finger), to teach');
INSERT INTO dbo.Strongs VALUES ('H3385', 'n-pr-loc', 'yer-oo-ale''', 'Yᵉrûwʼêl', 'h', 'x-pn', N'יְרוּאֵל', '', N'from 3384 and 410; founded of God;', 'Jeruel.', 'Jeruel, a place in Palestine');
