INSERT INTO dbo.Strongs VALUES ('H3387', 'n-m', 'yaw-roke''', 'yârôwq', 'h', 'heb', N'יָרוֹק', '', N'from 3417;', 'green thing.', 'green, i.e. an herb');
INSERT INTO dbo.Strongs VALUES ('H3388', 'n-pr-f', 'yer-oo-shaw''', 'Yᵉrûwshâʼ', 'h', 'x-pn', N'יְרוּשָׁא', '', N'or יְרוּשָׁה feminine passive participle of 3423; possessed;', 'Jerusha, Jerushah.', 'Jerusha or Jerushah, as Israelitess');
INSERT INTO dbo.Strongs VALUES ('H3389', 'n-pr-loc', 'yer-oo-shaw-lah''-im', 'Yᵉrûwshâlaim', 'h', 'x-pn', N'יְרוּשָׁלִַ͏ם', '', N'rarely יְרוּשָׁלַיִם; a dual (in allusion to its two main hills (the true pointing, at least of the former reading, seems to be that of 3390)); probably from (the passive participle of) 3384 and 7999; founded peaceful;', 'Jerusalem.', 'Jerushalaim or Jerushalem, the capital city of Palestine');
INSERT INTO dbo.Strongs VALUES ('H3390', 'n-pr-loc', 'yer-oo-shaw-lame''', 'Yᵉrûwshâlêm', 'h', 'arc', N'יְרוּשָׁלֵם', '', N'(Aramaic) corresponding to 3389', '', '');
