INSERT INTO dbo.Strongs VALUES ('H3393', 'n-m', 'yeh-rakh''', 'yᵉrach', 'h', 'arc', N'יְרַח', '', N'(Aramaic) corresponding to 3391;', 'month.', 'a month');
