INSERT INTO dbo.Strongs VALUES ('H3399', 'v', 'yaw-rat''', 'yâraṭ', 'h', 'heb', N'יָרַט', '', N'a primitive root;', 'be perverse, turn over.', 'to precipitate or hurl (rush) headlong; (intransitively) to be rash');
INSERT INTO dbo.Strongs VALUES ('H3400', 'n-pr-m', 'yer-ee-ale''', 'Yᵉrîyʼêl', 'h', 'x-pn', N'יְרִיאֵל', '', N'from 3384 and 410; thrown of God;', 'Jeriel. Compare 3385.', 'Jeriel, an Israelite');
INSERT INTO dbo.Strongs VALUES ('H3401', 'n-m', 'yaw-rebe''', 'yârîyb', 'h', 'heb', N'יָרִיב', '', N'from 7378;', 'that content(-eth), that strive.', 'literally he will contend; properly, adjective contentious; used as noun, an adversary');
INSERT INTO dbo.Strongs VALUES ('H3402', 'n-pr-m', 'yaw-rebe''', 'Yârîyb', 'h', 'x-pn', N'יָרִיב', '', N'the same as 3401;', 'Jarib.', 'Jarib, the name of three Israelites');
INSERT INTO dbo.Strongs VALUES ('H3403', 'n-pr-m', 'yer-eeb-ah''ee', 'Yᵉrîybay', 'h', 'x-pn', N'יְרִיבַי', '', N'from 3401; contentious;', 'Jeribai.', 'Jeribai, an Israelite');
INSERT INTO dbo.Strongs VALUES ('H3404', 'n-pr-m', 'yer-ee-yaw''', 'Yᵉrîyâh', 'h', 'x-pn', N'יְרִיָּה', '', N'or יְרִיָּהוּ; from 3384 and 3050; Jah will throw;', 'Jeriah, Jerijah.', 'Jerijah, an Israelite');
INSERT INTO dbo.Strongs VALUES ('H3405', 'n-pr-loc', 'yer-ee-kho''', 'Yᵉrîychôw', 'h', 'x-pn', N'יְרִיחוֹ', '', N'or יְרֵחוֹ; or variation (1 Kings 16:34) יְרִיחֹה; perhaps from 3394; its month; or else from 7306; fragrant;', 'Jericho.', 'Jericho or Jerecho, a place in Palestine');
INSERT INTO dbo.Strongs VALUES ('H3406', 'n-pr-f', 'yer-ee-mohth''', 'Yᵉrîymôwth', 'h', 'x-pn', N'יְרִימוֹת', '', N'or יְרֵימוֹת; or יְרֵמוֹת; feminine plural from 7311; elevations;', 'Jermoth, Jerimoth, and Ramoth (from the margin).', 'Jerimoth or Jeremoth, the name of twelve Israelites');
INSERT INTO dbo.Strongs VALUES ('H3407', 'n-f', 'yer-ee-aw''', 'yᵉrîyʻâh', 'h', 'heb', N'יְרִיעָה', '', N'from 3415;', 'curtain.', 'a hanging (as tremulous)');
INSERT INTO dbo.Strongs VALUES ('H3408', 'n-pr-f', 'yer-ee-ohth''', 'Yᵉrîyʻôwth', 'h', 'x-pn', N'יְרִיעוֹת', '', N'plural of 3407; curtains;', 'Jerioth.', 'Jerioth, an Israelitess');
INSERT INTO dbo.Strongs VALUES ('H3409', 'n-f', 'yaw-rake''', 'yârêk', 'h', 'heb', N'יָרֵךְ', '', N'from an unused root meaning to be soft;', '× body, loins, shaft, side, thigh.', 'the thigh (from its fleshy softness); by euphemistically the generative parts; figuratively, a shank, flank, side');
INSERT INTO dbo.Strongs VALUES ('H3410', 'n-f', 'yar-kaw''', 'yarkâʼ', 'h', 'arc', N'יַרְכָא', '', N'(Aramaic) corresponding to 3411;', 'thigh.', 'a thigh');
INSERT INTO dbo.Strongs VALUES ('H3411', 'n-f', 'yer-ay-kaw''', 'yᵉrêkâh', 'h', 'heb', N'יְרֵכָה', '', N'feminine of 3409;', 'border, coast, part, quarter, side.', 'properly, the flank; but used only figuratively, the rear or recess');
INSERT INTO dbo.Strongs VALUES ('H3412', 'n-pr-loc', 'yar-mooth''', 'Yarmûwth', 'h', 'x-pn', N'יַרְמוּת', '', N'from 7311; elevation;', 'Jarmuth.', 'Jarmuth, the name of two places in Palestine');
INSERT INTO dbo.Strongs VALUES ('H3413', 'n-pr-m', 'yer-ay-mah''-ee', 'Yᵉrêmay', 'h', 'x-pn', N'יְרֵמַי', '', N'from 7311; elevated;', 'Jeremai.', 'Jeremai, an Israelite');
INSERT INTO dbo.Strongs VALUES ('H3414', 'n-pr-m', 'yir-meh-yaw''', 'Yirmᵉyâh', 'h', 'x-pn', N'יִרְמְיָה', '', N'or יִרְמְיָהוּ; from 7311 and 3050; Jah will rise;', 'Jeremiah.', 'Jirmejah, the name of eight or nine Israelites');
INSERT INTO dbo.Strongs VALUES ('H3415', 'v', 'yaw-rah''', 'yâraʻ', 'h', 'heb', N'יָרַע', '', N'a primitive root;', 'be grevious (only Isaiah 15:4; the rest belong to 7489).', 'properly, to be broken up (with any violent action) i.e. (figuratively) to fear');
INSERT INTO dbo.Strongs VALUES ('H3416', 'n-pr-loc', 'yir-peh-ale''', 'Yirpᵉʼêl', 'h', 'x-pn', N'יִרְפְּאֵל', '', N'from 7495 and 410; God will heal;', 'Irpeel.', 'Jirpeel, a place in Palestine');
INSERT INTO dbo.Strongs VALUES ('H3417', 'v', 'yaw-rak''', 'yârâq', 'h', 'heb', N'יָרָק', '', N'a primitive root;', '× but, spit.', 'to spit');
INSERT INTO dbo.Strongs VALUES ('H3418', 'n-m', 'yeh''-rek', 'yereq', 'h', 'heb', N'יֶרֶק', '', N'from 3417 (in the sense of vacuity of color);', 'grass, green (thing).', 'properly, pallor, i.e. hence, the yellowish green of young and sickly vegetation; concretely, verdure, i.e. grass or vegetation');
INSERT INTO dbo.Strongs VALUES ('H3419', 'n-m', 'yaw-rawk''', 'yârâq', 'h', 'heb', N'יָרָק', '', N'from the same as 3418;', 'green, herbs.', 'properly, green; concretely, a vegetable');
INSERT INTO dbo.Strongs VALUES ('H3420', 'n-m', 'yay-raw-kone''', 'yêrâqôwn', 'h', 'heb', N'יֵרָקוֹן', '', N'from 3418;', 'greenish, yellow.', 'paleness, whether of persons (from fright), or of plants (from drought)');
INSERT INTO dbo.Strongs VALUES ('H3421', 'n-pr-m', 'yor-keh-awm''', 'Yorqᵉʻâm', 'h', 'x-pn', N'יׇרְקְעָם', '', N'from 7324 and 5971; people will be poured forth;', 'Jorkeam.', 'Jorkeam, a place in Palestine');
INSERT INTO dbo.Strongs VALUES ('H3422', 'a', 'yer-ak-rak''', 'yᵉraqraq', 'h', 'heb', N'יְרַקְרַק', '', N'from the same as 3418;', 'greenish, yellow.', 'yellowishness');
INSERT INTO dbo.Strongs VALUES ('H3423', 'v', 'yaw-rash''', 'yârash', 'h', 'heb', N'יָרַשׁ', '', N'or יָרֵשׁ; a primitive root;', 'cast out, consume, destroy, disinherit, dispossess, drive(-ing) out, enjoy, expel, × without fail, (give to, leave for) inherit(-ance, -or)   magistrate, be (make) poor, come to poverty, (give to, make to) possess, get (have) in (take) possession, seize upon, succeed, × utterly.', 'to occupy (by driving out previous tenants, and possessing in their place); by implication, to seize, to rob, to inherit; also to expel, to impoverish, to ruin');
INSERT INTO dbo.Strongs VALUES ('H3424', 'n-f', 'yer-ay-shaw''', 'yᵉrêshâh', 'h', 'heb', N'יְרֵשָׁה', '', N'from 3423;', 'possession.', 'occupancy');
INSERT INTO dbo.Strongs VALUES ('H3425', 'n-f', 'yer-oosh-shaw''', 'yᵉrushshâh', 'h', 'heb', N'יְרֻשָּׁה', '', N'from 3423;', 'heritage, inheritance, possession.', 'something occupied; a conquest; also a patrimony');
INSERT INTO dbo.Strongs VALUES ('H3426', 'prt', 'yaysh', 'yêsh', 'h', 'heb', N'יֵשׁ', '', N'perhaps from an unused root meaning to stand out, or exist; entity; used adverbially or as a copula for the substantive verb (1961);', '(there) are, (he, it, shall, there, there may, there shall, there should) be, thou do, had, hast, (which) hath, (I, shalt, that) have, (he, it, there) is, substance, it (there) was, (there) were, ye will, thou wilt, wouldest.', 'there is or are (or any other form of the verb to be, as may suit the connection)');
INSERT INTO dbo.Strongs VALUES ('H3427', 'v', 'yaw-shab''', 'yâshab', 'h', 'heb', N'יָשַׁב', '', N'a primitive root;', '(make to) abide(-ing), continue, (cause to, make to) dwell(-ing), ease self, endure, establish, × fail, habitation, haunt, (make to) inhabit(-ant), make to keep (house), lurking, × marry(-ing), (bring again to) place, remain, return, seat, set(-tle), (down-) sit(-down, still, -ting down, -ting (place) -uate), take, tarry.', 'properly, to sit down (specifically as judge. in ambush, in quiet); by implication, to dwell, to remain; causatively, to settle, to marry');
INSERT INTO dbo.Strongs VALUES ('H3428', 'n-pr-m', 'yeh-sheb-awb''', 'Yeshebʼâb', 'h', 'x-pn', N'יֶשֶׁבְאָב', '', N'from 3427 and 1; seat of (his) father;', 'Jeshebeab.', 'Jeshebab, an Israelite');
INSERT INTO dbo.Strongs VALUES ('H3429', 'n-pr-m', 'yo-shabe'' bash-sheh''-beth', 'Yôshêb bash-Shebeth', 'h', 'x-pn', N'יֹשֵׁב בַּשֶּׁבֶת', '', N'from the active participle of 3427 and 7674, with a preposition and the article interposed; sitting in the seat;', 'that sat in the seat.', 'Joshebbash-Shebeth, an Israelite');
