INSERT INTO dbo.Strongs VALUES ('H3511', 'n-m', 'keh-abe''', 'kᵉʼêb', 'h', 'heb', N'כְּאֵב', '', N'from 3510;', 'grief, pain, sorrow.', 'suffering (physical or mental), adversity');
INSERT INTO dbo.Strongs VALUES ('H3512', 'v a', 'kaw-aw''', 'kâʼâh', 'h', 'heb', N'כָּאָה', '', N'a primitive root;', 'broken, be grieved, make sad.', 'to despond; causatively, to deject');
INSERT INTO dbo.Strongs VALUES ('H3513', 'v', 'kaw-bad''', 'kâbad', 'h', 'heb', N'כָּבַד', '', N'or כָּבֵד; a primitive root;', 'abounding with, more grievously afflict, boast, be chargeable, × be dim, glorify, be (make) glorious (things), glory, (very) great, be grievous, harden, be (make) heavy, be heavier, lay heavily, (bring to, come to, do, get, be had in) honour (self), (be) honourable (man), lade, × more be laid, make self many, nobles, prevail, promote (to honour), be rich, be (go) sore, stop.', 'to be heavy, i.e. in a bad sense (burdensome, severe, dull) or in a good sense (numerous, rich, honorable); causatively, to make weighty (in the same two senses)');
INSERT INTO dbo.Strongs VALUES ('H3514', 'n-m', 'ko''-bed', 'kôbed', 'h', 'heb', N'כֹּבֶד', '', N'from 3513;', 'grievousness, heavy, great number.', 'weight, multitude, vehemence');
INSERT INTO dbo.Strongs VALUES ('H3515', 'a', 'kaw-bade''', 'kâbêd', 'h', 'heb', N'כָּבֵד', '', N'from 3513;', '(so) great, grievous, hard(-ened), (too) heavy(-ier), laden, much, slow, sore, thick.', 'heavy; figuratively in a good sense (numerous) or in a bad sense (severe, difficult, stupid)');
INSERT INTO dbo.Strongs VALUES ('H3516', 'n-f', 'kaw-bade''', 'kâbêd', 'h', 'heb', N'כָּבֵד', '', N'the same as 3515;', 'liver.', 'the liver (as the heaviest of the viscera)');
INSERT INTO dbo.Strongs VALUES ('H3517', 'n-f', 'keb-ay-dooth''', 'kᵉbêduth', 'h', 'heb', N'כְּבֵדֻת', '', N'feminine of 3515;', '× heavily.', 'difficulty');
INSERT INTO dbo.Strongs VALUES ('H3518', 'v', 'kaw-baw''', 'kâbâh', 'h', 'heb', N'כָּבָה', '', N'a primitive root;', 'go (put) out, quench.', 'to expire or (causatively) to extinguish (fire, light, anger)');
INSERT INTO dbo.Strongs VALUES ('H3519', 'n-m', 'kaw-bode''', 'kâbôwd', 'h', 'heb', N'כָּבוֹד', '', N'rarely כָּבֹד; from 3513;', 'glorious(-ly), glory, honour(-able).', 'properly, weight, but only figuratively in a good sense, splendor or copiousness');
INSERT INTO dbo.Strongs VALUES ('H3520', 'n-f', 'keb-ood-daw''', 'kᵉbûwddâh', 'h', 'heb', N'כְּבוּדָּה', '', N'irregular feminine passive participle of 3513;', 'carriage, all glorious, stately.', 'weightiness, i.e. magnificence, wealth');
INSERT INTO dbo.Strongs VALUES ('H3521', 'n-pr-loc', 'kaw-bool''', 'Kâbûwl', 'h', 'x-pn', N'כָּבוּל', '', N'from the same as 3525 in the sense of limitation; sterile;', 'Cabul.', 'Cabul, the name of two places in Palestine');
INSERT INTO dbo.Strongs VALUES ('H3522', 'n-pr-loc', 'kab-bone''', 'Kabbôwn', 'h', 'x-pn', N'כַּבּוֹן', '', N'from an unused root meaning to heap up; hilly;', 'Cabbon.', 'Cabon, a place in Palestine');
INSERT INTO dbo.Strongs VALUES ('H3523', 'n-m', 'keb-eer', 'kᵉbîyr', 'h', 'heb', N'כְּבִיר', '', N'from 3527 in the original sense of plaiting;', 'pillow.', 'a matrass (of intertwined materials)');
INSERT INTO dbo.Strongs VALUES ('H3524', 'a', 'kab-beer''', 'kabbîyr', 'h', 'heb', N'כַּבִּיר', '', N'from 3527;', '  feeble, mighty, most, much, strong, valiant.', 'vast, whether in extent (figuratively, of power, mighty; of time, aged), or in number, many');
INSERT INTO dbo.Strongs VALUES ('H3525', 'n-m', 'keh''-bel', 'kebel', 'h', 'heb', N'כֶּבֶל', '', N'from an unused root meaning to twine or braid together;', 'fetter.', 'a fetter');
INSERT INTO dbo.Strongs VALUES ('H3526', 'v', 'kaw-bas''', 'kâbaç', 'h', 'heb', N'כָּבַס', '', N'a primitive root;', 'fuller, wash(-ing).', 'to trample; hence, to wash (properly, by stamping with the feet), whether literal (including the fulling process) or figurative');
INSERT INTO dbo.Strongs VALUES ('H3527', 'v', 'kaw-bar''', 'kâbar', 'h', 'heb', N'כָּבַר', '', N'a primitive root;', 'in abundance, multiply.', 'properly, to plait together, i.e. (figuratively) to augment (especially in number or quantity, to accumulate)');
INSERT INTO dbo.Strongs VALUES ('H3528', 'adv', 'keb-awr''', 'kᵉbâr', 'h', 'heb', N'כְּבָר', '', N'from 3527;', 'already, (seeing that which), now.', 'properly, extent of time, i.e. a great while; hence, long ago, formerly, hitherto');
INSERT INTO dbo.Strongs VALUES ('H3529', 'n', 'keb-awr''', 'Kᵉbâr', 'h', 'x-pn', N'כְּבָר', '', N'the same as 3528; length;', 'Chebar. Compare 2249.', 'Kebar, a river of Mesopotamia');
INSERT INTO dbo.Strongs VALUES ('H3530', 'n-f', 'kib-raw''', 'kibrâh', 'h', 'heb', N'כִּבְרָה', '', N'feminine of 3528;', '× little.', 'properly, length, i.e. a measure (of uncertain dimension)');
INSERT INTO dbo.Strongs VALUES ('H3531', 'n-f', 'keb-aw-raw''', 'kᵉbârâh', 'h', 'heb', N'כְּבָרָה', '', N'from 3527 in its original sense;', 'sieve.', 'a sieve (as netted)');
INSERT INTO dbo.Strongs VALUES ('H3532', 'n-m', 'keh-bes''', 'kebes', 'h', 'heb', N'כֶּבֶשׂ', '', N'from an unused root meaning to dominate;', 'lamb, sheep.', 'a ram (just old enough to butt)');
INSERT INTO dbo.Strongs VALUES ('H3533', 'v', 'kaw-bash''', 'kâbash', 'h', 'heb', N'כָּבַשׁ', '', N'a primitive root;', 'bring into bondage, force, keep under, subdue, bring into subjection.', 'to tread down; hence, negatively, to disregard; positively, to conquer, subjugate, violate');
INSERT INTO dbo.Strongs VALUES ('H3534', 'n-m', 'keh''-besh', 'kebesh', 'h', 'heb', N'כֶּבֶשׁ', '', N'from 3533;', 'footstool.', 'a footstool (as trodden upon)');
INSERT INTO dbo.Strongs VALUES ('H3535', 'n-f', 'kib-saw''', 'kibsâh', 'h', 'heb', N'כִּבְשָׂה', '', N'or כַּבְשָׂה; feminine of 3532;', '(ewe) lamb.', 'a ewe');
INSERT INTO dbo.Strongs VALUES ('H3536', 'n-m', 'kib-shawn''', 'kibshân', 'h', 'heb', N'כִּבְשָׁן', '', N'from 3533;', 'furnace.', 'a smelting furnace (as reducing metals)');
INSERT INTO dbo.Strongs VALUES ('H3537', 'n-f', 'kad', 'kad', 'h', 'heb', N'כַּד', '', N'from an unused root meaning to deepen;', 'barrel, pitcher.', 'properly, a pail; but generally of earthenware; a jar for domestic purposes');
INSERT INTO dbo.Strongs VALUES ('H3538', 'a', 'ked-ab''', 'kᵉdab', 'h', 'arc', N'כְּדַב', '', N'(Aramaic) from a root corresponding to 3576;', 'lying.', 'false');
INSERT INTO dbo.Strongs VALUES ('H3539', 'n-m', 'kad-kode''', 'kadkôd', 'h', 'heb', N'כַּדְכֹּד', '', N'from the same as 3537 in the sense of striking fire from a metal forged;', 'agate.', 'a sparkling gem, probably the ruby');
INSERT INTO dbo.Strongs VALUES ('H3540', 'n-pr-m', 'ked-or-law-o''-mer', 'Kᵉdorlâʻômer', 'h', 'x-pn', N'כְּדׇרְלָעֹמֶר', '', N'of foreign origin;', 'Chedorlaomer.', 'Kedorlaomer, an early Persian king');
INSERT INTO dbo.Strongs VALUES ('H3541', 'prt', 'ko', 'kôh', 'h', 'heb', N'כֹּה', '', N'from the prefix k and 1931;', 'also, here,   hitherto, like, on the other side, so (and much), such, on that manner, (on) this (manner, side, way, way and that way),   mean while, yonder.', 'properly, like this, i.e. by implication, (of manner) thus (or so); also (of place) here (or hither); or (of time) now');
INSERT INTO dbo.Strongs VALUES ('H3542', 'adv', 'kaw', 'kâh', 'h', 'arc', N'כָּה', '', N'(Aramaic) corresponding to 3541', 'hitherto.', '');
INSERT INTO dbo.Strongs VALUES ('H3543', 'v', 'kaw-haw''', 'kâhâh', 'h', 'heb', N'כָּהָה', '', N'a primitive root;', 'darken, be dim, fail, faint, restrain, × utterly.', 'to be weak, i.e. (figuratively) to despond (causatively, rebuke), or (of light, the eye) to grow dull');
INSERT INTO dbo.Strongs VALUES ('H3544', 'a', 'kay-heh''', 'kêheh', 'h', 'heb', N'כֵּהֶה', '', N'from 3543;', 'somewhat dark, darkish, wax dim, heaviness, smoking.', 'feeble, obscure');
INSERT INTO dbo.Strongs VALUES ('H3545', 'n-f', 'kay-haw''', 'kêhâh', 'h', 'heb', N'כֵּהָה', '', N'feminine of 3544;', 'healing.', 'properly, a weakening; figuratively, alleviation, i.e. cure');
INSERT INTO dbo.Strongs VALUES ('H3546', 'v', 'keh-hal''', 'kᵉhal', 'h', 'arc', N'כְּהַל', '', N'(Aramaic) a root corresponding to and 3557;', 'be able, could.', 'to be able');
INSERT INTO dbo.Strongs VALUES ('H3547', 'v', 'kaw-han''', 'kâhan', 'h', 'heb', N'כָּהַן', '', N'a primitive root, apparently meaning to mediate in religious services; but used only as denominative from 3548;', 'deck, be (do the office of a, execute the, minister in the) priest(''s office).', 'to officiate as a priest; figuratively, to put on regalia');
INSERT INTO dbo.Strongs VALUES ('H3548', 'n-m', 'ko-hane''', 'kôhên', 'h', 'heb', N'כֹּהֵן', '', N'active participle of 3547;', 'chief ruler, × own, priest, prince, principal officer.', 'literally one officiating, a priest; also (by courtesy) an acting priest (although a layman)');
INSERT INTO dbo.Strongs VALUES ('H3549', 'n-m', 'kaw-hane''', 'kâhên', 'h', 'arc', N'כָּהֵן', '', N'(Aramaic) corresponding to 3548', 'priest.', '');
INSERT INTO dbo.Strongs VALUES ('H3550', 'n-f', 'keh-hoon-naw''', 'kᵉhunnâh', 'h', 'heb', N'כְּהֻנָּה', '', N'from 3547;', 'priesthood, priest''s office.', 'priesthood');
INSERT INTO dbo.Strongs VALUES ('H3551', 'n-f', 'kav', 'kav', 'h', 'arc', N'כַּו', '', N'(Aramaic) from a root corresponding to 3854 in the sense of piercing;', 'window.', 'a window (as a perforation)');
INSERT INTO dbo.Strongs VALUES ('H3552', 'n-pr-loc', 'koob', 'Kûwb', 'h', 'x-pn', N'כּוּב', '', N'of foreign derivation;', 'Chub.', 'Kub, a country near Egypt');
INSERT INTO dbo.Strongs VALUES ('H3553', 'n-m', 'ko''-bah', 'kôwbaʻ', 'h', 'heb', N'כּוֹבַע', '', N'from an unused root meaning to be high or rounded;', 'helmet. Compare 6959.', 'a helmet (as arched)');
INSERT INTO dbo.Strongs VALUES ('H3554', 'v', 'kaw-vaw''', 'kâvâh', 'h', 'heb', N'כָּוָה', '', N'a primitive root;', 'burn.', 'properly, to prick or penetrate; hence, to blister (as smarting or eating into)');
INSERT INTO dbo.Strongs VALUES ('H3555', 'n-f', 'kev-ee-yaw''', 'kᵉvîyâh', 'h', 'heb', N'כְּוִיָּה', '', N'from 3554;', 'burning.', 'a branding');
INSERT INTO dbo.Strongs VALUES ('H3556', 'n-m', 'ko-kawb''', 'kôwkâb', 'h', 'heb', N'כּוֹכָב', '', N'probably from the same as 3522 (in the sense of rolling) or 3554 (in the sense of blazing);', 'star(-gazer).', 'a star (as round or as shining); figuratively, a prince');
INSERT INTO dbo.Strongs VALUES ('H3557', 'v', 'kool', 'kûwl', 'h', 'heb', N'כּוּל', '', N'a primitive root;', '(be able to, can) abide, bear, comprehend, contain, feed, forbearing, guide, hold(-ing in), nourish(-er), be present, make provision, receive, sustain, provide sustenance (victuals).', 'properly, to keep in; hence, to measure; figuratively, to maintain (in various senses)');
INSERT INTO dbo.Strongs VALUES ('H3558', 'n-m', 'koo-mawz''', 'kûwmâz', 'h', 'heb', N'כּוּמָז', '', N'from an unused root meaning to store away;', 'tablet.', 'a jewel (probably gold beads)');
INSERT INTO dbo.Strongs VALUES ('H3559', 'v n-m', 'koon', 'kûwn', 'h', 'heb', N'כּוּן', '', N'a primitive root;', 'certain(-ty), confirm, direct, faithfulness, fashion, fasten, firm, be fitted, be fixed, frame, be meet, ordain, order, perfect, (make) preparation, prepare (self), provide, make provision, (be, make) ready, right, set (aright, fast, forth), be stable, (e-) stablish, stand, tarry, × very deed.', 'properly, to be erect (i.e. stand perpendicular); hence (causatively) to set up, in a great variety of applications, whether literal (establish, fix, prepare, apply), or figurative (appoint, render sure, proper or prosperous)');
INSERT INTO dbo.Strongs VALUES ('H3560', 'n-pr-loc', 'koon', 'Kûwn', 'h', 'x-pn', N'כּוּן', '', N'probably from 3559; established;', 'Chun.', 'Kun, a place in Syria');
INSERT INTO dbo.Strongs VALUES ('H3561', 'n-m', 'kav-vawn''', 'kavvân', 'h', 'heb', N'כַּוָּן', '', N'from 3559;', 'cake.', 'something prepared, i.e. a sacrificial wafer');
INSERT INTO dbo.Strongs VALUES ('H3562', 'n-pr-m', 'ko-nan-yaw''-hoo', 'Kôwnanyâhûw', 'h', 'x-pn', N'כּוֹנַנְיָהוּ', '', N'from 3559 and 3050; Jah has sustained;', 'Conaniah, Cononiah. Compare 3663.', 'Conanjah, the name of two Israelites');
INSERT INTO dbo.Strongs VALUES ('H3563', 'n-f', 'koce', 'kôwç', 'h', 'heb', N'כּוֹס', '', N'from an unused root meaning to hold together;', 'cup, (small) owl. Compare 3599.', 'a cup (as a container), often figuratively, a lot (as if a potion); also some unclean bird, probably an owl (perhaps from the cup-like cavity of its eye)');
INSERT INTO dbo.Strongs VALUES ('H3564', 'n-m', 'koor', 'kûwr', 'h', 'heb', N'כּוּר', '', N'from an unused root meaning properly, to dig through;', 'furnace. Compare 3600.', 'a pot or furnace (as if excavated)');
INSERT INTO dbo.Strongs VALUES ('H3565', 'n-pr-loc', 'kore aw-shawn''', 'Kôwr ʻÂshân', 'h', 'x-pn', N'כּוֹר עָשָׁן', '', N'from 3564 and 6227; furnace of smoke;', 'Chorashan.', 'Cor-Ashan, a place in Palestine');
INSERT INTO dbo.Strongs VALUES ('H3566', 'n-pr-m', 'ko''-resh', 'Kôwresh', 'h', 'x-pn', N'כּוֹרֶשׁ', '', N'or (Ezra 1:1 (last time),2) כֹּרֶשׁ; from the Persian;', 'Cyrus.', 'Koresh (or Cyrus), the Persian king');
INSERT INTO dbo.Strongs VALUES ('H3567', 'n-pr-m', 'ko''-resh', 'Kôwresh', 'h', 'x-pn', N'כּוֹרֶשׁ', '', N'(Aramaic) corresponding to 3566', 'Cyrus.', '');
INSERT INTO dbo.Strongs VALUES ('H3568', 'n-pr-m n-pr-loc', 'koosh', 'Kûwsh', 'h', 'x-pn', N'כּוּשׁ', '', N'probably of foreign origin;', 'Chush, Cush, Ethiopia.', 'Cush (or Ethiopia), the name of a son of Ham, and of his territory; also of an Israelite');
INSERT INTO dbo.Strongs VALUES ('H3569', 'a', 'koo-shee''', 'Kûwshîy', 'h', 'x-pn', N'כּוּשִׁי', '', N'patronymically from 3568;', 'Cushi, Cushite, Ethiopian(-s).', 'a Cushite, or descendant of Cush');
INSERT INTO dbo.Strongs VALUES ('H3570', 'n-pr-m', 'koo-shee''', 'Kûwshîy', 'h', 'x-pn', N'כּוּשִׁי', '', N'the same as 3569;', 'Cushi.', 'Cushi, the name of two Israelites');
INSERT INTO dbo.Strongs VALUES ('H3571', 'a-f', 'koo-sheeth''', 'Kûwshîyth', 'h', 'x-pn', N'כּוּשִׁית', '', N'feminine of 3569;', 'Ethiopian.', 'a Cushite woman');
INSERT INTO dbo.Strongs VALUES ('H3572', 'n-pr-loc', 'koo-shawn''', 'Kûwshân', 'h', 'x-pn', N'כּוּשָׁן', '', N'perhaps from 3568;', 'Cushan.', 'Cushan, a region of Arabia');
INSERT INTO dbo.Strongs VALUES ('H3573', 'n-pr-m', 'koo-shan'' rish-awthah''-yim', 'Kûwshan Rishʻâthayim', 'h', 'x-pn', N'כּוּשַׁן רִשְׁעָתַיִם', '', N'apparently from 3572 and the dual of 7564; Cushan of double wickedness;', 'Chushan-rishathayim.', 'Cushan-Rishathajim, a Mesopotamian king');
INSERT INTO dbo.Strongs VALUES ('H3574', 'n-f', 'ko-shaw-raw''', 'kôwshârâh', 'h', 'heb', N'כּוֹשָׁרָה', '', N'from 3787;', '× chain.', 'prosperity; in plural freedom');
INSERT INTO dbo.Strongs VALUES ('H3575', 'n-pr-loc', 'kooth', 'Kûwth', 'h', 'x-pn', N'כּוּת', '', N'or (feminine) כּוּתָה; of foreign origin;', 'Cuth.', 'Cuth or Cuthah, a province of Assyria');
INSERT INTO dbo.Strongs VALUES ('H3576', 'v', 'kaw-zab''', 'kâzab', 'h', 'heb', N'כָּזַב', '', N'a primitive root;', 'fail, (be found a, make a) liar, lie, lying, be in vain.', 'to lie (i.e. deceive), literally or figuratively');
INSERT INTO dbo.Strongs VALUES ('H3577', 'n-m', 'kaw-zawb''', 'kâzâb', 'h', 'heb', N'כָּזָב', '', N'from 3576;', 'deceitful, false, leasing,   liar, lie, lying.', 'falsehood; literally (untruth) or figuratively (idol)');
INSERT INTO dbo.Strongs VALUES ('H3578', 'n-pr-loc', 'ko-zeb-aw''', 'Kôzᵉbâʼ', 'h', 'x-pn', N'כֹּזְבָא', '', N'from 3576; fallacious;', 'Choseba.', 'Cozeba, a place in Palestine');
INSERT INTO dbo.Strongs VALUES ('H3579', 'n-pr-f', 'koz-bee''', 'Kôzᵉbîy', 'h', 'x-pn', N'כֹּזְבִי', '', N'from 3576; false;', 'Cozbi.', 'Cozbi, a Midianitess');
INSERT INTO dbo.Strongs VALUES ('H3580', 'n-pr-loc', 'kez-eeb''', 'Kᵉzîyb', 'h', 'x-pn', N'כְּזִיב', '', N'from 3576; falsified;', 'Chezib.', 'Kezib, a place in Palestine');
INSERT INTO dbo.Strongs VALUES ('H3581', 'n-m', 'ko''-akh', 'kôach', 'h', 'heb', N'כֹּחַ', '', N'or (Daniel 11:6) כּוֹחַ; from an unused root meaning to be firm;', 'ability, able, chameleon, force, fruits, might, power(-ful), strength, substance, wealth.', 'vigor, literally (force, in a good or a bad sense) or figuratively (capacity, means, produce); also (from its hardiness) a large lizard');
INSERT INTO dbo.Strongs VALUES ('H3582', 'v', 'kaw-khad''', 'kâchad', 'h', 'heb', N'כָּחַד', '', N'a primitive root;', 'conceal, cut down (off), desolate, hide.', 'to secrete, by act or word; hence (intensively) to destroy');
INSERT INTO dbo.Strongs VALUES ('H3583', 'v', 'kaw-khal''', 'kâchal', 'h', 'heb', N'כָּחַל', '', N'a primitive root;', 'paint.', 'to paint (with stibium)');
INSERT INTO dbo.Strongs VALUES ('H3584', 'v', 'kaw-khash''', 'kâchash', 'h', 'heb', N'כָּחַשׁ', '', N'a primitive root;', 'deceive, deny, dissemble, fail, deal falsely, be found liars, (be-) lie, lying, submit selves.', 'to be untrue, in word (to lie, feign, disown) or deed (to disappoint, fail, cringe)');
INSERT INTO dbo.Strongs VALUES ('H3585', 'n-m', 'kakh''-ash', 'kachash', 'h', 'heb', N'כַּחַשׁ', '', N'from 3584;', 'leanness, lies, lying.', 'literally a failure of flesh, i.e. emaciation; figuratively, hypocrisy');
INSERT INTO dbo.Strongs VALUES ('H3586', 'a', 'kekh-awsh''', 'kechâsh', 'h', 'heb', N'כֶּחָשׁ', '', N'from 3584;', 'lying.', 'faithless');
INSERT INTO dbo.Strongs VALUES ('H3587', 'n-m', 'kee', 'kîy', 'h', 'heb', N'כִּי', '', N'from 3554;', 'burning.', 'a brand or scar');
INSERT INTO dbo.Strongs VALUES ('H3588', 'conj', 'kee', 'kîy', 'h', 'heb', N'כִּי', '', N'a primitive particle (the full form of the prepositional prefix) indicating causal relations of all kinds, antecedent or consequent;', 'and,   (forasmuch, inasmuch, where-) as, assured(-ly),   but, certainly, doubtless,   else, even,   except, for, how, (because, in, so, than) that,   nevertheless, now, rightly, seeing, since, surely, then, therefore,   (al-) though,   till, truly,   until, when, whether, while, whom, yea, yet.', '(by implication) very widely used as a relative conjunction or adverb (as below); often largely modified by other particles annexed');
INSERT INTO dbo.Strongs VALUES ('H3589', 'n-m', 'keed', 'kîyd', 'h', 'heb', N'כִּיד', '', N'from a primitive root meaning to strike;', 'destruction.', 'a crushing; figuratively, calamity');
INSERT INTO dbo.Strongs VALUES ('H3590', 'n-m', 'kee-dode''', 'kîydôwd', 'h', 'heb', N'כִידוֹד', '', N'from the same as 3589 (compare 3539);', 'spark.', 'properly, something struck off, i.e. a spark (as struck)');
INSERT INTO dbo.Strongs VALUES ('H3591', 'n-m', 'kee-dohn''', 'kîydôwn', 'h', 'heb', N'כִּידוֹן', '', N'from the same as 3589; (perhaps smaller than 2595)', 'lance, shield, spear, target.', 'properly, something to strike with, i.e. a dart');
INSERT INTO dbo.Strongs VALUES ('H3592', 'n-pr', 'kee-dohn''', 'Kîydôwn', 'h', 'x-pn', N'כִּידוֹן', '', N'the same as 3591;', 'Chidon.', 'Kidon, a place in Palestine');
INSERT INTO dbo.Strongs VALUES ('H3593', 'n-m', 'kee-dore''', 'kîydôwr', 'h', 'heb', N'כִּידוֹר', '', N'of uncertain derivation;', 'battle.', 'perhaps tumult');
INSERT INTO dbo.Strongs VALUES ('H3594', 'n-pr', 'kee-yoon''', 'Kîyûwn', 'h', 'heb', N'כִּיּוּן', '', N'from 3559;', 'Chiun.', 'properly, a statue, i.e. idol; but used (by euphemism) for some heathen deity (perhaps corresponding to Priapus or Baal-peor)');
INSERT INTO dbo.Strongs VALUES ('H3595', 'n-m', 'kee-yore''', 'kîyôwr', 'h', 'heb', N'כִּיּוֹר', '', N'or כִּיֹּר; from the same as 3564;', 'hearth, laver, pan, scaffold.', 'properly, something round (as excavated or bored), i.e. a chafing-dish for coals or a caldron for cooking; hence (from similarity of form) a washbowl; also (for the same reason) a pulpit or platform');
INSERT INTO dbo.Strongs VALUES ('H3596', 'n-m', 'kee-lah''-ee', 'kîylay', 'h', 'heb', N'כִּילַי', '', N'or כֵּלַי; from 3557 in the sense of withholding;', 'churl.', 'niggardly');
INSERT INTO dbo.Strongs VALUES ('H3597', 'n-f', 'kay-laf''', 'kêylaph', 'h', 'heb', N'כֵּילַף', '', N'from an unused root meaning to clap or strike with noise;', 'hammer.', 'a club or sledge-hammer');
INSERT INTO dbo.Strongs VALUES ('H3598', 'n-f', 'kee-maw''', 'Kîymâh', 'h', 'heb', N'כִּימָה', '', N'from the same as 3558;', 'Pleiades, seven stars.', 'a cluster of stars, i.e. the Pleiades');
INSERT INTO dbo.Strongs VALUES ('H3599', 'n-m', 'keece', 'kîyç', 'h', 'heb', N'כִּיס', '', N'a form for 3563;', 'bag, cup, purse.', 'a cup; also a bag for money or weights');
INSERT INTO dbo.Strongs VALUES ('H3600', 'n-m', 'keer', 'kîyr', 'h', 'heb', N'כִּיר', '', N'a form for 3564 (only in the dual);', 'ranges for pots.', 'a cooking range (consisting of two parallel stones, across which the boiler is set)');
INSERT INTO dbo.Strongs VALUES ('H3601', 'n-m', 'kee-shore''', 'kîyshôwr', 'h', 'heb', N'כִּישׁוֹר', '', N'from 3787; compare 6418', 'spindle.', 'literally a director, i.e. the spindle or shank of a distaff, by which it is twirled');
INSERT INTO dbo.Strongs VALUES ('H3602', 'adv', 'kaw''-kaw', 'kâkâh', 'h', 'heb', N'כָּכָה', '', N'from 3541;', 'after that (this) manner, this matter, (even) so, in such a case, thus.', 'just so, referring to the previous or following context');
INSERT INTO dbo.Strongs VALUES ('H3603', 'n-f', 'kik-kawr''', 'kikkâr', 'h', 'heb', N'כִּכָּר', '', N'from 3769;', 'loaf, morsel, piece, plain, talent.', 'a circle, i.e. (by implication) a circumjacent tract or region, especially the Ghor or valley of the Jordan; also a (round) loaf; also a talent (or large [round] coin)');
INSERT INTO dbo.Strongs VALUES ('H3604', 'n-f', 'kik-kare''', 'kikkêr', 'h', 'arc', N'כִּכֵּר', '', N'(Aramaic) corresponding to 3603;', 'talent.', 'a talent');
INSERT INTO dbo.Strongs VALUES ('H3605', 'n-m', 'kole', 'kôl', 'h', 'heb', N'כֹּל', '', N'or (Jeremiah 33:8) כּוֹל; from 3634;', '(in) all (manner, (ye)), altogether, any (manner), enough, every (one, place, thing), howsoever, as many as, (no-) thing, ought, whatsoever, (the) whole, whoso(-ever).', 'properly, the whole; hence, all, any or every (in the singular only, but often in a plural sense)');
INSERT INTO dbo.Strongs VALUES ('H3606', 'n-m', 'kole', 'kôl', 'h', 'arc', N'כֹּל', '', N'(Aramaic) corresponding to 3605', 'all, any,   (forasmuch) as,   be-(for this) cause, every,   no (manner, -ne),   there (where) -fore,   though, what (where, who) -soever, (the) whole.', '');
INSERT INTO dbo.Strongs VALUES ('H3607', 'v', 'kaw-law''', 'kâlâʼ', 'h', 'heb', N'כָּלָא', '', N'a primitive root;', 'finish, forbid, keep (back), refrain, restrain, retain, shut up, be stayed, withhold.', 'to restrict, by act (hold back or in) or word (prohibit)');
INSERT INTO dbo.Strongs VALUES ('H3608', 'n-m', 'keh''-leh', 'keleʼ', 'h', 'heb', N'כֶּלֶא', '', N'from 3607;', 'prison. Compare 3610, 3628.', 'a prison');
INSERT INTO dbo.Strongs VALUES ('H3609', 'n-pr-m', 'kil-awb''', 'Kilʼâb', 'h', 'x-pn', N'כִּלְאָב', '', N'apparently from 3607 and 1; restraint of (his) father;', 'Chileab.', 'Kilab, an Israelite');
INSERT INTO dbo.Strongs VALUES ('H3610', 'n-m', 'kil-ah''-yim', 'kilʼayim', 'h', 'heb', N'כִּלְאַיִם', '', N'dual of 3608 in the original sense of separation;', 'divers seeds (-e kinds), mingled (seed).', 'two heterogeneities');
INSERT INTO dbo.Strongs VALUES ('H3611', 'n-m', 'keh''-leb', 'keleb', 'h', 'heb', N'כֶּלֶב', '', N'from an unused root means. to yelp, or else to attack;', 'dog.', 'a dog; hence (by euphemism) a male prostitute');
INSERT INTO dbo.Strongs VALUES ('H3612', 'n-pr-m', 'kaw-labe''', 'Kâlêb', 'h', 'x-pn', N'כָּלֵב', '', N'perhaps a form of 3611, or else from the same root in the sense of forcible;', 'Caleb.', 'Caleb, the name of three Israelites');
INSERT INTO dbo.Strongs VALUES ('H3613', 'n-pr-loc', 'kaw-labe'' ef-raw''-thaw', 'Kâlêb ʼEphrâthâh', 'h', 'x-pn', N'כָּלֵב אֶפְרָתָה', '', N'from 3612 and 672;', 'Caleb-ephrathah.', 'Caleb-Ephrathah, a place in Egypt (if the text is correct)');
INSERT INTO dbo.Strongs VALUES ('H3614', 'a', 'kaw-lib-bo''', 'Kâlibbôw', 'h', 'x-pn', N'כָּלִבּוֹ', '', N'probably by erroneous transcription for כָּלֵבִי; patronymically from 3612;', 'of the house of Caleb.', 'a Calebite or descendant of Caleb');
INSERT INTO dbo.Strongs VALUES ('H3615', 'v', 'kaw-law''', 'kâlâh', 'h', 'heb', N'כָּלָה', '', N'a primitive root;', 'accomplish, cease, consume (away), determine, destroy (utterly), be (when... were) done, (be an) end (of), expire, (cause to) fail, faint, finish, fulfil, × fully, × have, leave (off), long, bring to pass, wholly reap, make clean riddance, spend, quite take away, waste.', 'to end, whether intransitive (to cease, be finished, perish) or transitive (to complete, prepare, consume)');
INSERT INTO dbo.Strongs VALUES ('H3616', 'a', 'kaw-leh''', 'kâleh', 'h', 'heb', N'כָּלֶה', '', N'from 3615;', 'fail.', 'pining');
INSERT INTO dbo.Strongs VALUES ('H3617', 'n-f', 'kaw-law''', 'kâlâh', 'h', 'heb', N'כָּלָה', '', N'from 3615;', 'altogether, (be, utterly) consume(-d), consummation(-ption), was determined, (full, utter) end, riddance.', 'a completion; adverb, completely; also destruction');
INSERT INTO dbo.Strongs VALUES ('H3618', 'n-f', 'kal-law''', 'kallâh', 'h', 'heb', N'כַּלָּה', 'lemma כַּלָה missing dagesh, corrected to כַּלָּה', N'from 3634;', 'bride, daughter-in-law, spouse.', 'a bride (as if perfect); hence, a son''s wife');
INSERT INTO dbo.Strongs VALUES ('H3619', 'n-m', 'kel-oob''', 'kᵉlûwb', 'h', 'heb', N'כְּלוּב', 'xlit kᵉlûb corrected to kᵉlûwb', N'from the same as 3611;', 'basket, cage.', 'a bird-trap (as furnished with a clap-stick or treadle to spring it); hence, a basket (as resembling a wicker cage)');
INSERT INTO dbo.Strongs VALUES ('H3620', 'n-pr-m', 'kel-oob''', 'Kᵉlûwb', 'h', 'x-pn', N'כְּלוּב', '', N'the same as 3619;', 'Chelub.', 'Kelub, the name of two Israelites');
INSERT INTO dbo.Strongs VALUES ('H3621', 'n-pr-m', 'kel-oo-bay''-ee', 'Kᵉlûwbay', 'h', 'x-pn', N'כְּלוּבַי', '', N'a form of 3612;', 'Chelubai.', 'Kelubai, an Israelite');
INSERT INTO dbo.Strongs VALUES ('H3622', 'n-pr-m', 'kel-oo-hah''-ee', 'Kᵉlûwhay', 'h', 'x-pn', N'כְּלוּהַי', '', N'from 3615; completed;', 'Chelluh.', 'Keluhai, an Israelite');
INSERT INTO dbo.Strongs VALUES ('H3623', 'n-f', 'kel-oo-law''', 'kᵉlûwlâh', 'h', 'heb', N'כְּלוּלָה', '', N'denominative passive participle from 3618;', 'espousal.', 'bridehood (only in the plural)');
INSERT INTO dbo.Strongs VALUES ('H3624', 'n-m', 'keh''-lakh', 'kelach', 'h', 'heb', N'כֶּלַח', '', N'from an unused root meaning to be complete;', 'full (old) age.', 'maturity');
INSERT INTO dbo.Strongs VALUES ('H3625', 'n-pr-loc', 'keh''-lakh', 'Kelach', 'h', 'x-pn', N'כֶּלַח', '', N'the same as 3624;', 'Calah.', 'Kelach, a place in Assyria');
INSERT INTO dbo.Strongs VALUES ('H3626', 'n-pr-m', 'kol-kho-zeh''', 'Kol-Chôzeh', 'h', 'x-pn', N'כׇּל־חֹזֶה', '', N'from 3605 and 2374; every seer;', 'Col-hozeh.', 'Col-Chozeh, an Israelite');
INSERT INTO dbo.Strongs VALUES ('H3627', 'n-m', 'kel-ee''', 'kᵉlîy', 'h', 'heb', N'כְּלִי', '', N'from 3615;', 'armour(-bearer), artillery, bag, carriage,   furnish, furniture, instrument, jewel, that is made of, × one from another, that which pertaineth, pot,   psaltery, sack, stuff, thing, tool, vessel, ware, weapon,   whatsoever.', 'something prepared, i.e. any apparatus (as an implement, utensil, dress, vessel or weapon)');
INSERT INTO dbo.Strongs VALUES ('H3628', 'n-m', 'kel-ee''', 'kᵉlîyʼ', 'h', 'heb', N'כְּלִיא', '', N'or כְּלוּא; from 3627 (compare 3608);', 'prison.', 'a prison');
INSERT INTO dbo.Strongs VALUES ('H3629', 'n-f', 'kil-yaw''', 'kilyâh', 'h', 'heb', N'כִּלְיָה', '', N'feminine of 3627 (only in the plural);', 'kidneys, reins.', 'a kidney (as an essential organ); figuratively, the mind (as the interior self)');
INSERT INTO dbo.Strongs VALUES ('H3630', 'n-pr-m', 'kil-yone''', 'Kilyôwn', 'h', 'x-pn', N'כִּלְיוֹן', '', N'a form of 3631;', 'Chilion.', 'Kiljon, an Israelite');
INSERT INTO dbo.Strongs VALUES ('H3631', 'n-m', 'kil-law-yone''', 'killâyôwn', 'h', 'heb', N'כִּלָּיוֹן', '', N'from 3615;', 'consumption, failing.', 'pining, destruction');
INSERT INTO dbo.Strongs VALUES ('H3632', 'a', 'kaw-leel''', 'kâlîyl', 'h', 'heb', N'כָּלִיל', '', N'from 3634;', 'all, every whit, flame, perfect(-ion), utterly, whole burnt offering (sacrifice), wholly.', 'complete; as noun, the whole (specifically, a sacrifice entirely consumed); as adverb, fully');
INSERT INTO dbo.Strongs VALUES ('H3633', 'n-pr-m', 'kal-kole''', 'Kalkôl', 'h', 'x-pn', N'כַּלְכֹּל', '', N'from 3557; sustenance;', 'Calcol, Chalcol.', 'Calcol, an Israelite');
INSERT INTO dbo.Strongs VALUES ('H3634', 'v', 'kaw-lal''', 'kâlal', 'h', 'heb', N'כָּלַל', '', N'a primitive root;', '(make) perfect.', 'to complete');
INSERT INTO dbo.Strongs VALUES ('H3635', 'v', 'kel-al''', 'kᵉlal', 'h', 'arc', N'כְּלַל', '', N'(Aramaic) corresponding to 3634;', 'finish, make (set) up.', 'to complete');
INSERT INTO dbo.Strongs VALUES ('H3636', 'n-pr-m', 'kel-awl''', 'Kᵉlâl', 'h', 'x-pn', N'כְּלָל', '', N'from 3634; complete;', 'Chelal.', 'Kelal, an Israelite');
INSERT INTO dbo.Strongs VALUES ('H3637', 'v', 'kaw-lawm''', 'kâlam', 'h', 'heb', N'כָּלַם', '', N'a primitive root;', 'be (make) ashamed, blush, be confounded, be put to confusion, hurt, reproach, (do, put to) shame.', 'properly, to wound; but only figuratively, to taunt or insult');
INSERT INTO dbo.Strongs VALUES ('H3638', 'n-pr-loc', 'kil-mawd''', 'Kilmâd', 'h', 'x-pn', N'כִּלְמָד', '', N'of foreign derivation;', 'Chilmad.', 'Kilmad, a place apparently in the Assyrian empire');
INSERT INTO dbo.Strongs VALUES ('H3639', 'n-f', 'kel-im-maw''', 'kᵉlimmâh', 'h', 'heb', N'כְּלִמָּה', '', N'from 3637;', 'confusion, dishonour, reproach, shame.', 'disgrace');
INSERT INTO dbo.Strongs VALUES ('H3640', 'n-f', 'kel-im-mooth''', 'kᵉlimmûwth', 'h', 'heb', N'כְּלִמּוּת', '', N'from 3639;', 'shame.', 'disgrace');
INSERT INTO dbo.Strongs VALUES ('H3641', 'n-pr-loc', 'kal-neh''', 'Kalneh', 'h', 'x-pn', N'כַּלְנֶה', '', N'or כַּלְנֵה; also כַּלְנוֹ; of foreign derivation;', 'Calneh, Calno. Compare 3656.', 'Calneh or Calno, a place in the Assyrian empire');
INSERT INTO dbo.Strongs VALUES ('H3642', 'v', 'kaw-mah', 'kâmahh', 'h', 'heb', N'כָּמַהּ', '', N'a primitive root;', 'long.', 'to pine after');
INSERT INTO dbo.Strongs VALUES ('H3643', 'n-pr-m n-pr-loc', 'kim-hawm''', 'Kimhâm', 'h', 'x-pn', N'כִּמְהָם', '', N'from 3642; pining;', 'Chimham.', 'Kimham, an Israelite');
INSERT INTO dbo.Strongs VALUES ('H3644', 'prt', 'kem-o''', 'kᵉmôw', 'h', 'heb', N'כְּמוֹ', '', N'or כָּמוֹ; a form of the prefix k, but used separately [compare 3651];', 'according to, (such) as (it were, well as), in comparison of, like (as, to, unto), thus, when, worth.', 'as, thus, so');
INSERT INTO dbo.Strongs VALUES ('H3645', 'n-pr', 'kem-oshe''', 'Kᵉmôwsh', 'h', 'x-pn', N'כְּמוֹשׁ', '', N'or (Jeremiah 48:7) כְּמִישׁ; from an unused root meaning to subdue; the powerful;', 'Chemosh.', 'Kemosh, the god of the Moabites');
INSERT INTO dbo.Strongs VALUES ('H3646', 'n-m', 'kam-mone''', 'kammôn', 'h', 'heb', N'כַּמֹּן', '', N'from an unused root meaning to store up or preserve;', 'cummin.', '''cummin'' (from its use as a condiment)');
INSERT INTO dbo.Strongs VALUES ('H3647', 'v', 'kaw-mas''', 'kâmaç', 'h', 'heb', N'כָּמַס', '', N'a primitive root;', 'lay up in store.', 'to store away, i.e. (figuratively) in the memory');
INSERT INTO dbo.Strongs VALUES ('H3648', 'v', 'kaw-mar''', 'kâmar', 'h', 'heb', N'כָּמַר', '', N'a primitive root;', 'be black, be kindled, yearn.', 'properly, to intertwine or contract, i.e. (by implication) to shrivel (as with heat); figuratively, to be deeply affected with passion (love or pity)');
INSERT INTO dbo.Strongs VALUES ('H3649', 'n-m', 'kaw-mawr''', 'kâmâr', 'h', 'heb', N'כָּמָר', '', N'from 3648;', 'Chemarims (idolatrous) priests.', 'properly, an ascetic (as if shrunk with self-maceration), i.e. an idolatrous priest (only in plural)');
INSERT INTO dbo.Strongs VALUES ('H3650', 'n-m', 'kim-reer''', 'kimrîyr', 'h', 'heb', N'כִּמְרִיר', '', N'redupl. from 3648;', 'blackness.', 'obscuration (as if from shrinkage of light), i.e. an eclipse (only in plural)');
INSERT INTO dbo.Strongs VALUES ('H3651', 'adv', 'kane', 'kên', 'h', 'heb', N'כֵּן', '', N'from 3559;', '  after that (this, -ward, -wards), as... as,   (for-) asmuch as yet,   be (for which) cause,   following, howbeit, in (the) like (manner, -wise), × the more, right, (even) so, state, straightway, such (thing), surely,   there (where) -fore, this, thus, true, well, × you.', 'properly, set upright; hence (figuratively as adjective) just; but usually (as adverb or conjunction) rightly or so (in various applications to manner, time and relation; often with other particles)');
INSERT INTO dbo.Strongs VALUES ('H3652', 'adv', 'kane', 'kên', 'h', 'arc', N'כֵּן', '', N'(Aramaic) corresponding to 3651;', 'thus.', 'so');
INSERT INTO dbo.Strongs VALUES ('H3653', 'n-m', 'kane', 'kên', 'h', 'heb', N'כֵּן', '', N'the same as 3651, used as a noun;', 'base, estate, foot, office, place, well.', 'a stand, i.e. pedestal or station');
INSERT INTO dbo.Strongs VALUES ('H3654', 'n-m', 'kane', 'kên', 'h', 'heb', N'כֵּן', '', N'from 3661 in the sense of fastening; (from infixing its sting; used only in plural (and irregular in Exodus 8:17,18; Hebrews 13:14))', 'lice, × manner.', 'a gnat');
INSERT INTO dbo.Strongs VALUES ('H3655', 'v', 'kaw-naw''', 'kânâh', 'h', 'heb', N'כָּנָה', '', N'a primitive root;', 'give flattering titles, surname (himself).', 'to address by an additional name; hence, to eulogize');
INSERT INTO dbo.Strongs VALUES ('H3656', 'n-pr-loc', 'kan-neh''', 'Kanneh', 'h', 'x-pn', N'כַּנֶּה', '', N'for 3641;', 'Canneh.', 'Canneh, a place in Assyria');
INSERT INTO dbo.Strongs VALUES ('H3657', 'n-f', 'kaw-naw''', 'kannâh', 'h', 'heb', N'כַּנָּה', '', N'from 3661;', '× vineyard.', 'a plant (as set)');
INSERT INTO dbo.Strongs VALUES ('H3658', 'n-m', 'kin-nore''', 'kinnôwr', 'h', 'heb', N'כִּנּוֹר', '', N'from a unused root meaning to twang;', 'harp.', 'a harp');
INSERT INTO dbo.Strongs VALUES ('H3659', 'n-pr-m', 'kon-yaw''-hoo', 'Konyâhûw', 'h', 'x-pn', N'כׇּנְיָהוּ', '', N'for 3204;', 'Coniah.', 'Conjah, an Israelite king');
INSERT INTO dbo.Strongs VALUES ('H3660', 'adv', 'ken-ay-maw''', 'kᵉnêmâʼ', 'h', 'arc', N'כְּנֵמָא', '', N'(Aramaic) corresponding to 3644;', 'so, (in) this manner (sort), thus.', 'so or thus');
INSERT INTO dbo.Strongs VALUES ('H3661', 'n-f', 'kaw-nan''', 'kânan', 'h', 'heb', N'כָּנַן', '', N'a primitive root;', '× vineyard.', 'to set out, i.e. plant');
INSERT INTO dbo.Strongs VALUES ('H3662', 'n-pr-m', 'ken-aw-nee''', 'Kᵉnânîy', 'h', 'x-pn', N'כְּנָנִי', '', N'from 3661; planted;', 'Chenani.', 'Kenani, an Israelite');
INSERT INTO dbo.Strongs VALUES ('H3663', 'n-pr-m', 'ken-an-yaw''', 'Kᵉnanyâh', 'h', 'x-pn', N'כְּנַנְיָה', '', N'or כְּנַנְיָהוּ; from 3661 and 3050; Jah has planted;', 'Chenaniah.', 'Kenanjah, an Israelite');
INSERT INTO dbo.Strongs VALUES ('H3664', 'v', 'kaw-nas''', 'kânaç', 'h', 'heb', N'כָּנַס', '', N'a primitive root;', 'gather (together), heap up, wrap self.', 'to collect; hence, to enfold');
INSERT INTO dbo.Strongs VALUES ('H3665', 'v', 'kaw-nah''', 'kânaʻ', 'h', 'heb', N'כָּנַע', '', N'a primitive root;', 'bring down (low), into subjection, under, humble (self), subdue.', 'properly, to bend the knee; hence, to humiliate, vanquish');
INSERT INTO dbo.Strongs VALUES ('H3666', 'n-f', 'kin-aw''', 'kinʻâh', 'h', 'heb', N'כִּנְעָה', '', N'from 3665 in the sense of folding (compare 3664);', 'wares.', 'a package');
INSERT INTO dbo.Strongs VALUES ('H3667', 'n-pr-m n-pr-loc n-m', 'ken-ah''-an', 'Kᵉnaʻan', 'h', 'x-pn', N'כְּנַעַן', '', N'from 3665; humiliated;', 'Canaan, merchant, traffick.', 'Kenaan, a son a Ham; also the country inhabited by him');
INSERT INTO dbo.Strongs VALUES ('H3668', 'n-pr-f', 'ken-ah-an-aw''', 'Kᵉnaʻănâh', 'h', 'x-pn', N'כְּנַעֲנָה', '', N'feminine of 3667;', 'Chenaanah.', 'Kenaanah, the name of two Israelites');
INSERT INTO dbo.Strongs VALUES ('H3669', 'n-m', 'ken-ah-an-ee''', 'Kᵉnaʻanîy', 'h', 'x-pn', N'כְּנַעַנִי', '', N'patrial from 3667;', 'Canaanite, merchant, trafficker.', 'a Kenaanite or inhabitant of Kenaan; by implication, a pedlar (the Canaanites standing for their neighbors the Ishmaelites, who conducted mercantile caravans)');
INSERT INTO dbo.Strongs VALUES ('H3670', 'v', 'kaw-naf''', 'kânaph', 'h', 'heb', N'כָּנַף', '', N'a primitive root;', 'be removed.', 'properly, to project laterally, i.e. probably (reflexive) to withdraw');
INSERT INTO dbo.Strongs VALUES ('H3671', 'n-f', 'kaw-nawf''', 'kânâph', 'h', 'heb', N'כָּנָף', '', N'from 3670;', '  bird, border, corner, end, feather(-ed), × flying,   (one an-) other, overspreading, × quarters, skirt, × sort, uttermost part, wing(-ed).', 'an edge or extremity; specifically (of a bird or army) a wing, (of a garment or bedclothing) a flap, (of the earth) a quarter, (of a building) a pinnacle');
INSERT INTO dbo.Strongs VALUES ('H3672', 'n-pr-loc', 'kin-ner-oth''', 'Kinnᵉrôwth', 'h', 'x-pn', N'כִּנְּרוֹת', '', N'or כִּנֶּרֶתlemma כִּנֶרֶת missing dagesh, corrected to כִּנֶּרֶת; respectively plural and singular feminine from the same as 3658; perhaps harp-shaped;', 'Chinnereth, Chinneroth, Cinneroth.', 'Kinneroth or Kinnereth, a place in Palestine');
INSERT INTO dbo.Strongs VALUES ('H3673', 'v', 'kaw-nash''', 'kânash', 'h', 'arc', N'כָּנַשׁ', '', N'(Aramaic) corresponding to 3664;', 'gather together.', 'to assemble');
INSERT INTO dbo.Strongs VALUES ('H3674', 'n-m', 'ken-awth''', 'kᵉnâth', 'h', 'heb', N'כְּנָת', '', N'from 3655;', 'companion.', 'a colleague (as having the same title)');
INSERT INTO dbo.Strongs VALUES ('H3675', 'n-m', 'ken-awth''', 'kᵉnâth', 'h', 'arc', N'כְּנָת', '', N'(Aramaic) corresponding to 3674', 'companion.', '');
