INSERT INTO dbo.Strongs VALUES ('H3762', 'a', 'kar-mel-eeth''', 'Karmᵉlîyth', 'h', 'x-pn', N'כַּרְמְלִית', '', N'feminine of 3761;', 'Carmelitess.', 'a Karmelitess or female inhabitant of Karmel');
INSERT INTO dbo.Strongs VALUES ('H3763', 'n-pr-m', 'ker-awn''', 'Kᵉrân', 'h', 'x-pn', N'כְּרָן', '', N'of uncertain derivation;', 'Cheran.', 'Keran, an aboriginal Idumaean');
INSERT INTO dbo.Strongs VALUES ('H3764', 'n-m', 'kor-say''', 'korçêʼ', 'h', 'arc', N'כׇּרְסֵא', '', N'(Aramaic) corresponding to 3678;', 'throne.', 'a throne');
INSERT INTO dbo.Strongs VALUES ('H3765', 'v', 'kir-same''', 'kirçêm', 'h', 'heb', N'כִּרְסֵם', '', N'from 3697;', 'waste.', 'to lay waste');
INSERT INTO dbo.Strongs VALUES ('H3766', 'v', 'kaw-rah''', 'kâraʻ', 'h', 'heb', N'כָּרַע', '', N'a primitive root;', 'bow (down, self), bring down (low), cast down, couch, fall, feeble, kneeling, sink, smite (stoop) down, subdue, × very.', 'to bend the knee; by implication, to sink, to prostrate');
INSERT INTO dbo.Strongs VALUES ('H3767', 'n-f', 'kaw-raw''', 'kârâʻ', 'h', 'heb', N'כָּרָע', '', N'from 3766;', 'leg.', 'the leg (from the knee to the ankle) of men or locusts (only in the dual)');
INSERT INTO dbo.Strongs VALUES ('H3768', 'n-m', 'kar-pas''', 'karpaç', 'h', 'heb', N'כַּרְפַּס', '', N'of foreign origin;', 'green.', 'byssus or fine vegetable wool');
INSERT INTO dbo.Strongs VALUES ('H3769', 'v', 'kaw-rar''', 'kârar', 'h', 'heb', N'כָּרַר', '', N'a primitive root;', 'dance(-ing).', 'to dance (i.e. whirl)');
INSERT INTO dbo.Strongs VALUES ('H3770', 'n-m', 'ker-ace''', 'kᵉrês', 'h', 'heb', N'כְּרֵשׂ', '', N'by variation from 7164;', 'belly.', 'the paunch or belly (as swelling out)');
INSERT INTO dbo.Strongs VALUES ('H3771', 'n-pr-m', 'kar-shen-aw''', 'Karshᵉnâʼ', 'h', 'x-pn', N'כַּרְשְׁנָא', '', N'of foreign origin;', 'Carshena.', 'Karshena, a courtier of Xerxes');
INSERT INTO dbo.Strongs VALUES ('H3772', 'v', 'kaw-rath''', 'kârath', 'h', 'heb', N'כָּרַת', '', N'a primitive root;', 'be chewed, be con-(feder-) ate, covenant, cut (down, off), destroy, fail, feller, be freed, hew (down), make a league (covenant), × lose, perish, × utterly, × want.', 'to cut (off, down or asunder); by implication, to destroy or consume; specifically, to covenant (i.e. make an alliance or bargain, originally by cutting flesh and passing between the pieces)');
INSERT INTO dbo.Strongs VALUES ('H3773', 'n-f', 'kaw-rooth-aw''', 'kâruthâh', 'h', 'heb', N'כָּרֻתָה', '', N'passive participle feminine of 3772;', 'beam.', 'something cut, i.e. a hewn timber');
INSERT INTO dbo.Strongs VALUES ('H3774', 'a', 'ker-ay-thee''', 'Kᵉrêthîy', 'h', 'x-pn', N'כְּרֵתִי', '', N'probably from 3772 in the sense of executioner; (compare 2876) (only collectively in the singular as plural)', 'Cherethims, Cherethites.', 'a Kerethite or life-guardsman');
INSERT INTO dbo.Strongs VALUES ('H3775', 'n-m', 'keh''-seb', 'keseb', 'h', 'heb', N'כֶּשֶׂב', '', N'apparently by transposition for 3532;', 'lamb.', 'a young sheep');
INSERT INTO dbo.Strongs VALUES ('H3776', 'n-f', 'kis-baw''', 'kisbâh', 'h', 'heb', N'כִּשְׂבָּה', '', N'feminine of 3775;', 'lamb.', 'a young ewe');
INSERT INTO dbo.Strongs VALUES ('H3777', 'n-pr-m', 'keh''-sed', 'Kesed', 'h', 'x-pn', N'כֶּשֶׂד', '', N'from an unused root of uncertain meaning;', 'Chesed.', 'Kesed, a relative of Abraham');
INSERT INTO dbo.Strongs VALUES ('H3778', 'n-pr-loc n-pr-m', 'kas-dee''', 'Kasdîy', 'h', 'x-pn', N'כַּשְׂדִּי', '', N'(occasionally with enclitic) כַּשְׂדִּימָה; towards the Kasdites into Chaldea), patronymically from 3777 (only in the plural);', 'Chaldeans, Chaldees, inhabitants of Chaldea.', 'a Kasdite, or descendant of Kesed; by implication, a Chaldaean (as if so descended); also an astrologer (as if proverbial of that people');
INSERT INTO dbo.Strongs VALUES ('H3779', 'n-m', 'kas-dah''-ee', 'Kasday', 'h', 'x-pn', N'כַּשְׂדַּי', '', N'(Aramaic) corresponding to 3778;', 'Chaldean.', 'a Chaldaean or inhabitant of Chaldaea; by implication, a Magian or professional astrologer');
INSERT INTO dbo.Strongs VALUES ('H3780', 'v', 'kaw-saw''', 'kâsâh', 'h', 'heb', N'כָּשָׂה', '', N'a primitive root;', 'be covered. Compare 3680.', 'to grow fat (i.e. be covered with flesh)');
INSERT INTO dbo.Strongs VALUES ('H3781', 'n-m', 'kash-sheel''', 'kashshîyl', 'h', 'heb', N'כַּשִּׁיל', '', N'from 3782;', 'ax.', 'properly, a feller, i.e. an axe');
INSERT INTO dbo.Strongs VALUES ('H3782', 'v', 'kaw-shal''', 'kâshal', 'h', 'heb', N'כָּשַׁל', '', N'a primitive root;', 'bereave (from the margin), cast down, be decayed, (cause to) fail, (cause, make to) fall (down, -ing), feeble, be (the) ruin(-ed, of), (be) overthrown, (cause to) stumble, × utterly, be weak.', 'to totter or waver (through weakness of the legs, especially the ankle); by implication, to falter, stumble, faint or fall');
INSERT INTO dbo.Strongs VALUES ('H3783', 'n-m', 'kish-shaw-lone''', 'kishshâlôwn', 'h', 'heb', N'כִּשָּׁלוֹן', '', N'from 3782;', 'fall.', 'properly, a tottering, i.e. ruin');
INSERT INTO dbo.Strongs VALUES ('H3784', 'v', 'kaw-shaf''', 'kâshaph', 'h', 'heb', N'כָּשַׁף', '', N'a primitive root;', 'sorcerer, (use) witch(-craft).', 'properly, to whisper a spell, i.e. to inchant or practise magic');
INSERT INTO dbo.Strongs VALUES ('H3785', 'n-m', 'keh''-shef', 'kesheph', 'h', 'heb', N'כֶּשֶׁף', '', N'from 3784;', 'sorcery, witchcraft.', 'magic');
INSERT INTO dbo.Strongs VALUES ('H3786', 'n-m', 'kash-shawf''', 'kashshâph', 'h', 'heb', N'כַּשָּׁף', '', N'from 3784;', 'sorcerer.', 'a magician');
INSERT INTO dbo.Strongs VALUES ('H3787', 'v', 'kaw-share''', 'kâshêr', 'h', 'heb', N'כָּשֵׁר', '', N'a primitive root properly, to be straight or right;', 'direct, be right, prosper.', 'by implication, to be acceptable; also to succeed or prosper');
INSERT INTO dbo.Strongs VALUES ('H3788', 'n-m', 'kish-rone''', 'kishrôwn', 'h', 'heb', N'כִּשְׁרוֹן', '', N'from 3787;', 'equity, good, right.', 'success, advantage');
INSERT INTO dbo.Strongs VALUES ('H3789', 'v', 'kaw-thab''', 'kâthab', 'h', 'heb', N'כָּתַב', '', N'a primitive root;', 'describe, record, prescribe, subscribe, write(-ing, -ten).', 'to grave, by implication, to write (describe, inscribe, prescribe, subscribe)');
INSERT INTO dbo.Strongs VALUES ('H3790', 'v', 'keth-ab''', 'kᵉthab', 'h', 'arc', N'כְּתַב', '', N'(Aramaic) corresponding to 3789', 'write(-ten).', '');
INSERT INTO dbo.Strongs VALUES ('H3791', 'n-m', 'kaw-thawb''', 'kâthâb', 'h', 'heb', N'כָּתָב', '', N'from 3789;', 'register, scripture, writing.', 'something written, i.e. a writing, record or book');
INSERT INTO dbo.Strongs VALUES ('H3792', 'n-m', 'keth-awb''', 'kᵉthâb', 'h', 'arc', N'כְּתָב', '', N'(Aramaic) corresponding to 3791', 'prescribing, writing(-ten).', '');
INSERT INTO dbo.Strongs VALUES ('H3793', 'n-f', 'keth-o''-beth', 'kᵉthôbeth', 'h', 'heb', N'כְּתֹבֶת', '', N'from 3789;', '× any (mark).', 'a letter or other mark branded on the skin');
INSERT INTO dbo.Strongs VALUES ('H3794', 'a', 'kit-tee''', 'Kittîy', 'h', 'x-pn', N'כִּתִּי', '', N'or כִּתִּיִּי; patrial from an unused name denoting Cyprus (only in the plural);', 'Chittim, Kittim.', 'a Kittite or Cypriote; hence, an islander in general, i.e. the Greeks or Romans on the shores opposite Palestine');
INSERT INTO dbo.Strongs VALUES ('H3795', 'a', 'kaw-theeth''', 'kâthîyth', 'h', 'heb', N'כָּתִית', '', N'from 3807;', 'beaten.', 'beaten, i.e. pure (oil)');
INSERT INTO dbo.Strongs VALUES ('H3796', 'n-m', 'ko''-thel', 'kôthel', 'h', 'heb', N'כֹּתֶל', '', N'from an unused root meaning to compact;', 'wall.', 'a wall (as gathering inmates)');
INSERT INTO dbo.Strongs VALUES ('H3797', 'n-m', 'keth-al''', 'kᵉthal', 'h', 'arc', N'כְּתַל', '', N'(Aramaic) corresponding to 3796', 'wall.', '');
INSERT INTO dbo.Strongs VALUES ('H3798', 'n-pr-loc', 'kith-leesh''', 'Kithlîysh', 'h', 'x-pn', N'כִּתְלִישׁ', 'lemma כְּתִלִישׁ first two vowels, corrected to כִּתְלִישׁ', N'from 3796 and 376; wall of a man;', 'Kithlish.', 'Kithlish, a place in Palestine');
INSERT INTO dbo.Strongs VALUES ('H3799', 'v', 'kaw-tham''', 'kâtham', 'h', 'heb', N'כָּתַם', '', N'a primitive root;', 'mark.', 'properly, to carve or engrave, i.e. (by implication) to inscribe indelibly');
INSERT INTO dbo.Strongs VALUES ('H3800', 'n-m', 'keh''-them', 'kethem', 'h', 'heb', N'כֶּתֶם', '', N'from 3799;', '((most) fine, pure) gold(-en wedge).', 'properly, something carved out, i.e. ore; hence, gold (pure as originally mined)');
INSERT INTO dbo.Strongs VALUES ('H3801', 'n-f', 'keth-o''-neth', 'kᵉthôneth', 'h', 'heb', N'כְּתֹנֶת', '', N'or כֻּתֹּנֶת; from an unused root meaning to cover (compare 3802);', 'coat, garment, robe.', 'a shirt');
INSERT INTO dbo.Strongs VALUES ('H3802', 'n-f', 'kaw-thafe''', 'kâthêph', 'h', 'heb', N'כָּתֵף', '', N'from an unused root meaning to clothe;', 'arm, corner, shoulder(-piece), side, undersetter.', 'the shoulder (proper, i.e. upper end of the arm; as being the spot where the garments hang); figuratively, side-piece or lateral projection of anything');
INSERT INTO dbo.Strongs VALUES ('H3803', 'v', 'kaw-thar''', 'kâthar', 'h', 'heb', N'כָּתַר', '', N'a primitive root;', 'beset round, compass about, be crowned, inclose round, suffer.', 'to enclose; hence (in a friendly sense) to crown, (in a hostile one) to besiege; also to wait (as restraining oneself)');
INSERT INTO dbo.Strongs VALUES ('H3804', 'n-m', 'keh''-ther', 'kether', 'h', 'heb', N'כֶּתֶר', '', N'from 3803;', 'crown.', 'properly, a circlet, i.e. a diadem');
INSERT INTO dbo.Strongs VALUES ('H3805', 'n-f', 'ko-theh''-reth', 'kôthereth', 'h', 'heb', N'כֹתֶרֶת', '', N'feminine active participle of 3803;', 'chapiter.', 'the capital of a column');
INSERT INTO dbo.Strongs VALUES ('H3806', 'v', 'kaw-thash''', 'kâthash', 'h', 'heb', N'כָּתַשׁ', '', N'a primitive root;', 'bray.', 'to butt or pound');
INSERT INTO dbo.Strongs VALUES ('H3807', 'v', 'kaw-thath''', 'kâthath', 'h', 'heb', N'כָּתַת', '', N'a primitive root;', 'beat (down, to pieces), break in pieces, crushed, destroy, discomfit, smite, stamp. l', 'to bruise or violently strike');
INSERT INTO dbo.Strongs VALUES ('H3808', 'adv', 'lo', 'lôʼ', 'h', 'heb', N'לֹא', '', N'or לוֹא; or לֹה; (Deuteronomy 3:11), a primitive particle;', '× before,   or else, ere,   except, ig(-norant), much, less, nay, neither, never, no((-ne), -r, (-thing)), (× as though...,(can-), for) not (out of), of nought, otherwise, out of,   surely,   as truly as,   of a truth,   verily, for want,   whether, without.', 'not (the simple or abs. negation); by implication, no; often used with other particles');
INSERT INTO dbo.Strongs VALUES ('H3809', 'adv', 'law', 'lâʼ', 'h', 'arc', N'לָא', '', N'(Aramaic) or לָה; (Aramaic) (Daniel 4:32), corresponding to 3808', 'or even, neither, no(-ne, -r), (can-) not, as nothing, without.', '');
INSERT INTO dbo.Strongs VALUES ('H3810', 'n-pr-loc', 'lo deb-ar''', 'Lôʼ Dᵉbar', 'h', 'x-pn', N'לֹא דְבַר', '', N'or לוֹ דבַר; (Samuel 9:4,5), or לִדְבִר; (Joshua 13:26), (probably rather לֹדְבַר ); from 3808 and 1699; pastureless;', 'Debir, Lodebar.', 'Lo-Debar, a place in Palestine');
INSERT INTO dbo.Strongs VALUES ('H3811', 'v', 'law-aw''', 'lâʼâh', 'h', 'heb', N'לָאָה', '', N'a primitive root;', 'faint, grieve, lothe, (be, make) weary (selves).', 'to tire; (figuratively) to be (or make) disgusted');
INSERT INTO dbo.Strongs VALUES ('H3812', 'n-pr-f', 'lay-aw''', 'Lêʼâh', 'h', 'x-pn', N'לֵאָה', '', N'from 3811; weary;', 'Leah.', 'Leah, a wife of Jacob');
INSERT INTO dbo.Strongs VALUES ('H3813', 'v', 'law-at''', 'lâʼaṭ', 'h', 'heb', N'לָאַט', '', N'a primitive root;', 'cover.', 'to muffle');
INSERT INTO dbo.Strongs VALUES ('H3814', 'n-m', 'lawt', 'lâʼṭ', 'h', 'heb', N'לָאט', '', N'from 3813 (or perhaps for active participle of 3874);', 'softly.', 'properly, muffled, i.e. silently');
INSERT INTO dbo.Strongs VALUES ('H3815', 'n-pr-m', 'law-ale''', 'Lâʼêl', 'h', 'x-pn', N'לָאֵל', '', N'from the prepositional prefix and 410; (belonging) to God;', 'Lael.', 'Laël an Israelite');
INSERT INTO dbo.Strongs VALUES ('H3816', 'n-m', 'leh-ome''', 'lᵉʼôm', 'h', 'heb', N'לְאֹם', 'xlit lᵉôm corrected to lᵉʼôm', N'or לְאוֹם; from an unused root meaning to gather;', 'nation, people.', 'a community');
INSERT INTO dbo.Strongs VALUES ('H3817', 'n-m', 'leh-oom-meem''', 'Lᵉʼummîym', 'h', 'x-pn', N'לְאֻמִּים', '', N'plural of 3816; communities;', 'Leummim.', 'Leummim, an Arabian');
INSERT INTO dbo.Strongs VALUES ('H3818', 'n-pr-m', 'lo am-mee''', 'Lôʼ ʻAmmîy', 'h', 'x-pn', N'לֹא עַמִּי', '', N'from 3808 and 5971 with pronominal suffix; not my people;', 'Lo-ammi.', 'Lo-Ammi, the symbolic name of a son of Hosea');
INSERT INTO dbo.Strongs VALUES ('H3819', 'n-pr-f', 'lo roo-khaw-maw''', 'Lôʼ Ruchâmâh', 'h', 'x-pn', N'לֹא רֻחָמָה', '', N'from 3808 and 7355; not pitied;', 'Lo-ruhamah.', 'Lo-Ruchamah, the symbolic name of a son of Hosea');
INSERT INTO dbo.Strongs VALUES ('H3820', 'n-m', 'labe', 'lêb', 'h', 'heb', N'לֵב', '', N'a form of 3824;', 'care for, comfortably, consent, × considered, courag(-eous), friend(-ly), ((broken-), (hard-), (merry-), (stiff-), (stout-), double) heart(-ed), × heed, × I, kindly, midst, mind(-ed), × regard(-ed), × themselves, × unawares, understanding, × well, willingly, wisdom.', 'the heart; also used (figuratively) very widely for the feelings, the will and even the intellect; likewise for the centre of anything');
INSERT INTO dbo.Strongs VALUES ('H3821', 'n-m', 'labe', 'lêb', 'h', 'arc', N'לֵב', '', N'(Aramaic) corresponding to 3820', 'heart.', '');
INSERT INTO dbo.Strongs VALUES ('H3822', 'n-pr-loc', 'leb-aw-oth''', 'Lᵉbâʼôwth', 'h', 'x-pn', N'לְבָאוֹת', '', N'plural of 3833; lionesses;', 'Lebaoth. See also 1034.', 'Lebaoth, a place in Palestine');
INSERT INTO dbo.Strongs VALUES ('H3823', 'v', 'law-bab''', 'lâbab', 'h', 'heb', N'לָבַב', '', N'a primitive root;', 'make cakes, ravish, be wise.', 'properly, to be enclosed (as if with fat); by implication (as denominative from 3824); to unheart; i.e. (in a good sense) transport (with love), or (in a bad sense) stultify; to make cakes');
INSERT INTO dbo.Strongs VALUES ('H3824', 'n-m', 'lay-bawb''', 'lêbâb', 'h', 'heb', N'לֵבָב', '', N'from 3823; used also like 3820', '  bethink themselves, breast, comfortably, courage, ((faint), (tender-) heart(-ed), midst, mind, × unawares, understanding.', 'the heart (as the most interior organ);');
INSERT INTO dbo.Strongs VALUES ('H3825', 'n-m', 'leb-ab''', 'lᵉbab', 'h', 'arc', N'לְבַב', '', N'(Aramaic) corresponding to 3824', 'heart.', '');
INSERT INTO dbo.Strongs VALUES ('H3826', 'n-f', 'lib-baw''', 'libbâh', 'h', 'heb', N'לִבָּה', '', N'feminine of 3820;', 'heart.', 'the heart');
INSERT INTO dbo.Strongs VALUES ('H3827', 'n-f', 'lab-baw''', 'labbâh', 'h', 'heb', N'לַבָּה', '', N'for 3852;', 'flame.', 'flame');
INSERT INTO dbo.Strongs VALUES ('H3828', 'n-f', 'leb-o-naw''', 'lᵉbôwnâh', 'h', 'heb', N'לְבוֹנָה', '', N'or לְבֹנָה; from 3836;', '(frank-) incense.', 'frankincense (from its whiteness or perhaps that of its smoke)');
INSERT INTO dbo.Strongs VALUES ('H3829', 'n-pr-loc', 'leb-o-naw''', 'Lᵉbôwnâh', 'h', 'x-pn', N'לְבוֹנָה', '', N'the same as 3828;', 'Lebonah.', 'Lebonah, a place in Palestine');
INSERT INTO dbo.Strongs VALUES ('H3830', 'n-m', 'leb-oosh''', 'lᵉbûwsh', 'h', 'heb', N'לְבוּשׁ', '', N'or לְבֻשׁ; from 3847;', 'apparel, clothed with, clothing, garment, raiment, vestment, vesture.', 'a garment (literally or figuratively); by implication (euphemistically) a wife');
INSERT INTO dbo.Strongs VALUES ('H3831', 'n-m', 'leb-oosh''', 'lᵉbûwsh', 'h', 'arc', N'לְבוּשׁ', '', N'(Aramaic) corresponding to 3830', 'garment.', '');
INSERT INTO dbo.Strongs VALUES ('H3832', 'v', 'law-bat''', 'lâbaṭ', 'h', 'heb', N'לָבַט', '', N'a primitive root;', 'fall.', 'to overthrow; intransposed, to fall');
INSERT INTO dbo.Strongs VALUES ('H3833', 'n', 'law-bee''', 'lâbîyʼ', 'h', 'heb', N'לָבִיא', '', N'or (Ezekiel 19:2) לְבִיָּא; irregular masculine plural לְבָאִים; irregular feminine plural לְבָאוֹת; from an unused root meaning to roar; compare 738', '(great, old, stout) lion, lioness, young (lion).', 'a lion (properly, a lioness as the fiercer (although not a roarer;))');
INSERT INTO dbo.Strongs VALUES ('H3834', 'n-f', 'law-bee-baw''', 'lâbîybâh', 'h', 'heb', N'לָבִיבָה', '', N'or rather לְבִבָה; from 3823 in its original sense of fatness (or perhaps of folding);', 'cake.', 'a cake (either as fried or turned)');
INSERT INTO dbo.Strongs VALUES ('H3835', 'v', 'law-ban''', 'lâban', 'h', 'heb', N'לָבַן', '', N'a primitive root; also as denominative from 3843', 'make brick, be (made, make) white(-r).', 'to be (or become) white; to make bricks');
INSERT INTO dbo.Strongs VALUES ('H3836', 'a', 'law-bawn''', 'lâbân', 'h', 'heb', N'לָבָן', '', N'or (Genesis 49:12) לָבֵן; from 3835;', 'white.', 'white');
INSERT INTO dbo.Strongs VALUES ('H3837', 'n-pr-m n-pr-loc', 'law-bawn''', 'Lâbân', 'h', 'x-pn', N'לָבָן', '', N'the same as 3836;', 'Laban.', 'Laban, a Mesopotamian; also a place in the Desert');
INSERT INTO dbo.Strongs VALUES ('H3838', 'n-pr-m', 'leb-aw-naw''', 'Lᵉbânâʼ', 'h', 'x-pn', N'לְבָנָא', '', N'or לְבָנָה; the same as 3842;', 'Lebana, Lebanah.', 'Lebana or Lebanah, one of the Nethinim');
INSERT INTO dbo.Strongs VALUES ('H3839', 'n-m', 'lib-neh''', 'libneh', 'h', 'heb', N'לִבְנֶה', '', N'from 3835;', 'poplar.', 'some sort of whitish tree, perhaps the storax');
INSERT INTO dbo.Strongs VALUES ('H3840', 'n-f', 'lib-naw''', 'libnâh', 'h', 'heb', N'לִבְנָה', '', N'from 3835;', 'paved.', 'properly, whiteness, i.e. (by implication) transparency');
INSERT INTO dbo.Strongs VALUES ('H3841', 'n-pr-loc', 'lib-naw''', 'Libnâh', 'h', 'x-pn', N'לִבְנָה', '', N'the same as 3839;', 'Libnah.', 'Libnah, a place in the Desert and one in Palestine');
INSERT INTO dbo.Strongs VALUES ('H3842', 'n-f', 'leb-aw-naw''', 'lᵉbânâh', 'h', 'heb', N'לְבָנָה', '', N'from 3835;', 'moon. See also 3838.', 'properly, (the) white, i.e. the moon');
INSERT INTO dbo.Strongs VALUES ('H3843', 'n-f', 'leb-ay-naw''', 'lᵉbênâh', 'h', 'heb', N'לְבֵנָה', '', N'from 3835;', '(altar of) brick, tile.', 'a brick (from the whiteness of the clay)');
INSERT INTO dbo.Strongs VALUES ('H3844', 'n-pr-loc', 'leb-aw-nohn''', 'Lᵉbânôwn', 'h', 'x-pn', N'לְבָנוֹן', '', N'from 3825; (the) white mountain (from its snow);', 'Lebanon.', 'Lebanon, a mountain range in Palestine');
INSERT INTO dbo.Strongs VALUES ('H3845', 'n-pr-m', 'lib-nee''', 'Libnîy', 'h', 'x-pn', N'לִבְנִי', '', N'from 3835; white;', 'Libni.', 'Libni, an Israelite');
INSERT INTO dbo.Strongs VALUES ('H3846', 'a', 'lib-nee''', 'Libnîy', 'h', 'x-pn', N'לִבְנִי', '', N'patronymically from 3845;', 'Libnites.', 'a Libnite or descendants of Libni (collectively)');
INSERT INTO dbo.Strongs VALUES ('H3847', 'v', 'law-bash''', 'lâbash', 'h', 'heb', N'לָבַשׁ', '', N'or לָבֵשׁ; a primitive root;', '(in) apparel, arm, array (self), clothe (self), come upon, put (on, upon), wear.', 'properly, wrap around, i.e. (by implication) to put on a garment or clothe (oneself, or another), literally or figuratively');
INSERT INTO dbo.Strongs VALUES ('H3848', 'v', 'leb-ash''', 'lᵉbash', 'h', 'arc', N'לְבַשׁ', '', N'(Aramaic) corresponding to 3847', 'clothe.', '');
INSERT INTO dbo.Strongs VALUES ('H3849', 'n-m', 'lohg', 'lôg', 'h', 'heb', N'לֹג', '', N'from an unused root apparently meaning to deepen or hollow (like 3537);', 'log (of oil).', 'a log or measure for liquids');
INSERT INTO dbo.Strongs VALUES ('H3850', 'n-pr-loc n-pr-m', 'lode', 'Lôd', 'h', 'x-pn', N'לֹד', '', N'from an unused root of uncertain signification;', 'Lod.', 'Lod, a place in Palestine');
