INSERT INTO dbo.Strongs VALUES ('H3852', 'n-f', 'leh-aw-baw''', 'lehâbâh', 'h', 'heb', N'לֶהָבָה', '', N'or לַהֶבֶת; feminine of 3851, and meaning the same', 'flame(-ming), head (of a spear).', '');
INSERT INTO dbo.Strongs VALUES ('H3853', 'n-m', 'leh-haw-beem''', 'Lᵉhâbîym', 'h', 'x-pn', N'לְהָבִים', '', N'plural of 3851; flames;', 'Lehabim.', 'Lehabim, a son of Mizraim, and his descendants');
INSERT INTO dbo.Strongs VALUES ('H3854', 'n-m', 'lah''-hag', 'lahag', 'h', 'heb', N'לַהַג', '', N'from an unused root meaning to be eager;', 'study.', 'intense mental application');
INSERT INTO dbo.Strongs VALUES ('H3855', 'n-pr-m', 'lah''-had', 'Lahad', 'h', 'x-pn', N'לַהַד', '', N'from an unused root meaning to glow (compare 3851) or else to be earnest (compare 3854);', 'Lahad.', 'Lahad, an Israelite');
INSERT INTO dbo.Strongs VALUES ('H3856', 'v', 'law-hah''', 'lâhahh', 'h', 'heb', N'לָהַהּ', '', N'a primitive root meaning properly, to burn, i.e. (by implication)', 'faint, mad.', 'to be rabid (figuratively, insane); also (from the exhaustion of frenzy) to languish');
INSERT INTO dbo.Strongs VALUES ('H3857', 'v', 'law-hat''', 'lâhaṭ', 'h', 'heb', N'לָהַט', '', N'a primitive root;', 'burn (up), set on fire, flaming, kindle.', 'properly, to lick, i.e. (by implication) to blaze');
INSERT INTO dbo.Strongs VALUES ('H3858', 'n-m', 'lah''-hat', 'lahaṭ', 'h', 'heb', N'לַהַט', '', N'from 3857;', 'flaming, enchantment.', 'a blaze; also (from the idea of enwrapping) magic (as covert)');
INSERT INTO dbo.Strongs VALUES ('H3859', 'v', 'law-ham''', 'lâham', 'h', 'heb', N'לָהַם', '', N'a primitive root;', 'wound.', 'properly, to burn in, i.e. (figuratively) to rankle');
INSERT INTO dbo.Strongs VALUES ('H3860', 'conj', 'law-hane''', 'lâhên', 'h', 'heb', N'לָהֵן', '', N'from the prepositional prefix meaning to or for and 2005;', 'for them (by mistake for prepositional suffix).', 'properly for if; hence, therefore');
INSERT INTO dbo.Strongs VALUES ('H3861', 'conj', 'law-hane''', 'lâhên', 'h', 'arc', N'לָהֵן', 'xlit lâwhên corrected to lâhên', N'(Aramaic) corresponding to 3860;', 'but, except, save, therefore, wherefore.', 'therefore; also except');
INSERT INTO dbo.Strongs VALUES ('H3862', 'n-f', 'lah-hak-aw''', 'lahăqâh', 'h', 'heb', N'לַהֲקָה', '', N'probably from an unused root meaning to gather;', 'company.', 'an assembly');
INSERT INTO dbo.Strongs VALUES ('H3863', 'conj', 'loo', 'lûwʼ', 'h', 'heb', N'לוּא', '', N'or לֻא; or לוּ;', 'if (haply), peradventure, I pray thee, though, I would, would God (that).', 'a conditional particle; if; by implication (interj. as a wish) would that!');
INSERT INTO dbo.Strongs VALUES ('H3864', 'n', 'loo-bee''', 'Lûwbîy', 'h', 'x-pn', N'לוּבִי', '', N'or לֻבִּי; (Daniel 11:43), partrial from a name probably derived from an unused root meaning to thirst, i.e. a dry region; apparently', 'Lubim(-s), Libyans.', 'a Libyan or inhabitant of interior Africa (only in plural)');
INSERT INTO dbo.Strongs VALUES ('H3865', 'n-pr', 'lood', 'Lûwd', 'h', 'x-pn', N'לוּד', '', N'probably of foreign derivation;', 'Lud, Lydia.', 'Lud, the name of two nations');
INSERT INTO dbo.Strongs VALUES ('H3866', 'a', 'loo-dee''', 'Lûwdîy', 'h', 'x-pn', N'לוּדִי', '', N'or לוּדִיִּי; patrial from 3865;', 'Ludim. Lydians.', 'a Ludite or inhabitants of Lud (only in plural)');
INSERT INTO dbo.Strongs VALUES ('H3867', 'v', 'law-vaw''', 'lâvâh', 'h', 'heb', N'לָוָה', '', N'a primitive root;', 'abide with, borrow(-er), cleave, join (self), lend(-er).', 'properly, to twine, i.e. (by implication) to unite, to remain; also to borrow (as a form of obligation) or (caus.) to lend');
INSERT INTO dbo.Strongs VALUES ('H3868', 'v', 'looz', 'lûwz', 'h', 'heb', N'לוּז', '', N'a primitive root; (compare 3867, 3874 and 3885)', 'depart, froward, perverse(-ness).', 'to turn aside , i.e. (literally) to depart, (figuratively) be perverse');
