INSERT INTO dbo.Strongs VALUES ('H3870', 'n-pr-loc', 'looz', 'Lûwz', 'h', 'x-pn', N'לוּז', '', N'probably from 3869 (as growing there);', 'Luz.', 'Luz, the name of two places in Palestine');
INSERT INTO dbo.Strongs VALUES ('H3871', 'n-m', 'loo''-akh', 'lûwach', 'h', 'heb', N'לוּחַ', '', N'or לֻחַ; from a primitive root;', 'board, plate, table.', 'probably meaning to glisten; a tablet (as polished), of stone, wood or metal');
INSERT INTO dbo.Strongs VALUES ('H3872', 'n-pr-loc', 'loo-kheeth''', 'Lûwchîyth', 'h', 'x-pn', N'לוּחִית', '', N'or לֻחוֹת; (Jeremiah 48:5), from the same as 3871; floored;', 'Luhith.', 'Luchith, a place East of the Jordan');
INSERT INTO dbo.Strongs VALUES ('H3873', 'n-pr-m', 'lo-khashe''', 'Lôwchêsh', 'h', 'x-pn', N'לוֹחֵשׁ', '', N'active participle of 3907; (the) enchanter;', 'Hallohesh, Haloshesh (includ. the article).', 'Lochesh, an Israelite');
INSERT INTO dbo.Strongs VALUES ('H3874', 'v', 'loot', 'lûwṭ', 'h', 'heb', N'לוּט', '', N'a primitive root;', 'cast, wrap.', 'to wrap up');
INSERT INTO dbo.Strongs VALUES ('H3875', 'n-m', 'lote', 'lôwṭ', 'h', 'heb', N'לוֹט', '', N'from 3874;', 'covering.', 'a veil');
