INSERT INTO dbo.Strongs VALUES ('H3878', 'n-pr-m', 'lay-vee''', 'Lêvîy', 'h', 'x-pn', N'לֵוִי', '', N'from 3867; attached;', 'Levi. See also 3879, 3881.', 'Levi, a son of Jacob');
