INSERT INTO dbo.Strongs VALUES ('H3881', 'a', 'lay-vee-ee''', 'Lêvîyîy', 'h', 'x-pn', N'לֵוִיִּי', '', N'or לֵוִי; patronymically from 3878;', 'Leviite.', 'a Levite or descendant of Levi');
