INSERT INTO dbo.Strongs VALUES ('H3919', 'n-pr-m n-pr-loc', 'lah''-yish', 'Layish', 'h', 'x-pn', N'לַיִשׁ', '', N'the same as 3918;', 'Laish. Compare 3889.', 'Laish, the name of two places in Palestine');
