INSERT INTO dbo.Strongs VALUES ('H3922', 'n-pr-loc', 'lay-kaw''', 'lêkâh', 'h', 'x-pn', N'לֵכָה', '', N'from 3212; a journey;', 'Lecah.', 'Lekah, a place in Palestine');
INSERT INTO dbo.Strongs VALUES ('H3923', 'n-pr-loc', 'law-keesh''', 'Lâkîysh', 'h', 'x-pn', N'לָכִישׁ', 'xlit Lâchîysh corrected to Lâkîysh', N'from an unused root of uncertain meaning;', 'Lachish.', 'Lakish, a place in Palestine');
INSERT INTO dbo.Strongs VALUES ('H3924', 'n-f', 'loo-law-aw''', 'lulâʼâh', 'h', 'heb', N'לֻלָאָה', '', N'from the same as 3883;', 'loop.', 'a loop');
