INSERT INTO dbo.Strongs VALUES ('H3928', 'a', 'lim-mood''', 'limmûwd', 'h', 'heb', N'לִמּוּד', '', N'or לִמֻּד; from 3925;', 'accustomed, disciple, learned, taught, used.', 'instructed');
INSERT INTO dbo.Strongs VALUES ('H3929', 'n-pr-m', 'leh''-mek', 'Lemek', 'h', 'x-pn', N'לֶמֶךְ', '', N'from an unused root of uncertain meaning;', 'Lamech.', 'Lemek, the name of two antediluvian patriarchs');
