INSERT INTO dbo.Strongs VALUES ('H4113', 'n-f', 'mah-ham-o-raw''', 'mahămôrâh', 'h', 'heb', N'מַהֲמֹרָה', '', N'from an unused root of uncertain meaning;', 'deep pit.', 'perhaps an abyss');
INSERT INTO dbo.Strongs VALUES ('H4114', 'n-f', 'mah-pay-kaw''', 'mahpêkâh', 'h', 'heb', N'מַהְפֵּכָה', '', N'from 2015;', 'when...overthrew, overthrow(-n).', 'a destruction');
INSERT INTO dbo.Strongs VALUES ('H4115', 'n-f', 'mah-peh''-keth', 'mahpeketh', 'h', 'heb', N'מַהְפֶּכֶת', '', N'from 2015;', 'prison, stocks.', 'a wrench, i.e. the stocks');
INSERT INTO dbo.Strongs VALUES ('H4116', 'v', 'maw-har''', 'mâhar', 'h', 'heb', N'מָהַר', '', N'a primitive root;', 'be carried headlong, fearful, (cause to make, in, make) haste(-n, -ily), (be) hasty, (fetch, make ready) × quickly, rash, × shortly, (be so) × soon, make speed, × speedily, × straightway, × suddenly, swift.', 'properly, to be liquid or flow easily, i.e. (by implication); to hurry (in a good or a bad sense); often used (with another verb) adverbially, promptly');
INSERT INTO dbo.Strongs VALUES ('H4117', 'v', 'maw-har''', 'mâhar', 'h', 'heb', N'מָהַר', '', N'a primitive root (perhaps rather the same as 4116 through the idea of readiness in assent);', 'endow, × surely.', 'to bargain (for a wife), i.e. to wed');
INSERT INTO dbo.Strongs VALUES ('H4118', 'a adv', 'mah-hare''', 'mahêr', 'h', 'heb', N'מַהֵר', '', N'from 4116;', 'hasteth, hastily, at once, quickly, soon, speedily, suddenly.', 'properly, hurrying; hence (adverbially) in a hurry');
INSERT INTO dbo.Strongs VALUES ('H4119', 'n-m', 'mo''-har', 'môhar', 'h', 'heb', N'מֹהַר', '', N'from 4117;', 'dowry.', 'a price (for a wife)');
INSERT INTO dbo.Strongs VALUES ('H4120', 'n-f', 'meh-hay-raw''', 'mᵉhêrâh', 'h', 'heb', N'מְהֵרָה', '', N'feminine of 4118;', 'hastily, quickly, shortly, soon, make (with) speed(-ily), swiftly.', 'properly, a hurry; hence (adverbially) promptly');
INSERT INTO dbo.Strongs VALUES ('H4121', 'n-pr-m', 'mah-har-ah''-ee', 'Mahăray', 'h', 'x-pn', N'מַהֲרַי', '', N'from 4116; hasty;', 'Maharai.', 'Maharai, an Israelite');
INSERT INTO dbo.Strongs VALUES ('H4122', 'n-pr-m', 'mah-hare'' shaw-lawl'' khawsh baz', 'Mahêr Shâlâl Châsh Baz', 'h', 'x-pn', N'מַהֵר שָׁלָל חָשׁ בַּז', '', N'from 4118 and 7998 and 2363 and 957; hasting (is he (the enemy) to the) booty, swift (to the) prey;', 'Maher-sha-lal-bash-baz.', 'Maher-Shalal-Chash-Baz; the symbolical name of the son of Isaiah');
INSERT INTO dbo.Strongs VALUES ('H4123', 'n-f', 'mah-hath-al-law''', 'mahăthallâh', 'h', 'heb', N'מַהֲתַלָּה', '', N'from 2048;', 'deceit.', 'a delusion');
INSERT INTO dbo.Strongs VALUES ('H4124', 'n-pr-m n-pr-loc', 'mo-awb', 'Môwʼâb', 'h', 'x-pn', N'מוֹאָב', '', N'from a prolonged form of the prepositional prefix m- and 1; from (her [the mother''s]) father;', 'Moab.', 'Moab, an incestuous son of Lot; also his territory and descendants');
INSERT INTO dbo.Strongs VALUES ('H4125', 'a', 'mo-aw-bee''', 'Môwʼâbîy', 'h', 'x-pn', N'מוֹאָבִי', '', N'feminine מוֹאָבִיָּה; or מוֹאָבִיתxlit Môwâbîyth corrected to Môwʼâbîyth; patronymical from 4124;', '(woman) of Moab, Moabite(-ish, -ss).', 'a Moabite or Moabitess, i.e. a descendant from Moab');
INSERT INTO dbo.Strongs VALUES ('H4126', 'n-m', 'mo-baw''', 'môwbâʼ', 'h', 'heb', N'מוֹבָא', '', N'by transp. for 3996;', 'coming.', 'an entrance');
INSERT INTO dbo.Strongs VALUES ('H4127', 'v', 'moog', 'mûwg', 'h', 'heb', N'מוּג', '', N'a primitive root;', 'consume, dissolve, (be) faint(-hearted), melt (away), make soft.', 'to melt, i.e. literally (to soften, flow down, disappear), or figuratively (to fear, faint)');
INSERT INTO dbo.Strongs VALUES ('H4128', 'v', 'mood', 'mûwd', 'h', 'heb', N'מוּד', '', N'a primitive root;', 'measure.', 'to shake');
INSERT INTO dbo.Strongs VALUES ('H4129', 'n-m', 'mo-dah''', 'môwdaʻ', 'h', 'heb', N'מוֹדַע', '', N'or rather מֹדָע; from 3045;', 'kinswoman.', 'an acquaintance');
INSERT INTO dbo.Strongs VALUES ('H4130', 'n-f', 'mo-dah''-ath', 'môwdaʻath', 'h', 'heb', N'מוֹדַעַת', '', N'from 3045;', 'kindred.', 'acquaintance');
INSERT INTO dbo.Strongs VALUES ('H4131', 'v', 'mote', 'môwṭ', 'h', 'heb', N'מוֹט', '', N'a primitive root;', 'be carried, cast, be out of course, be fallen in decay, × exceedingly, fall(-ing down), be (re-) moved, be ready, shake, slide, slip.', 'to waver; by implication, to slip, shake, fall');
INSERT INTO dbo.Strongs VALUES ('H4132', 'n-m', 'mote', 'môwṭ', 'h', 'heb', N'מוֹט', '', N'from 4131;', 'bar, be moved, staff, yoke.', 'a wavering, i.e. fall; by implication, a pole (as shaking); hence, a yoke (as essentially a bent pole)');
INSERT INTO dbo.Strongs VALUES ('H4133', 'n-f', 'mo-taw''', 'môwṭâh', 'h', 'heb', N'מוֹטָה', '', N'feminine of 4132;', 'bands, heavy, staves, yoke.', 'a pole; by implication, an ox-bow; hence, a yoke (either literal or figurative)');
INSERT INTO dbo.Strongs VALUES ('H4134', 'v', 'mook', 'mûwk', 'h', 'heb', N'מוּךְ', '', N'a primitive root;', 'be (waxen) poor(-er).', 'to become thin, i.e. (figuratively) be impoverished');
INSERT INTO dbo.Strongs VALUES ('H4135', 'v', 'mool', 'mûwl', 'h', 'heb', N'מוּל', '', N'a primitive root;', 'circumcise(-ing), selves), cut down (in pieces), destroy, × must needs.', 'to cut short, i.e. curtail (specifically the prepuce, i.e. to circumcise); by implication, to blunt; figuratively, to destroy');
INSERT INTO dbo.Strongs VALUES ('H4136', 'n-m', 'mool', 'mûwl', 'h', 'heb', N'מוּל', '', N'or מוֹל; (Deuteronomy 1:1), or מוֹאל; (Nehemiah 12:38), or מֻל; (Numbers 22:5), from 4135;', '(over) against, before, (fore-) front, from, (God-) ward, toward, with.', 'properly, abrupt, i.e. a precipice; by implication, the front; used only adverbially (with prepositional prefix) opposite');
INSERT INTO dbo.Strongs VALUES ('H4137', 'n-pr-loc', 'mo-law-daw''', 'Môwlâdâh', 'h', 'x-pn', N'מוֹלָדָה', '', N'from 3205; birth;', 'Moladah.', 'Moladah, a place in Palestine');
INSERT INTO dbo.Strongs VALUES ('H4138', 'n-f', 'mo-leh''-deth', 'môwledeth', 'h', 'heb', N'מוֹלֶדֶת', '', N'from 3205;', 'begotten, born, issue, kindred, native(-ity).', 'nativity (plural birth-place); by implication, lineage, native country; also offspring, family');
INSERT INTO dbo.Strongs VALUES ('H4139', 'n-f', 'moo-law''', 'mûwlâh', 'h', 'heb', N'מוּלָה', '', N'from 4135;', 'circumcision.', 'circumcision');
INSERT INTO dbo.Strongs VALUES ('H4140', 'n-pr-m', 'mo-leed''', 'Môwlîyd', 'h', 'x-pn', N'מוֹלִיד', '', N'from 3205; genitor;', 'Molid.', 'Molid, an Israelite');
INSERT INTO dbo.Strongs VALUES ('H4141', 'n-m', 'moo-sawb''', 'mûwçâb', 'h', 'heb', N'מוּסָב', '', N'from 5437;', 'winding about.', 'a turn, i.e. circuit (of a building)');
INSERT INTO dbo.Strongs VALUES ('H4142', 'a-f', 'moo-sab-baw''', 'mûwçabbâh', 'h', 'heb', N'מוּסַבָּה', '', N'or מֻסַבָּה; feminine of 4141;', 'being changed, inclosed, be set, turning.', 'a reversal, i.e. the backside (of a gem), fold (of a double-leaved door), transmutation (of a name)');
INSERT INTO dbo.Strongs VALUES ('H4143', 'n-m', 'moo-sawd''', 'mûwçâd', 'h', 'heb', N'מוּסָד', '', N'from 3245;', 'foundation.', 'a foundation');
