INSERT INTO dbo.Strongs VALUES ('H4145', 'n-f', 'moo-saw-daw''', 'mûwçâdâh', 'h', 'heb', N'מוּסָדָה', '', N'feminine of 4143;', 'foundation, grounded. Compare 4328.', 'a foundation; figuratively, an appointment');
INSERT INTO dbo.Strongs VALUES ('H4146', 'n-f', 'mo-saw-daw''', 'môwçâdâh', 'h', 'heb', N'מוֹסָדָה', '', N'or מֹסָדָה; feminine of 4144;', 'foundation.', 'a foundation');
INSERT INTO dbo.Strongs VALUES ('H4147', 'n-m', 'mo-sare''', 'môwçêr', 'h', 'heb', N'מוֹסֵר', '', N'also (in plural) feminine מוֹסֵרָה; or מֹסְרָה; from 3256;', 'band, bond.', 'properly, chastisement, i.e. (by implication) a halter; figuratively, restraint');
INSERT INTO dbo.Strongs VALUES ('H4148', 'n-m', 'moo-sawr''', 'mûwçâr', 'h', 'heb', N'מוּסָר', '', N'from 3256;', 'bond, chastening(-eth), chastisement, check, correction, discipline, doctrine, instruction, rebuke.', 'properly, chastisement; figuratively, reproof, warning or instruction; also restraint');
INSERT INTO dbo.Strongs VALUES ('H4149', 'n-pr-f', 'mo-say-raw''', 'Môwçêrâh', 'h', 'x-pn', N'מוֹסֵרָה', '', N'or (plural) מֹסְרוֹת feminine of 4147; correction or corrections;', 'Mosera.', 'Moserah, a place in the Desert');
INSERT INTO dbo.Strongs VALUES ('H4150', 'n-m', 'mo-ade''', 'môwʻêd', 'h', 'heb', N'מוֹעֵד', '', N'or מֹעֵד; or (feminine) מוֹעָדָה; (2 Chronicles 8:13), from 3259;', 'appointed (sign, time), (place of, solemn) assembly, congregation, (set, solemn) feast, (appointed, due) season, solemn(-ity), synogogue, (set) time (appointed).', 'properly, an appointment, i.e. a fixed time or season; specifically, a festival; conventionally a year; by implication, an assembly (as convened for a definite purpose); technically the congregation; by extension, the place of meeting; also a signal (as appointed beforehand)');
INSERT INTO dbo.Strongs VALUES ('H4151', 'n-m', 'mo-awd''', 'môwʻâd', 'h', 'heb', N'מוֹעָד', '', N'from 3259; (as in 4150);', 'appointed time.', 'properly, an assembly figuratively, a troop');
INSERT INTO dbo.Strongs VALUES ('H4152', 'n-f', 'moo-aw-daw''', 'mûwʻâdâh', 'h', 'heb', N'מוּעָדָה', '', N'from 3259;', 'appointed.', 'an appointed place, i.e. asylum');
INSERT INTO dbo.Strongs VALUES ('H4153', 'n-pr-m', 'mo-ad-yaw''', 'Môwʻadyâh', 'h', 'x-pn', N'מוֹעַדְיָה', '', N'from 4151 and 3050; assembly of Jah;', 'Moadiah. Compare 4573.', 'Moadjah, an Israelite');
INSERT INTO dbo.Strongs VALUES ('H4154', 'n-f', 'moo-ay''-deth', 'mûwʻedeth', 'h', 'heb', N'מוּעֶדֶת', '', N'feminine passive participle of 4571;', 'out of joint.', 'properly, made to slip, i.e. dislocated');
