INSERT INTO dbo.Strongs VALUES ('H4156', 'n-f', 'mo-ay-tsaw''', 'môwʻêtsâh', 'h', 'heb', N'מוֹעֵצָה', '', N'from 3289;', 'counsel, device.', 'a purpose');
