INSERT INTO dbo.Strongs VALUES ('H4161', 'n-m', 'mo-tsaw''', 'môwtsâʼ', 'h', 'heb', N'מוֹצָא', '', N'or מֹצָאxlit môtsâ corrected to môtsâʼ; from 3318;', 'brought out, bud, that which came out, east, going forth, goings out, that which (thing that) is gone out, outgoing, proceeded out, spring, vein, (water-) course (springs).', 'a going forth, i.e. (the act) an egress, or (the place) an exit; hence, a source or product; specifically, dawn, the rising of the sun (the East), exportation, utterance, a gate, a fountain, a mine, a meadow (as producing grass)');
