INSERT INTO dbo.Strongs VALUES ('H4164', 'n-m', 'moo-tsak''', 'mûwtsaq', 'h', 'heb', N'מוּצַק', '', N'or מוּצָק; from 3332;', 'anguish, is straitened, straitness.', 'narrowness; figuratively, distress');
