INSERT INTO dbo.Strongs VALUES ('H4167', 'v', 'mook', 'mûwq', 'h', 'heb', N'מוּק', '', N'a primitive root;', 'be corrupt.', 'to jeer, i.e. (intens.) blaspheme');
INSERT INTO dbo.Strongs VALUES ('H4168', 'n-m', 'mo-kade''', 'môwqêd', 'h', 'heb', N'מוֹקֵד', '', N'from 3344;', 'burning, hearth.', 'a fire or fuel; abstractly, a conflagration');
INSERT INTO dbo.Strongs VALUES ('H4169', 'n-f', 'mo-ked-aw''', 'môwqᵉdâh', 'h', 'heb', N'מוֹקְדָה', '', N'feminine of 4168;', 'burning.', 'fuel');
