INSERT INTO dbo.Strongs VALUES ('H4176', 'n-m', 'mo-reh''', 'Môwreh', 'h', 'x-pn', N'מוֹרֶה', '', N'or מֹרֶה; the same as 4175;', 'Moreh.', 'Moreh, a Canaanite; also a hill (perhaps named from him)');
INSERT INTO dbo.Strongs VALUES ('H4177', 'n-m', 'mo-raw''', 'môwrâh', 'h', 'heb', N'מוֹרָה', '', N'from 4171 in the sense of shearing;', 'razor.', 'a razor');
INSERT INTO dbo.Strongs VALUES ('H4178', 'v', 'mo-rawt''', 'môwrâṭ', 'h', 'heb', N'מוֹרָט', '', N'from 3399;', 'peeled.', 'obstinate, i.e. independent');
INSERT INTO dbo.Strongs VALUES ('H4179', 'n-pr-loc', 'mo-ree-yaw''', 'Môwrîyâh', 'h', 'x-pn', N'מוֹרִיָּה', '', N'or מֹרִיָּה; from 7200 and 3050; seen of Jah;', 'Moriah.', 'Morijah, a hill in Palestine');
INSERT INTO dbo.Strongs VALUES ('H4180', 'n-m', 'mo-rawsh''', 'môwrâsh', 'h', 'heb', N'מוֹרָשׁ', '', N'from 3423;', 'possession, thought.', 'a possession; figuratively, delight');
INSERT INTO dbo.Strongs VALUES ('H4181', 'n-f', 'mo-raw-shaw''', 'môwrâshâh', 'h', 'heb', N'מוֹרָשָׁה', '', N'feminine of 4180;', 'heritage, inheritance, possession.', 'a possession');
INSERT INTO dbo.Strongs VALUES ('H4182', 'n-pr-loc', 'mo-reh''-sheth gath', 'Môwresheth Gath', 'h', 'x-pn', N'מוֹרֶשֶׁת גַּת', '', N'from 3423 and 1661; possession of Gath;', 'Moresheth-gath.', 'Moresheth-Gath, a place in Palestine');
INSERT INTO dbo.Strongs VALUES ('H4183', 'a', 'mo-rash-tee''', 'Môwrashtîy', 'h', 'x-pn', N'מוֹרַשְׁתִּי', 'xlit Morashtîy corrected to Môwrashtîy', N'patrial from 4182;', 'Morashthite.', 'a Morashtite or inhabitant of Moresheth-Gath');
INSERT INTO dbo.Strongs VALUES ('H4184', 'v', 'moosh', 'mûwsh', 'h', 'heb', N'מוּשׁ', '', N'a primitive root;', 'feel, handle.', 'to touch');
