INSERT INTO dbo.Strongs VALUES ('H4186', 'n-m', 'mo-shawb''', 'môwshâb', 'h', 'heb', N'מוֹשָׁב', '', N'or מֹשָׁב; from 3427;', 'assembly, dwell in, dwelling(-place), wherein (that) dwelt (in), inhabited place, seat, sitting, situation, sojourning.', 'a seat; figuratively, a site; abstractly, a session; by extension an abode (the place or the time); by implication, population');
INSERT INTO dbo.Strongs VALUES ('H4187', 'n-pr-m', 'moo-shee''', 'Mûwshîy', 'h', 'x-pn', N'מוּשִׁי', '', N'or מֻשִּׁי; from 4184; sensitive;', 'Mushi.', 'Mushi, a Levite');
INSERT INTO dbo.Strongs VALUES ('H4188', 'a', 'moo-shee''', 'Mûwshîy', 'h', 'x-pn', N'מוּשִׁי', '', N'patronymical from 4187;', 'Mushites.', 'a Mushite (collectively) or descendants of Mushi');
INSERT INTO dbo.Strongs VALUES ('H4189', 'n-f', 'mo-shek-aw''', 'môwshᵉkâh', 'h', 'heb', N'מוֹשְׁכָה', '', N'act participle feminine of 4900;', 'band.', 'something drawing, i.e. (figuratively) a cord');
INSERT INTO dbo.Strongs VALUES ('H4190', 'n-f', 'mo-shaw-aw''', 'môwshâʻâh', 'h', 'heb', N'מוֹשָׁעָה', '', N'from 3467;', 'salvation.', 'deliverance');
