INSERT INTO dbo.Strongs VALUES ('H4281', 'n-f', 'makh-ar-ay-shaw''', 'machărêshâh', 'h', 'heb', N'מַחֲרֵשָׁה', '', N'from 2790;', 'mattock.', 'probably a pick-axe');
INSERT INTO dbo.Strongs VALUES ('H4282', 'n-f', 'makh-ar-eh''-sheth', 'machăresheth', 'h', 'heb', N'מַחֲרֶשֶׁת', '', N'from 2790;', 'share.', 'probably a hoe');
