INSERT INTO dbo.Strongs VALUES ('H4285', 'n-m', 'makh-shawk''', 'machshâk', 'h', 'heb', N'מַחְשָׁךְ', '', N'from 2821;', 'dark(-ness, place).', 'darkness; concretely, a dark place');
