INSERT INTO dbo.Strongs VALUES ('H4288', 'n-f', 'mekh-it-taw''', 'mᵉchittâh', 'h', 'heb', N'מְחִתָּה', '', N'from 2846;', 'destruction, dismaying, ruin, terror.', 'properly, a dissolution; concretely, a ruin, or (abstractly) consternation');
