INSERT INTO dbo.Strongs VALUES ('H4291', 'v', 'met-aw''', 'mᵉṭâʼ', 'h', 'arc', N'מְטָא', '', N'(Aramaic) or מְטָה; (Aramaic), apparently corresponding to 4672 in the intransitive sense of being found present;', 'come, reach.', 'to arrive, extend or happen');
INSERT INTO dbo.Strongs VALUES ('H4292', 'n-m', 'mat-at-ay''', 'maṭʼăṭêʼ', 'h', 'heb', N'מַטְאֲטֵא', '', N'apparently a denominative from 2916;', 'besom.', 'a broom (as removing dirt (compare English ''to dust'', i.e. remove dust))');
INSERT INTO dbo.Strongs VALUES ('H4293', 'n-m', 'mat-bay''-akh', 'maṭbêach', 'h', 'heb', N'מַטְבֵּחַ', '', N'from 2873;', 'slaughter.', 'slaughter');
