INSERT INTO dbo.Strongs VALUES ('H4297', 'n-m', 'moot-teh''', 'muṭṭeh', 'h', 'heb', N'מֻטֶּה', '', N'from 5186;', 'perverseness.', 'a stretching, i.e. distortion (figuratively, iniquity)');
INSERT INTO dbo.Strongs VALUES ('H4298', 'n-f', 'moot-taw''', 'muṭṭâh', 'h', 'heb', N'מֻטָּה', '', N'from 5186;', 'stretching out.', 'expansion');
INSERT INTO dbo.Strongs VALUES ('H4299', 'n-m', 'mat-veh''', 'maṭveh', 'h', 'heb', N'מַטְוֶה', '', N'from 2901;', 'spun.', 'something spun');
INSERT INTO dbo.Strongs VALUES ('H4300', 'n-m', 'met-eel''', 'mᵉṭîyl', 'h', 'heb', N'מְטִיל', '', N'from 2904 in the sense of hammering out;', 'bar.', 'an iron bar (as forged)');
