INSERT INTO dbo.Strongs VALUES ('H4302', 'n-m', 'mat-taw''', 'maṭṭâʻ', 'h', 'heb', N'מַטָּע', '', N'from 5193;', 'plant(-ation, -ing).', 'something planted, i.e. the place (a garden or vineyard), or the thing (a plant, figuratively or men); by implication, the act, planting');
