INSERT INTO dbo.Strongs VALUES ('H4308', 'n-pr-f', 'mat-rade''', 'Maṭrêd', 'h', 'x-pn', N'מַטְרֵד', '', N'from 2956; propulsive;', 'Matred.', 'Matred, an Edomitess');
INSERT INTO dbo.Strongs VALUES ('H4309', 'a', 'mat-ree''', 'Maṭrîy', 'h', 'x-pn', N'מַטְרִי', '', N'from 4305; rainy;', 'Matri.', 'Matri, an Israelite');
