INSERT INTO dbo.Strongs VALUES ('H4311', 'n-pr-loc', 'may-deb-aw''', 'Mêydᵉbâʼ', 'h', 'x-pn', N'מֵידְבָא', '', N'from 4325 and 1679; water of quiet;', 'Medeba.', 'Medeba, a place in Palestine');
