INSERT INTO dbo.Strongs VALUES ('H4314', 'n-pr-m', 'may zaw-hawb''', 'Mêy Zâhâb', 'h', 'x-pn', N'מֵי זָהָב', '', N'from 4325 and 2091, water of gold;', 'Mezahab.', 'Me-Zahab, an Edomite');
INSERT INTO dbo.Strongs VALUES ('H4315', 'n-m', 'may-tawb''', 'mêyṭâb', 'h', 'heb', N'מֵיטָב', '', N'from 3190;', 'best.', 'the best part');
