INSERT INTO dbo.Strongs VALUES ('H4355', 'v', 'maw-kak''', 'mâkak', 'h', 'heb', N'מָכַךְ', '', N'a primitive root;', 'be brought low, decay.', 'to tumble (in ruins); figuratively, to perish');
