INSERT INTO dbo.Strongs VALUES ('H4362', 'n-m', 'mik-man''', 'mikman', 'h', 'heb', N'מִכְמַן', '', N'from the same as 3646 in the sense of hiding;', 'treasure.', 'treasure (as hidden)');
