INSERT INTO dbo.Strongs VALUES ('H4369', 'n-f', 'mek-oo-naw''', 'mᵉkunâh', 'h', 'heb', N'מְכֻנָה', '', N'the same as 4350;', 'base.', 'a spot');
INSERT INTO dbo.Strongs VALUES ('H4370', 'n-m', 'mik-nawce''', 'miknâç', 'h', 'heb', N'מִכְנָס', '', N'from 3647 in the sense of hiding;', 'breeches.', '(only in dual) drawers (from concealing the private parts)');
INSERT INTO dbo.Strongs VALUES ('H4371', 'n-m', 'meh''-kes', 'mekeç', 'h', 'heb', N'מֶכֶס', '', N'probably from an unused root meaning to enumerate;', 'tribute.', 'an assessment (as based upon a census)');
INSERT INTO dbo.Strongs VALUES ('H4372', 'n-m', 'mik-seh''', 'mikçeh', 'h', 'heb', N'מִכְסֶה', '', N'from 3680;', 'covering.', 'a covering, i.e. weatherboarding');
INSERT INTO dbo.Strongs VALUES ('H4373', 'n-f', 'mik-saw''', 'mikçâh', 'h', 'heb', N'מִכְסָה', '', N'feminine of 4371;', 'number, worth.', 'an enumeration; by implication, a valuation');
