INSERT INTO dbo.Strongs VALUES ('H4377', 'n-m', 'meh''-ker', 'meker', 'h', 'heb', N'מֶכֶר', '', N'from 4376;', 'pay, price, ware.', 'merchandise; also value');
INSERT INTO dbo.Strongs VALUES ('H4378', 'n-m', 'mak-kawr''', 'makkâr', 'h', 'heb', N'מַכָּר', '', N'from 5234;', 'acquaintance.', 'an acquaintance');
INSERT INTO dbo.Strongs VALUES ('H4379', 'n-m', 'mik-reh''', 'mikreh', 'h', 'heb', N'מִכְרֶה', '', N'from 3738;', '(salt-) pit.', 'a pit (for salt)');
INSERT INTO dbo.Strongs VALUES ('H4380', 'n-f', 'mek-ay-raw''', 'mᵉkêrâh', 'h', 'heb', N'מְכֵרָה', '', N'probably from the same as 3564 in the sense of stabbing;', 'habitation.', 'a sword');
INSERT INTO dbo.Strongs VALUES ('H4381', 'n-pr-m', 'mik-ree''', 'Mikrîy', 'h', 'x-pn', N'מִכְרִי', '', N'from 4376; salesman;', 'Michri.', 'Mikri, an Israelite');
INSERT INTO dbo.Strongs VALUES ('H4382', 'a', 'mek-ay-raw-thee''', 'Mᵉkêrâthîy', 'h', 'x-pn', N'מְכֵרָתִי', '', N'patrial from an unused name (the same as 4380) of a place in Palestine;', 'Mecherathite.', 'a Mekerathite, or inhabitant of Mekerah');
INSERT INTO dbo.Strongs VALUES ('H4383', 'n-m', 'mik-shole''', 'mikshôwl', 'h', 'heb', N'מִכְשׁוֹל', '', N'or מִכְשֹׁל; masculine from 3782;', 'caused to fall, offence, × (no-) thing offered, ruin, stumbling-block.', 'a stumbling-block, literally or figuratively (obstacle, enticement (specifically an idol), scruple)');
INSERT INTO dbo.Strongs VALUES ('H4384', 'n-f', 'mak-shay-law''', 'makshêlâh', 'h', 'heb', N'מַכְשֵׁלָה', '', N'feminine from 3782;', 'ruin, stumbling-block.', 'a stumbling-block, but only figuratively (fall, enticement [idol])');
