INSERT INTO dbo.Strongs VALUES ('H4401', 'n-pr-m', 'mal-aw-kee''', 'Malʼâkîy', 'h', 'x-pn', N'מַלְאָכִי', 'xlit Malʻâkîy corrected to Malʼâkîy', N'from the same as 4397; ministrative;', 'Malachi.', 'Malaki, a prophet');
INSERT INTO dbo.Strongs VALUES ('H4402', 'n-f', 'mil-layth''', 'millêʼth', 'h', 'heb', N'מִלֵּאת', '', N'from 4390;', '× fitly.', 'fulness, i.e. (concretely) a plump socket (of the eye)');
