INSERT INTO dbo.Strongs VALUES ('H4542', 'a', 'mis-kane''', 'miçkên', 'h', 'heb', N'מִסְכֵּן', '', N'from 5531;', 'poor (man).', 'indigent');
INSERT INTO dbo.Strongs VALUES ('H4543', 'n-f', 'mis-ken-aw''', 'miçkᵉnâh', 'h', 'heb', N'מִסְכְּנָה', '', N'by transp. from 3664;', 'store(-house), treasure.', 'a magazine');
