INSERT INTO dbo.Strongs VALUES ('H4546', 'n-f', 'mes-il-law''', 'mᵉçillâh', 'h', 'heb', N'מְסִלָּה', '', N'from 5549;', 'causeway, course, highway, path, terrace.', 'a thoroughfare (as turnpiked), literally or figuratively; specifically a viaduct, a staircase');
INSERT INTO dbo.Strongs VALUES ('H4547', 'n-m', 'mas-lool''', 'maçlûwl', 'h', 'heb', N'מַסְלוּל', '', N'from 5549;', 'highway.', 'a thoroughfare (as turnpiked)');
INSERT INTO dbo.Strongs VALUES ('H4548', 'n-f', 'mas-mare''', 'maçmêr', 'h', 'heb', N'מַסְמֵר', '', N'or מִסְמֵר; also (feminine) מַסְמְרָה; or מִסְמְרָה; or even מַשְׂמְרָה; (Ecclesiastes 12:11), from 5568;', 'nail.', 'a peg (as bristling from the surface)');
INSERT INTO dbo.Strongs VALUES ('H4549', 'v', 'maw-sas''', 'mâçaç', 'h', 'heb', N'מָסַס', '', N'a primitive root;', 'discourage, faint, be loosed, melt (away), refuse, × utterly.', 'to liquefy; figuratively, to waste (with disease), to faint (with fatigue, fear or grief)');
INSERT INTO dbo.Strongs VALUES ('H4550', 'n-m', 'mas-sah''', 'maççaʻ', 'h', 'heb', N'מַסַּע', '', N'from 5265;', 'journey(-ing).', 'a departure (from striking the tents), i.e. march (not necessarily a single day''s travel); by implication, a station (or point of departure)');
INSERT INTO dbo.Strongs VALUES ('H4551', 'n-m', 'mas-saw''', 'maççâʻ', 'h', 'heb', N'מַסָּע', '', N'from 5265 in the sense of projecting;', 'before it was brought, dart.', 'a missile (spear or arrow); also a quarry (whence stones are, as it were, ejected)');
INSERT INTO dbo.Strongs VALUES ('H4552', 'n-m', 'mis-awd''', 'miçʻâd', 'h', 'heb', N'מִסְעָד', '', N''' from 5582;', 'pillar.', 'a balustrade (for stairs)');
