INSERT INTO dbo.Strongs VALUES ('H4555', 'n-f', 'mis-paw-khaw''', 'miçpâchâh', 'h', 'heb', N'מִסְפָּחָה', '', N'from 5596;', 'kerchief.', 'a veil (as spread out)');
