INSERT INTO dbo.Strongs VALUES ('H4557', 'n-m', 'mis-pawr''', 'miçpâr', 'h', 'heb', N'מִסְפָּר', '', N'from 5608;', '  abundance, account, × all, × few, (in-) finite, (certain) number(-ed), tale, telling,   time.', 'a number, definite (arithmetical) or indefinite (large, innumerable; small, a few); also (abstractly) narration');
INSERT INTO dbo.Strongs VALUES ('H4558', 'n-pr-m', 'mis-pawr''', 'Miçpâr', 'h', 'x-pn', N'מִסְפָּר', '', N'the same as 4457; number;', 'Mizpar. Compare 4559.', 'Mispar, an Israelite');
INSERT INTO dbo.Strongs VALUES ('H4559', 'n-pr-f', 'mis-peh''-reth', 'Miçpereth', 'h', 'x-pn', N'מִסְפֶּרֶת', '', N'feminine of 4437; enumeration;', 'Mispereth. Compare 4458.', 'Mispereth, an Israelite');
INSERT INTO dbo.Strongs VALUES ('H4560', 'v', 'maw-sar''', 'mâçar', 'h', 'heb', N'מָסַר', '', N'a primitive root;', 'commit, deliver.', 'to sunder, i.e. (transitively) set apart, or (reflex.) apostatize');
INSERT INTO dbo.Strongs VALUES ('H4561', 'n-m', 'mo-sawr''', 'môçâr', 'h', 'heb', N'מֹסָר', '', N'from 3256;', 'instruction.', 'admonition');
