INSERT INTO dbo.Strongs VALUES ('H4564', 'n-m', 'mas-tare''', 'maçtêr', 'h', 'heb', N'מַסְתֵּר', '', N'from 5641;', 'hid.', 'properly, a hider, i.e. (abstractly) a hiding, i.e. aversion');
INSERT INTO dbo.Strongs VALUES ('H4565', 'n-m', 'mis-tawr''', 'miçtâr', 'h', 'heb', N'מִסְתָּר', '', N'from 5641;', 'secret(-ly, place).', 'properly, a concealer, i.e. a covert');
INSERT INTO dbo.Strongs VALUES ('H4566', 'n-m', 'mah-bawd''', 'maʻbâd', 'h', 'heb', N'מַעְבָּד', '', N'from 5647;', 'work.', 'an act');
INSERT INTO dbo.Strongs VALUES ('H4567', 'n-m', 'mah-bawd''', 'maʻbâd', 'h', 'arc', N'מַעְבָד', '', N'(Aramaic) corresponding to 4566;', 'work.', 'an act');
INSERT INTO dbo.Strongs VALUES ('H4568', 'n-m', 'mah-ab-eh''', 'maʻăbeh', 'h', 'heb', N'מַעֲבֶה', '', N'from 5666;', 'clay.', 'properly, compact (part of soil), i.e. loam');
INSERT INTO dbo.Strongs VALUES ('H4569', 'n-m', 'mah-ab-awr''', 'maʻăbâr', 'h', 'heb', N'מַעֲבָר', '', N'or feminine מַעֲבָרָה; from 5674;', 'ford, place where...pass, passage.', 'a crossing-place (of a river, a ford; of a mountain, a pass); abstractly, a transit, i.e. (figuratively) overwhelming');
INSERT INTO dbo.Strongs VALUES ('H4570', 'n-m', 'mah-gawl''', 'maʻgâl', 'h', 'heb', N'מַעְגָּל', '', N'or feminine מַעְגָּלָה; from the same as 5696;', 'going, path, trench, way(-side).', 'a track (literally or figuratively); also a rampart (as circular)');
INSERT INTO dbo.Strongs VALUES ('H4571', 'v', 'maw-ad''', 'mâʻad', 'h', 'heb', N'מָעַד', '', N'a primitive root;', 'make to shake, slide, slip.', 'to waver');
INSERT INTO dbo.Strongs VALUES ('H4572', 'n-pr-m', 'mah-ad-ah''-ee', 'Maʻăday', 'h', 'x-pn', N'מַעֲדַי', '', N'from 5710; ornamental;', 'Maadai.', 'Maadai, an Israelite');
INSERT INTO dbo.Strongs VALUES ('H4573', 'n-pr-m', 'mah-ad-yaw''', 'Maʻădyâh', 'h', 'x-pn', N'מַעֲדְיָה', '', N'from 5710 and 3050; ornament of Jah;', 'Maadiah. Compare 4153.', 'Maadjah, an Israelite');
INSERT INTO dbo.Strongs VALUES ('H4574', 'n-m', 'mah-ad-awn''', 'maʻădân', 'h', 'heb', N'מַעֲדָן', '', N'or (feminine) מַעֲדַנָּה; from 5727;', 'dainty, delicately, delight.', 'a delicacy or (abstractly) pleasure (adverbially, cheerfully)');
INSERT INTO dbo.Strongs VALUES ('H4575', 'n-f', 'mah-ad-an-naw''', 'maʻădannâh', 'h', 'heb', N'מַעֲדַנָּה', '', N'by transitive from 6029;', 'influence.', 'a bond, i.e. group');
