INSERT INTO dbo.Strongs VALUES ('H4579', 'n-f', 'may-aw''', 'mêʻâh', 'h', 'heb', N'מֵעָה', '', N'feminine of 4578;', 'gravel.', 'the belly, i.e. (figuratively) interior');
INSERT INTO dbo.Strongs VALUES ('H4580', 'n-m', 'maw-ogue''', 'mâʻôwg', 'h', 'heb', N'מָעוֹג', '', N'from 5746; also with 3934 a table-buffoon, i.e.', 'cake, feast.', 'a cake of bread; parasite');
