INSERT INTO dbo.Strongs VALUES ('H4582', 'n-pr-m', 'maw-oke''', 'Mâʻôwk', 'h', 'x-pn', N'מָעוֹךְ', '', N'from 4600; oppressed;', 'Maoch.', 'Maok, a Philistine');
