INSERT INTO dbo.Strongs VALUES ('H4587', 'n-pr-m', 'meh-o-no-thah''-ee', 'Mᵉʻôwnôthay', 'h', 'x-pn', N'מְעוֹנֹתַי', '', N'plural of 4585; habitative;', 'Meonothai.', 'Meonothai, an Israelite');
