INSERT INTO dbo.Strongs VALUES ('H4596', 'n-m', 'meh-ee''', 'mᵉʻîy', 'h', 'heb', N'מְעִי', '', N'from 5753; (compare 5856)', 'heap.', 'a pile of rubbish (as contorted), i.e. a ruin');
