INSERT INTO dbo.Strongs VALUES ('H4598', 'n-m', 'meh-eel''', 'mᵉʻîyl', 'h', 'heb', N'מְעִיל', '', N'from 4603 in the sense of covering;', 'cloke, coat, mantle, robe.', 'a robe (i.e. upper and outer garment)');
INSERT INTO dbo.Strongs VALUES ('H4599', 'n-m', 'mah-yawn''', 'maʻyân', 'h', 'heb', N'מַעְיָן', '', N'or מַעְיְנוֹ; (Psalm 114:8), or (feminine) מַעְיָנָה; from 5869 (as a denominative in the sense of a spring);', 'fountain, spring, well.', 'a fountain (also collectively), figuratively, a source (of satisfaction)');
INSERT INTO dbo.Strongs VALUES ('H4600', 'v', 'maw-ak''', 'mâʻak', 'h', 'heb', N'מָעַךְ', '', N'a primitive root;', 'bruised, stuck, be pressed.', 'to press, i.e. to pierce, emasculate, handle');
