INSERT INTO dbo.Strongs VALUES ('H4602', 'a', 'mah-ak-aw-thee''', 'Maʻăkâthîy', 'h', 'x-pn', N'מַעֲכָתִי', '', N'patrial from 4601;', 'Maachathite.', 'a Maakathite, or inhabitant of Maakah');
INSERT INTO dbo.Strongs VALUES ('H4603', 'v', 'maw-al''', 'mâʻal', 'h', 'heb', N'מָעַל', '', N'a primitive root;', 'transgress, (commit, do a) trespass(-ing).', 'properly, to cover up; used only figuratively, to act covertly, i.e. treacherously');
INSERT INTO dbo.Strongs VALUES ('H4604', 'n-m', 'mah''-al', 'maʻal', 'h', 'heb', N'מַעַל', '', N'from 4603;', 'falsehood, grievously, sore, transgression, trespass, × very.', 'treachery, i.e. sin');
