INSERT INTO dbo.Strongs VALUES ('H4606', 'n-m', 'may-awl''', 'mêʻâl', 'h', 'arc', N'מֵעָל', '', N'(Aramaic) from 5954;', 'going down.', '(only in plural as singular) the setting (of the sun)');
INSERT INTO dbo.Strongs VALUES ('H4607', 'n-m', 'mo''-al', 'môʻal', 'h', 'heb', N'מֹעַל', '', N'from 5927;', 'lifting up.', 'a raising (of the hands)');
