INSERT INTO dbo.Strongs VALUES ('H4610', 'n-pr-loc', 'mah-al-ay'' ak-rabbeem''', 'Maʻălêh ʻAqrabbîym', 'h', 'x-pn', N'מַעֲלֵה עַקְרַבִּים', '', N'from 4608 and (the plural of) 6137;', 'Maaleh-accrabim, the ascent (going up) of Akrabbim.', 'Steep of Scorpions, a place in the Desert');
INSERT INTO dbo.Strongs VALUES ('H4611', 'n-m', 'mah-al-awl''', 'maʻălâl', 'h', 'heb', N'מַעֲלָל', '', N'from 5953;', 'doing, endeavour, invention, work.', 'an act (good or bad)');
INSERT INTO dbo.Strongs VALUES ('H4612', 'n-m', 'mah-am-awd''', 'maʻămâd', 'h', 'heb', N'מַעֲמָד', '', N'from 5975;', 'attendance, office, place, state.', '(figuratively) a position');
INSERT INTO dbo.Strongs VALUES ('H4613', 'n-m', 'moh-om-awd''', 'moʻŏmâd', 'h', 'heb', N'מׇעֳמָד', '', N'from 5975;', 'standing.', 'literally a foothold');
INSERT INTO dbo.Strongs VALUES ('H4614', 'n-f', 'mah-am-aw-saw''', 'maʻămâçâh', 'h', 'heb', N'מַעֲמָסָה', '', N'from 6006;', 'burdensome.', 'burdensomeness');
INSERT INTO dbo.Strongs VALUES ('H4615', 'n-m', 'mah-am-awk''', 'maʻămâq', 'h', 'heb', N'מַעֲמָק', '', N'from 6009;', 'deep, depth.', 'a deep');
