INSERT INTO dbo.Strongs VALUES ('H4702', 'n-m', 'mats-tsaw''', 'matstsâʻ', 'h', 'heb', N'מַצָּע', '', N'from 3331;', 'bed.', 'a couch');
INSERT INTO dbo.Strongs VALUES ('H4703', 'n-m', 'mits-awd''', 'mitsʻâd', 'h', 'heb', N'מִצְעָד', '', N'from 6805;', 'going, step.', 'a step; figuratively, companionship');
INSERT INTO dbo.Strongs VALUES ('H4704', 'n-f', 'mits-tseh-ee-raw''', 'mitstsᵉʻîyrâh', 'h', 'heb', N'מִצְּעִירָה', '', N'feminine of 4705;', 'little.', 'properly, littleness; concretely, diminutive');
INSERT INTO dbo.Strongs VALUES ('H4705', 'n-m', 'mits-awr''', 'mitsʻâr', 'h', 'heb', N'מִצְעָר', '', N'from 6819;', 'little one (while), small.', 'petty (in size or number); adverbially, a short (time)');
INSERT INTO dbo.Strongs VALUES ('H4706', 'n-pr-loc', 'mits-awr''', 'Mitsʻâr', 'h', 'x-pn', N'מִצְעָר', '', N'the same as 4705;', 'Mizar.', 'Mitsar, a peak of Lebanon');
INSERT INTO dbo.Strongs VALUES ('H4707', 'n-m', 'mits-peh''', 'mitspeh', 'h', 'heb', N'מִצְפֶּה', '', N'from 6822;', 'watch tower.', 'an observatory, especially for military purposes');
INSERT INTO dbo.Strongs VALUES ('H4708', 'n-pr-loc', 'mits-peh''', 'Mitspeh', 'h', 'x-pn', N'מִצְפֶּה', '', N'the same as 4707;', 'Mizpeh, watch tower. Compare 4709.', 'Mitspeh, the name of five places in Palestine');
INSERT INTO dbo.Strongs VALUES ('H4709', 'n-pr-f', 'mits-paw''', 'Mitspâh', 'h', 'x-pn', N'מִצְפָּה', '', N'feminine of 4708;', 'Mitspah. (This seems rather to be only an orthographic variation of 4708 when ''in pause''.)', 'Mitspah, the name of two places in Palestine');
INSERT INTO dbo.Strongs VALUES ('H4710', 'n-m', 'mits-poon''', 'mitspun', 'h', 'heb', N'מִצְפֻּן', '', N'from 6845;', 'hidden thing.', 'a secret (place or thing, perhaps, treasure)');
INSERT INTO dbo.Strongs VALUES ('H4711', 'v', 'maw-tsats''', 'mâtsats', 'h', 'heb', N'מָצַץ', '', N'a primitive root;', 'milk.', 'to suck');
INSERT INTO dbo.Strongs VALUES ('H4712', 'n-m', 'may-tsar''', 'mêtsar', 'h', 'heb', N'מֵצַר', '', N'from 6869;', 'distress, pain, strait.', 'something tight, i.e. (figuratively) trouble');
INSERT INTO dbo.Strongs VALUES ('H4713', 'a', 'mits-ree''', 'Mitsrîy', 'h', 'x-pn', N'מִצְרִי', '', N'from 4714;', 'Egyptian, of Egypt.', 'a Mitsrite, or inhabitant of Mitsrajim');
INSERT INTO dbo.Strongs VALUES ('H4714', 'n-pr', 'mits-rah''-yim', 'Mitsrayim', 'h', 'x-pn', N'מִצְרַיִם', '', N'dual of 4693;', 'Egypt, Egyptians, Mizraim.', 'Mitsrajim, i.e. Upper and Lower Egypt');
INSERT INTO dbo.Strongs VALUES ('H4715', 'n-m', 'mits-rafe''', 'mitsrêph', 'h', 'heb', N'מִצְרֵף', '', N'from 6884;', 'fining pot.', 'a crucible');
INSERT INTO dbo.Strongs VALUES ('H4716', 'n-m', 'mak', 'maq', 'h', 'heb', N'מַק', '', N'from 4743;', 'rottenness, stink.', 'properly, a melting, i.e. putridity');
INSERT INTO dbo.Strongs VALUES ('H4717', 'n-f', 'mak-kaw-baw''', 'maqqâbâh', 'h', 'heb', N'מַקָּבָה', '', N'from 5344;', 'hammer.', 'properly, a perforatrix, i.e. a hammer (as piercing)');
INSERT INTO dbo.Strongs VALUES ('H4718', 'n-f', 'mak-keh''-beth', 'maqqebeth', 'h', 'heb', N'מַקֶּבֶת', '', N'from 5344;', 'hammer, hole.', 'properly, a perforator, i.e. a hammer (as piercing); also (intransitively) a perforation, i.e. a quarry');
INSERT INTO dbo.Strongs VALUES ('H4719', 'n-pr-loc', 'mak-kay-daw''', 'Maqqêdâh', 'h', 'x-pn', N'מַקֵּדָה', '', N'from the same as 5348 in the denominative sense of herding (compare 5349); fold;', 'Makkedah.', 'Makkedah, a place in Palestine');
INSERT INTO dbo.Strongs VALUES ('H4720', 'n-m', 'mik-dawsh''', 'miqdâsh', 'h', 'heb', N'מִקְדָּשׁ', '', N'or מִקְּדָשׁ; (Exodus 15:17), from 6942;', 'chapel, hallowed part, holy place, sanctuary.', 'a consecrated thing or place, especially, a palace, sanctuary (whether of Jehovah or of idols) or asylum');
INSERT INTO dbo.Strongs VALUES ('H4721', 'n-m', 'mak-hale''', 'maqhêl', 'h', 'heb', N'מַקְהֵל', '', N'or (feminine) מַקְהֵלָה; from 6950;', 'congregation.', 'an assembly');
INSERT INTO dbo.Strongs VALUES ('H4722', 'n-pr-f', 'mak-hay-loth''', 'Maqhêlôth', 'h', 'x-pn', N'מַקְהֵלֹת', '', N'plural of 4721 (feminine); assemblies;', 'Makheloth.', 'Makheloth, a place in the Desert');
INSERT INTO dbo.Strongs VALUES ('H4723', 'n-pr-m n-m', 'mik-veh''', 'miqveh', 'h', 'heb', N'מִקְוֶה', '', N'or מִקְוֵה; (1 Kings 10:28), or מִקְוֵאlemma מִּקְוֵא extra dagesh, corrected to מִקְוֵא; (2 Chronicles 1:16), from 6960;', 'abiding, gathering together, hope, linen yarn, plenty (of water), pool.', 'something waited for, i.e. confidence (objective or subjective); also a collection, i.e. (of water) a pond, or (of men and horses) a caravan or drove');
INSERT INTO dbo.Strongs VALUES ('H4724', 'n-f', 'mik-vaw''', 'miqvâh', 'h', 'heb', N'מִקְוָה', '', N'feminine of 4723;', 'ditch.', 'a collection, i.e. (of water) a reservoir');
INSERT INTO dbo.Strongs VALUES ('H4725', 'n-m', 'maw-kome''', 'mâqôwm', 'h', 'heb', N'מָקוֹם', '', N'or מָקֹם; also (feminine) מְקוֹמָה; or מְקֹמָה; from 6965;', 'country, × home, × open, place, room, space, × whither(-soever).', 'properly, a standing, i.e. a spot; but used widely of a locality (general or specific); also (figuratively) of a condition (of body or mind)');
INSERT INTO dbo.Strongs VALUES ('H4726', 'n-m', 'maw-kore''', 'mâqôwr', 'h', 'heb', N'מָקוֹר', '', N'or מָקֹר; from 6979;', 'fountain, issue, spring, well(-spring).', 'properly, something dug, i.e. a (general) source (of water, even when naturally flowing; also of tears, blood (by euphemism, of the female pudenda); figuratively, of happiness, wisdom, progeny)');
INSERT INTO dbo.Strongs VALUES ('H4727', 'n-m', 'mik-kawkh''', 'miqqâch', 'h', 'heb', N'מִקָּח', '', N'from 3947;', 'taking.', 'reception');
INSERT INTO dbo.Strongs VALUES ('H4728', 'n-f', 'mak-kaw-khaw''', 'maqqâchâh', 'h', 'heb', N'מַקָּחָה', '', N'from 3947;', 'ware.', 'something received, i.e. merchandise (purchased)');
INSERT INTO dbo.Strongs VALUES ('H4729', 'n-m', 'mik-tawr''', 'miqṭâr', 'h', 'heb', N'מִקְטָר', '', N'from 6999;', 'to burn...upon.', 'something to fume (incense) on i.e. a hearth place');
INSERT INTO dbo.Strongs VALUES ('H4730', 'n-f', 'mik-teh''-reth', 'miqṭereth', 'h', 'heb', N'מִקְטֶרֶת', '', N'feminine of 4729;', 'censer.', 'something to fume (incense) in, i.e. a coal-pan');
INSERT INTO dbo.Strongs VALUES ('H4731', 'n-m', 'mak-kale', 'maqqêl', 'h', 'heb', N'מַקֵּל', '', N'or (feminine) מַקְּלָה; from an unused root meaning apparently to germinate;', 'rod, (hand-)staff.', 'a shoot, i.e. stick (with leaves on, or for walking, striking, guiding, divining)');
INSERT INTO dbo.Strongs VALUES ('H4732', 'n-pr-m', 'mik-lohth''', 'Miqlôwth', 'h', 'x-pn', N'מִקְלוֹת', '', N'(or perhaps mik-kel-ohth'') plural of (feminine) 4731; rods;', 'Mikloth.', 'Mikloth, a place in the Desert');
INSERT INTO dbo.Strongs VALUES ('H4733', 'n-m', 'mik-lawt''', 'miqlâṭ', 'h', 'heb', N'מִקְלָט', '', N'from 7038 in the sense of taking in;', 'refuge.', 'an asylum (as a receptacle)');
INSERT INTO dbo.Strongs VALUES ('H4734', 'n-f', 'mik-lah''-ath', 'miqlaʻath', 'h', 'heb', N'מִקְלַעַת', '', N'from 7049;', 'carved (figure), carving, graving.', 'a sculpture (probably in bas-relief)');
