INSERT INTO dbo.Strongs VALUES ('H4737', 'n-pr-m', 'mik-nay-yaw''-hoo', 'Miqnêyâhûw', 'h', 'x-pn', N'מִקְנֵיָהוּ', '', N'from 4735 and 3050; possession of Jah;', 'Mikneiah.', 'Miknejah, an Israelite');
