INSERT INTO dbo.Strongs VALUES ('H4739', 'n-pr-loc', 'maw-kats''', 'Mâqats', 'h', 'x-pn', N'מָקַץ', '', N'from 7112; end;', 'Makaz.', 'Makats, a place in Palestine');
INSERT INTO dbo.Strongs VALUES ('H4740', 'n-m', 'mak-tso''-ah', 'maqtsôwaʻ', 'h', 'heb', N'מַקְצוֹעַ', '', N'or מַקְצֹעַ; or (feminine) מַקְצֹעָה; from 7106 in the denominative sense of bending;', 'corner, turning.', 'an angle or recess');
INSERT INTO dbo.Strongs VALUES ('H4741', 'n-f', 'mak-tsoo-aw''', 'maqtsuʻâh', 'h', 'heb', N'מַקְצֻעָה', '', N'from 7106;', 'plane.', 'a scraper, i.e. a carving chisel');
INSERT INTO dbo.Strongs VALUES ('H4742', 'n-f', 'mek-oots-aw''', 'mᵉqutsʻâh', 'h', 'heb', N'מְקֻצְעָה', '', N'from 7106 in the denominative sense of bending;', 'corner.', 'an angle');
INSERT INTO dbo.Strongs VALUES ('H4743', 'v', 'maw-kak''', 'mâqaq', 'h', 'heb', N'מָקַק', '', N''' a primitive root;', 'consume away, be corrupt, dissolve, pine away.', 'to melt; figuratively, to flow, dwindle, vanish');
