INSERT INTO dbo.Strongs VALUES ('H4746', 'n-m', 'mek-aw-reh''', 'mᵉqâreh', 'h', 'heb', N'מְקָרֶה', '', N'from 7136;', 'building.', 'properly, something meeting, i.e. a frame (of timbers)');
INSERT INTO dbo.Strongs VALUES ('H4747', 'n-f', 'mek-ay-raw''', 'mᵉqêrâh', 'h', 'heb', N'מְקֵרָה', '', N'from the same as 7119;', '× summer.', 'a cooling off');
