INSERT INTO dbo.Strongs VALUES ('H4750', 'n-f', 'mik-shaw''', 'miqshâh', 'h', 'heb', N'מִקְשָׁה', '', N'denominative from 7180;', 'garden of cucumbers.', 'literally a cucumbered field, i.e. a cucumber patch');
INSERT INTO dbo.Strongs VALUES ('H4751', 'a-m', 'mar', 'mar', 'h', 'heb', N'מַר', '', N'or (feminine) מָרָה; from 4843;', '  angry, bitter(-ly, -ness), chafed, discontented, × great, heavy.', 'bitter (literally or figuratively); also (as noun) bitterness, or (adverbially) bitterly');
INSERT INTO dbo.Strongs VALUES ('H4752', 'n-m', 'mar', 'mar', 'h', 'heb', N'מַר', '', N'from 4843 in its original sense of distillation;', 'drop.', 'a drop');
