INSERT INTO dbo.Strongs VALUES ('H4764', 'n-pr-f', 'may-rawb''', 'Mêrâb', 'h', 'x-pn', N'מֵרָב', '', N'from 7231; increase;', 'Merab.', 'Merab, a daughter of Saul');
