INSERT INTO dbo.Strongs VALUES ('H4767', 'n-f', 'meer-baw''', 'mirbâh', 'h', 'heb', N'מִרְבָּה', '', N'from 7235;', 'much.', 'abundance, i.e. a great quantity');
