INSERT INTO dbo.Strongs VALUES ('H4771', 'n-m', 'mar-go''-ah', 'margôwaʻ', 'h', 'heb', N'מַרְגּוֹעַ', '', N'from 7280;', 'rest.', 'a resting place');
