INSERT INTO dbo.Strongs VALUES ('H4775', 'v', 'maw-rad''', 'mârad', 'h', 'heb', N'מָרַד', '', N'a primitive root;', 'rebel(-lious).', 'to rebel');
INSERT INTO dbo.Strongs VALUES ('H4776', 'n-m', 'mer-ad''', 'mᵉrad', 'h', 'arc', N'מְרַד', '', N'(Aramaic) from a root corresponding to 4775;', 'rebellion.', 'rebellion');
