INSERT INTO dbo.Strongs VALUES ('H4779', 'a', 'maw-rawd''', 'mârâd', 'h', 'arc', N'מָרָד', '', N'(Aramaic) from the same as 4776;', 'rebellious.', 'rebellious');
INSERT INTO dbo.Strongs VALUES ('H4780', 'n-f', 'mar-dooth''', 'mardûwth', 'h', 'heb', N'מַרְדּוּת', '', N'from 4775;', '× rebellious.', 'rebelliousness');
INSERT INTO dbo.Strongs VALUES ('H4781', 'n-pr-m', 'mer-o-dawk''', 'Mᵉrôdâk', 'h', 'x-pn', N'מְרֹדָךְ', '', N'of foreign derivation;', 'Merodach. Compare 4757.', 'Merodak, a Babylonian idol');
INSERT INTO dbo.Strongs VALUES ('H4782', 'n-pr-m', 'mor-dek-ah''-ee', 'Mordᵉkay', 'h', 'x-pn', N'מׇרְדְּכַי', '', N'of foreign derivation;', 'Mordecai.', 'Mordecai, an Israelite');
INSERT INTO dbo.Strongs VALUES ('H4783', 'n-m', 'moor-dawf''', 'murdâph', 'h', 'heb', N'מֻרְדָּף', '', N'from 7291;', 'persecuted.', 'persecuted');
