INSERT INTO dbo.Strongs VALUES ('H5038', 'n-f', 'neb-ay-law''', 'nᵉbêlâh', 'h', 'heb', N'נְבֵלָה', '', N'from 5034;', '(dead) body, (dead) carcase, dead of itself, which died, (beast) that (which) dieth of itself.', 'a flabby thing, i.e. a carcase or carrion (human or bestial, often collectively); figuratively, an idol');
INSERT INTO dbo.Strongs VALUES ('H5039', 'n-f', 'neb-aw-law''', 'nᵉbâlâh', 'h', 'heb', N'נְבָלָה', '', N'feminine of 5036;', 'folly, vile, villany.', 'foolishness, i.e. (morally) wickedness; concretely, a crime; by extension, punishment');
INSERT INTO dbo.Strongs VALUES ('H5040', 'n-f', 'nab-looth''', 'nablûwth', 'h', 'heb', N'נַבְלוּת', '', N'from 5036;', 'lewdness.', 'properly, disgrace, i.e. the (female) pudenda');
INSERT INTO dbo.Strongs VALUES ('H5041', 'n-pr-loc', 'neb-al-lawt''', 'Nᵉballâṭ', 'h', 'x-pn', N'נְבַלָּט', '', N'apparently from 5036 and 3909; foolish secrecy;', 'Neballat.', 'Neballat, a place in Palestine');
INSERT INTO dbo.Strongs VALUES ('H5042', 'v', 'naw-bah''', 'nâbaʻ', 'h', 'heb', N'נָבַע', '', N'a primitive root;', 'belch out, flowing, pour out, send forth, utter (abundantly).', 'to gush forth; figuratively, to utter (good or bad words); specifically, to emit (a foul odor)');
INSERT INTO dbo.Strongs VALUES ('H5043', 'n-f', 'neb-reh-shaw''', 'nebrᵉshâʼ', 'h', 'arc', N'נֶבְרְשָׁא', '', N'(Aramaic) from an unused root meaning to shine;', 'candlestick.', 'a light; plural (collectively) a chandelier');
INSERT INTO dbo.Strongs VALUES ('H5044', 'n-pr-loc', 'nib-shawn''', 'Nibshân', 'h', 'x-pn', N'נִבְשָׁן', '', N'of uncertain derivation;', 'Nibshan.', 'Nibshan, a place in Palestine');
INSERT INTO dbo.Strongs VALUES ('H5045', 'n-m', 'neh''-gheb', 'negeb', 'h', 'heb', N'נֶגֶב', '', N'from an unused root meaning to be parched;', 'south (country, side, -ward).', 'the south (from its drought); specifically, the Negeb or southern district of Judah, occasionally, Egypt (as south to Palestine)');
INSERT INTO dbo.Strongs VALUES ('H5046', 'v', 'naw-gad''', 'nâgad', 'h', 'heb', N'נָגַד', '', N'a primitive root;', 'bewray, × certainly, certify, declare(-ing), denounce, expound, × fully, messenger, plainly, profess, rehearse, report, shew (forth), speak, × surely, tell, utter.', 'properly, to front, i.e. stand boldly out opposite; by implication (causatively), to manifest; figuratively, to announce (always by word of mouth to one present); specifically, to expose, predict, explain, praise');
INSERT INTO dbo.Strongs VALUES ('H5047', 'v', 'neg-ad''', 'nᵉgad', 'h', 'arc', N'נְגַד', '', N'(Aramaic) corresponding to 5046;', 'issue.', 'to flow (through the idea of clearing the way)');
INSERT INTO dbo.Strongs VALUES ('H5048', 'prep', 'neh''-ghed', 'neged', 'h', 'heb', N'נֶגֶד', '', N'from 5046;', 'about, (over) against, × aloof, × far (off), × from, over, presence, × other side, sight, × to view.', 'a front, i.e. part opposite; specifically a counterpart, or mate; usually (adverbial, especially with preposition) over against or before');
INSERT INTO dbo.Strongs VALUES ('H5049', 'prep', 'neh''-ghed', 'neged', 'h', 'arc', N'נֶגֶד', '', N'(Aramaic) corresponding to 5048;', 'toward.', 'opposite');
INSERT INTO dbo.Strongs VALUES ('H5050', 'v', 'naw-gah''', 'nâgahh', 'h', 'heb', N'נָגַהּ', '', N'a primitive root;', '(en-) lighten, (cause to) shine.', 'to glitter; causatively, to illuminate');
INSERT INTO dbo.Strongs VALUES ('H5051', 'n-f', 'no''-gah', 'nôgahh', 'h', 'heb', N'נֹגַהּ', '', N'from 5050;', 'bright(-ness), light, (clear) shining.', 'brilliancy (literally or figuratively)');
INSERT INTO dbo.Strongs VALUES ('H5052', 'n-pr-m', 'no''-gah', 'Nôgahh', 'h', 'x-pn', N'נֹגַהּ', '', N'the same as 5051;', 'Nogah.', 'Nogah, a son of David');
INSERT INTO dbo.Strongs VALUES ('H5053', 'n-f', 'no''-gah', 'nôgahh', 'h', 'arc', N'נֹגַהּ', '', N'(Aramaic) corresponding to 5051;', 'morning.', 'dawn');
INSERT INTO dbo.Strongs VALUES ('H5054', 'n-f', 'neg-o-haw''', 'nᵉgôhâh', 'h', 'heb', N'נְגֹהָה', '', N'feminine of 5051;', 'brightness.', 'splendor');
INSERT INTO dbo.Strongs VALUES ('H5055', 'v', 'naw-gakh''', 'nâgach', 'h', 'heb', N'נָגַח', '', N'a primitive root;', 'gore, push (down, -ing).', 'to butt with the horns; figuratively, to war against');
INSERT INTO dbo.Strongs VALUES ('H5056', 'a', 'nag-gawkh''', 'naggâch', 'h', 'heb', N'נַגָּח', '', N'from 5055;', 'used (wont) to push.', 'butting, i.e. vicious');
INSERT INTO dbo.Strongs VALUES ('H5057', 'n-m', 'naw-gheed''', 'nâgîyd', 'h', 'heb', N'נָגִיד', '', N'or נָגִד; from 5046;', 'captain, chief, excellent thing, (chief) governor, leader, noble, prince, (chief) ruler.', 'a commander (as occupying the front), civil, military or religious; generally (abstractly, plural), honorable themes');
INSERT INTO dbo.Strongs VALUES ('H5058', 'n-f', 'neg-ee-naw''', 'nᵉgîynâh', 'h', 'heb', N'נְגִינָה', '', N'or נְגִינַת; (Psalm 61:title), from 5059;', 'stringed instrument, musick, Neginoth (plural), song.', 'properly, instrumental music; by implication, a stringed instrument; by extension, a poem set to music; specifically, an epigram');
INSERT INTO dbo.Strongs VALUES ('H5059', 'v', 'naw-gan''', 'nâgan', 'h', 'heb', N'נָגַן', '', N'a primitive root;', 'player on instruments, sing to the stringed instruments, melody, ministrel, play(-er, -ing).', 'properly, to thrum, i.e. beat a tune with the fingers; expectation. to play on a stringed instrument; hence (generally), to make music');
INSERT INTO dbo.Strongs VALUES ('H5060', 'v', 'naw-gah''', 'nâgaʻ', 'h', 'heb', N'נָגַע', '', N'a primitive root;', 'beat, (× be able to) bring (down), cast, come (nigh), draw near (nigh), get up, happen, join, near, plague, reach (up), smite, strike, touch.', 'properly, to touch, i.e. lay the hand upon (for any purpose; euphemistically, to lie with a woman); by implication, to reach (figuratively, to arrive, acquire); violently, to strike (punish, defeat, destroy, etc.)');
INSERT INTO dbo.Strongs VALUES ('H5061', 'n-m', 'neh''-gah', 'negaʻ', 'h', 'heb', N'נֶגַע', '', N'from 5060;', 'plague, sore, stricken, stripe, stroke, wound.', 'a blow (figuratively, infliction); also (by implication) a spot (concretely, a leprous person or dress)');
INSERT INTO dbo.Strongs VALUES ('H5062', 'v', 'naw-gaf''', 'nâgaph', 'h', 'heb', N'נָגַף', '', N'a primitive root;', 'beat, dash, hurt, plague, slay, smite (down), strike, stumble, × surely, put to the worse.', 'to push, gore, defeat, stub (the toe), inflict (a disease)');
INSERT INTO dbo.Strongs VALUES ('H5063', 'n-m', 'neh''-ghef', 'negeph', 'h', 'heb', N'נֶגֶף', '', N'from 5062;', 'plague, stumbling.', 'a trip (of the foot); figuratively, an infliction (of disease)');
INSERT INTO dbo.Strongs VALUES ('H5064', 'v', 'naw-gar''', 'nâgar', 'h', 'heb', N'נָגַר', '', N'a primitive root;', 'fall, flow away, pour down (out), run, shed, spilt, trickle down.', 'to flow; figuratively, to stretch out; causatively, to pour out or down; figuratively, to deliver over');
INSERT INTO dbo.Strongs VALUES ('H5065', 'v', 'naw-gas''', 'nâgas', 'h', 'heb', N'נָגַשׂ', '', N'a primitive root;', 'distress, driver, exact(-or), oppress(-or), × raiser of taxes, taskmaster.', 'to drive (an animal, a workman, a debtor, an army); by implication, to tax, harass, tyrannize');
INSERT INTO dbo.Strongs VALUES ('H5066', 'v', 'naw-gash''', 'nâgash', 'h', 'heb', N'נָגַשׁ', '', N'a primitive root;', '(make to) approach (nigh), bring (forth, hither, near), (cause to) come (hither, near, nigh), give place, go hard (up), (be, draw, go) near (nigh), offer, overtake, present, put, stand.', 'to be or come (causatively, bring) near (for any purpose); euphemistically, to lie with a woman; as an enemy, to attack; religious to worship; causatively, to present; figuratively, to adduce an argument; by reversal, to stand back');
INSERT INTO dbo.Strongs VALUES ('H5067', 'n-m', 'nade', 'nêd', 'h', 'heb', N'נֵד', '', N'from 5110 in the sense of piling up;', 'heap.', 'a mound, i.e. wave');
INSERT INTO dbo.Strongs VALUES ('H5068', 'v', 'naw-dab''', 'nâdab', 'h', 'heb', N'נָדַב', '', N'a primitive root;', 'offer freely, be (give, make, offer self) willing(-ly).', 'to impel; hence, to volunteer (as a soldier), to present spontaneously');
INSERT INTO dbo.Strongs VALUES ('H5069', 'v', 'ned-ab''', 'nᵉdab', 'h', 'arc', N'נְדַב', '', N'(Aramaic) corresponding to 5068;', '(be minded of...own) freewill (offering), offer freely (willingly).', 'be (or give) liberal(-ly)');
INSERT INTO dbo.Strongs VALUES ('H5070', 'n-pr-m', 'naw-dawb''', 'Nâdâb', 'h', 'x-pn', N'נָדָב', '', N'from 5068; liberal;', 'Nadab.', 'Nadab, the name of four Israelites');
INSERT INTO dbo.Strongs VALUES ('H5071', 'n-f', 'ned-aw-baw''', 'nᵉdâbâh', 'h', 'heb', N'נְדָבָה', '', N'from 5068;', 'free(-will) offering, freely, plentiful, voluntary(-ily, offering), willing(-ly), offering).', 'properly (abstractly) spontaneity, or (adjectively) spontaneous; also (concretely) a spontaneous or (by inference, in plural) abundant gift');
INSERT INTO dbo.Strongs VALUES ('H5072', 'n-pr-m', 'ned-ab-yaw''', 'Nᵉdabyâh', 'h', 'x-pn', N'נְדַבְיָה', '', N'from 5068 and 3050; largess of Jah;', 'Nedabiah.', 'Nedabjah, an Israelite');
INSERT INTO dbo.Strongs VALUES ('H5073', 'n-m', 'nid-bawk''', 'nidbâk', 'h', 'arc', N'נִדְבָּךְ', '', N'(Aramaic) from a root meaning to stick;', 'row.', 'a layer (of building materials)');
INSERT INTO dbo.Strongs VALUES ('H5074', 'v', 'naw-dad''', 'nâdad', 'h', 'heb', N'נָדַד', '', N'a primitive root;', 'chase (away), × could not, depart, flee (× apace, away), (re-) move, thrust away, wander (abroad, -er, -ing).', 'properly, to wave to and fro (rarely to flap up and down); figuratively, to rove, flee, or (causatively) to drive away');
INSERT INTO dbo.Strongs VALUES ('H5075', 'v', 'ned-ad''', 'nᵉdad', 'h', 'arc', N'נְדַד', '', N'(Aramaic) corresponding to 5074;', 'go from.', 'to depart');
INSERT INTO dbo.Strongs VALUES ('H5076', 'n-m', 'naw-dood''', 'nâdud', 'h', 'heb', N'נָדֻד', '', N'passive participle of 5074;', 'tossing to and fro.', 'properly, tossed; abstractly, a rolling (on the bed)');
INSERT INTO dbo.Strongs VALUES ('H5077', 'v', 'naw-daw''', 'nâdâh', 'h', 'heb', N'נָדָה', '', N'or נָדָא; (2 Kings 17:21), a primitive root;', 'cast out, drive, put far away.', 'properly, to toss; figuratively, to exclude, i.e. banish, postpone, prohibit');
INSERT INTO dbo.Strongs VALUES ('H5078', 'n-m', 'nay''-deh', 'nêdeh', 'h', 'heb', N'נֵדֶה', '', N'from 5077 in the sense of freely flinging money;', 'gifts.', 'a bounty (for prostitution)');
INSERT INTO dbo.Strongs VALUES ('H5079', 'n-f', 'nid-daw''', 'niddâh', 'h', 'heb', N'נִדָּה', '', N'from 5074;', '× far, filthiness, × flowers, menstruous (woman), put apart, × removed (woman), separation, set apart, unclean(-ness, thing, with filthiness).', 'properly, rejection; by implication, impurity, especially personal (menstruation) or moral (idolatry, incest)');
INSERT INTO dbo.Strongs VALUES ('H5080', 'v', 'naw-dakh''', 'nâdach', 'h', 'heb', N'נָדַח', '', N'a primitive root;', 'banish, bring, cast down (out), chase, compel, draw away, drive (away, out, quite), fetch a stroke, force, go away, outcast, thrust away (out), withdraw.', 'to push off; used in a great variety of applications, literally and figuratively (to expel, mislead, strike, inflict, etc.)');
INSERT INTO dbo.Strongs VALUES ('H5081', 'a', 'naw-deeb''', 'nâdîyb', 'h', 'heb', N'נָדִיב', '', N'from 5068;', 'free, liberal (things), noble, prince, willing (hearted).', 'properly, voluntary, i.e. generous; hence, magnanimous; as noun, a grandee (sometimes a tyrant)');
INSERT INTO dbo.Strongs VALUES ('H5082', 'n-f', 'ned-ee-baw''', 'nᵉdîybâh', 'h', 'heb', N'נְדִיבָה', '', N'feminine of 5081;', 'soul.', 'properly, nobility, i.e. reputation');
INSERT INTO dbo.Strongs VALUES ('H5083', 'n-m', 'naw-dawn''', 'nâdân', 'h', 'heb', N'נָדָן', '', N'probably from an unused root meaning to give;', 'gift.', 'a present (for prostitution)');
INSERT INTO dbo.Strongs VALUES ('H5084', 'n-m', 'naw-dawn''', 'nâdân', 'h', 'heb', N'נָדָן', '', N'of uncertain derivation;', 'sheath.', 'a sheath (of a sword)');
INSERT INTO dbo.Strongs VALUES ('H5085', 'n-m', 'nid-neh''', 'nidneh', 'h', 'arc', N'נִדְנֶה', '', N'(Aramaic) from the same as 5084;', 'body.', 'a sheath; figuratively, the body (as the receptacle of the soul)');
INSERT INTO dbo.Strongs VALUES ('H5086', 'v', 'naw-daf''', 'nâdaph', 'h', 'heb', N'נָדַף', '', N'a primitive root;', 'drive (away, to and fro), thrust down, shaken, tossed to and fro.', 'to shove asunder, i.e. disperse');
INSERT INTO dbo.Strongs VALUES ('H5087', 'v', 'naw-dar''', 'nâdar', 'h', 'heb', N'נָדַר', '', N'a primitive root;', '(make a) vow.', 'to promise (pos., to do or give something to God)');
INSERT INTO dbo.Strongs VALUES ('H5088', 'n-m', 'neh''-der', 'neder', 'h', 'heb', N'נֶדֶר', '', N'or נֵדֶר; from 5087;', 'vow(-ed).', 'a promise (to God); also (concretely) a thing promised');
INSERT INTO dbo.Strongs VALUES ('H5089', 'n-m', 'no''-ah', 'nôahh', 'h', 'heb', N'נֹהַּ', '', N'from an unused root meaning to lament;', 'wailing.', 'lamentation');
INSERT INTO dbo.Strongs VALUES ('H5090', 'v', 'naw-hag''', 'nâhag', 'h', 'heb', N'נָהַג', '', N'a primitive root;', 'acquaint, bring (away), carry away, drive (away), lead (away, forth), (be) guide, lead (away, forth).', 'to drive forth (a person, an animal or chariot), i.e. lead, carry away; reflexively, to proceed (i.e. impel or guide oneself); also (from the panting induced by effort), to sigh');
INSERT INTO dbo.Strongs VALUES ('H5091', 'v', 'naw-haw''', 'nâhâh', 'h', 'heb', N'נָהָה', '', N'a primitive root;', 'lament, wail.', 'to groan, i.e. bewail; hence (through the idea of crying aloud), to assemble (as if on proclamation)');
INSERT INTO dbo.Strongs VALUES ('H5092', 'n-m', 'neh-hee''', 'nᵉhîy', 'h', 'heb', N'נְהִי', '', N'from 5091;', 'lamentation, wailing.', 'an elegy');
INSERT INTO dbo.Strongs VALUES ('H5093', 'n-f', 'nih-yaw''', 'nihyâh', 'h', 'heb', N'נִהְיָה', '', N'feminine of 5092;', 'doleful.', 'lamentation');
INSERT INTO dbo.Strongs VALUES ('H5094', 'n-m', 'neh-heere''', 'nᵉhîyr', 'h', 'arc', N'נְהִיר', '', N'(Aramaic) or נְהִירוּ; (Aramaic), from the same as 5105;', 'light.', 'illumination, i.e. (figuratively) wisdom');
INSERT INTO dbo.Strongs VALUES ('H5095', 'v', 'naw-hal''', 'nâhal', 'h', 'heb', N'נָהַל', '', N'a primitive root;', 'carry, feed, guide, lead (gently, on).', 'properly, to run with a sparkle, i.e. flow; hence (transitively), to conduct, and (by inference) to protect, sustain');
INSERT INTO dbo.Strongs VALUES ('H5096', 'n-pr-loc', 'nah-hal-awl''', 'Nahălâl', 'h', 'x-pn', N'נַהֲלָל', '', N'or נַהֲלֹל; the same as 5097;', 'Nahalal, Nahallal, Nahalol.', 'Nahalal or Nahalol, a place in Palestine');
INSERT INTO dbo.Strongs VALUES ('H5097', 'n-m', 'nah-hal-ole''', 'nahălôl', 'h', 'heb', N'נַהֲלֹל', '', N'from 5095;', 'bush.', 'pasture');
INSERT INTO dbo.Strongs VALUES ('H5098', 'v', 'naw-ham''', 'nâham', 'h', 'heb', N'נָהַם', '', N'a primitive root;', 'mourn, roar(-ing).', 'to growl');
INSERT INTO dbo.Strongs VALUES ('H5099', 'n-m', 'nah''-ham', 'naham', 'h', 'heb', N'נַהַם', '', N'from 5098;', 'roaring.', 'a snarl');
INSERT INTO dbo.Strongs VALUES ('H5100', 'n-f', 'neh-haw-maw''', 'nᵉhâmâh', 'h', 'heb', N'נְהָמָה', '', N'feminine of 5099;', 'disquietness, roaring.', 'snarling');
INSERT INTO dbo.Strongs VALUES ('H5101', 'v', 'naw-hak''', 'nâhaq', 'h', 'heb', N'נָהַק', '', N'a primitive root;', 'bray.', 'to bray (as an ass), scream (from hunger)');
INSERT INTO dbo.Strongs VALUES ('H5102', 'v', 'naw-har''', 'nâhar', 'h', 'heb', N'נָהַר', '', N'a primitive root;', 'flow (together), be lightened.', 'to sparkle, i.e. (figuratively) be cheerful; hence (from the sheen of a running stream) to flow, i.e. (figuratively) assemble');
INSERT INTO dbo.Strongs VALUES ('H5103', 'n-m', 'neh-har''', 'nᵉhar', 'h', 'arc', N'נְהַר', '', N'(Aramaic) from a root corresponding to 5102;', 'river, stream.', 'a river, especially the Euphrates');
INSERT INTO dbo.Strongs VALUES ('H5104', 'n-m', 'naw-hawr''', 'nâhâr', 'h', 'heb', N'נָהָר', '', N'from 5102;', 'flood, river.', 'a stream (including the sea; expectation the Nile, Euphrates, etc.); figuratively, prosperity');
INSERT INTO dbo.Strongs VALUES ('H5105', 'n-f', 'neh-haw-raw''', 'nᵉhârâh', 'h', 'heb', N'נְהָרָה', '', N'from 5102 in its original sense;', 'light.', 'daylight');
INSERT INTO dbo.Strongs VALUES ('H5106', 'v', 'noo', 'nûwʼ', 'h', 'heb', N'נוּא', '', N'a primitive root;', 'break, disallow, discourage, make of none effect.', 'to refuse, forbid, dissuade, or neutralize');
INSERT INTO dbo.Strongs VALUES ('H5107', 'v', 'noob', 'nûwb', 'h', 'heb', N'נוּב', '', N'a primitive root;', 'bring forth (fruit), make cheerful, increase.', 'to germinate, i.e. (figuratively) to (causatively, make) flourish; also (of words), to utter');
INSERT INTO dbo.Strongs VALUES ('H5108', 'n-m', 'nobe', 'nôwb', 'h', 'heb', N'נוֹב', '', N'or נֵיב; from 5107;', 'fruit.', 'produce, literally or figuratively');
INSERT INTO dbo.Strongs VALUES ('H5109', 'n-pr-m', 'no-bah''ee', 'Nôwbay', 'h', 'x-pn', N'נוֹבַי', '', N'from 5108; fruitful;', 'Nebai (from the margin).', 'Nobai, an Israelite');
INSERT INTO dbo.Strongs VALUES ('H5110', 'v', 'nood', 'nûwd', 'h', 'heb', N'נוּד', '', N'a primitive root;', 'bemoan, flee, get, mourn, make to move, take pity, remove, shake, skip for joy, be sorry, vagabond, way, wandering.', 'to nod, i.e. waver; figuratively, to wander, flee, disappear; also (from shaking the head in sympathy), to console, deplore, or (from tossing the head in scorn) taunt');
INSERT INTO dbo.Strongs VALUES ('H5111', 'v', 'nood', 'nûwd', 'h', 'arc', N'נוּד', '', N'(Aramaic) corresponding to 5116;', 'get away.', 'to flee');
INSERT INTO dbo.Strongs VALUES ('H5112', 'n-m', 'node', 'nôwd', 'h', 'heb', N'נוֹד', 'lemma נוֹדּ extra dagesh, corrected to נוֹד', N'(only defective נֹד ); from 5110;', 'wandering.', 'exile');
INSERT INTO dbo.Strongs VALUES ('H5113', 'n-pr-loc', 'node', 'Nôwd', 'h', 'x-pn', N'נוֹד', '', N'the same as 5112; vagrancy;', 'Nod.', 'Nod, the land of Cain');
INSERT INTO dbo.Strongs VALUES ('H5114', 'n-pr-m', 'no-dawb''', 'Nôwdâb', 'h', 'x-pn', N'נוֹדָב', '', N'from 5068; noble;', 'Nodab.', 'Nodab, an Arab tribe');
INSERT INTO dbo.Strongs VALUES ('H5115', 'v', 'naw-vaw''', 'nâvâh', 'h', 'heb', N'נָוָה', '', N'a primitive root; (compare 5116)', 'keep at home, prepare an habitation.', 'to rest (as at home); causatively (through the implied idea of beauty), to celebrate (with praises)');
INSERT INTO dbo.Strongs VALUES ('H5116', 'n', 'naw-veh''', 'nâveh', 'h', 'heb', N'נָוֶה', '', N'or (feminine) נָוָה; from 5115;', 'comely, dwelling (place), fold, habitation, pleasant place, sheepcote, stable, tarried.', '(adjectively) at home; hence (by implication of satisfaction) lovely; also (noun) a home, of God (temple), men (residence), flocks (pasture), or wild animals (den)');
INSERT INTO dbo.Strongs VALUES ('H5117', 'v', 'noo''-akh', 'nûwach', 'h', 'heb', N'נוּחַ', '', N'a primitive root;', 'cease, be confederate, lay, let down, (be) quiet, remain, (cause to, be at, give, have, make to) rest, set down. Compare 3241.', 'to rest, i.e. settle down; used in a great variety of applications, literal and figurative, intransitive, transitive and causative (to dwell, stay, let fall, place, let alone, withdraw, give comfort, etc.)');
INSERT INTO dbo.Strongs VALUES ('H5118', 'n-m', 'noo''-akh', 'nûwach', 'h', 'heb', N'נוּחַ', '', N'or נוֹחַ; from 5117;', 'rest(-ed, -ing place).', 'quiet');
INSERT INTO dbo.Strongs VALUES ('H5119', 'n-pr-f', 'no-chaw''', 'Nôwchâh', 'h', 'x-pn', N'נוֹחָה', '', N'feminine of 5118; quietude;', 'Nohah.', 'Nochah, an Israelite');
INSERT INTO dbo.Strongs VALUES ('H5120', 'v', 'noot', 'nûwṭ', 'h', 'heb', N'נוּט', '', N'', 'be moved.', 'to quake');
INSERT INTO dbo.Strongs VALUES ('H5121', 'n-pr-loc', 'naw-veeth''', 'Nâvîyth', 'h', 'x-pn', N'נָוִית', '', N'from 5115; residence;', 'Naioth (from the margin).', 'Navith, a place in Palestine');
INSERT INTO dbo.Strongs VALUES ('H5122', 'n-f', 'nev-aw-loo''', 'nᵉvâlûw', 'h', 'arc', N'נְוָלוּ', '', N'(Aramaic) or נְוָלִי; (Aramaic), from an unused root probably meaning to be foul;', 'dunghill.', 'a sink');
INSERT INTO dbo.Strongs VALUES ('H5123', 'v', 'noom', 'nûwm', 'h', 'heb', N'נוּם', '', N'a primitive root;', 'sleep, slumber.', 'to slumber (from drowsiness)');
INSERT INTO dbo.Strongs VALUES ('H5124', 'n-f', 'noo-maw''', 'nûwmâh', 'h', 'heb', N'נוּמָה', '', N'from 5123;', 'drowsiness.', 'sleepiness');
INSERT INTO dbo.Strongs VALUES ('H5125', 'v', 'noon', 'nûwn', 'h', 'heb', N'נוּן', '', N'a primitive root;', 'be continued.', 'to resprout, i.e. propagate by shoots; figuratively, to be perpetual');
INSERT INTO dbo.Strongs VALUES ('H5126', 'n-pr-m', 'noon', 'Nûwn', 'h', 'x-pn', N'נוּן', '', N'or נוֹן; (1 Chronicles 7:27), from 5125; perpetuity,', 'Non, Nun.', 'Nun or Non, the father of Joshua');
INSERT INTO dbo.Strongs VALUES ('H5127', 'v', 'noos', 'nûwç', 'h', 'heb', N'נוּס', '', N'a primitive root;', '× abate, away, be displayed, (make to) flee (away, -ing), put to flight, × hide, lift up a standard.', 'to flit, i.e. vanish away (subside, escape; causatively, chase, impel, deliver)');
INSERT INTO dbo.Strongs VALUES ('H5128', 'v', 'noo''-ah', 'nûwaʻ', 'h', 'heb', N'נוּעַ', '', N'a primitive root;', 'continually, fugitive, × make, to (go) up and down, be gone away, (be) move(-able, -d), be promoted, reel, remove, scatter, set, shake, sift, stagger, to and fro, be vagabond, wag, (make) wander (up and down).', 'to waver, in a great variety of applications, literally and figuratively (as subjoined)');
INSERT INTO dbo.Strongs VALUES ('H5129', 'n-pr-m n-pr-f', 'no-ad-yaw''', 'Nôwʻadyâh', 'h', 'x-pn', N'נוֹעַדְיָה', '', N'from 3259 and 3050; convened of Jah;', 'Noadiah.', 'Noadjah, the name of an Israelite, and a false prophetess');
INSERT INTO dbo.Strongs VALUES ('H5130', 'v', 'noof', 'nûwph', 'h', 'heb', N'נוּף', '', N'a primitive root;', 'lift up, move, offer, perfume, send, shake, sift, strike, wave.', 'to quiver (i.e. vibrate up and down, or rock to and fro); used in a great variety of applications (including sprinkling, beckoning, rubbing, bastinadoing, sawing, waving, etc.)');
INSERT INTO dbo.Strongs VALUES ('H5131', 'n-m', 'nofe', 'nôwph', 'h', 'heb', N'נוֹף', '', N'from 5130;', 'situation. Compare 5297.', 'elevation');
INSERT INTO dbo.Strongs VALUES ('H5132', 'v', 'noots', 'nûwts', 'h', 'heb', N'נוּץ', '', N'a primitive root;', 'flee away, bud (forth).', 'properly, to flash; also, to fly away (from the quickness of motion)');
INSERT INTO dbo.Strongs VALUES ('H5133', 'n-f', 'no-tsaw''', 'nôwtsâh', 'h', 'heb', N'נוֹצָה', '', N'or נֹצָה; feminine active participle of 5327 in the sense of flying;', 'feather(-s), ostrich.', 'a pinion (or wing feather); often (collectively) plumage');
INSERT INTO dbo.Strongs VALUES ('H5134', 'v', 'nook', 'nûwq', 'h', 'heb', N'נוּק', '', N'a primitive root;', 'nurse.', 'to suckle');
INSERT INTO dbo.Strongs VALUES ('H5135', 'n', 'noor', 'nûwr', 'h', 'arc', N'נוּר', '', N'(Aramaic) from an unused root (corresponding to that of 5216) meaning to shine;', 'fiery, fire.', 'fire');
INSERT INTO dbo.Strongs VALUES ('H5136', 'v', 'noosh', 'nûwsh', 'h', 'heb', N'נוּשׁ', '', N'a primitive root;', 'be full of heaviness.', 'to be sick, i.e. (figuratively) distressed');
INSERT INTO dbo.Strongs VALUES ('H5137', 'v', 'naw-zaw''', 'nâzâh', 'h', 'heb', N'נָזָה', '', N'a primitive root;', 'sprinkle.', 'to spirt, i.e. besprinkle (especially in expiation)');
INSERT INTO dbo.Strongs VALUES ('H5138', 'n-m', 'naw-zeed''', 'nâzîyd', 'h', 'heb', N'נָזִיד', '', N'from 2102;', 'pottage.', 'something boiled, i.e. soup');
INSERT INTO dbo.Strongs VALUES ('H5139', 'n-m', 'naw-zeer''', 'nâzîyr', 'h', 'heb', N'נָזִיר', '', N'or נָזִר; from 5144;', 'Nazarite (by a false alliteration with Nazareth), separate(-d), vine undressed.', 'separate, i.e. consecrated (as prince, a Nazirite); hence (figuratively from the latter) an unpruned vine (like an unshorn Nazirite)');
INSERT INTO dbo.Strongs VALUES ('H5140', 'v', 'naw-zal''', 'nâzal', 'h', 'heb', N'נָזַל', '', N'a primitive root;', 'distil, drop, flood, (cause to) flow(-ing), gush out, melt, pour (down), running water, stream.', 'to drip, or shed by trickling');
INSERT INTO dbo.Strongs VALUES ('H5141', 'n-m', 'neh''-zem', 'nezem', 'h', 'heb', N'נֶזֶם', '', N'from an unused root of uncertain meaning;', 'earring, jewel.', 'a nose-ring');
INSERT INTO dbo.Strongs VALUES ('H5142', 'v', 'nez-ak''', 'nᵉzaq', 'h', 'arc', N'נְזַק', '', N'(Aramaic) corresponding to the root of 5143;', 'have (en-) damage, hurt(-ful).', 'to suffer (causatively, inflict) loss');
INSERT INTO dbo.Strongs VALUES ('H5143', 'n-m', 'nay''zek', 'nêzeq', 'h', 'heb', N'נֵזֶק', '', N'from an unused root meaning to injure;', 'damage.', 'loss');
INSERT INTO dbo.Strongs VALUES ('H5144', 'v', 'naw-zar''', 'nâzar', 'h', 'heb', N'נָזַר', '', N'a primitive root;', 'consecrate, separate(-ing, self).', 'to hold aloof, i.e. (intransitivey) abstain (from food and drink, from impurity, and even from divine worship (i.e. apostatize)); specifically, to set apart (to sacred purposes), i.e. devote');
INSERT INTO dbo.Strongs VALUES ('H5145', 'n-m', 'neh''-zer', 'nezer', 'h', 'heb', N'נֶזֶר', '', N'or נֵזֶר; from 5144;', 'consecration, crown, hair, separation.', 'properly, something set apart, i.e. (abstractly) dedication (of a priet or Nazirite); hence (concretely) unshorn locks; also (by implication) a chaplet (especially of royalty)');
INSERT INTO dbo.Strongs VALUES ('H5146', 'n-pr-m', 'no''-akh', 'Nôach', 'h', 'x-pn', N'נֹחַ', '', N'the same as 5118; rest;', 'Noah.', 'Noach, the patriarch of the flood');
INSERT INTO dbo.Strongs VALUES ('H5147', 'n-pr-m', 'nakh-bee''', 'Nachbîy', 'h', 'x-pn', N'נַחְבִּי', '', N'from 2247; occult;', 'Nakbi.', 'Nachbi, an Israelite');
INSERT INTO dbo.Strongs VALUES ('H5148', 'v', 'naw-khaw''', 'nâchâh', 'h', 'heb', N'נָחָה', '', N'a primitive root;', 'bestow, bring, govern, guide, lead (forth), put, straiten.', 'to guide; by implication, to transport (into exile, or as colonists)');
INSERT INTO dbo.Strongs VALUES ('H5149', 'n-pr-m', 'neh-khoom''', 'Nᵉchûwm', 'h', 'x-pn', N'נְחוּם', '', N'from 5162; comforted;', 'Nehum.', 'Nechum, an Israelite');
INSERT INTO dbo.Strongs VALUES ('H5150', 'n-m', 'nee-khoom''', 'nichûwm', 'h', 'heb', N'נִחוּם', '', N'or נִחֻם; from 5162;', 'comfort(-able), repenting.', 'properly, consoled; abstractly, solace');
INSERT INTO dbo.Strongs VALUES ('H5151', 'n-pr-m', 'nakh-oom''', 'Nachûwm', 'h', 'x-pn', N'נַחוּם', '', N'from 5162; comfortable;', 'Nahum.', 'Nachum, an Israelite prophet');
INSERT INTO dbo.Strongs VALUES ('H5152', 'n-pr-m', 'naw-khore''', 'Nâchôwr', 'h', 'x-pn', N'נָחוֹר', '', N'from the same as 5170; snorer;', 'Nahor.', 'Nachor, the name of the grandfather and a brother of Abraham');
INSERT INTO dbo.Strongs VALUES ('H5153', 'a', 'naw-khoosh''', 'nâchûwsh', 'h', 'heb', N'נָחוּשׁ', '', N'apparently passive participle of 5172 (perhaps in the sense of ringing), i.e. bell-metal; or from the red color of the throat of a serpent (5175, as denominative) when hissing);', 'of brass.', 'coppery, i.e. (figuratively) hard');
INSERT INTO dbo.Strongs VALUES ('H5154', 'n-f', 'nekh-oo-shaw''', 'nᵉchûwshâh', 'h', 'heb', N'נְחוּשָׁה', '', N'or נְחֻשָׁה; feminine of 5153;', 'brass, steel. Compare 5176.', 'copper');
INSERT INTO dbo.Strongs VALUES ('H5155', 'n-f', 'nekh-ee-law''', 'nᵉchîylâh', 'h', 'heb', N'נְחִילָה', '', N'probably denominative from 2485;', '(plural) Nehiloth.', 'a flute');
INSERT INTO dbo.Strongs VALUES ('H5156', 'n-m', 'nekh-eer''', 'nᵉchîyr', 'h', 'heb', N'נְחִיר', '', N'from the same as 5170;', '(dual) nostrils.', 'a nostril');
INSERT INTO dbo.Strongs VALUES ('H5157', 'v', 'naw-khal''', 'nâchal', 'h', 'heb', N'נָחַל', '', N'a primitive root;', 'divide, have (inheritance), take as a heritage, (cause to, give to, make to) inherit, (distribute for, divide (for, for an, by), give for, have, leave for, take (for)) inheritance, (have in, cause to, be made to) possess(-ion).', 'to inherit (as a (figurative) mode of descent), or (generally) to occupy; causatively, to bequeath, or (generally) distribute, instate');
INSERT INTO dbo.Strongs VALUES ('H5158', 'n-m', 'nakh''-al', 'nachal', 'h', 'heb', N'נַחַל', '', N'or (feminine) נַחְלָה; (Psalm 124:4), or נַחֲלָה; (Ezekiel 47:19; Ezekiel 48:28), from 5157 in its original sense;', 'brook, flood, river, stream, valley.', 'a stream, especially a winter torrent; (by implication) a (narrow) valley (in which a brook runs); also a shaft (of a mine)');
INSERT INTO dbo.Strongs VALUES ('H5159', 'n-f', 'nakh-al-aw''', 'nachălâh', 'h', 'heb', N'נַחֲלָה', '', N'from 5157 (in its usual sense);', 'heritage, to inherit, inheritance, possession. Compare 5158.', 'properly, something inherited, i.e. (abstractly) occupancy, or (concretely) an heirloom; generally an estate, patrimony or portion');
INSERT INTO dbo.Strongs VALUES ('H5160', 'n-pr-loc', 'nakh-al-ee-ale''', 'Nachălîyʼêl', 'h', 'x-pn', N'נַחֲלִיאֵל', '', N'from 5158 and 410; valley of God;', 'Nahaliel.', 'Nachaliël, a place in the Desert');
INSERT INTO dbo.Strongs VALUES ('H5161', 'a', 'nekh-el-aw-mee''', 'Nechĕlâmîy', 'h', 'x-pn', N'נֶחֱלָמִי', '', N'apparently a patronymic from an unused name (apparently passive participle of 2492); dreamed;', 'Nehelamite.', 'a Nechelamite, or descendant of Nechlam');
INSERT INTO dbo.Strongs VALUES ('H5162', 'v', 'naw-kham''', 'nâcham', 'h', 'heb', N'נָחַם', '', N'a primitive root;', 'comfort (self), ease (one''s self), repent(-er,-ing, self).', 'properly, to sigh, i.e. breathe strongly; by implication, to be sorry, i.e. (in a favorable sense) to pity, console or (reflexively) rue; or (unfavorably) to avenge (oneself)');
INSERT INTO dbo.Strongs VALUES ('H5163', 'n-pr-m', 'nakh''-am', 'Nacham', 'h', 'x-pn', N'נַחַם', '', N'from 5162; consolation;', 'Naham.', 'Nacham, an Israelite');
INSERT INTO dbo.Strongs VALUES ('H5164', 'n-m', 'no''-kham', 'nôcham', 'h', 'heb', N'נֹחַם', '', N'from 5162;', 'repentance.', 'ruefulness, i.e. desistance');
INSERT INTO dbo.Strongs VALUES ('H5165', 'n-f', 'nekh-aw-maw''', 'nechâmâh', 'h', 'heb', N'נֶחָמָה', '', N'from 5162;', 'comfort.', 'consolation');
INSERT INTO dbo.Strongs VALUES ('H5166', 'n-pr-m', 'nekh-em-yaw''', 'Nᵉchemyâh', 'h', 'x-pn', N'נְחֶמְיָה', '', N'from 5162 and 3050; consolation of Jah;', 'Nehemiah.', 'Nechemjah, the name of three Israelites');
INSERT INTO dbo.Strongs VALUES ('H5167', 'n-pr-m', 'nakh-am-aw-nee''', 'Nachămânîy', 'h', 'x-pn', N'נַחֲמָנִי', '', N'from 5162; consolatory;', 'Nahamani.', 'Nachamani, an Israelite');
INSERT INTO dbo.Strongs VALUES ('H5168', 'p', 'nakh-noo''', 'nachnûw', 'h', 'heb', N'נַחְנוּ', '', N'for 587;', 'we.', 'we');
INSERT INTO dbo.Strongs VALUES ('H5169', 'v', 'naw-khats''', 'nâchats', 'h', 'heb', N'נָחַץ', '', N'a primitive root;', 'require haste.', 'to be urgent');
INSERT INTO dbo.Strongs VALUES ('H5170', 'n-m', 'nakh''-ar', 'nachar', 'h', 'heb', N'נַחַר', '', N'and (feminine) נַחֲרָה; from an unused root meaning to snort or snore;', 'nostrils, snorting.', 'a snorting');
INSERT INTO dbo.Strongs VALUES ('H5171', 'n-pr-m', 'nakh-ar-ah''-ee', 'Nachăray', 'h', 'x-pn', N'נַחֲרַי', '', N'or נַחְרַי; from the same as 5170; snorer;', 'Naharai, Nahari.', 'Nacharai or Nachrai, an Israelite');
INSERT INTO dbo.Strongs VALUES ('H5172', 'v', 'naw-khash''', 'nâchash', 'h', 'heb', N'נָחַשׁ', '', N'a primitive root;', '× certainly, divine, enchanter, (use) × enchantment, learn by experience, × indeed, diligently observe.', 'properly, to hiss, i.e. whisper a (magic) spell; generally, to prognosticate');
INSERT INTO dbo.Strongs VALUES ('H5173', 'n-m', 'nakh''-ash', 'nachash', 'h', 'heb', N'נַחַשׁ', '', N'from 5172;', 'enchantment.', 'an incantation or augury');
INSERT INTO dbo.Strongs VALUES ('H5174', 'n-m', 'nekh-awsh''', 'nᵉchâsh', 'h', 'arc', N'נְחָשׁ', '', N'(Aramaic) corresponding to 5154;', 'brass.', 'copper');
INSERT INTO dbo.Strongs VALUES ('H5175', 'n-m', 'naw-khawsh''', 'nâchâsh', 'h', 'heb', N'נָחָשׁ', '', N'from 5172;', 'serpent.', 'a snake (from its hiss)');
INSERT INTO dbo.Strongs VALUES ('H5176', 'n-pr-m', 'naw-khawsh''', 'Nâchâsh', 'h', 'x-pn', N'נָחָשׁ', '', N'the same as 5175;', 'Nahash.', 'Nachash, the name of two persons apparently non-Israelite');
INSERT INTO dbo.Strongs VALUES ('H5177', 'n-pr-m', 'nakh-shone''', 'Nachshôwn', 'h', 'x-pn', N'נַחְשׁוֹן', '', N'from 5172; enchanter;', 'Naashon, Nahshon.', 'Nachshon, an Israelite');
INSERT INTO dbo.Strongs VALUES ('H5178', 'n-m', 'nekh-o''-sheth', 'nᵉchôsheth', 'h', 'heb', N'נְחֹשֶׁת', '', N'for 5154;', 'brasen, brass, chain, copper, fetter (of brass), filthiness, steel.', 'copper, hence, something made of that metal, i.e. coin, a fetter; figuratively, base (as compared with gold or silver)');
INSERT INTO dbo.Strongs VALUES ('H5179', 'n-pr-f', 'nekh-oosh-taw''', 'Nᵉchushtâʼ', 'h', 'x-pn', N'נְחֻשְׁתָּא', '', N'from 5178; copper;', 'Nehushta.', 'Nechushta, an Israelitess');
INSERT INTO dbo.Strongs VALUES ('H5180', 'n', 'nekh-oosh-tawn''', 'Nᵉchushtân', 'h', 'heb', N'נְחֻשְׁתָּן', '', N'from 5178;', 'Nehushtan.', 'something made of copper, i.e. the copper serpent of the Desert');
INSERT INTO dbo.Strongs VALUES ('H5181', 'v', 'naw-khath''', 'nâchath', 'h', 'heb', N'נָחַת', '', N'a primitive root;', 'be broken, (cause to) come down, enter, go down, press sore, settle, stick fast.', 'to sink, i.e. descend; causatively, to press or lead down');
INSERT INTO dbo.Strongs VALUES ('H5182', 'v', 'nekh-ath''', 'nᵉchath', 'h', 'arc', N'נְחַת', '', N'(Aramaic) corresponding to 5181;', 'carry, come down, depose, lay up, place.', 'to descend; causatively, to bring away, deposit, depose');
INSERT INTO dbo.Strongs VALUES ('H5183', 'n', 'nakh''-ath', 'Nachath', 'h', 'heb', N'נַחַת', '', N'from 5182; also (intransitively; perhaps from 5117)', 'lighting down, quiet(-ness), to rest, be set on.', 'a descent, i.e. imposition, unfavorable (punishment) or favorable (food); restfulness');
INSERT INTO dbo.Strongs VALUES ('H5184', 'n-pr-m', 'nakh''-ath', 'Nachath', 'h', 'x-pn', N'נַחַת', '', N'the same as 5183; quiet;', 'Nahath.', 'Nachath, the name of an Edomite and of two Israelites');
INSERT INTO dbo.Strongs VALUES ('H5185', 'a', 'naw-khayth''', 'nâchêth', 'h', 'heb', N'נָחֵת', '', N'from 5181;', 'come down.', 'descending');
INSERT INTO dbo.Strongs VALUES ('H5186', 'v', 'naw-taw''', 'nâṭâh', 'h', 'heb', N'נָטָה', '', N'a primitive root;', '  afternoon, apply, bow (down, -ing), carry aside, decline, deliver, extend, go down, be gone, incline, intend, lay, let down, offer, outstretched, overthrown, pervert, pitch, prolong, put away, shew, spread (out), stretch (forth, out), take (aside), turn (aside, away), wrest, cause to yield.', 'to stretch or spread out; by implication, to bend away (including moral deflection); used in a great variety of application (as follows)');
INSERT INTO dbo.Strongs VALUES ('H5187', 'a', 'net-eel''', 'nᵉṭîyl', 'h', 'heb', N'נְטִיל', '', N'from 5190;', 'that bear.', 'laden');
INSERT INTO dbo.Strongs VALUES ('H5188', 'n-f', 'net-ee-faw''', 'nᵉṭîyphâh', 'h', 'heb', N'נְטִיפָה', '', N'from 5197;', 'chain, collar.', 'a pendant for the ears (especially of pearls)');
INSERT INTO dbo.Strongs VALUES ('H5189', 'n-f', 'net-ee-shaw''', 'nᵉṭîyshâh', 'h', 'heb', N'נְטִישָׁה', '', N'from 5203;', 'battlement, branch, plant.', 'a tendril (as an offshoot)');
INSERT INTO dbo.Strongs VALUES ('H5190', 'v', 'naw-tal''', 'nâṭal', 'h', 'heb', N'נָטַל', '', N'a primitive root;', 'bear, offer, take up.', 'to lift; by implication, to impose');
INSERT INTO dbo.Strongs VALUES ('H5191', 'v', 'net-al''', 'nᵉṭal', 'h', 'arc', N'נְטַל', '', N'(Aramaic) corresponding to 5190;', 'take up.', 'to raise');
INSERT INTO dbo.Strongs VALUES ('H5192', 'n-m', 'nay''-tel', 'nêṭel', 'h', 'heb', N'נֵטֶל', '', N'; from 5190;', 'weighty.', 'a burden');
INSERT INTO dbo.Strongs VALUES ('H5193', 'v', 'naw-tah''', 'nâṭaʻ', 'h', 'heb', N'נָטַע', '', N'a primitive root;', 'fastened, plant(-er).', 'properly, to strike in, i.e. fix; specifically, to plant (literally or figuratively)');
INSERT INTO dbo.Strongs VALUES ('H5194', 'n-m', 'neh''-tah', 'neṭaʻ', 'h', 'heb', N'נֶטַע', '', N'from 5193;', 'plant.', 'a plant; collectively, a plantation; abstractly, a planting');
INSERT INTO dbo.Strongs VALUES ('H5195', 'n-m', 'naw-tee''-ah', 'nâṭîyaʻ', 'h', 'heb', N'נָטִיעַ', 'xlit nâṭîaʻ corrected to nâṭîyaʻ', N'from 5193;', 'plant.', 'a plant');
INSERT INTO dbo.Strongs VALUES ('H5196', 'n-pr-loc', 'net-aw-eem''', 'Nᵉṭâʻîym', 'h', 'x-pn', N'נְטָעִים', '', N'plural of 5194;', 'plants.', 'Netaim, a place in Palestine');
INSERT INTO dbo.Strongs VALUES ('H5197', 'v', 'naw-taf''', 'nâṭaph', 'h', 'heb', N'נָטַף', '', N'a primitive root;', 'drop(-ping), prophesy(-et).', 'to ooze, i.e. distil gradually; by implication, to fall in drops; figuratively, to speak by inspiration');
INSERT INTO dbo.Strongs VALUES ('H5198', 'n-m', 'naw-tawf''', 'nâṭâph', 'h', 'heb', N'נָטָף', '', N'from 5197;', 'drop, stacte.', 'a drop; specifically, an aromatic gum (probably stacte)');
INSERT INTO dbo.Strongs VALUES ('H5199', 'n-pr-loc', 'net-o-faw''', 'Nᵉṭôphâh', 'h', 'x-pn', N'נְטֹפָה', '', N'from 5197; distillation;', 'Netophah.', 'Netophah, a place in Palestine');
INSERT INTO dbo.Strongs VALUES ('H5200', 'a', 'net-o-faw-thee''', 'Nᵉṭôphâthîy', 'h', 'x-pn', N'נְטֹפָתִי', '', N'patronymic from 5199;', 'Netophathite.', 'a Netophathite, or inhabitant of Netophah');
INSERT INTO dbo.Strongs VALUES ('H5201', 'v', 'naw-tar''', 'nâṭar', 'h', 'heb', N'נָטַר', '', N'a primitive root;', 'bear grudge, keep(-er), reserve.', 'to guard; figuratively, to cherish (anger)');
INSERT INTO dbo.Strongs VALUES ('H5202', 'v', 'net-ar''', 'nᵉṭar', 'h', 'arc', N'נְטַר', '', N'(Aramaic) corresponding to 5201;', 'keep.', 'to retain');
INSERT INTO dbo.Strongs VALUES ('H5203', 'v', 'naw-tash''', 'nâṭash', 'h', 'heb', N'נָטַשׁ', '', N'a primitive root;', 'cast off, drawn, let fall, forsake, join (battle), leave (off), lie still, loose, spread (self) abroad, stretch out, suffer.', 'properly, to pound, i.e. smite; by implication (as if beating out, and thus expanding) to disperse; also, to thrust off, down, out or upon (inclusively, reject, let alone, permit, remit, etc.)');
INSERT INTO dbo.Strongs VALUES ('H5204', 'n-m', 'nee', 'nîy', 'h', 'heb', N'נִי', '', N'a doubtful word; apparently from 5091;', 'wailing.', 'lamentation');
INSERT INTO dbo.Strongs VALUES ('H5205', 'n-m', 'need', 'nîyd', 'h', 'heb', N'נִיד', '', N'from 5110;', 'moving.', 'motion (of the lips in speech)');
INSERT INTO dbo.Strongs VALUES ('H5206', 'n-f', 'nee-daw''', 'nîydâh', 'h', 'heb', N'נִידָה', '', N'feminine of 5205;', 'removed.', 'removal, i.e. exile');
INSERT INTO dbo.Strongs VALUES ('H5207', 'n-m', 'nee-kho''-akh', 'nîychôwach', 'h', 'heb', N'נִיחוֹחַ', '', N'or נִיחֹחַ; from 5117;', 'sweet (odour).', 'properly, restful, i.e. pleasant; abstractly, delight');
INSERT INTO dbo.Strongs VALUES ('H5208', 'n-m', 'nee-kho''-akh', 'nîychôwach', 'h', 'arc', N'נִיחוֹחַ', '', N'(Aramaic) or נִיחֹחַ; (shorter) (Aramaic), corresponding to 5207;', 'sweet odour (savour).', 'pleasure');
INSERT INTO dbo.Strongs VALUES ('H5209', 'n-m', 'neen', 'nîyn', 'h', 'heb', N'נִין', '', N'from 5125;', 'son.', 'progeny');
INSERT INTO dbo.Strongs VALUES ('H5210', 'n-pr-loc', 'nee-nev-ay''', 'Nîynᵉvêh', 'h', 'x-pn', N'נִינְוֵה', '', N'of foreign origin;', 'Nineveh.', 'Nineveh, the capital of Assyria');
INSERT INTO dbo.Strongs VALUES ('H5211', 'n-m', 'neece', 'nîyç', 'h', 'heb', N'נִיס', '', N'from 5127;', 'that fleeth.', 'fugitive');
INSERT INTO dbo.Strongs VALUES ('H5212', 'n', 'nee-sawn''', 'Nîyçân', 'h', 'x-pn', N'נִיסָן', '', N'probably of foreign origin;', 'Nisan.', 'Nisan, the first month of the Jewish sacred year');
INSERT INTO dbo.Strongs VALUES ('H5213', 'n-m', 'nee-tsotes''', 'nîytsôwts', 'h', 'heb', N'נִיצוֹץ', '', N'from 5340;', 'spark.', 'a spark');
INSERT INTO dbo.Strongs VALUES ('H5214', 'v', 'neer', 'nîyr', 'h', 'heb', N'נִיר', '', N'a root probably identical with that of 5216, through the idea of the gleam of a fresh furrow;', 'break up.', 'to till the soil');
INSERT INTO dbo.Strongs VALUES ('H5215', 'n-m', 'neer', 'nîyr', 'h', 'heb', N'נִיר', '', N'or נִר; from 5214;', 'fallow ground, plowing, tillage.', 'properly, plowing, i.e. (concretely) freshly plowed land');
INSERT INTO dbo.Strongs VALUES ('H5216', 'n-m', 'neer', 'nîyr', 'h', 'heb', N'נִיר', '', N'or נִר; also נֵיר; or נֵר; or (feminine) נֵרָה; from a primitive root (see 5214; 5135) properly, meaning to glisten;', 'candle, lamp, light.', 'a lamp (i.e. the burner) or light (literally or figuratively)');
INSERT INTO dbo.Strongs VALUES ('H5217', 'v', 'naw-kaw''', 'nâkâʼ', 'h', 'heb', N'נָכָא', '', N'a primitive root;', 'be viler.', 'to smite, i.e. drive away');
INSERT INTO dbo.Strongs VALUES ('H5218', 'a', 'naw-kay''', 'nâkêʼ', 'h', 'heb', N'נָכֵא', '', N'or נָכָא; from 5217;', 'broken, stricken, wounded.', 'smitten, i.e. (figuratively) afflicted');
INSERT INTO dbo.Strongs VALUES ('H5219', 'n-f', 'nek-ohth''', 'nᵉkôʼth', 'h', 'heb', N'נְכֹאת', '', N'from 5218;', 'spicery(-ces).', 'properly, a smiting, i.e. (concretely) an aromatic gum (perhaps styrax) (as powdered)');
INSERT INTO dbo.Strongs VALUES ('H5220', 'n-m', 'neh''-ked', 'neked', 'h', 'heb', N'נֶכֶד', '', N'from an unused root meaning to propagate;', 'nephew, son''s son.', 'offspring');
INSERT INTO dbo.Strongs VALUES ('H5221', 'v', 'naw-kaw''', 'nâkâh', 'h', 'heb', N'נָכָה', '', N'a primitive root;', 'beat, cast forth, clap, give (wounds), × go forward, × indeed, kill, make (slaughter), murderer, punish, slaughter, slay(-er, -ing), smite(-r, -ing), strike, be stricken, (give) stripes, × surely, wound.', 'to strike (lightly or severely, literally or figuratively)');
INSERT INTO dbo.Strongs VALUES ('H5222', 'a', 'nay-keh''', 'nêkeh', 'h', 'heb', N'נֵכֶה', '', N'from 5221;', 'abject.', 'a smiter, i.e. (figuratively) traducer');
INSERT INTO dbo.Strongs VALUES ('H5223', 'a', 'naw-keh''', 'nâkeh', 'h', 'heb', N'נָכֶה', '', N'', 'contrite, lame.', 'smitten, i.e. (literally) maimed, or (figuratively) dejected');
INSERT INTO dbo.Strongs VALUES ('H5224', 'n-pr-m', 'nek-o''', 'Nᵉkôw', 'h', 'x-pn', N'נְכוֹ', '', N'probably of Egyptian origin;', 'Necho. Compare 6549.', 'Neko, an Egyptian king');
INSERT INTO dbo.Strongs VALUES ('H5225', 'n-pr-m', 'naw-kone''', 'Nâkôwn', 'h', 'x-pn', N'נָכוֹן', '', N'from 3559; prepared;', 'Nachon.', 'Nakon, probably an Israelite');
INSERT INTO dbo.Strongs VALUES ('H5226', 'adv', 'nay''-kakh', 'nêkach', 'h', 'heb', N'נֵכַח', '', N'from an unused root meaning to be straightforward;', 'before, over against.', 'properly, the fore part; used adverbially, opposite');
INSERT INTO dbo.Strongs VALUES ('H5227', 'adv', 'no''-kakh', 'nôkach', 'h', 'heb', N'נֹכַח', '', N'from the same as 5226;', '(over) against, before, direct(-ly), for, right (on).', 'properly, the front part; used adverbially (especially with preposition), opposite, in front of, forward, in behalf of');
INSERT INTO dbo.Strongs VALUES ('H5228', 'a', 'naw-ko''-akh', 'nâkôach', 'h', 'heb', N'נָכֹחַ', '', N'from the same as 5226;', 'plain, right, uprightness.', 'straightforward, i.e. (figuratively), equitable, correct, or (abstractly), integrity');
INSERT INTO dbo.Strongs VALUES ('H5229', 'a-f', 'nek-o-khaw''', 'nᵉkôchâh', 'h', 'heb', N'נְכֹחָה', '', N'feminine of 5228;', 'equity, right (thing), uprightness.', 'properly, straightforwardness, i.e. (figuratively) integrity, or (concretely) a truth');
INSERT INTO dbo.Strongs VALUES ('H5230', 'v', 'naw-kal''', 'nâkal', 'h', 'heb', N'נָכַל', '', N'a primitive root;', 'beguile, conspire, deceiver, deal subtilly.', 'to defraud, i.e. act treacherously');
INSERT INTO dbo.Strongs VALUES ('H5231', 'n-m', 'nay''-kel', 'nêkel', 'h', 'heb', N'נֵכֶל', '', N'from 5230;', 'wile.', 'deceit');
INSERT INTO dbo.Strongs VALUES ('H5232', 'n-m', 'nek-as''', 'nᵉkaç', 'h', 'arc', N'נְכַס', '', N'(Aramaic) corresponding to 5233', 'goods.', '');
INSERT INTO dbo.Strongs VALUES ('H5233', 'n-m', 'neh''-kes', 'nekeç', 'h', 'heb', N'נֶכֶס', '', N'from an unused root meaning to accumulate;', 'riches, wealth.', 'treasure');
INSERT INTO dbo.Strongs VALUES ('H5234', 'v', 'naw-kar''', 'nâkar', 'h', 'heb', N'נָכַר', '', N'a primitive root;', 'acknowledge, × could, deliver, discern, dissemble, estrange, feign self to be another, know, take knowledge (notice), perceive, regard, (have) respect, behave (make) self strange(-ly).', 'properly, to scrutinize, i.e. look intently at; hence (with recognition implied), to acknowledge, be acquainted with, care for, respect, revere, or (with suspicion implied), to disregard, ignore, be strange toward, reject, resign, dissimulate (as if ignorant or disowning)');
INSERT INTO dbo.Strongs VALUES ('H5235', 'n-m', 'neh''-ker', 'neker', 'h', 'heb', N'נֶכֶר', '', N'or נֹכֶר; from 5234;', 'strange.', 'something strange, i.e. unexpected calamity');
INSERT INTO dbo.Strongs VALUES ('H5236', 'n-m', 'nay-kawr''', 'nêkâr', 'h', 'heb', N'נֵכָר', '', N''' from 5234;', 'alien, strange (  -er).', 'foreign, or (concretely) a foreigner, or (abstractly) heathendom');
INSERT INTO dbo.Strongs VALUES ('H5237', 'a', 'nok-ree''', 'nokrîy', 'h', 'heb', N'נׇכְרִי', '', N'from 5235 (second form);', 'alien, foreigner, outlandish, strange(-r, woman).', 'strange, in a variety of degrees and applications (foreign, non-relative, adulterous, different, wonderful)');
INSERT INTO dbo.Strongs VALUES ('H5238', 'n-f', 'nek-oth''', 'nᵉkôth', 'h', 'heb', N'נְכֹת', '', N'probably for 5219;', 'precious things.', 'spicery, i.e. (generally) valuables');
INSERT INTO dbo.Strongs VALUES ('H5239', 'v', 'naw-law''', 'nâlâh', 'h', 'heb', N'נָלָה', '', N'apparently a primitive root;', 'make an end.', 'to complete');
INSERT INTO dbo.Strongs VALUES ('H5240', 'a', 'nem-ib-zeh''', 'nᵉmibzeh', 'h', 'heb', N'נְמִבְזֶה', '', N'from 959,', 'vile.', 'despised');
INSERT INTO dbo.Strongs VALUES ('H5241', 'n-pr-m', 'nem-oo-ale''', 'Nᵉmûwʼêl', 'h', 'x-pn', N'נְמוּאֵל', '', N'apparently for 3223;', 'Nemuel.', 'Nemuel, the name of two Israelites');
INSERT INTO dbo.Strongs VALUES ('H5242', 'a', 'nem-oo-ay-lee''', 'Nᵉmûwʼêlîy', 'h', 'x-pn', N'נְמוּאֵלִי', '', N'from 5241;', 'Nemuelite.', 'a Nemuelite, or descendant of Nemuel');
INSERT INTO dbo.Strongs VALUES ('H5243', 'v', 'naw-mal''', 'nâmal', 'h', 'heb', N'נָמַל', '', N'a primitive root;', '(branch to) be cut down (off), circumcise.', 'to become clipped or (specifically) circumcised');
INSERT INTO dbo.Strongs VALUES ('H5244', 'n-f', 'nem-aw-law''', 'nᵉmâlâh', 'h', 'heb', N'נְמָלָה', '', N'feminine from 5243;', 'ant.', 'an ant (probably from its almost bisected form)');
INSERT INTO dbo.Strongs VALUES ('H5245', 'n-m', 'nem-ar''', 'nᵉmar', 'h', 'arc', N'נְמַר', '', N'(Aramaic) corresponding to 5246', 'leopard.', '');
INSERT INTO dbo.Strongs VALUES ('H5246', 'n-m', 'naw-mare''', 'nâmêr', 'h', 'heb', N'נָמֵר', '', N'from an unused root meaning properly, to filtrate, i.e. be limpid (comp 5247 and 5249); and thus to spot or stain as if by dripping;', 'leopard.', 'a leopard (from its stripes)');
INSERT INTO dbo.Strongs VALUES ('H5247', 'n-pr-loc', 'nim-raw''', 'Nimrâh', 'h', 'x-pn', N'נִמְרָה', '', N'from the same as 5246; clear water;', 'Nimrah. See also 1039, 5249.', 'Nimrah, a place East of the Jordan');
INSERT INTO dbo.Strongs VALUES ('H5248', 'n-pr-m', 'nim-rode''', 'Nimrôwd', 'h', 'x-pn', N'נִמְרוֹד', '', N'or נִמְרֹד; probably of foreign origin;', 'Nimrod.', 'Nimrod, a son of Cush');
INSERT INTO dbo.Strongs VALUES ('H5249', 'n-pr-loc', 'nim-reem''', 'Nimrîym', 'h', 'x-pn', N'נִמְרִים', '', N'plural of a masculine corresponding to 5247; clear waters;', 'Nimrim. Compare 1039.', 'Nimrim, a place East of the Jordan');
INSERT INTO dbo.Strongs VALUES ('H5250', 'n-pr-m', 'nim-shee''', 'Nimshîy', 'h', 'x-pn', N'נִמְשִׁי', '', N'probably from 4871; extricated;', 'Nimshi.', 'Nimshi, the (grand-) father of Jehu');
INSERT INTO dbo.Strongs VALUES ('H5251', 'n-m', 'nace', 'nêç', 'h', 'heb', N'נֵס', '', N'from 5264;', 'banner, pole, sail, (en-) sign, standard.', 'a flag; also a sail; by implication, a flagstaff; generally a signal; figuratively, a token');
INSERT INTO dbo.Strongs VALUES ('H5252', 'n-f', 'nes-ib-baw''', 'nᵉçibbâh', 'h', 'heb', N'נְסִבָּה', '', N'feminine participle passive of 5437;', 'cause.', 'properly, an environment, i.e. circumstance or turn of affairs');
INSERT INTO dbo.Strongs VALUES ('H5253', 'v', 'naw-sag''', 'nâçag', 'h', 'heb', N'נָסַג', '', N'a primitive root;', 'departing away, remove, take (hold), turn away.', 'to retreat');
INSERT INTO dbo.Strongs VALUES ('H5254', 'v', 'naw-saw''', 'nâçâh', 'h', 'heb', N'נָסָה', '', N'a primitive root;', 'adventure, assay, prove, tempt, try.', 'to test; by implication, to attempt');
INSERT INTO dbo.Strongs VALUES ('H5255', 'v', 'naw-sakh''', 'nâçach', 'h', 'heb', N'נָסַח', '', N'a primitive root;', 'destroy, pluck, root.', 'to tear away');
INSERT INTO dbo.Strongs VALUES ('H5256', 'v', 'nes-akh''', 'nᵉçach', 'h', 'arc', N'נְסַח', '', N'(Aramaic) corresponding to 5255', 'pull down.', '');
INSERT INTO dbo.Strongs VALUES ('H5257', 'n-m', 'nes-eek''', 'nᵉçîyk', 'h', 'heb', N'נְסִיךְ', '', N'from 5258;', 'drink offering, duke, prince(-ipal).', 'properly, something poured out, i.e. a libation; also a molten image; by implication, a prince (as anointed)');
INSERT INTO dbo.Strongs VALUES ('H5258', 'v', 'naw-sak''', 'nâçak', 'h', 'heb', N'נָסַךְ', '', N'a primitive root;', 'cover, melt, offer, (cause to) pour (out), set (up).', 'to pour out, especially a libation, or to cast (metal); by analogy, to anoint a king');
INSERT INTO dbo.Strongs VALUES ('H5259', 'v', 'naw-sak''', 'nâçak', 'h', 'heb', N'נָסַךְ', '', N'a primitive root (probably identical with 5258 through the idea of fusion);', 'that is spread.', 'to interweave, i.e. (figuratively) to overspread');
INSERT INTO dbo.Strongs VALUES ('H5260', 'v', 'nes-ak''', 'nᵉçak', 'h', 'arc', N'נְסַךְ', '', N'(Aramaic) corresponding to 5258;', 'offer.', 'to pour out a libation');
INSERT INTO dbo.Strongs VALUES ('H5261', 'n-m', 'nes-ak''', 'nᵉçak', 'h', 'arc', N'נְסַךְ', '', N'(Aramaic) corresponding to 5262;', 'drink offering.', 'a libation');
INSERT INTO dbo.Strongs VALUES ('H5262', 'n-m', 'neh''-sek', 'neçek', 'h', 'heb', N'נֶסֶךְ', '', N'or נֵסֶךְ; from 5258;', 'cover, drink offering, molten image.', 'a libation; also a cast idol');
INSERT INTO dbo.Strongs VALUES ('H5263', 'v', 'naw-sas''', 'nâçaç', 'h', 'heb', N'נָסַס', '', N'a primitive root;', 'faint.', 'to wane, i.e. be sick');
INSERT INTO dbo.Strongs VALUES ('H5264', 'v', 'naw-sas''', 'nâçaç', 'h', 'heb', N'נָסַס', '', N'a primitive root; to gleam from afar, i.e. to be conspicuous as a signal; or rather perhaps a denominative from 5251 (and identical with 5263, through the idea of a flag as fluttering in the wind);', 'lift up as an ensign.', 'to raise a beacon');
INSERT INTO dbo.Strongs VALUES ('H5265', 'v', 'naw-sah''', 'nâçaʻ', 'h', 'heb', N'נָסַע', '', N'a primitive root;', 'cause to blow, bring, get, (make to) go (away, forth, forward, onward, out), (take) journey, march, remove, set aside (forward), × still, be on his (go their) way.', 'properly, to pull up, especially the tent-pins, i.e. start on a journey');
INSERT INTO dbo.Strongs VALUES ('H5266', 'v', 'naw-sak''', 'nâçaq', 'h', 'heb', N'נָסַק', '', N'a primitive root;', 'ascend.', 'to go up');
INSERT INTO dbo.Strongs VALUES ('H5267', 'v', 'nes-ak''', 'nᵉçaq', 'h', 'arc', N'נְסַק', '', N'(Aramaic) corresponding to 5266', 'take up.', '');
INSERT INTO dbo.Strongs VALUES ('H5268', 'n-pr-m', 'nis-roke''', 'Niçrôk', 'h', 'x-pn', N'נִסְרֹךְ', 'lemma נְסִרֹךְ first vowel, corrected to נִסְרֹךְ', N'of foreign origin;', 'Nisroch.', 'Nisrok, a Babylonian idol');
INSERT INTO dbo.Strongs VALUES ('H5269', 'n-pr-loc', 'nay-aw''', 'Nêʻâh', 'h', 'x-pn', N'נֵעָה', '', N'from 5128; motion;', 'Neah.', 'Neah, a place in Palestine');
INSERT INTO dbo.Strongs VALUES ('H5270', 'n-pr-f', 'no-aw''', 'Nôʻâh', 'h', 'x-pn', N'נֹעָה', '', N'from 5128; movement;', 'Noah.', 'Noah, an Israelitess');
INSERT INTO dbo.Strongs VALUES ('H5271', 'n-m n-f', 'naw-oor''', 'nâʻûwr', 'h', 'heb', N'נָעוּר', '', N'or נָעֻר; and (feminine) נְעֻרָה; properly, passive participle from 5288 as denominative;', 'childhood, youth.', '(only in plural collective or emphatic form) youth, the state (juvenility) or the persons (young people)');
INSERT INTO dbo.Strongs VALUES ('H5272', 'n-pr-loc', 'neh-ee-ale''', 'Nᵉʻîyʼêl', 'h', 'x-pn', N'נְעִיאֵל', '', N'from 5128 and 410; moved of God;', 'Neiel.', 'Neiel, a place in Palestine');
INSERT INTO dbo.Strongs VALUES ('H5273', 'a', 'naw-eem''', 'nâʻîym', 'h', 'heb', N'נָעִים', '', N'from 5276;', 'pleasant(-ure), sweet.', 'delightful (objective or subjective, literal or figurative)');
INSERT INTO dbo.Strongs VALUES ('H5274', 'v', 'naw-al''', 'nâʻal', 'h', 'heb', N'נָעַל', '', N'a primitive root; also denominative from 5275', 'bolt, inclose, lock, shoe, shut up.', 'properly, to fasten up, i.e. with a bar or cord; hence, to sandal, i.e. furnish with slippers');
INSERT INTO dbo.Strongs VALUES ('H5275', 'n-f', 'nah''-al', 'naʻal', 'h', 'heb', N'נַעַל', '', N'or (feminine) נַעֲלָה; from 5274;', 'dryshod, (pair of) shoe((-latchet), -s).', 'properly, a sandal tongue; by extension a sandal or slipper (sometimes as a symbol of occupancy, a refusal to marry, or of something valueless)');
INSERT INTO dbo.Strongs VALUES ('H5276', 'v', 'naw-ame''', 'nâʻêm', 'h', 'heb', N'נָעֵם', '', N'a primitive root;', 'pass in beauty, be delight, be pleasant, be sweet.', 'to be agreeable (literally or figuratively)');
INSERT INTO dbo.Strongs VALUES ('H5277', 'n-pr-m', 'nah''-am', 'Naʻam', 'h', 'x-pn', N'נַעַם', '', N'from 5276; pleasure;', 'Naam.', 'Naam, an Israelite');
INSERT INTO dbo.Strongs VALUES ('H5278', 'n-m', 'no''-am', 'nôʻam', 'h', 'heb', N'נֹעַם', '', N'from 5276;', 'beauty, pleasant(-ness).', 'agreeableness, i.e. delight, suitableness, splendor or grace');
INSERT INTO dbo.Strongs VALUES ('H5279', 'n-pr-f n-pr-loc', 'nah-am-aw''', 'Naʻămâh', 'h', 'x-pn', N'נַעֲמָה', '', N'feminine of 5277; pleasantness;', 'Naamah.', 'Naamah, the name of an antediluvian woman, of an Ammonitess, and of a place in Palestine');
INSERT INTO dbo.Strongs VALUES ('H5280', 'a', 'nah-am-ee''', 'Naʻămîy', 'h', 'x-pn', N'נַעֲמִי', '', N'patronymic from 5283;', 'Naamites.', 'a Naamanite, or descendant of Naaman (collectively)');
INSERT INTO dbo.Strongs VALUES ('H5281', 'n-pr-f', 'no-om-ee''', 'Noʻŏmîy', 'h', 'x-pn', N'נׇעֳמִי', '', N'from 5278; pleasant;', 'Naomi.', 'Noömi, an Israelitess');
INSERT INTO dbo.Strongs VALUES ('H5282', 'n-m', 'nah-am-awn''', 'naʻămân', 'h', 'heb', N'נַעֲמָן', '', N'from 5276;', 'pleasant.', 'pleasantness (plural as concrete)');
INSERT INTO dbo.Strongs VALUES ('H5283', 'n-pr-m', 'nah-am-awn''', 'Naʻămân', 'h', 'x-pn', N'נַעֲמָן', '', N'the same as 5282;', 'Naaman.', 'Naaman, the name of an Israelite and of a Damascene');
INSERT INTO dbo.Strongs VALUES ('H5284', 'a', 'nah-am-aw-thee''', 'Naʻămâthîy', 'h', 'x-pn', N'נַעֲמָתִי', '', N'patrial from a place corresponding in name (but not identical) with 5279;', 'Naamathite.', 'a Naamathite, or inhabitant of Naamah');
INSERT INTO dbo.Strongs VALUES ('H5285', 'n-m', 'nah-ats-oots''', 'naʻătsûwts', 'h', 'heb', N'נַעֲצוּץ', '', N'from an unused root meaning to prick;', 'thorn.', 'probably a brier; by implication, a thicket of thorny bushes');
INSERT INTO dbo.Strongs VALUES ('H5286', 'v', 'naw-ar''', 'nâʻar', 'h', 'heb', N'נָעַר', '', N'a primitive root;', 'yell.', 'to growl');
INSERT INTO dbo.Strongs VALUES ('H5287', 'v', 'naw-ar''', 'nâʻar', 'h', 'heb', N'נָעַר', '', N'a primitive root (probably identical with 5286, through the idea of the rustling of mane, which usually accompanies the lion''s roar);', 'shake (off, out, self), overthrow, toss up and down.', 'to tumble about');
INSERT INTO dbo.Strongs VALUES ('H5288', 'n-m', 'nah''-ar', 'naʻar', 'h', 'heb', N'נַעַר', '', N'from 5287;', 'babe, boy, child, damsel (from the margin), lad, servant, young (man).', '(concretely) a boy (as active), from the age of infancy to adolescence; by implication, a servant; also (by interch. of sex), a girl (of similar latitude in age)');
INSERT INTO dbo.Strongs VALUES ('H5289', 'n-m', 'nah''-ar', 'naʻar', 'h', 'heb', N'נַעַר', '', N'from 5287 in its derivative sense of tossing about;', 'young one.', 'a wanderer');
INSERT INTO dbo.Strongs VALUES ('H5290', 'n-m', 'no''-ar', 'nôʻar', 'h', 'heb', N'נֹעַר', '', N'from 5287; (compare 5288)', 'child, youth.', '(abstractly) boyhood');
INSERT INTO dbo.Strongs VALUES ('H5291', 'n-f', 'nah-ar-aw''', 'naʻărâh', 'h', 'heb', N'נַעֲרָה', '', N'feminine of 5288;', 'damsel, maid(-en), young (woman).', 'a girl (from infancy to adolescence)');
INSERT INTO dbo.Strongs VALUES ('H5292', 'n-pr-loc n-pr-f', 'nah-ar-aw''', 'Naʻărâh', 'h', 'x-pn', N'נַעֲרָה', '', N'the same as 5291;', 'Naarah, Naarath.', 'Naarah, the name of an Israelitess, and of a place in Palestine');
INSERT INTO dbo.Strongs VALUES ('H5293', 'n-pr-m', 'nah-ar-ah''-ee', 'Naʻăray', 'h', 'x-pn', N'נַעֲרַי', '', N'from 5288; youthful;', 'Naarai.', 'Naarai, an Israelite');
INSERT INTO dbo.Strongs VALUES ('H5294', 'n-pr-m', 'neh-ar-yaw''', 'Nᵉʻaryâh', 'h', 'x-pn', N'נְעַרְיָה', '', N'from 5288 and 3050; servant of Jah;', 'Neariah.', 'Nearjah, the name of two Israelites');
