INSERT INTO dbo.Strongs VALUES ('H5296', 'n-f', 'neh-o''-reth', 'nᵉʻôreth', 'h', 'heb', N'נְעֹרֶת', '', N'from 5287;', 'tow.', 'something shaken out, i.e. tow (as the refuse of flax)');
INSERT INTO dbo.Strongs VALUES ('H5297', 'n-pr-loc', 'nofe', 'Nôph', 'h', 'x-pn', N'נֹף', '', N'a variation of 4644;', 'Noph.', 'Noph, the capital of Upper Egypt');
INSERT INTO dbo.Strongs VALUES ('H5298', 'n-pr-m', 'neh''-feg', 'Nepheg', 'h', 'x-pn', N'נֶפֶג', '', N'from an unused root probably meaning to spring forth; a sprout;', 'Nepheg.', 'Nepheg, the name of two Israelites');
INSERT INTO dbo.Strongs VALUES ('H5299', 'n-f', 'naw-faw''', 'nâphâh', 'h', 'heb', N'נָפָה', '', N'from 5130 in the sense of lifting;', 'border, coast, region, sieve.', 'a sieve');
INSERT INTO dbo.Strongs VALUES ('H5300', 'n', 'nef-oo-shes-eem''', 'Nᵉphûwshᵉçîym', 'h', 'x-pn', N'נְפוּשְׁסִים', '', N'for 5304;', 'Nephisesim (from the margin).', 'Nephushesim, a Temple-servant');
INSERT INTO dbo.Strongs VALUES ('H5301', 'v', 'naw-fakh''', 'nâphach', 'h', 'heb', N'נָפַח', '', N'a primitive root;', 'blow, breath, give up, cause to lose (life), seething, snuff.', 'to puff, in various applications (literally, to inflate, blow hard, scatter, kindle, expire; figuratively, to disesteem)');
INSERT INTO dbo.Strongs VALUES ('H5302', 'n-pr-loc', 'no''-fakh', 'Nôphach', 'h', 'x-pn', N'נֹפַח', '', N'from 5301; a gust;', 'Nophah.', 'Nophach, a place in Moab');
INSERT INTO dbo.Strongs VALUES ('H5303', 'n-m', 'nef-eel''', 'nᵉphîyl', 'h', 'heb', N'נְפִיל', '', N'or נְפִל; from 5307;', 'giant.', 'properly, a feller, i.e. a bully or tyrant');
INSERT INTO dbo.Strongs VALUES ('H5304', 'n-pr', 'nef-ee-seem''', 'Nᵉphîyçîym', 'h', 'x-pn', N'נְפִיסִים', '', N'plural from an unused root meaning to scatter; expansions;', 'Nephusim (from the margin).', 'Nephisim, a Temple-servant');
INSERT INTO dbo.Strongs VALUES ('H5305', 'n-pr-m', 'naw-feesh''', 'Nâphîysh', 'h', 'x-pn', N'נָפִישׁ', '', N'from 5314; refreshed;', 'Naphish.', 'Naphish, a son of Ishmael, and his posterity');
INSERT INTO dbo.Strongs VALUES ('H5306', 'n-m', 'no''-fek', 'nôphek', 'h', 'heb', N'נֹפֶךְ', '', N'from an unused root meaning to glisten;', 'emerald.', 'shining; a gem, probably the garnet');
INSERT INTO dbo.Strongs VALUES ('H5307', 'v', 'naw-fal''', 'nâphal', 'h', 'heb', N'נָפַל', '', N'a primitive root;', 'be accepted, cast (down, self, (lots), out), cease, die, divide (by lot), (let) fail, (cause to, let, make, ready to) fall (away, down, -en, -ing), fell(-ing), fugitive, have (inheritance), inferior, be judged (by mistake for 6419), lay (along), (cause to) lie down, light (down), be (× hast) lost, lying, overthrow, overwhelm, perish, present(-ed, -ing), (make to) rot, slay, smite out, × surely, throw down.', 'to fall, in a great variety of applications (intransitive or causative, literal or figurative)');
INSERT INTO dbo.Strongs VALUES ('H5308', 'v', 'nef-al''', 'nᵉphal', 'h', 'arc', N'נְפַל', '', N'(Aramaic) corresponding to 5307', 'fall (down), have occasion.', '');
INSERT INTO dbo.Strongs VALUES ('H5309', 'n-m', 'neh''-fel', 'nephel', 'h', 'heb', N'נֶפֶל', '', N'or נֵפֶל; from 5307;', 'untimely birth.', 'something fallen, i.e. an abortion');
INSERT INTO dbo.Strongs VALUES ('H5310', 'v', 'naw-fats''', 'nâphats', 'h', 'heb', N'נָפַץ', '', N'a primitive root;', 'be beaten in sunder, break (in pieces), broken, dash (in pieces), cause to be discharged, dispersed, be overspread, scatter.', 'to dash to pieces, or scatter');
INSERT INTO dbo.Strongs VALUES ('H5311', 'n-m', 'neh''-fets', 'nephets', 'h', 'heb', N'נֶפֶץ', '', N'from 5310;', 'scattering.', 'a storm (as dispersing)');
INSERT INTO dbo.Strongs VALUES ('H5312', 'v', 'nef-ak''', 'nᵉphaq', 'h', 'arc', N'נְפַק', '', N'(Aramaic) a primitive root;', 'come (go, take) forth (out).', 'to issue; causatively, to bring out');
INSERT INTO dbo.Strongs VALUES ('H5313', 'n-f', 'nif-kaw''', 'niphqâʼ', 'h', 'arc', N'נִפְקָא', '', N'(Aramaic) from 5312;', 'expense.', 'an outgo, i.e. expense');
INSERT INTO dbo.Strongs VALUES ('H5314', 'v', 'naw-fash''', 'nâphash', 'h', 'heb', N'נָפַשׁ', '', N'a primitive root;', '(be) refresh selves (-ed).', 'to breathe; passively, to be breathed upon , i.e. (figuratively) refreshed (as if by a current of air)');
INSERT INTO dbo.Strongs VALUES ('H5315', 'n-f', 'neh''-fesh', 'nephesh', 'h', 'heb', N'נֶפֶשׁ', '', N'from 5314;', 'any, appetite, beast, body, breath, creature, × dead(-ly), desire, × (dis-) contented, × fish, ghost,   greedy, he, heart(-y), (hath, × jeopardy of) life (× in jeopardy), lust, man, me, mind, mortally, one, own, person, pleasure, (her-, him-, my-, thy-) self, them (your) -selves,   slay, soul,   tablet, they, thing, (× she) will, × would have it.', 'properly, a breathing creature, i.e. animal of (abstractly) vitality; used very widely in a literal, accommodated or figurative sense (bodily or mental)');
INSERT INTO dbo.Strongs VALUES ('H5316', 'n-f', 'neh''-feth', 'nepheth', 'h', 'heb', N'נֶפֶת', '', N'for 5299;', 'country.', 'a height');
INSERT INTO dbo.Strongs VALUES ('H5317', 'n-m', 'no''-feth', 'nôpheth', 'h', 'heb', N'נֹפֶת', '', N'from 5130 in the sense of shaking to pieces;', 'honeycomb.', 'a dripping i.e. of honey (from the comb)');
INSERT INTO dbo.Strongs VALUES ('H5318', 'n-pr-loc', 'nef-to''-akh', 'Nephtôwach', 'h', 'x-pn', N'נֶפְתּוֹחַ', '', N'from 6605; opened, i.e. a spring;', 'Neptoah.', 'Nephtoach, a place in Palestine');
INSERT INTO dbo.Strongs VALUES ('H5319', 'n-m', 'naf-tool''', 'naphtûwl', 'h', 'heb', N'נַפְתּוּל', '', N'from 6617;', 'wrestling.', 'properly, wrestled; but used (in the plural) transitively, a struggle');
INSERT INTO dbo.Strongs VALUES ('H5320', 'n-pr-loc', 'naf-too-kheem', 'Naphtuchîym', 'h', 'x-pn', N'נַפְתֻּחִים', '', N'plural of foreign origin,', 'Naptuhim.', 'Naphtuchim, an Egyptian tribe');
INSERT INTO dbo.Strongs VALUES ('H5321', 'n-pr-m n-pr-loc', 'naf-taw-lee''', 'Naphtâlîy', 'h', 'x-pn', N'נַפְתָּלִי', '', N'from 6617; my wrestling;', 'Naphtali.', 'Naphtali, a son of Jacob, with the tribe descended from him, and its territory');
INSERT INTO dbo.Strongs VALUES ('H5322', 'n-m', 'nayts', 'nêts', 'h', 'heb', N'נֵץ', '', N'from 5340;', 'blossom, hawk.', 'a flower (from its brilliancy); also a hawk (from it flashing speed)');
INSERT INTO dbo.Strongs VALUES ('H5323', 'v', 'naw-tsaw''', 'nâtsâʼ', 'h', 'heb', N'נָצָא', '', N'a primitive root;', 'flee.', 'to go away');
INSERT INTO dbo.Strongs VALUES ('H5324', 'v', 'naw-tsab''', 'nâtsab', 'h', 'heb', N'נָצַב', '', N'a primitive root;', 'appointed, deputy, erect, establish, × Huzzah (by mistake for a proper name), lay, officer, pillar, present, rear up, set (over, up), settle, sharpen, establish, (make to) stand(-ing, still, up, upright), best state.', 'to station, in various applications (literally or figuratively)');
INSERT INTO dbo.Strongs VALUES ('H5325', 'n-m', 'nits-twawb''', 'nitstsâb', 'h', 'heb', N'נִצָּב', '', N'passive participle of 5324;', 'haft.', 'fixed, i.e. a handle');
INSERT INTO dbo.Strongs VALUES ('H5326', 'n-f', 'nits-baw''', 'nitsbâh', 'h', 'arc', N'נִצְבָּה', '', N'(Aramaic) from a root corresponding to 5324;', 'strength.', 'fixedness, i.e. firmness');
INSERT INTO dbo.Strongs VALUES ('H5327', 'v', 'naw-tsaw''', 'nâtsâh', 'h', 'heb', N'נָצָה', '', N'a primitive root;', 'be laid waste, runinous, strive (together).', 'properly, to go forth, i.e. (by implication) to be expelled, and (consequently) desolate; causatively, to lay waste; also (specifically), to quarrel');
INSERT INTO dbo.Strongs VALUES ('H5328', 'n-f', 'nits-tsaw''', 'nitstsâh', 'h', 'heb', N'נִצָּה', '', N'feminine of 5322;', 'flower.', 'a blossom');
INSERT INTO dbo.Strongs VALUES ('H5329', 'v', 'naw-tsakh''', 'nâtsach', 'h', 'heb', N'נָצַח', '', N'a primitive root; also as denominative from 5331', 'excel, chief musician (singer), oversee(-r), set forward.', 'properly, to glitter from afar, i.e. to be eminent (as a superintendent, especially of the Temple services and its music); to be permanent');
INSERT INTO dbo.Strongs VALUES ('H5330', 'v', 'nets-akh''', 'nᵉtsach', 'h', 'arc', N'נְצַח', '', N'(Aramaic) corresponding to 5329;', 'be preferred.', 'to become chief');
INSERT INTO dbo.Strongs VALUES ('H5331', 'n-m', 'neh''-tsakh', 'netsach', 'h', 'heb', N'נֶצַח', '', N'or נֵצַח; from 5329;', 'alway(-s), constantly, end, (  n-) ever(more), perpetual, strength, victory.', 'properly, a goal, i.e. the bright object at a distance travelled towards; hence (figuratively), splendor, or (subjectively) truthfulness, or (objectively) confidence; but usually (adverbially), continually (i.e. to the most distant point of view)');
INSERT INTO dbo.Strongs VALUES ('H5332', 'n-m', 'nay''-tsakh', 'Nêtsach', 'h', 'heb', N'נֵצַח', '', N'probably identical with 5331, through the idea of brilliancy of color;', 'blood, strength.', 'juice of the grape (as blood red)');
INSERT INTO dbo.Strongs VALUES ('H5333', 'n-m', 'nets-eeb''', 'nᵉtsîyb', 'h', 'heb', N'נְצִיב', '', N'or נְצִב; from 5324;', 'garrison, officer, pillar.', 'something stationary, i.e. a prefect, a military post, a statue');
INSERT INTO dbo.Strongs VALUES ('H5334', 'n-pr-loc', 'nets-eeb''', 'Nᵉtsîyb', 'h', 'x-pn', N'נְצִיב', '', N'the same as 5333; station;', 'Nezib.', 'Netsib, a place in Palestine');
INSERT INTO dbo.Strongs VALUES ('H5335', 'n-pr-m', 'nets-ee''-akh', 'nᵉtsîyach', 'h', 'x-pn', N'נְצִיחַ', '', N'from 5329; conspicuous;', 'Neziah.', 'Netsiach, a Temple-servant');
INSERT INTO dbo.Strongs VALUES ('H5336', 'a', 'naw-tsere''', 'nâtsîyr', 'h', 'heb', N'נָצִיר', '', N'from 5341;', 'preserved.', 'properly, conservative; but used passively, delivered');
INSERT INTO dbo.Strongs VALUES ('H5337', 'v', 'naw-tsal''', 'nâtsal', 'h', 'heb', N'נָצַל', '', N'a primitive root;', '× at all, defend, deliver (self), escape, × without fail, part, pluck, preserve, recover, rescue, rid, save, spoil, strip, × surely, take (out).', 'to snatch away, whether in a good or a bad sense');
INSERT INTO dbo.Strongs VALUES ('H5338', 'v', 'nets-al''', 'nᵉtsal', 'h', 'arc', N'נְצַל', '', N'(Aramaic) corresponding to 5337;', 'deliver, rescue.', 'to extricate');
INSERT INTO dbo.Strongs VALUES ('H5339', 'n-m', 'nits-tsawn''', 'nitstsân', 'h', 'heb', N'נִצָּן', '', N'from 5322;', 'flower.', 'a blossom');
INSERT INTO dbo.Strongs VALUES ('H5340', 'v', 'naw-tsats''', 'nâtsats', 'h', 'heb', N'נָצַץ', '', N'a primitive root;', 'sparkle.', 'to glare, i.e. be bright-colored');
