INSERT INTO dbo.Strongs VALUES ('H5343', 'a', 'nek-ay''', 'nᵉqêʼ', 'h', 'arc', N'נְקֵא', '', N'(Aramaic) from a root corresponding to 5352;', 'pure.', 'clean');
