INSERT INTO dbo.Strongs VALUES ('H5347', 'n-f', 'nek-ay-baw''', 'nᵉqêbâh', 'h', 'heb', N'נְקֵבָה', '', N'from 5344;', 'female.', 'female (from the sexual form)');
INSERT INTO dbo.Strongs VALUES ('H5348', 'a', 'naw-kode''', 'nâqôd', 'h', 'heb', N'נָקֹד', '', N'from an unused root meaning to mark (by puncturing or branding);', 'speckled.', 'spotted');
