INSERT INTO dbo.Strongs VALUES ('H5350', 'n-m', 'nik-kood''', 'niqqud', 'h', 'heb', N'נִקֻּד', '', N'from the same as 5348;', 'cracknel, mouldy.', 'a crumb (as broken to spots); also a biscuit (as pricked)');
INSERT INTO dbo.Strongs VALUES ('H5351', 'n-f', 'ned-ood-daw''', 'nᵉquddâh', 'h', 'heb', N'נְקֻדָּה', '', N'feminine of 5348;', 'stud.', 'a boss');
INSERT INTO dbo.Strongs VALUES ('H5352', 'v', 'naw-kaw''', 'nâqâh', 'h', 'heb', N'נָקָה', '', N'a primitive root;', 'acquit × at all, × altogether, be blameless, cleanse, (be) clear(-ing), cut off, be desolate, be free, be (hold) guiltless, be (hold) innocent, × by no means, be quit, be (leave) unpunished, × utterly, × wholly.', 'to be (or make) clean (literally or figuratively); by implication (in an adverse sense) to be bare, i.e. extirpated');
INSERT INTO dbo.Strongs VALUES ('H5353', 'n-pr-f', 'nek-o-daw''', 'Nᵉqôwdâʼ', 'h', 'x-pn', N'נְקוֹדָא', '', N'feminine of 5348 (in the figurative sense of marked); distinction;', 'Nekoda.', 'Nekoda, a Temple-servant');
INSERT INTO dbo.Strongs VALUES ('H5354', 'v', 'naw-kat''', 'nâqaṭ', 'h', 'heb', N'נָקַט', '', N'a primitive root;', 'weary.', 'to loathe');
