INSERT INTO dbo.Strongs VALUES ('H5356', 'n-m', 'nik-kaw-yone''', 'niqqâyôwn', 'h', 'heb', N'נִקָּיוֹן', '', N'or נִקָּיֹן; from 5352;', 'cleanness, innocency.', 'clearness (literally or figuratively)');
INSERT INTO dbo.Strongs VALUES ('H5357', 'n-m', 'naw-keek''', 'nâqîyq', 'h', 'heb', N'נָקִיק', '', N'from an unused root meaning to bore;', 'hole.', 'a cleft');
INSERT INTO dbo.Strongs VALUES ('H5358', 'v', 'naw-kam''', 'nâqam', 'h', 'heb', N'נָקַם', '', N'a primitive root;', 'avenge(-r, self), punish, revenge (self), × surely, take vengeance.', 'to grudge, i.e. avenge or punish');
INSERT INTO dbo.Strongs VALUES ('H5359', 'n-m', 'naw-kawm''', 'nâqâm', 'h', 'heb', N'נָקָם', '', N'from 5358;', '  avenged, quarrel, vengeance.', 'revenge');
INSERT INTO dbo.Strongs VALUES ('H5360', 'n-f', 'nek-aw-maw''', 'nᵉqâmâh', 'h', 'heb', N'נְקָמָה', '', N'feminine of 5359;', '  avenge, revenge(-ing), vengeance.', 'avengement, whether the act or the passion');
INSERT INTO dbo.Strongs VALUES ('H5361', 'v', 'naw-kah''', 'nâqaʻ', 'h', 'heb', N'נָקַע', '', N'a primitive root;', 'be alienated.', 'to feel aversion');
INSERT INTO dbo.Strongs VALUES ('H5362', 'v', 'naw-kaf''', 'nâqaph', 'h', 'heb', N'נָקַף', '', N'a primitive root;', 'compass (about, -ing), cut down, destroy, go round (about), inclose, round.', 'to strike with more or less violence (beat, fell, corrode); by implication (of attack) to knock together, i.e. surround or circulate');
INSERT INTO dbo.Strongs VALUES ('H5363', 'n-m', 'no''-kef', 'nôqeph', 'h', 'heb', N'נֹקֶף', '', N'from 5362;', 'shaking.', 'a threshing (of olives)');
INSERT INTO dbo.Strongs VALUES ('H5364', 'n-f', 'nik-paw''', 'niqpâh', 'h', 'heb', N'נִקְפָּה', '', N'from 5362;', 'rent.', 'probably a rope (as encircling)');
INSERT INTO dbo.Strongs VALUES ('H5365', 'v', 'naw-kar''', 'nâqar', 'h', 'heb', N'נָקַר', '', N'a primitive root;', 'dig, pick out, pierce, put (thrust) out.', 'to bore (penetrate, quarry)');
INSERT INTO dbo.Strongs VALUES ('H5366', 'n-f', 'nek-aw-raw''', 'nᵉqârâh', 'h', 'heb', N'נְקָרָה', '', N'from 5365;', 'cleft, clift.', 'a fissure');
INSERT INTO dbo.Strongs VALUES ('H5367', 'v', 'naw-kash''', 'nâqash', 'h', 'heb', N'נָקַשׁ', '', N'a primitive root;', 'catch (lay a) snare.', 'to entrap (with a noose), literally or figuratively');
INSERT INTO dbo.Strongs VALUES ('H5368', 'v', 'nek-ash''', 'nᵉqash', 'h', 'arc', N'נְקַשׁ', '', N'(Aramaic) corresponding to 5367; used in the sense of 5362;', 'smote.', 'to knock');
INSERT INTO dbo.Strongs VALUES ('H5369', 'n-pr-m', 'nare', 'Nêr', 'h', 'x-pn', N'נֵר', '', N'the same as 5216; lamp;', 'Ner.', 'Ner, an Israelite');
INSERT INTO dbo.Strongs VALUES ('H5370', 'n-pr-m', 'nare-gal''', 'Nêrᵉgal', 'h', 'x-pn', N'נֵרְגַּל', '', N'of foreign origin;', 'Nergal.', 'Nergal, a Cuthite deity');
INSERT INTO dbo.Strongs VALUES ('H5371', 'n-pr-m', 'nare-gal'' shar-eh''-tser', 'Nêrᵉgal Sharʼetser', 'h', 'x-pn', N'נֵרְגַּל שַׁרְאֶצֶר', '', N'from 5370 and 8272;', 'Nergal-sharezer.', 'Nergal-Sharetser, the name of two Babylonians');
INSERT INTO dbo.Strongs VALUES ('H5372', 'v', 'neer-gawn''', 'nirgân', 'h', 'heb', N'נִרְגָּן', '', N'from an unused root meaning to roll to pieces;', 'talebearer, whisperer.', 'a slanderer');
INSERT INTO dbo.Strongs VALUES ('H5373', 'n-m', 'nayrd', 'nêrd', 'h', 'heb', N'נֵרְדְּ', '', N'of foreign origin;', 'spikenard.', 'nard, an aromatic');
INSERT INTO dbo.Strongs VALUES ('H5374', 'n-pr-m', 'nay-ree-yaw''', 'Nêrîyâh', 'h', 'x-pn', N'נֵרִיָּה', '', N'or נֵרִיָּהוּ; from 5216 and 3050; light of Jah;', 'Neriah.', 'Nerijah, an Israelite');
INSERT INTO dbo.Strongs VALUES ('H5375', 'v', 'naw-saw''', 'nâsâʼ', 'h', 'heb', N'נָשָׂא', '', N'or נָסָה; (Psalm 4:6 [7]), a primitive root;', 'accept, advance, arise, (able to, (armor), suffer to) bear(-er, up), bring (forth), burn, carry (away), cast, contain, desire, ease, exact, exalt (self), extol, fetch, forgive, furnish, further, give, go on, help, high, hold up, honorable (  man), lade, lay, lift (self) up, lofty, marry, magnify, × needs, obtain, pardon, raise (up), receive, regard, respect, set (up), spare, stir up,   swear, take (away, up), × utterly, wear, yield.', 'to lift, in a great variety of applications, literal and figurative, absolute and relative');
INSERT INTO dbo.Strongs VALUES ('H5376', 'v', 'nes-aw''', 'nᵉsâʼ', 'h', 'arc', N'נְשָׂא', '', N'(Aramaic) corresponding to 5375', 'carry away, make insurrection, take.', '');
