INSERT INTO dbo.Strongs VALUES ('H5466', 'n-m', 'saw-deen''', 'çâdîyn', 'h', 'heb', N'סָדִין', '', N'from an unused root meaning to envelop;', 'fine linen, sheet.', 'a wrapper, i.e. shirt');
INSERT INTO dbo.Strongs VALUES ('H5467', 'n-pr-loc', 'sed-ome''', 'Çᵉdôm', 'h', 'x-pn', N'סְדֹם', '', N'from an unused root meaning to scorch; burnt (i.e. volcanic or bituminous) district;', 'Sodom.', 'Sedom, a place near the Dead Sea');
INSERT INTO dbo.Strongs VALUES ('H5468', 'n-m', 'seh''-der', 'çeder', 'h', 'heb', N'סֶדֶר', '', N'from an unused root meaning to arrange;', 'order.', 'order');
INSERT INTO dbo.Strongs VALUES ('H5469', 'n-m', 'cah''-har', 'çahar', 'h', 'heb', N'סַהַר', '', N'from an unused root meaning to be round;', 'round.', 'roundness');
INSERT INTO dbo.Strongs VALUES ('H5470', 'n-m', 'so''-har', 'çôhar', 'h', 'heb', N'סֹהַר', '', N'from the same as 5469;', 'prison.', 'a dungeon (as surrounded by walls)');
INSERT INTO dbo.Strongs VALUES ('H5471', 'n-pr-m', 'so', 'Çôwʼ', 'h', 'x-pn', N'סוֹא', '', N'of foreign derivation;', 'So.', 'So, an Egyptian king');
INSERT INTO dbo.Strongs VALUES ('H5472', 'v', 'soog', 'çûwg', 'h', 'heb', N'סוּג', '', N'a primitive root;', 'backslider, drive, go back, turn (away, back).', 'properly, to flinch, i.e. (by implication) to go back, literally (to retreat) or figuratively (to apostatize)');
INSERT INTO dbo.Strongs VALUES ('H5473', 'v', 'soog', 'çûwg', 'h', 'heb', N'סוּג', '', N'a primitive root (probably rather identical with 5472 through the idea of shrinking from a hedge; compare 7735);', 'set about.', 'to hem in, i.e. bind');
INSERT INTO dbo.Strongs VALUES ('H5474', 'n-m', 'soo-gar''', 'çûwgar', 'h', 'heb', N'סוּגַר', '', N'from 5462;', 'ward.', 'an inclosure, i.e. cage (for an animal)');
INSERT INTO dbo.Strongs VALUES ('H5475', 'n-m', 'sode', 'çôwd', 'h', 'heb', N'סוֹד', '', N'from 3245;', 'assembly, consel, inward, secret (counsel).', 'a session, i.e. company of persons (in close deliberation); by implication, intimacy, consultation, a secret');
INSERT INTO dbo.Strongs VALUES ('H5476', 'n-pr-m', 'so-dee''', 'Çôwdîy', 'h', 'x-pn', N'סוֹדִי', '', N'from 5475; a confidant;', 'Sodi.', 'Sodi, an Israelite');
INSERT INTO dbo.Strongs VALUES ('H5477', 'n-pr-m', 'soo''-akh', 'Çûwach', 'h', 'x-pn', N'סוּחַ', '', N'from an unused root meaning to wipe away; sweeping;', 'Suah.', 'Suach, an Israelite');
INSERT INTO dbo.Strongs VALUES ('H5478', 'n-f', 'soo-khaw''', 'çûwchâh', 'h', 'heb', N'סוּחָה', '', N'from the same as 5477;', 'torn.', 'something swept away, i.e. filth');
INSERT INTO dbo.Strongs VALUES ('H5479', 'n-pr-m', 'so-tah''-ee', 'Çôwṭay', 'h', 'x-pn', N'סוֹטַי', '', N'from 7750; roving;', 'Sotai.', 'Sotai, one of the Nethinim');
INSERT INTO dbo.Strongs VALUES ('H5480', 'v', 'sook', 'çûwk', 'h', 'heb', N'סוּךְ', '', N'a primitive root;', 'anoint (self), × at all.', 'properly, to smear over (with oil), i.e. anoint');
INSERT INTO dbo.Strongs VALUES ('H5481', 'n-f', 'soom-po-neh-yaw''', 'çûwmᵉpôwnᵉyâh', 'h', 'arc', N'סוּמְפּוֹנְיָה', '', N'(Aramaic) or סוּמְפֹּנְיָה; (Aramaic), or סִיפֹנְיָא; (Daniel 3:10) (Aramaic), of Greek origin;', 'dulcimer.', 'a bagpipe (with a double pipe)');
INSERT INTO dbo.Strongs VALUES ('H5482', 'n-pr-loc', 'sev-ay-nay''', 'Çᵉvênêh', 'h', 'x-pn', N'סְוֵנֵה', '', N'(rather to be written סְוֵנָה; for סְוֵן; i.e to Seven); of Egyptian derivation;', 'Syene.', 'Seven, a place in Upper Egypt');
INSERT INTO dbo.Strongs VALUES ('H5483', 'n-m', 'soos', 'çûwç', 'h', 'heb', N'סוּס', '', N'or סֻס; from an unused root meaning to skip (properly, for joy);', 'crane, horse (-back, -hoof). Compare 6571.', 'a horse (as leaping); also a swallow (from its rapid flight)');
INSERT INTO dbo.Strongs VALUES ('H5484', 'n-f', 'soo-saw''', 'çûwçâh', 'h', 'heb', N'סוּסָה', '', N'feminine of 5483;', 'company of horses.', 'a mare');
INSERT INTO dbo.Strongs VALUES ('H5485', 'n-pr-m', 'soo-see''', 'Çûwçîy', 'h', 'x-pn', N'סוּסִי', '', N'from 5483; horse-like;', 'Susi.', 'Susi, an Israelite');
INSERT INTO dbo.Strongs VALUES ('H5486', 'v', 'soof', 'çûwph', 'h', 'heb', N'סוּף', '', N'a primitive root;', 'consume, have an end, perish, × be utterly.', 'to snatch away, i.e. terminate');
INSERT INTO dbo.Strongs VALUES ('H5487', 'v', 'soof', 'çûwph', 'h', 'arc', N'סוּף', '', N'(Aramaic) corresponding to 5486;', 'consume, fulfill.', 'to come to an end');
INSERT INTO dbo.Strongs VALUES ('H5488', 'n-m', 'soof', 'çûwph', 'h', 'heb', N'סוּף', '', N'probably of Egyptian origin;', 'flag, Red (sea), weed. Compare 5489.', 'a reed, especially the papyrus');
INSERT INTO dbo.Strongs VALUES ('H5489', 'n-pr-loc', 'soof', 'Çûwph', 'h', 'heb', N'סוּף', '', N'for 5488 (by ellipsis of 3220);', 'Red Sea.', 'the Reed (Sea)');
INSERT INTO dbo.Strongs VALUES ('H5490', 'n-m', 'sofe', 'çôwph', 'h', 'heb', N'סוֹף', '', N'from 5486;', 'conclusion, end, hinder participle', 'a termination');
INSERT INTO dbo.Strongs VALUES ('H5491', 'n-m', 'sofe', 'çôwph', 'h', 'arc', N'סוֹף', '', N'(Aramaic) corresponding to 5490', 'end.', '');
INSERT INTO dbo.Strongs VALUES ('H5492', 'n-f n-pr-loc', 'soo-faw''', 'çûwphâh', 'h', 'heb', N'סוּפָה', '', N'from 5486;', 'Red Sea, storm, tempest, whirlwind, Red sea.', 'a hurricane');
INSERT INTO dbo.Strongs VALUES ('H5493', 'v', 'soor', 'çûwr', 'h', 'heb', N'סוּר', '', N'or שׂוּר; (Hosea 9:12), a primitive root;', 'be(-head), bring, call back, decline, depart, eschew, get (you), go (aside), × grievous, lay away (by), leave undone, be past, pluck away, put (away, down), rebel, remove (to and fro), revolt, × be sour, take (away, off), turn (aside, away, in), withdraw, be without.', 'to turn off (literally or figuratively)');
INSERT INTO dbo.Strongs VALUES ('H5494', 'n-m', 'soor', 'çûwr', 'h', 'heb', N'סוּר', '', N'probably passive participle of 5493;', 'degenerate.', 'turned off, i.e. deteriorated');
INSERT INTO dbo.Strongs VALUES ('H5495', 'n', 'soor', 'Çûwr', 'h', 'x-pn', N'סוּר', '', N'the same as 5494;', 'Sur.', 'Sur, a gate of the temple');
INSERT INTO dbo.Strongs VALUES ('H5496', 'v', 'sooth', 'çûwth', 'h', 'heb', N'סוּת', '', N'perhaps denominative from 7898;', 'entice, move, persuade, provoke, remove, set on, stir up, take away.', 'properly, to prick, i.e. (figuratively) stimulate; by implication, to seduce');
INSERT INTO dbo.Strongs VALUES ('H5497', 'n-m', 'sooth', 'çûwth', 'h', 'heb', N'סוּת', '', N'probably from the same root as 4533;', 'clothes.', 'covering, i.e. clothing');
INSERT INTO dbo.Strongs VALUES ('H5498', 'v', 'saw-khab''', 'çâchab', 'h', 'heb', N'סָחַב', '', N'a primitive root;', 'draw (out), tear.', 'to trail along');
INSERT INTO dbo.Strongs VALUES ('H5499', 'n-f', 'seh-khaw-baw''', 'çᵉchâbâh', 'h', 'heb', N'סְחָבָה', '', N'from 5498;', 'cast clout.', 'a rag');
INSERT INTO dbo.Strongs VALUES ('H5500', 'v', 'saw-khaw''', 'çâchâh', 'h', 'heb', N'סָחָה', '', N'a primitive root;', 'scrape.', 'to sweep away');
INSERT INTO dbo.Strongs VALUES ('H5501', 'n-m', 'seh-khee''', 'çᵉchîy', 'h', 'heb', N'סְחִי', '', N'from 5500;', 'offscouring.', 'refuse (as swept off)');
INSERT INTO dbo.Strongs VALUES ('H5502', 'v', 'saw-khaf''', 'çâchaph', 'h', 'heb', N'סָחַף', '', N'a primitive root;', 'sweep (away).', 'to scrape off');
INSERT INTO dbo.Strongs VALUES ('H5503', 'v', 'saw-khar''', 'çâchar', 'h', 'heb', N'סָחַר', '', N'a primitive root;', 'go about, merchant(-man), occupy with, pant, trade, traffick.', 'to travel round (specifically as a pedlar); intensively, to palpitate');
INSERT INTO dbo.Strongs VALUES ('H5504', 'n-m', 'sakh''-ar', 'çachar', 'h', 'heb', N'סַחַר', '', N'from 5503;', 'merchandise.', 'profit (from trade)');
INSERT INTO dbo.Strongs VALUES ('H5505', 'n-m', 'saw-khar''', 'çâchar', 'h', 'heb', N'סָחַר', '', N'from 5503;', 'mart, merchandise.', 'an emporium; abstractly, profit (from trade)');
INSERT INTO dbo.Strongs VALUES ('H5506', 'n-f', 'sekh-o-raw''', 'çᵉchôrâh', 'h', 'heb', N'סְחֹרָה', '', N'from 5503;', 'merchandise.', 'traffic');
INSERT INTO dbo.Strongs VALUES ('H5507', 'n-f', 'so-khay-raw''', 'çôchêrâh', 'h', 'heb', N'סֹחֵרָה', '', N'properly, active participle feminine of 5503;', 'buckler.', 'something surrounding the person, i.e. a shield');
INSERT INTO dbo.Strongs VALUES ('H5508', 'n-f', 'so-kheh''-reth', 'çôchêreth', 'h', 'heb', N'סֹחֵרֶת', '', N'similar to 5507;', 'black marble.', 'probably a (black) tile (or tessara) for laying borders with');
INSERT INTO dbo.Strongs VALUES ('H5509', 'n-m', 'seeg', 'çîyg', 'h', 'heb', N'סִיג', '', N'or סוּג; (Ezekiel 22:18), from 5472 in the sense of refuse;', 'dross.', 'scoria');
INSERT INTO dbo.Strongs VALUES ('H5510', 'n', 'see-vawn''', 'Çîyvân', 'h', 'x-pn', N'סִיוָן', '', N'probably of Persian origin;', 'Sivan.', 'Sivan, the third Hebrew month');
