INSERT INTO dbo.Strongs VALUES ('H5513', 'a', 'see-nee''', 'Çîynîy', 'h', 'x-pn', N'סִינִי', '', N'from an otherwise unknown name of a man;', 'Sinite.', 'a Sinite, or descendant of one of the sons of Canaan');
INSERT INTO dbo.Strongs VALUES ('H5514', 'n-pr-loc', 'see-nah''-ee', 'Çîynay', 'h', 'x-pn', N'סִינַי', '', N'of uncertain derivation;', 'Sinai.', 'Sinai, mountain of Arabia');
