INSERT INTO dbo.Strongs VALUES ('H5521', 'n-f', 'sook-kaw''', 'çukkâh', 'h', 'heb', N'סֻכָּה', '', N'feminine of 5520;', 'booth, cottage, covert, pavilion, tabernacle, tent.', 'a hut or lair');
