INSERT INTO dbo.Strongs VALUES ('H5532', 'v', 'saw-kan''', 'çâkan', 'h', 'heb', N'סָכַן', '', N'a primitive root;', 'acquaint (self), be advantage, × ever, (be, (un-)) profit(-able), treasurer, be wont.', 'to be familiar with; by implication, to minister to, be serviceable to, to cherish, be customary');
INSERT INTO dbo.Strongs VALUES ('H5533', 'v', 'saw-kan''', 'çâkan', 'h', 'heb', N'סָכַן', '', N'probably a denominative from 7915;', 'endanger, impoverish.', 'properly, to cut, i.e. damage; also to grow (causatively, make) poor');
