INSERT INTO dbo.Strongs VALUES ('H5537', 'v', 'saw-law''', 'çâlâʼ', 'h', 'heb', N'סָלָא', '', N'a primitive root;', 'compare.', 'to suspend in a balance, i.e. weigh');
