INSERT INTO dbo.Strongs VALUES ('H5540', 'n-pr-m', 'seh''-led', 'Çeled', 'h', 'x-pn', N'סֶלֶד', '', N'from 5539; exultation;', 'Seled.', 'Seled, an Israelite');
INSERT INTO dbo.Strongs VALUES ('H5541', 'v', 'saw-law''', 'çâlâh', 'h', 'heb', N'סָלָה', '', N'a primitive root;', 'tread down (under foot), value.', 'to hang up, i.e. weigh, or (figuratively) contemn');
INSERT INTO dbo.Strongs VALUES ('H5542', 'v', 'seh''-law', 'çelâh', 'h', 'heb', N'סֶלָה', '', N'from 5541;', 'Selah.', 'suspension (of music), i.e. pause');
