INSERT INTO dbo.Strongs VALUES ('H5544', 'n-m', 'sil-lone''', 'çillôwn', 'h', 'heb', N'סִלּוֹן', '', N'or סַלּוֹן; from 5541;', 'brier, thorn.', 'a prickle (as if pendulous)');
