INSERT INTO dbo.Strongs VALUES ('H5548', 'n-pr-loc', 'sal-kaw''', 'Çalkâh', 'h', 'x-pn', N'סַלְכָה', '', N'from an unused root. meaning to walk; walking;', 'Salcah, Salchah.', 'Salcah, a place East of the Jordan');
INSERT INTO dbo.Strongs VALUES ('H5549', 'v', 'saw-lal''', 'çâlal', 'h', 'heb', N'סָלַל', '', N'a primitive root;', 'cast up, exalt (self), extol, make plain, raise up.', 'to mound up (especially a turnpike); figurative, to exalt; reflexively, to oppose (as by a dam)');
INSERT INTO dbo.Strongs VALUES ('H5550', 'n-f', 'so-lel-aw''', 'çôlᵉlâh', 'h', 'heb', N'סֹלְלָה', '', N'or סוֹלְלָה; active participle feminine of 5549, but used passively;', 'bank, mount.', 'a military mound, i.e. rampart of besiegers');
INSERT INTO dbo.Strongs VALUES ('H5551', 'n-m', 'sool-lawm''', 'çullâm', 'h', 'heb', N'סֻלָּם', '', N'from 5549;', 'ladder.', 'a stair-case');
INSERT INTO dbo.Strongs VALUES ('H5552', 'n-f', 'sal-sil-law''', 'çalçillâh', 'h', 'heb', N'סַלְסִלָּה', '', N'from 5541;', 'basket.', 'a twig (as pendulous)');
INSERT INTO dbo.Strongs VALUES ('H5553', 'n-m', 'seh''-lah', 'çelaʻ', 'h', 'heb', N'סֶלַע', '', N'from an unused root meaning to be lofty;', '(ragged) rock, stone(-ny), strong hold.', 'a craggy rock, literally or figuratively (a fortress)');
INSERT INTO dbo.Strongs VALUES ('H5554', 'n-pr-loc', 'seh''-lah', 'Çelaʻ', 'h', 'x-pn', N'סֶלַע', '', N'the same as 5553;', 'rock, Sela(-h).', 'Sela, the rock-city of Idumaea');
