INSERT INTO dbo.Strongs VALUES ('H5647', 'v', 'aw-bad''', 'ʻâbad', 'h', 'heb', N'עָבַד', '', N'a primitive root;', '× be, keep in bondage, be bondmen, bond-service, compel, do, dress, ear, execute,   husbandman, keep, labour(-ing man, bring to pass, (cause to, make to) serve(-ing, self), (be, become) servant(-s), do (use) service, till(-er), transgress (from margin), (set a) work, be wrought, worshipper,', 'to work (in any sense); by implication, to serve, till, (causatively) enslave, etc.');
INSERT INTO dbo.Strongs VALUES ('H5648', 'v', 'ab-bad''', 'ʻăbad', 'h', 'arc', N'עֲבַד', '', N'(Aramaic) corresponding to 5647;', '× cut, do, execute, go on, make, move, work.', 'to do, make, prepare, keep, etc.');
