INSERT INTO dbo.Strongs VALUES ('H5653', 'n-pr-m', 'ab-daw''', 'ʻAbdâʼ', 'h', 'x-pn', N'עַבְדָּא', '', N'from 5647; work;', 'Abda', 'Abda, the name of two Israelites');
