INSERT INTO dbo.Strongs VALUES ('H5655', 'n-pr-m', 'ab-deh-ale''', 'ʻAbdᵉʼêl', 'h', 'x-pn', N'עַבְדְּאֵל', '', N'from 5647 and 410; serving God;', 'Abdeel. Compare 5661.', 'Abdeel, an Israelite');
INSERT INTO dbo.Strongs VALUES ('H5656', 'n-f', 'ab-o-daw''', 'ʻăbôdâh', 'h', 'heb', N'עֲבֹדָה', '', N'or עֲבוֹדָה; from 5647;', 'act, bondage,   bondservant, effect, labour, ministering(-try), office, service(-ile, -itude), tillage, use, work, × wrought.', 'work of any kind');
INSERT INTO dbo.Strongs VALUES ('H5657', 'n-f', 'ab-ood-daw''', 'ʻăbuddâh', 'h', 'heb', N'עֲבֻדָּה', '', N'passive participle of 5647;', 'household, store of servants.', 'something wrought, i.e. (concretely) service');
INSERT INTO dbo.Strongs VALUES ('H5658', 'n-pr-m n-pr-loc', 'ab-dohn''', 'ʻAbdôwn', 'h', 'x-pn', N'עַבְדוֹן', '', N'from 5647; servitude;', 'Abdon. Compare 5683.', 'Abdon, the name of a place in Palestine and of four Israelites');
INSERT INTO dbo.Strongs VALUES ('H5659', 'n-f', 'ab-dooth''', 'ʻabdûwth', 'h', 'heb', N'עַבְדוּת', '', N'from 5647;', 'bondage.', 'servitude');
INSERT INTO dbo.Strongs VALUES ('H5660', 'n-pr-m', 'ab-dee''', 'ʻAbdîy', 'h', 'x-pn', N'עַבְדִּי', '', N'from 5647; serviceable;', 'Abdi.', 'Abdi, the name of two Israelites');
