INSERT INTO dbo.Strongs VALUES ('H5663', 'n-pr-m', 'eh''-bed meh''-lek', 'ʻEbed Melek', 'h', 'x-pn', N'עֶבֶד מֶלֶךְ', '', N'from 5650 and 4428; servant of a king;', 'Ebed-melech.', 'Ebed-Melek, a eunuch of Zedekeah');
INSERT INTO dbo.Strongs VALUES ('H5664', 'n-pr-m', 'ab-ade'' neg-o''', 'ʻĂbêd Nᵉgôw', 'h', 'x-pn', N'עֲבֵד נְגוֹ', '', N'the same as 5665;', 'Abed-nego.', 'Abed-Nego, the Babylonian name of one of Daniel''s companions');
