INSERT INTO dbo.Strongs VALUES ('H5668', 'prep', 'aw-boor''', 'ʻâbûwr', 'h', 'heb', N'עָבוּר', '', N'or עָבֻר; passive participle of 5674;', 'because of, for (...''s sake), (intent) that, to.', 'properly, crossed, i.e. (abstractly) transit; used only adverbially, on account of, in order that');
