INSERT INTO dbo.Strongs VALUES ('H5675', 'n-m', 'ab-ar''', 'ʻăbar', 'h', 'arc', N'עֲבַר', '', N'(Aramaic) corresponding to 5676', 'beyond, this side.', '');
