INSERT INTO dbo.Strongs VALUES ('H5677', 'n-pr-m', 'ay''-ber', 'ʻÊbêr', 'h', 'x-pn', N'עֵבֵר', '', N'the same as 5676;', 'Eber, Heber.', 'Eber, the name of two patriarchs and four Israelites');
