INSERT INTO dbo.Strongs VALUES ('H5680', 'n-pr', 'ib-ree''', 'ʻIbrîy', 'h', 'x-pn', N'עִבְרִי', '', N'patronymic from 5677;', 'Hebrew(-ess, woman).', 'an Eberite (i.e. Hebrew) or descendant of Eber');
