INSERT INTO dbo.Strongs VALUES ('H5689', 'v', 'aw-gab''', 'ʻăgab', 'h', 'heb', N'עֲגַב', '', N'a primitive root;', 'dote, lover.', 'to breathe after, i.e. to love (sensually)');
