INSERT INTO dbo.Strongs VALUES ('H5692', 'n-f', 'oog-gaw''', 'ʻuggâh', 'h', 'heb', N'עֻגָּה', '', N'from 5746;', 'cake (upon the hearth).', 'an ashcake (as round)');
