INSERT INTO dbo.Strongs VALUES ('H5713', 'n-f', 'ay-daw''', 'ʻêdâh', 'h', 'heb', N'עֵדָה', '', N'feminine of 5707 in its techn. sense;', 'testimony, witness. Compare 5712.', 'testimony');
