INSERT INTO dbo.Strongs VALUES ('H5909', 'n-m', 'ak-bawr''', 'ʻakbâr', 'h', 'heb', N'עַכְבָּר', '', N'probably from the same as 5908 in the secondary sense of attacking;', 'mouse.', 'a mouse (as nibbling)');
INSERT INTO dbo.Strongs VALUES ('H5910', 'n-pr-loc', 'ak-ko''', 'ʻAkkôw', 'h', 'x-pn', N'עַכּוֹ', '', N'apparently from an unused root meaning to hem in;', 'Accho.', 'Akko (from its situation on a bay)');
INSERT INTO dbo.Strongs VALUES ('H5911', 'n-m', 'aw-kore''', 'ʻÂkôwr', 'h', 'x-pn', N'עָכוֹר', '', N'from 5916; troubled;', 'Achor.', 'Akor, the name of a place in Palestine');
