INSERT INTO dbo.Strongs VALUES ('H5915', 'n-pr-f', 'ak-saw''', 'ʻAkçâh', 'h', 'x-pn', N'עַכְסָה', '', N'feminine of 5914; anklet;', 'Achsah.', 'Aksah, an Israelitess');
INSERT INTO dbo.Strongs VALUES ('H5916', 'v', 'aw-kar''', 'ʻâkar', 'h', 'heb', N'עָכַר', '', N'a primitive root;', 'trouble, stir.', 'properly, to roil water; figuratively, to disturb or affict');
