INSERT INTO dbo.Strongs VALUES ('H5918', 'n-pr-m', 'ok-rawn''', 'ʻOkrân', 'h', 'x-pn', N'עׇכְרָן', '', N'from 5916; muddler;', 'Ocran.', 'Okran, an Israelite');
