INSERT INTO dbo.Strongs VALUES ('H5928', 'n-f', 'al-law''', 'ʻălâh', 'h', 'arc', N'עֲלָה', '', N'(Aramaic) corresponding to 5930;', 'burnt offering.', 'a holocaust');
