INSERT INTO dbo.Strongs VALUES ('H5931', 'n-f', 'il-law''', 'ʻillâh', 'h', 'arc', N'עִלָּה', '', N'(Aramaic) feminine from a root corresponding to 5927;', 'occasion.', 'a pretext (as arising artificially)');
