INSERT INTO dbo.Strongs VALUES ('H6421', 'n-pr-m', 'pel-al-yaw''', 'Pᵉlalyâh', 'h', 'x-pn', N'פְּלַלְיָה', '', N'from 6419 and 3050; Jah has judged;', 'Pelaliah.', 'Pelaljah, an Israelite');
INSERT INTO dbo.Strongs VALUES ('H6422', 'pron', 'pal-mo-nee''', 'palmôwnîy', 'h', 'heb', N'פַּלְמוֹנִי', '', N'probably for 6423;', 'certain.', 'a certain one, i.e. so-and-so');
INSERT INTO dbo.Strongs VALUES ('H6423', 'pron', 'pel-o-nee''', 'pᵉlônîy', 'h', 'heb', N'פְּלֹנִי', '', N'from 6395;', 'such.', 'such a one, i.e. a specified person');
INSERT INTO dbo.Strongs VALUES ('H6424', 'v', 'paw-las''', 'pâlaç', 'h', 'heb', N'פָּלַס', '', N'a primitive root;', 'make, ponder, weigh.', 'properly, to roll flat, i.e. prepare (a road); also to revolve, i.e. weigh (mentally)');
INSERT INTO dbo.Strongs VALUES ('H6425', 'n-m', 'peh''-les', 'peleç', 'h', 'heb', N'פֶּלֶס', '', N'from 6424;', 'scales, weight.', 'a balance');
INSERT INTO dbo.Strongs VALUES ('H6426', 'v', 'paw-lats''', 'pâlats', 'h', 'heb', N'פָּלַץ', '', N'a primitive root;', 'tremble.', 'properly, perhaps to rend, i.e. (by implication) to quiver');
INSERT INTO dbo.Strongs VALUES ('H6427', 'n-f', 'pal-law-tsooth''', 'pallâtsûwth', 'h', 'heb', N'פַּלָּצוּת', '', N'from 6426;', 'fearfulness, horror, trembling.', 'affright');
INSERT INTO dbo.Strongs VALUES ('H6428', 'v', 'paw-lash''', 'pâlash', 'h', 'heb', N'פָּלַשׁ', '', N'a primitive root;', 'roll (wallow) self.', 'to roll (in dust)');
INSERT INTO dbo.Strongs VALUES ('H6429', 'n', 'pel-eh''-sheth', 'Pᵉlesheth', 'h', 'x-pn', N'פְּלֶשֶׁת', '', N'from 6428; rolling, i.e. migratory;', 'Palestina, Palestine, Philistia, Philistines.', 'Pelesheth, a region of Syria');
INSERT INTO dbo.Strongs VALUES ('H6430', 'a', 'pel-ish-tee''', 'Pᵉlishtîy', 'h', 'x-pn', N'פְּלִשְׁתִּי', '', N'patrial from 6429;', 'Philistine.', 'a Pelishtite or inhabitant of Pelesheth');
INSERT INTO dbo.Strongs VALUES ('H6431', 'n-pr-m', 'peh''-leth', 'Peleth', 'h', 'x-pn', N'פֶּלֶת', '', N'from an unused root meaning to flee; swiftness;', 'Peleth.', 'Peleth, the name of two Israelites');
INSERT INTO dbo.Strongs VALUES ('H6432', 'a', 'pel-ay-thee''', 'Pᵉlêthîy', 'h', 'heb', N'פְּלֵתִי', '', N'from the same form as 6431;', 'Pelethites.', 'a courier (collectively) or official messenger');
INSERT INTO dbo.Strongs VALUES ('H6433', 'n-m', 'poom', 'pum', 'h', 'arc', N'פֻּם', '', N'(Aramaic) probably for 6310;', 'mouth.', 'the mouth (literally or figuratively)');
INSERT INTO dbo.Strongs VALUES ('H6434', 'n-m', 'pane', 'pên', 'h', 'heb', N'פֵּן', '', N'from an unused root meaning to turn;', 'corner.', 'an angle (of a street or wall)');
INSERT INTO dbo.Strongs VALUES ('H6435', 'conj', 'pane', 'pên', 'h', 'heb', N'פֵּן', '', N'from 6437;', '(lest) (peradventure), that...not.', 'properly, removal; used only (in the construction) adverb as conjunction, lest');
INSERT INTO dbo.Strongs VALUES ('H6436', 'n-m', 'pan-nag''', 'pannag', 'h', 'heb', N'פַּנַּג', '', N'of uncertain derivation;', 'Pannag.', 'probably pastry');
INSERT INTO dbo.Strongs VALUES ('H6437', 'v', 'paw-naw''', 'pânâh', 'h', 'heb', N'פָּנָה', '', N'a primitive root;', 'appear, at (even-) tide, behold, cast out, come on, × corner, dawning, empty, go away, lie, look, mark, pass away, prepare, regard, (have) respect (to), (re-) turn (aside, away, back, face, self), × right (early).', 'to turn; by implication, to face, i.e. appear, look, etc.');
INSERT INTO dbo.Strongs VALUES ('H6438', 'n-f', 'pin-naw''', 'pinnâh', 'h', 'heb', N'פִּנָּה', '', N'feminine of 6434;', 'bulwark, chief, corner, stay, tower.', 'an angle; by implication, a pinnacle; figuratively, a chieftain');
INSERT INTO dbo.Strongs VALUES ('H6439', 'n-pr-m n-pr-loc', 'pen-oo-ale''', 'Pᵉnûwʼêl', 'h', 'x-pn', N'פְּנוּאֵל', '', N'or (more properly,) פְּנִיאֵל; from 6437 and 410; face of God;', 'Peniel, Penuel.', 'Penuel or Peniel, a place East of Jordan; also (as Penuel) the name of two Israelites');
INSERT INTO dbo.Strongs VALUES ('H6440', 'n-m', 'paw-neem''', 'pânîym', 'h', 'heb', N'פָּנִים', '', N'plural (but always as singular) of an unused noun פָּנֶה; from 6437);', '  accept, a-(be-) fore(-time), against, anger, × as (long as), at,   battle,   because (of),   beseech, countenance, edge,   employ, endure,   enquire, face, favour, fear of, for, forefront(-part), form(-er time, -ward), from, front, heaviness, × him(-self),   honourable,   impudent,   in, it, look(-eth) (-s), × me,   meet, × more than, mouth, of, off, (of) old (time), × on, open,   out of, over against, the partial, person,   please, presence, propect, was purposed, by reason of,   regard, right forth,   serve, × shewbread, sight, state, straight,   street, × thee, × them(-selves), through (  -out), till, time(-s) past, (un-) to(-ward),   upon, upside (  down), with(-in,   -stand), × ye, × you.', 'the face (as the part that turns); used in a great variety of applications (literally and figuratively); also (with prepositional prefix) as a preposition (before, etc.)');
INSERT INTO dbo.Strongs VALUES ('H6441', 'adv', 'pen-ee''-maw', 'pᵉnîymâh', 'h', 'heb', N'פְּנִימָה', '', N'from 6440 with directive enclitic;', '(with-) in(-ner part, -ward).', 'faceward, i.e. indoors');
INSERT INTO dbo.Strongs VALUES ('H6442', 'a', 'pen-ee-mee''', 'pᵉnîymîy', 'h', 'heb', N'פְּנִימִי', '', N'from 6440;', '(with-) in(-ner, -ward).', 'interior');
INSERT INTO dbo.Strongs VALUES ('H6443', 'n-m', 'paw-neen''', 'pânîyn', 'h', 'heb', N'פָּנִין', '', N'or פָּנִי; from the same as 6434;', 'ruby.', 'probably a pearl (as round)');
INSERT INTO dbo.Strongs VALUES ('H6444', 'n-pr-f', 'pen-in-naw''', 'Pᵉninnâh', 'h', 'x-pn', N'פְּנִנָּה', '', N'probably feminine from 6443 contr.;', 'Peninnah.', 'Peninnah, an Israelitess');
INSERT INTO dbo.Strongs VALUES ('H6445', 'v', 'paw-nak''', 'pânaq', 'h', 'heb', N'פָּנַק', '', N'a primitive root;', 'bring up.', 'to enervate');
INSERT INTO dbo.Strongs VALUES ('H6446', 'n-m', 'pas', 'paç', 'h', 'heb', N'פַּס', '', N'from 6461; properly, the palm (of the hand) or sole (of the foot) (compare 6447); by implication (plural)', '(divers) colours.', 'a long and sleeved tunic (perhaps simply a wide one; from the original sense of the root, i.e. of many breadths)');
INSERT INTO dbo.Strongs VALUES ('H6447', 'n-m', 'pas', 'paç', 'h', 'arc', N'פַּס', '', N'(Aramaic) from a root corresponding to 6461;', 'participle', 'the palm (of the hand, as being spread out)');
INSERT INTO dbo.Strongs VALUES ('H6448', 'v', 'paw-sag''', 'pâçag', 'h', 'heb', N'פָּסַג', '', N'a primitive root;', 'consider.', 'to cut up, i.e. (figuratively) contemplate');
INSERT INTO dbo.Strongs VALUES ('H6449', 'n-pr-loc', 'pis-gaw''', 'Piçgâh', 'h', 'x-pn', N'פִּסְגָּה', '', N'from 6448; a cleft;', 'Pisgah.', 'Pisgah, a Mountain East of Jordan');
INSERT INTO dbo.Strongs VALUES ('H6450', 'n-pr-loc', 'pas dam-meem''', 'Paç Dammîym', 'h', 'x-pn', N'פַּס דַּמִּים', '', N'from 6446 and the plural of 1818; palm (i.e. dell) of bloodshed;', 'Pas-dammim. Compare 658.', 'Pas-Dammim, a place in Palestine');
INSERT INTO dbo.Strongs VALUES ('H6451', 'n-f', 'pis-saw''', 'piççâh', 'h', 'heb', N'פִּסָּה', '', N'from 6461;', 'handful.', 'expansion, i.e. abundance');
INSERT INTO dbo.Strongs VALUES ('H6452', 'v', 'paw-sakh''', 'pâçach', 'h', 'heb', N'פָּסַח', '', N'a primitive root;', 'halt, become lame, leap, pass over.', 'to hop, i.e. (figuratively) skip over (or spare); by implication, to hesitate; also (literally) to limp, to dance');
INSERT INTO dbo.Strongs VALUES ('H6453', 'n-m', 'peh''-sakh', 'peçach', 'h', 'heb', N'פֶּסַח', '', N'from 6452;', 'passover (offering).', 'a pretermission, i.e. exemption; used only techically of the Jewish Passover (the festival or the victim)');
INSERT INTO dbo.Strongs VALUES ('H6454', 'n-pr-m', 'paw-say''-akh', 'Pâçêach', 'h', 'x-pn', N'פָּסֵחַ', '', N'from 6452; limping;', 'Paseah, Phaseah.', 'Paseach, the name of two Israelites');
INSERT INTO dbo.Strongs VALUES ('H6455', 'a', 'pis-say''-akh', 'piççêach', 'h', 'heb', N'פִּסֵּחַ', '', N'from 6452;', 'lame.', 'lame');
INSERT INTO dbo.Strongs VALUES ('H6456', 'n-m', 'pes-eel''', 'pᵉçîyl', 'h', 'heb', N'פְּסִיל', '', N'from 6458;', 'carved (graven) image, quarry.', 'an idol');
INSERT INTO dbo.Strongs VALUES ('H6457', 'n-pr-m', 'paw-sak''', 'Pâçak', 'h', 'x-pn', N'פָּסַךְ', '', N'from an unused root meaning to divide; divider;', 'Pasach.', 'Pasak, an Israelite');
INSERT INTO dbo.Strongs VALUES ('H6458', 'v', 'paw-sal''', 'pâçal', 'h', 'heb', N'פָּסַל', '', N'a primitive root;', 'grave, hew.', 'to carve, whether wood or stone');
INSERT INTO dbo.Strongs VALUES ('H6459', 'n-m', 'peh''-sel', 'peçel', 'h', 'heb', N'פֶּסֶל', 'lemma פֶסֶל missing dagesh, corrected to פֶּסֶל', N'from 6458;', 'carved (graven) image.', 'an idol');
INSERT INTO dbo.Strongs VALUES ('H6460', 'n-m', 'pes-an-tay-reen''', 'pᵉçanṭêrîyn', 'h', 'arc', N'פְּסַנְטֵרִין', 'lemma פִּסַנְטֵרִין first vowel, corrected to פְּסַנְטֵרִין', N'(Aramaic) or פְּסַנְתֵּרִין; a transliteration of the Greek,', 'psaltery.', 'psalterion; a lyre');
INSERT INTO dbo.Strongs VALUES ('H6461', 'v', 'paw-sas''', 'pâçaç', 'h', 'heb', N'פָּסַס', '', N'a primitive root;', 'cease.', 'probably to disperse, i.e. (intransitive) disappear');
INSERT INTO dbo.Strongs VALUES ('H6462', 'n-pr-m', 'pis-paw''', 'Piçpâh', 'h', 'x-pn', N'פִּסְפָּה', '', N'perhaps from 6461; dispersion;', 'Pispah.', 'Pispah, an Israelite');
INSERT INTO dbo.Strongs VALUES ('H6463', 'v', 'paw-aw''', 'pâʻâh', 'h', 'heb', N'פָּעָה', '', N'a primitive root;', 'cry.', 'to scream');
INSERT INTO dbo.Strongs VALUES ('H6464', 'n-pr-loc', 'paw-oo''', 'Pâʻûw', 'h', 'x-pn', N'פָּעוּ', '', N'or פָּעִי; from 6463; screaming;', 'Pai, Pau.', 'Pau or Pai, a place in Edom');
INSERT INTO dbo.Strongs VALUES ('H6465', 'n-pr', 'peh-ore''', 'Pᵉʻôwr', 'h', 'x-pn', N'פְּעוֹר', '', N'from 6473; a gap; also 1187)', 'Peor. See also 1047.', 'Peör, a mountain East of Jordan; Baal Peor, (for a deity worshipped there');
INSERT INTO dbo.Strongs VALUES ('H6466', 'v', 'paw-al''', 'pâʻal', 'h', 'heb', N'פָּעַל', '', N'a primitive root;', 'commit, (evil-) do(-er), make(-r), ordain, work(-er).', 'to do or make (systematically and habitually), especially to practise');
INSERT INTO dbo.Strongs VALUES ('H6467', 'n-m', 'po''-al', 'pôʻal', 'h', 'heb', N'פֹּעַל', '', N'from 6466;', 'act, deed, do, getting, maker, work.', 'an act or work (concretely)');
INSERT INTO dbo.Strongs VALUES ('H6468', 'n-f', 'peh-ool-law''', 'pᵉʻullâh', 'h', 'heb', N'פְּעֻלָּה', '', N'feminine passive participle of 6466;', 'labour, reward, wages, work.', '(abstractly) work');
INSERT INTO dbo.Strongs VALUES ('H6469', 'n-pr-m', 'peh-ool-leh-thah''-ee', 'Pᵉʻullᵉthay', 'h', 'x-pn', N'פְּעֻלְּתַי', 'xlit Pᵉullʻthay corrected to Pᵉʻullᵉthay', N'from 6468; laborious;', 'Peulthai.', 'Peullethai, an Israelite');
INSERT INTO dbo.Strongs VALUES ('H6470', 'v', 'paw-am''', 'pâʻam', 'h', 'heb', N'פָּעַם', '', N'a primitive root;', 'move, trouble.', 'to tap, i.e. beat regularly; hence (generally) to impel or agitate');
INSERT INTO dbo.Strongs VALUES ('H6471', 'n-f', 'pah''-am', 'paʻam', 'h', 'heb', N'פַּעַם', '', N'or (feminine) פַּעֲמָה; from 6470;', 'anvil, corner, foot(-step), going, (hundred-) fold, × now, (this)   once, order, rank, step,   thrice, (often-), second, this, two) time(-s), twice, wheel.', 'a stroke, literally or figuratively (in various applications, as follow)');
INSERT INTO dbo.Strongs VALUES ('H6472', 'n-m', 'pah-am-one''', 'paʻămôn', 'h', 'heb', N'פַּעֲמֹן', '', N'from 6471;', 'bell.', 'a bell (as struck)');
INSERT INTO dbo.Strongs VALUES ('H6473', 'v', 'paw-ar''', 'pâʻar', 'h', 'heb', N'פָּעַר', '', N'a primitive root;', 'gape, open (wide).', 'to yawn, i.e. open wide (literally or figuratively)');
INSERT INTO dbo.Strongs VALUES ('H6474', 'n-pr-m', 'pah-ar-ah''-ee', 'Paʻăray', 'h', 'x-pn', N'פַּעֲרַי', '', N'from 6473; yawning;', 'Paarai.', 'Paarai, an Israelite');
INSERT INTO dbo.Strongs VALUES ('H6475', 'v', 'paw-tsaw''', 'pâtsâh', 'h', 'heb', N'פָּצָה', '', N'a primitive root;', 'deliver, gape, open, rid, utter.', 'to rend, i.e. open (especially the mouth)');
INSERT INTO dbo.Strongs VALUES ('H6476', 'v', 'paw-tsakh''', 'pâtsach', 'h', 'heb', N'פָּצַח', '', N'a primitive root;', 'break (forth, forth into joy), make a loud noise.', 'to break out (in joyful sound)');
INSERT INTO dbo.Strongs VALUES ('H6477', 'n-f', 'pets-ee-raw''', 'pᵉtsîyrâh', 'h', 'heb', N'פְּצִירָה', '', N'from 6484;', '  file.', 'bluntness');
INSERT INTO dbo.Strongs VALUES ('H6478', 'v', 'paw-tsal''', 'pâtsal', 'h', 'heb', N'פָּצַל', '', N'a primitive root;', 'pill.', 'to peel');
INSERT INTO dbo.Strongs VALUES ('H6479', 'n-f', 'pets-aw-law''', 'pᵉtsâlâh', 'h', 'heb', N'פְּצָלָה', '', N'from 6478;', 'strake.', 'a peeling');
INSERT INTO dbo.Strongs VALUES ('H6480', 'v', 'paw-tsam''', 'pâtsam', 'h', 'heb', N'פָּצַם', '', N'a primitive root;', 'break.', 'to rend (by earthquake)');
INSERT INTO dbo.Strongs VALUES ('H6481', 'v', 'paw-tsah''', 'pâtsaʻ', 'h', 'heb', N'פָּצַע', '', N'a primitive root;', 'wound.', 'to split, i.e. wound');
INSERT INTO dbo.Strongs VALUES ('H6482', 'n-m', 'peh''-tsah', 'petsaʻ', 'h', 'heb', N'פֶּצַע', '', N'from 6481;', 'wound(-ing).', 'a wound');
INSERT INTO dbo.Strongs VALUES ('H6483', 'n-pr-m', 'pits-tsates''', 'Pitstsêts', 'h', 'x-pn', N'פִּצֵּץ', '', N'from an unused root meaning to dissever; dispersive;', 'Apses (including the article).', 'Pitstsets, a priest');
INSERT INTO dbo.Strongs VALUES ('H6484', 'v', 'paw-tsar''', 'pâtsar', 'h', 'heb', N'פָּצַר', '', N'a primitive root;', 'press, urge, stubbornness.', 'to peck at, i.e. (figuratively) stun or dull');
INSERT INTO dbo.Strongs VALUES ('H6485', 'v n-m', 'paw-kad''', 'pâqad', 'h', 'heb', N'פָּקַד', '', N'a primitive root;', 'appoint, × at all, avenge, bestow, (appoint to have the, give a) charge, commit, count, deliver to keep, be empty, enjoin, go see, hurt, do judgment, lack, lay up, look, make, × by any means, miss, number, officer, (make) overseer, have (the) oversight, punish, reckon, (call to) remember(-brance), set (over), sum, × surely, visit, want.', 'to visit (with friendly or hostile intent); by analogy, to oversee, muster, charge, care for, miss, deposit, etc.');
INSERT INTO dbo.Strongs VALUES ('H6486', 'n-f', 'pek-ood-daw''', 'pᵉquddâh', 'h', 'heb', N'פְּקֻדָּה', '', N'feminine passive participle of 6485;', 'account, (that have the) charge, custody, that which...laid up, numbers, office(-r), ordering, oversight,   prison, reckoning, visitation.', 'visitation (in many senses, chiefly official)');
INSERT INTO dbo.Strongs VALUES ('H6487', 'n-m', 'pik-kaw-done''', 'piqqâdôwn', 'h', 'heb', N'פִּקָּדוֹן', '', N'from 6485;', 'that which was delivered (to keep), store.', 'a deposit');
INSERT INTO dbo.Strongs VALUES ('H6488', 'n-f', 'pek-ee-dooth''', 'pᵉqiduth', 'h', 'heb', N'פְּקִדֻת', '', N'from 6496;', 'ward.', 'supervision');
INSERT INTO dbo.Strongs VALUES ('H6489', 'n-pr', 'pek-ode''', 'Pᵉqôwd', 'h', 'x-pn', N'פְּקוֹד', '', N'from 6485; punishment;', 'Pekod.', 'Pekod, a symbolic name for Babylon');
INSERT INTO dbo.Strongs VALUES ('H6490', 'n-m', 'pik-kood''', 'piqqûwd', 'h', 'heb', N'פִּקּוּד', '', N'or פִּקֻּד; from 6485;', 'commandment, precept, statute.', 'properly, appointed, i.e. a mandate (of God; plural only, collectively, for the Law)');
INSERT INTO dbo.Strongs VALUES ('H6491', 'v', 'paw-kakh''', 'pâqach', 'h', 'heb', N'פָּקַח', '', N'a primitive root;', 'open.', 'to open (the senses, especially the eyes); figuratively, to be observant');
INSERT INTO dbo.Strongs VALUES ('H6492', 'n-pr-m', 'peh''-kakh', 'Peqach', 'h', 'x-pn', N'פֶּקַח', '', N'from 6491; watch;', 'Pekah.', 'Pekach, an Israelite king');
INSERT INTO dbo.Strongs VALUES ('H6493', 'a', 'pik-kay''-akh', 'piqqêach', 'h', 'heb', N'פִּקֵּחַ', '', N'from 6491;', 'seeing, wise.', 'clear-sighted; figuratively, intelligent');
INSERT INTO dbo.Strongs VALUES ('H6494', 'n-pr-m', 'pek-akh-yaw''', 'Pᵉqachyâh', 'h', 'x-pn', N'פְּקַחְיָה', '', N'from 6491 and 3050; Jah has observed;', 'Pekahiah.', 'Pekachjah, an Israelite king');
INSERT INTO dbo.Strongs VALUES ('H6495', 'n-m', 'pek-akh-ko''-akh', 'pᵉqach-qôwach', 'h', 'heb', N'פְּקַח־קוֹחַ', '', N'from 6491 redoubled;', 'opening of the prison.', 'opening (of a dungeon), i.e. jail-delivery (figuratively, salvation for sin)');
INSERT INTO dbo.Strongs VALUES ('H6496', 'n-m', 'paw-keed''', 'pâqîyd', 'h', 'heb', N'פָּקִיד', '', N'from 6485;', 'which had the charge, governor, office, overseer, (that) was set.', 'a superintendent (civil, military or religious)');
INSERT INTO dbo.Strongs VALUES ('H6497', 'n-m', 'peh''-kah', 'peqaʻ', 'h', 'heb', N'פֶּקַע', '', N'from an unused root meaning to burst; only used as an architectural term of an ornament similar to 6498,', 'knop.', 'a semi-globe');
INSERT INTO dbo.Strongs VALUES ('H6498', 'n-f', 'pak-koo-aw''', 'paqquʻâh', 'h', 'heb', N'פַּקֻּעָה', '', N'from the same as 6497;', 'gourd.', 'the wild cucumber (from splitting open to shed its seeds)');
INSERT INTO dbo.Strongs VALUES ('H6499', 'n-m', 'par', 'par', 'h', 'heb', N'פַּר', '', N'or פָּר; from 6565;', '(  young) bull(-ock), calf, ox.', 'a bullock (apparently as breaking forth in wild strength, or perhaps as dividing the hoof)');
INSERT INTO dbo.Strongs VALUES ('H6500', 'v', 'paw-raw''', 'pârâʼ', 'h', 'heb', N'פָּרָא', '', N'a primitive root;', 'be fruitful.', 'to bear fruit');
INSERT INTO dbo.Strongs VALUES ('H6501', 'n-m', 'peh''-reh', 'pereʼ', 'h', 'heb', N'פֶּרֶא', '', N'or פֶּרֶה; (Jeremiah 2:24), from 6500 in the secondary sense of running wild;', 'wild (ass).', 'the onager');
