INSERT INTO dbo.Strongs VALUES ('H6682', 'n-f', 'tsev-aw-khaw''', 'tsᵉvâchâh', 'h', 'heb', N'צְוָחָה', '', N'from 6681;', 'cry(-ing).', 'a screech (of anguish)');
INSERT INTO dbo.Strongs VALUES ('H6683', 'n-f', 'tsoo-law''', 'tsûwlâh', 'h', 'heb', N'צוּלָה', '', N'from an unused root meaning to sink;', 'deep.', 'an abyss (of the sea)');
INSERT INTO dbo.Strongs VALUES ('H6684', 'v', 'tsoom', 'tsûwm', 'h', 'heb', N'צוּם', '', N'a primitive root;', '× at all, fast.', 'to cover over (the mouth), i.e. to fast');
INSERT INTO dbo.Strongs VALUES ('H6685', 'n-m', 'tsome', 'tsôwm', 'h', 'heb', N'צוֹם', '', N'or צֹם; from 6684;', 'fast(-ing).', 'a fast');
INSERT INTO dbo.Strongs VALUES ('H6686', 'n-pr-m', 'tsoo-awr''', 'Tsûwʻâr', 'h', 'x-pn', N'צוּעָר', '', N'from 6819; small;', 'Zuar.', 'Tsuär, an Israelite');
