INSERT INTO dbo.Strongs VALUES ('H6690', 'n-pr-m', 'tso-fakh''', 'Tsôwphach', 'h', 'x-pn', N'צוֹפַח', '', N'from an unused root meaning to expand, breadth;', 'Zophah.', 'Tsophach, an Israelite');
