INSERT INTO dbo.Strongs VALUES ('H6694', 'v', 'tsook', 'tsûwq', 'h', 'heb', N'צוּק', '', N'a primitive root (identical with through the idea of narrowness (of orifice));', 'be molten, pour.', 'to pour out, i.e. (figuratively) smelt, utter');
INSERT INTO dbo.Strongs VALUES ('H6695', 'n-m n-f', 'tsoke', 'tsôwq', 'h', 'heb', N'צוֹק', '', N'or (feminine) צוּקָה; from 6693;', 'anguish, × troublous.', 'a strait, i.e. (figuratively) distress');
INSERT INTO dbo.Strongs VALUES ('H6696', 'v', 'tsoor', 'tsûwr', 'h', 'heb', N'צוּר', '', N'a primitive root;', 'adversary, assault, beset, besiege, bind (up), cast, distress, fashion, fortify, inclose, lay siege, put up in bags.', 'to cramp, i.e. confine (in many applications, literally and figuratively, formative or hostile)');
