INSERT INTO dbo.Strongs VALUES ('H6698', 'n-pr-m', 'tsoor', 'Tsûwr', 'h', 'x-pn', N'צוּר', '', N'the same as 6697; rock;', 'Zur.', 'Tsur, the name of a Midianite and of an Israelite');
