INSERT INTO dbo.Strongs VALUES ('H6700', 'n-pr-m', 'tsoo-ree-ale''', 'Tsûwrîyʼêl', 'h', 'x-pn', N'צוּרִיאֵל', '', N'from 6697 and 410; rock of God;', 'Zuriel.', 'Tsuriël, an Israelite');
