INSERT INTO dbo.Strongs VALUES ('H6702', 'v', 'tsooth', 'tsûwth', 'h', 'heb', N'צוּת', '', N'a primitive root;', 'burn.', 'to blaze');
INSERT INTO dbo.Strongs VALUES ('H6703', 'a', 'tsakh', 'tsach', 'h', 'heb', N'צַח', '', N'from 6705;', 'clear, dry, plainly, white.', 'dazzling, i.e. sunny, bright, (figuratively) evident');
INSERT INTO dbo.Strongs VALUES ('H6704', 'a', 'tsee-kheh''', 'tsicheh', 'h', 'heb', N'צִחֶה', '', N'from an unused root meaning to glow;', 'dried up.', 'parched');
