INSERT INTO dbo.Strongs VALUES ('H6712', 'n-m', 'tsekh-oke''', 'tsᵉchôq', 'h', 'heb', N'צְחֹק', '', N'from 6711;', 'laugh(-ed to scorn).', 'laughter (in pleasure or derision)');
