INSERT INTO dbo.Strongs VALUES ('H6714', 'n-pr-m', 'tso''-khar', 'Tsôchar', 'h', 'x-pn', N'צֹחַר', '', N'from the same as 6713; whiteness;', 'Zohar. Compare 3328.', 'Tsochar, the name of a Hittite and of an Israelite');
