INSERT INTO dbo.Strongs VALUES ('H6722', 'a', 'tsee-do-nee''', 'Tsîydônîy', 'h', 'x-pn', N'צִידֹנִי', '', N'patrial from 6721;', 'Sidonian, of Sidon, Zidonian.', 'a Tsidonian or inhabitant of Tsidon');
