INSERT INTO dbo.Strongs VALUES ('H6742', 'n-m', 'tsel-ool''', 'tsᵉlûwl', 'h', 'heb', N'צְלוּל', '', N'from 6749 in the sense of rolling;', 'cake.', 'a (round or flattened) cake');
