INSERT INTO dbo.Strongs VALUES ('H6745', 'n-f', 'tsay-law-khaw''', 'tsêlâchâh', 'h', 'heb', N'צֵלָחָה', '', N'from 6743;', 'pan.', 'something protracted or flattened out, i.e. a platter');
