INSERT INTO dbo.Strongs VALUES ('H6747', 'n-f', 'tsal-lakh''-ath', 'tsallachath', 'h', 'heb', N'צַלַּחַת', '', N'from 6743;', 'bosom, dish.', 'something advanced or deep, i.e. a bowl; figuratively, the bosom');
