INSERT INTO dbo.Strongs VALUES ('H6751', 'v', 'tsaw-lal''', 'tsâlal', 'h', 'heb', N'צָלַל', '', N'a primitive root (identical with through the idea of hovering over (compare 6754));', 'begin to be dark, shadowing.', 'to shade, as twilight or an opaque object');
