INSERT INTO dbo.Strongs VALUES ('H6754', 'n-m', 'tseh''-lem', 'tselem', 'h', 'heb', N'צֶלֶם', '', N'from an unused root meaning to shade;', 'image, vain shew.', 'a phantom, i.e. (figuratively) illusion, resemblance; hence, a representative figure, especially an idol');
