INSERT INTO dbo.Strongs VALUES ('H6758', 'n-pr-loc', 'tsal-mo-naw''', 'Tsalmônâh', 'h', 'x-pn', N'צַלְמֹנָה', '', N'feminine of 6757; shadiness;', 'Zalmonah.', 'Tsalmonah, a place in the Desert');
INSERT INTO dbo.Strongs VALUES ('H6759', 'n-pr-m', 'tsal-moon-naw''', 'Tsalmunnâʻ', 'h', 'x-pn', N'צַלְמֻנָּע', '', N'from 6738 and 4513; shade has been denied;', 'Zalmunna.', 'Tsalmunna, a Midianite');
INSERT INTO dbo.Strongs VALUES ('H6760', 'v', 'tsaw-lah''', 'tsâlaʻ', 'h', 'heb', N'צָלַע', '', N'a primitive root; probably to curve; used only as denominative from 6763,', 'halt.', 'to limp (as if one-sided)');
INSERT INTO dbo.Strongs VALUES ('H6761', 'n-m', 'tseh''-lah', 'tselaʻ', 'h', 'heb', N'צֶלַע', '', N'from 6760;', 'adversity, halt(-ing).', 'a limping or full (figuratively)');
INSERT INTO dbo.Strongs VALUES ('H6762', 'n-pr-loc', 'tseh''-lah', 'Tselaʻ', 'h', 'x-pn', N'צֶלַע', '', N'the same as 6761;', 'Zelah.', 'Tsela, a place in Palestine');
