INSERT INTO dbo.Strongs VALUES ('H6764', 'n-pr-m', 'tsaw-lawf''', 'Tsâlâph', 'h', 'x-pn', N'צָלָף', '', N'from an unused root of unknown meaning;', 'Zalaph.', 'Tsalaph, an Israelite');
