INSERT INTO dbo.Strongs VALUES ('H7651', 'n', 'sheh''-bah', 'shebaʻ', 'h', 'heb', N'שֶׁבַע', '', N'or (masculine) (שִׁבְעָה); from 7650; a primitive cardinal number;', '(  by) seven(-fold),-s, (-teen, -teenth), -th, times). Compare 7658.', 'seven (as the sacred full one); also (adverbially) seven times; by implication, a week; by extension, an indefinite number');
