INSERT INTO dbo.Strongs VALUES ('H7748', 'n-pr-m', 'shoo-khawm''', 'Shûwchâm', 'h', 'x-pn', N'שׁוּחָם', '', N'from 7743; humbly;', 'Shuham.', 'Shucham, an Israelite');
INSERT INTO dbo.Strongs VALUES ('H7749', 'a', 'shoo-khaw-mee''', 'Shûwchâmîy', 'h', 'x-pn', N'שׁוּחָמִי', '', N'patronymic from 7748;', 'Shuhamites.', 'a Shuchamite (collectively)');
INSERT INTO dbo.Strongs VALUES ('H7750', 'v', 'soot', 'sûwṭ', 'h', 'heb', N'שׂוּט', '', N'or (by permutation) סוּט; a primitive root;', 'turn aside to.', 'to detrude, i.e. (intransitively and figuratively) become derelict (wrongly practise; namely, idolatry)');
