INSERT INTO dbo.Strongs VALUES ('H8416', 'n-f', 'teh-hil-law''', 'tᵉhillâh', 'h', 'heb', N'תְּהִלָּה', '', N'from 1984;', 'praise.', 'laudation; specifically (concretely) a hymn');
INSERT INTO dbo.Strongs VALUES ('H8417', 'n-f', 'to-hol-aw''', 'tohŏlâh', 'h', 'heb', N'תׇּהֳלָה', '', N'feminine of an unused noun (apparently from 1984) meaning bluster;', 'folly.', 'braggadocio, i.e. (by implication) fatuity');
INSERT INTO dbo.Strongs VALUES ('H8418', 'n-f', 'tah-hal-oo-kaw''', 'tahălukâh', 'h', 'heb', N'תַּהֲלֻכָה', '', N'from 1980;', '× went.', 'a procession');
