INSERT INTO dbo.Strongs VALUES ('H8424', 'n-f', 'too-gaw''', 'tûwgâh', 'h', 'heb', N'תּוּגָה', '', N'from 3013;', 'heaviness, sorrow.', 'depression (of spirits); concretely a grief');
