INSERT INTO dbo.Strongs VALUES ('H8428', 'v', 'taw-vaw''', 'tâvâh', 'h', 'heb', N'תָּוָה', '', N'a primitive root (or perhaps identical with 8427 through a similar idea from scraping to pieces);', 'limit (by confusion with 8427).', 'to grieve');
