INSERT INTO dbo.Strongs VALUES ('H8430', 'n-pr-m', 'to''-akh', 'Tôwach', 'h', 'x-pn', N'תּוֹחַ', '', N'from an unused root meaning to depress; humble;', 'Toah.', 'Toach, an Israelite');
