INSERT INTO dbo.Strongs VALUES ('H8434', 'n-pr-loc', 'to-lawd''', 'Tôwlâd', 'h', 'x-pn', N'תּוֹלָד', '', N'from 3205; posterity;', 'Tolad. Compare 513.', 'Tolad, a place in Palestine');
