INSERT INTO dbo.Strongs VALUES ('H8436', 'n-pr-m', 'too-lone''', 'Tûwlôwn', 'h', 'x-pn', N'תּוּלוֹן', 'xlit Tûwlôn corrected to Tûwlôwn', N'from 8524; suspension;', 'Tilon (from the margin).', 'Tulon, an Israelite');
INSERT INTO dbo.Strongs VALUES ('H8437', 'n-m', 'to-lawl''', 'tôwlâl', 'h', 'heb', N'תּוֹלָל', '', N'from 3213;', 'that wasted.', 'causing to howl, i.e. an oppressor');
